INSERT INTO `ps_product_lang` VALUES (386,1,1,'A+X shakes things up with its first book-length story as Captain America and Cyclops find themselves on a collision course! Cap is hell-bent on arresting the fugitive Cyclops, but that’s only half of this duo’s troubles. They also need to defeat a horde of menacing Skrulls and find Professor X’s former students, the Skrull mutants known as Cadre K! But there’s more! Emma Frost and Black Widow team up in a steamy saga! Magneto encounters the Superior Spider-Man! Dr. Strange and Beast face a truly insane threat! A heartbreaking story from the past of Spider-Man and Psylocke! Iron Man teams with fan-favorite X-student Broo! And Brian Michael Bendis pens a very special A+X tale! Featuring the Marvel writing debut of Max Bemis of the band Say Anything and Jeff Loveness, Emmy-nominated writer for Jimmy Kimmel Live! Collecting A+X #13-18.','A PLUS X TP VOL 03 EQUALS OUTSTANDING (9780785190110)','marvel-comics','','','MARVEL COMICS','A PLUS X TP VOL 03 EQUALS OUTSTANDING (9780785190110)','','','',''),(387,1,1,'Marvel’s most amazing heroes step into the spotlight in this all-action book packed with adventure, danger, drama… and fun! Black Widow seeks redemption for her past — in ways the Avengers wouldn’t approve! Carol Danvers takes on the legacy of Captain Marvel and lives her dream of traveling to the stars! Teenager Kamala Khan fights crime as Ms. Marvel — but is she ready for this dangerous new life? She-Hulk isn’t just a green powerhouse — her skills as an attorney will knock her opponents’ socks off! A mysterious woman wields the enchanted hammer Mjolnir, and claims the powers of the mighty Thor! And Squirrel Girl faces her greatest challenge yet: college! Whatever your tastes, there’s something here for everyone! Collecting BLACK WIDOW (2014) #1, CAPTAIN MARVEL (2014) #1, MS. MARVEL (2014) #1, SHE-HULK (2014) #1, THOR (2014) #1 and UNBEATABLE SQUIRREL GIRL #1.','A-FORCE PRESENTS TP VOL 01 (9780785198987)','marvel-comics','','','MARVEL COMICS','A-FORCE PRESENTS TP VOL 01 (9780785198987)','','','',''),(388,1,1,'The Marvel heroes everyone is talking about continue their epic adventures! Black Widow stages a daring jailbreak from a South American prison! In the midst of an alien uprising, will Captain Marvel defy the Avengers and side with the underdogs? Find out why Kamala Khan, the new Ms. Marvel, is the most lovable (but awkward) new hero around! When her client, the son of Doctor Doom, seeks asylum, She-Hulk will go to the ends of the earth for justice! What happens when the all-new Thor is separated from her hammer? And Squirrel Girl battles Galactus on the moon! (Yup, you read that right!) It’s cover-to-cover suspense, heroics and fun! Collecting BLACK WIDOW (2014) #3, CAPTAIN MARVEL (2014) #3, MS. MARVEL (2014) #3, SHE-HULK (2014) #3, THOR (2014) #3 and THE UNBEATABLE SQUIRREL GIRL (2015) #3.','A-FORCE PRESENTS TP VOL 03 (9780785199007)','marvel-comics','','','MARVEL COMICS','A-FORCE PRESENTS TP VOL 03 (9780785199007)','','','',''),(389,1,1,'The Marvel Universe’s most exciting action heroes continue their adventures! Black Widow discovers a deadly plot that spans the globe! Captain Marvel sets out to find the real reason behind the resettlement of Rocket Girl’s people! Ms. Marvel learns a secret about her new powers as she investigates the Inventor! She-Hulk’s client, Kristoff Vernard, has been kidnapped by his father: Doctor Doom! The new Thor is adjusting to life as a hero, but the original Odinson wants his hammer back! And the final showdown between Squirrel Girl and Galactus is here! Six kick-butt heroes, six epic adventures — comics don’t get any better than this! Collecting BLACK WIDOW (2014) #4, CAPTAIN MARVEL (2014) #4, MS. MARVEL (2014) #4, SHE-HULK (2014) #4, THOR (2014) #4 and UNBEATABLE SQUIRREL GIRL (2015) #4.','A-FORCE PRESENTS TP VOL 04 (9780785195337)','marvel-comics','','','MARVEL COMICS','A-FORCE PRESENTS TP VOL 04 (9780785195337)','','','',''),(390,1,1,'Amazing heroes in astonishing adventures! Black Widow races against time to thwart a dark plot threatening Europe. Captain Marvel rebels against an empire and declares a star war! Jersey City’s new sensation, Ms. Marvel, hones her powers — and her costume! She-Hulk and Hellcat delve deep into the mysterious Blue File, and dig up a Marvel Universe-wide conspiracy! The all-new Thor has her hands full with Absorbing Man and Titania — not to mention the de-hammered Odinson and his ever-cranky All-Father! Plus: Thrill to a selection of strange tails of the unbeatable Squirrel Girl! They’re a force to be reckoned with, and the “A” stands for “awesome!” Collecting BLACK WIDOW (2014) #5, CAPTAIN MARVEL (2014) #5, MS. MARVEL (2014) #5, SHE-HULK (2014) #5, THOR (2014) #5 and THE UNBEATABLE SQUIRREL GIRL (2015A) #5.','A-FORCE PRESENTS TP VOL 05 (9781302901936)','marvel-comics','','','MARVEL COMICS','A-FORCE PRESENTS TP VOL 05 (9781302901936)','','','',''),(391,1,1,'Marvel’s most awesome heroes continue their adventures! Black Widow’s strength and cunning will be tested to their limits as she takes on a mission too dangerous for S.H.I.E.L.D.! Let battle commence as Captain Marvel wades into an interplanetary turf war! Ms. Marvel checks off another super hero rite of passage: a team-up with Wolverine! As the mysterious Blue File turns friend into foe, who can She-Hulk trust? The Odinson continues to narrow down the possible answer to the question on everyone’s lips: Who is the new Thor? And Squirrel Girl meets Girl Squirrel — and also a hippo! Grade A excitement, guaranteed! Collecting BLACK WIDOW (2014) #6, CAPTAIN MARVEL (2014) #6, MS. MARVEL (2014) #6, SHE-HULK (2014) #6, THOR (2014) #6 and UNBEATABLE SQUIRREL GIRL (2015A) #6.','A-FORCE PRESENTS TP VOL 06 (9781302902124)','marvel-comics','','','MARVEL COMICS','A-FORCE PRESENTS TP VOL 06 (9781302902124)','','','',''),(392,1,1,'Najpotworniejsze kreacje Jacka Kirby’ego od A do Z! Od legendarnych bestii nawiedzających świat bez bohaterów, po tytanów Marvel Universe, 26 najsłynniejszych potworów w kolejności alfabetycznej: od Awesome Androida przez Devil Dinosaura, Fin Fang Fooma, Groota, Mangoga i Xemnu po Zetorę! Wszyscy pojawiają się na niesamowitych okładkach i ilustracjach takich twórców jak Arthur Adams, Mike Allred, Chris Bachalo, John Cassaday, Chris Samnee i Walter Simonson! Do tego: zawarto tu także opowieści autorstwa Jacka Kirby’ego z bestiami takimi jak Blip, Elektro, Kraa i Thorr! Tom zbiera KIRBY MONSTER VARIANT COVERS, oraz materiały z TALES TO ASTONISH (1959) #15-16 i #22, TALES OF SUSPENSE #13, #18, oraz #23, i JOURNEY INTO MYSTERY (1952) #57 i #62.','A-Z MARVEL MONSTERS HC (9781302908638)','marvel-comics','','','MARVEL COMICS','A-Z MARVEL MONSTERS HC (9781302908638)','','','',''),(393,1,1,'Efekty \"Absolute Carnage\" są odczuwalne w całym uniwersum Marvela! Nieżyjący Thaddeus „Thunderbolt” Ross był kiedyś Czerwonym Hulkiem - i krótko związał się z symbiontem Venoma! Teraz zwłoki Rossa zostały wykopane, choć dlaczego i przez kogo, pozostają niewiadomym. Bruce Banner postanawia odkryć, kto tego dokonał! Podczas pierwszej wizyty w Nowym Jorku ten sam symbiont krótko związał się z ludzkim gospodarzem, którym nie był Peter Parker ani Eddiem Brockiem! Teraz, lata później, ten tajemniczy mężczyzna stanie oko w oko z Carnage! Była Ghost Rider, Alejandra Jones, jest następna na liście! Danny Ketch musi znów wsiąść na motor, ale czy uda mu się uchronić ją przed szponami Carnage? Zawiera: ABSOLUTE CARNAGE: IMMORTAL HULK, ABSOLUTE CARNAGE: SYMBIOTE SPIDER-MAN i ABSOLUTE CARNAGE: SYMBIOTE OF VENGEANCE.','ABSOLUTE CARNAGE IMMORTAL HULK &amp; OTHER TALES TP (9781302924485)','marvel-comics','','','MARVEL COMICS','ABSOLUTE CARNAGE IMMORTAL HULK & OTHER TALES TP (9781302924485)','','','',''),(394,1,1,'Kult Carnage przybywa do Nowego Jorku! Kiedy ostatni raz go widzieliśmy, John Jameson został uwolniony z miejsca masakry w mieście Doverton w Kolorado przez Misty Knight. Od tego czasu słuch o nich zaginął. Jak więc stali się jedynymi ludźmi, którzy są w stanie zapobiec chaosowi, gdy śmiertelny wróg Spider-Mana zostaje wskrzeszony w piwnicy Instytutu Ravencroft? Czy Iron Fist, Morbius, Cloak i Dagger pomogą im pokonać wskrzeszonego Demogoblina?! Plus: Wiele lat temu Cletus Kasady użył symbionta Carnage, aby przejąć Doverton i jego mieszkańców - w tym zespół Avengers, który przybył, aby go zatrzymać! Teraz Kapitan Ameryka, Hawkeye, Wolverine i Thing muszą ponownie się zebrać, gdy odkryją los miasta! Zawiera: ABSOLUTE CARNAGE: LETHAL PROTECTORS #1-3 i ABSOLUTE CARNAGE: AVENGERS #1.','ABSOLUTE CARNAGE LETHAL PROTECTORS TP (9781302920135)','marvel-comics','','','MARVEL COMICS','ABSOLUTE CARNAGE LETHAL PROTECTORS TP (9781302920135)','','','',''),(395,1,1,'Czy Miles Morales jest naznaczony? Tym razem musi zmierzyć się z Mac Garganem, czyli Skorpionem! Ale gdy podwładni Carnage\'a atakują Nowym Jorku, Miles dowiaduje się, że i Scorpion ma w życiu epizod związany z Venomem i innymi symbiontami! A sam Miles może dopiero się z nimi związać, jeśli Carnage i jego mroczni naśladowcy go złapią! Jeśli Miles nie będzie w stanie ich zwalczyć, musi mieć nadzieję, że ktoś pokona Spider-Mana napędzanego mrocznym symbiontem! Plus: Carnage liczy na to, że szybko uda mu się połączyć z Knullem, bogiem symbiontów. Tylko Weapon H jest w stanie go powstrzymać! Zawiera: ABSOLUTE CARNAGE: MILES MORALES #1-3 i ABSOLUTE CARNAGE: WEAPON PLUS #1.','ABSOLUTE CARNAGE MILES MORALES TP (9781302920142)','marvel-comics','','','MARVEL COMICS','ABSOLUTE CARNAGE MILES MORALES TP (9781302920142)','','','',''),(396,1,1,'No description','ABSOLUTE CARNAGE OMNIBUS HC (9781302925291)','marvel-comics','','','MARVEL COMICS','ABSOLUTE CARNAGE OMNIBUS HC (9781302925291)','','','',''),(397,1,1,'Powrót klasycznego symbionta… Scream! Przed laty Patricia Robertson została związana z klonem Venoma, który potem stał się Manią. Od tego czasu żyła w strachu przed symbiontami. Ale żyła również z tajemnicą. Teraz musi zmierzyć się ze swoimi demonami i znów posiąść siłę Scream. Może myśli, że zna symbionty, ale nic nie może jej przygotować na Knulla! Plus: od czasu zakończenia DEADPOOL VS. CARNAGE, cztery z pięciu symbiontów Fundacji Życia - Riot, Phage, Agony i Lasher - zostali związani z bezpańskim psem wędrującym po Środkowym Zachodzie. Ale gdy Carnage atakuje Nowy Jork, wzywa ich wołanie Knulla! Zawiera: ABSOLUTE CARNAGE: SCREAM #1-3 i ABSOLUTE CARNAGE: SEPARATION ANXIETY.','ABSOLUTE CARNAGE SCREAM TP (9781302920159)','marvel-comics','','','MARVEL COMICS','ABSOLUTE CARNAGE SCREAM TP (9781302920159)','','','',''),(398,1,1,'Carnage powraca i planuje zabić każdego, kto kiedykolwiek nosił symbionta! Cletus Kasady ukrywał się przed resztą świata przez miesiące, teraz powraca do Nowego Jorku, silniejszy niż kiedykolwiek! Co gorsza, do rogrywki dołącza nowy gracz i to nie jest ktoś, kogo można się spodziewać! Spider-Man i Venom muszą stawić czoła szaleństwu Carnage\'a, ale nie wygląda to dobrze. Ledwo uchodzą z życiem i muszą zebrać sojuszników, którzy wesprą ich w walce. Smutna prawda jest taka, że nie każdy ujdzie z życiem... o ile komukolwiek się uda! Zawiera Absolute Carnage (2019) #1-#5 i Free Comic Book Day 2019 (Spider-Man/Venom) #1.','ABSOLUTE CARNAGE TP (9781302919085)','marvel-comics','','','MARVEL COMICS','ABSOLUTE CARNAGE TP (9781302919085)','','','',''),(399,1,1,'Bohaterowie Marvela spotykają złoczyńców, z którymi nigdy wcześniej nie walczyli! Punisher kontra Królowa Brood! Eddie Brock i Venom są celem Lady Hellbender! Ms. Marvel walczy z Super-Skrullem, który ma wszystkie moce Fantastycznej Czwórki po swojej stronie! Deadpoola w walce o spokojny sen z Nightmare! Zabójczy Bullseye knuje jak pokonać She-Hulk! Ghost Spider kontra Arcade! Moon Knight kontra Kang the Conqueror! A na koniec Wolverine kontra czarodziejka Morgan Le Fay! Zawiera: DEADPOOL ANNUAL (2019) #1, GHOST-SPIDER ANNUAL #1, MOON KNIGHT ANNUAL (2019) #1, MS. MARVEL ANNUAL (2019) #1, PUNISHER ANNUAL (2019) #1, SHE-HULK ANNUAL #1, VENOM ANNUAL (2019) #1 i WOLVERINE ANNUAL (2019) #1.','ACTS OF EVIL TP (9781302921545)','marvel-comics','','','MARVEL COMICS','ACTS OF EVIL TP (9781302921545)','','','',''),(400,1,1,'Sojusz zła zagraża Mścicielom! Doktor Doom, Red Skull, Kingpin, Magneto i inni połączyli siły, aby stawić naprzeciw Mścicieli zupełnie nieznanych wrogów! Avengers walczą z Freedom Force, Mole Manem, Wreckerem, Juggernautem, Controllerem, Absorbing Manem i nie tylko - i ponoszą druzgocącą klęskę! Plus: Cloak i Dagger pomagają, New Warriors debiutują - a Magneto realizuje swój własny plan! Ale kto potajemnie ciągnie za wszystko sznurki? Czy Avengers mogą pokonać prawdziwego mózga operacji, zanim jego ukryty plan się powiedzie? Zawiera: AVENGERS SPOTLIGHT #26-28, AVENGERS (1963) #311-313, QUASAR #5-7, IRON MAN (1968) #251-252, AVENGERS WEST COAST #53-55, MUTANT MISADVENTURES OF CLOAK AND DAGGER #9 oraz materiały z CAPTAIN AMERICA (1968) #365-367, THOR (1966) #411-413, AVENGERS ANNUAL #19 i AVENGERS SPOTLIGHT #29.','ACTS OF VENGEANCE TP AVENGERS (9781302922733)','marvel-comics','','','MARVEL COMICS','ACTS OF VENGEANCE TP AVENGERS (9781302922733)','','','',''),(401,1,1,'No description','ACTS OF VENGEANCE TP MARVEL UNIVERSE (9781302923105)','marvel-comics','','','MARVEL COMICS','ACTS OF VENGEANCE TP MARVEL UNIVERSE (9781302923105)','','','',''),(402,1,1,'Stworzony przez naukowców z Enclave szukających życia doskonałego i niezrównanych twórców: Stana Lee i Jacka Kirby\'ego, zadebiutował jako postać znana po prostu jako Him! Kiedy ta doskonała istota spotkała High Evolutionary, zyskała cel, klejnot duszy i imię: Adam Warlock! Jego przygody wstrząsną waszym pojmowaniem świata – a także Counter-Earth! Teraz, kompletna oryginalna saga Warlocka z lat 70. została zebrana w jednym tomie. Znajdziecie tu pierwsze życie (i śmierć) Adama Warlocka, debiut Infinity Gems, sagę Magusa, klasyczną wojnę z Thanosem, debiut Her, zmartwychwstanie Adama Warlocka i ogromny skarbiec pełen materiałów bonusowych! Tom zbiera zeszyty FANTASTIC FOUR (1961) #66-67, THOR (1966) #165-166, MARVEL PREMIERE #1-2, WARLOCK (1972) #1-15, INCREDIBLE HULK (1968) #176-178 i ANNUAL #6, STRANGE TALES (1951) #178-181, MARVEL TEAM-UP (1972) #55, AVENGERS ANNUAL #7 i MARVEL TWO-IN-ONE (1972) #61-63 oraz ANNUAL #2.','ADAM WARLOCK OMNIBUS HC KANE CVR (9781302949877)','marvel-comics','','','MARVEL COMICS','ADAM WARLOCK OMNIBUS HC KANE CVR (9781302949877)','','','',''),(403,1,1,'Stworzony przez naukowców z Enclave szukających życia doskonałego i niezrównanych twórców: Stana Lee i Jacka Kirby\'ego, zadebiutował jako postać znana po prostu jako Him! Kiedy ta doskonała istota spotkała High Evolutionary, zyskała cel, klejnot duszy i imię: Adam Warlock! Jego przygody wstrząsną waszym pojmowaniem świata – a także Counter-Earth! Teraz, kompletna oryginalna saga Warlocka z lat 70. została zebrana w jednym tomie. Znajdziecie tu pierwsze życie (i śmierć) Adama Warlocka, debiut Infinity Gems, sagę Magusa, klasyczną wojnę z Thanosem, debiut Her, zmartwychwstanie Adama Warlocka i ogromny skarbiec pełen materiałów bonusowych! Tom zbiera zeszyty FANTASTIC FOUR (1961) #66-67, THOR (1966) #165-166, MARVEL PREMIERE #1-2, WARLOCK (1972) #1-15, INCREDIBLE HULK (1968) #176-178 i ANNUAL #6, STRANGE TALES (1951) #178-181, MARVEL TEAM-UP (1972) #55, AVENGERS ANNUAL #7 i MARVEL TWO-IN-ONE (1972) #61-63 oraz ANNUAL #2.','ADAM WARLOCK OMNIBUS HC STARLIN CVR DM VAR (9781302949884)','marvel-comics','','','MARVEL COMICS','ADAM WARLOCK OMNIBUS HC STARLIN CVR DM VAR (9781302949884)','','','',''),(404,1,1,'No description','ADVENTURE INTO FEAR OMNIBUS HC (9781302925123)','marvel-comics','','','MARVEL COMICS','ADVENTURE INTO FEAR OMNIBUS HC (9781302925123)','','','',''),(405,1,1,'Pełne akcji i przygody niesamowitego Człowieka-Pająka opowiedziane w stylu animacji! Spider-Man zmierzy się z jednymi ze swoich najniebezpieczniejszych wrogów, oraz innymi przeciwnościami! Z gniewem Vulture’a trzeba będzie poradzić sobie w powietrzu, a po lądowaniu czeka nas zemsta Rhino! Potem Spidey znajdzie się w centrum zainteresowania Punishera! Zaraz po nim atakuje Hammerhead! Kto pociąga za sznurki, gdy Spider-Manowi przyjdzie walczyć z Fantastic Four? Pajęczak połączy także siły z Beastem i Gambitem z X-Men, aby ochronić młodego mutanta przed Mister Sinisterem! Tom zbiera zeszyty ADVENTURES OF SPIDER-MAN #1-6, oraz ADVENTURES OF THE X-MEN #3.','ADVENTURES OF SPIDER-MAN GN TP SINISTER INTENTIONS VOL 01 (9781302917791)','marvel-comics','','','MARVEL COMICS','ADVENTURES OF SPIDER-MAN GN TP SINISTER INTENTIONS VOL 01 (9781302917791)','','','',''),(406,1,1,'Spider-Man i jego wrogowie walczą jak w animacji z lat 90! W drugim tomie swoich przygód, Spider-Man odwiedza Crimetown. Bezduszni Enforcers atakują na rozkaz Kingpina! Nic jednak nie przygotuje naszego bohatera na przybycie samego Wilsona Fiska! Później Mysterio funduje Spidey’emu koszmar na dzikim zachodzie. Czy Beetle schwyta Spider-Mana? Czy może ten zaszczyt przypadnie jego starym wrogom? Doctor Octopus łączy siły z Venomem, a to nie jest dobra wiadomość! Jak Spidey przetrwa to wszystko? Tom zbiera zeszyty ADVENTURES OF SPIDER-MAN #7-12.','ADVENTURES OF SPIDER-MAN GN TP SPECTACULAR FOES (9781302919849)','marvel-comics','','','MARVEL COMICS','ADVENTURES OF SPIDER-MAN GN TP SPECTACULAR FOES (9781302919849)','','','',''),(407,1,1,'Najsłynniejsi X-Men wszechczasów w kolejnych przygodach w stylu animacji! Jubilee staje twarzą w twarz z Sabertoothem! Póżniej Gambit trafia w sam środek wojny między złodziejami a zabójcami, razem z rozgniewanym bratem Cajuna! Cyclops, Jean Grey i Storm wkraczają do akcji, gdy X-Men znajdują się na celowniku Vanishera, a także Sentineli, Spiral i Hellfire Club! Czy mutanci Marvela odniosą sukces w medialnym Mojoverse? Wszystko traci kolor i radość, kiedy X-Men zostają przysłonięci cieniem Man-Thinga! Historia nabiera kosmicznego wymiaru, gdy na scenę wkraczają Shi’ar, Watcher, Living Tribunal i wielu innych! Tom zbiera ADVENTURES OF THE X-MEN #7-12.','ADVENTURES OF X-MEN GN TP RITES OF PASSAGE (9781302919856)','marvel-comics','','','MARVEL COMICS','ADVENTURES OF X-MEN GN TP RITES OF PASSAGE (9781302919856)','','','',''),(408,1,1,'X-Men stali się gwiazdami lat dziewięćdziesiątych - i nie zadowalając się własnymi tytułami, ukradli również miejsce na łamach czasopisma SPIDER-MAN MAGAZINE! Teraz te historie zebrano razem po raz pierwszy! Dołącz do najbardziej kultowego składu X-Men! Oto Cyclops, Wolverine, Storm, Jean Gray, Rogue, Gambit, Beast, Jubilee i Professor X w starciu z niesamowitymi wrogami, w tym Magneto, Juggernaut, Mystique, Sabretooth, Mojo, Morlocks i Sentinels! Plus: Wielka dwuczęściowa przygoda z samym Spider-Manem! Ale dlaczego Cyclops walczy z Gambitem? I czy Jubilee może przetrwać, gdy ukryje się na Savage Land? Plus: dodatkowe historie z udziałem Iron Mana i Fantastycznej Czwórki! Zawiera materiały z SPIDER-MAN MAGAZINE #1-13 i SPIDER-MAN MAGAZINE SPECIAL #1-2.','ADVENTURES OF X-MEN GN TP TOOTH &amp; CLAW (9781302923129)','marvel-comics','','','MARVEL COMICS','ADVENTURES OF X-MEN GN TP TOOTH & CLAW (9781302923129)','','','',''),(409,1,1,'Przygody X-Men z ich najlepszej ery, wprost ze świata animacji! Wolverine kontra dziki Hulk - po czyjej stronie będą Havok i X-Factor? Co wspólnego ma z tym Leader? W międzyczasie, Beast i Gambit z pomocą Spider-Mana mierzą się z machinacjami Mister Sinistera! Życie Cyclopsa skręca w mrocznym kierunku, gdy na jego drodze staną demoniczni N\'Garai i Dweller-In-Darkness! Gdy Magneto i jego Bractwo popełniają zbrodnię, X-Men muszą wkroczyć do akcji - sytuacja wymyka się jednak z kontroli i nadejść może Apocalypse! Kto wyjdzie zwycięzko z bitwy? Zawiera: ADVENTURES OF THE X-MEN #1-6 and ADVENTURES OF SPIDER-MAN #3','ADVENTURES OF X-MEN GN TP VOL 01 (9781302917968)','marvel-comics','','','MARVEL COMICS','ADVENTURES OF X-MEN GN TP VOL 01 (9781302917968)','','','',''),(410,1,1,'Dalsze przygody dwóch nowych agentów Atlas! Żywiołowe siły natury ścierają się, gdy szanghajska sensacja Aero spotyka filipińską superbohaterkę Wave! Odchodząc z Triumph Division, Wave musi odzyskać zaufanie swojego zespołu - a Aero jest jej winna przysługę. Bohaterowie łączą siły, by zbadać AlonTech, mroczną firmę, która dała Wave jej moce. Ale kim jest Sea Hunter i jaki jest jej związek z dziwną rasą podwodną? Następnie poszukiwanie ojca przez Sword Mastera prowadzi go do Ameryki - i na celownik Shang-Chi, mistrza Kung Fu! Magiczny miecz Lin Lie jest kuszącym celem - ale kiedy Ares, grecki bóg wojny, zdobędzie broń dla siebie, czy bohaterowie mogą odebrać miecz dla prawowitego właściciela? A może będą musieli zawrzeć umowę z Aresem - i stawić czoła bogom Madripoor? Zawiera materiał z AERO #1-6 i SWORD MASTER #1-6.','AERO &amp; SWORD MASTER TP ORIGINS AND ODYSSEYS (9781302922610)','marvel-comics','','','MARVEL COMICS','AERO & SWORD MASTER TP ORIGINS AND ODYSSEYS (9781302922610)','','','',''),(411,1,1,'Leć z jednym z Nowych Agents of Atlas! To anglojęzyczny debiut Aero, szybującej superbohaterki z Chin! Kiedy Aero nie walczy z potworami za pomocą swoich sił wiatru, jest architektem z Szanghaju o imieniu Lei Ling, która czasami chce po prostu zjeść w spokoju kolację ze swoim chłopakiem. Ale kiedy ten chłopak ją zaskakuje, Ling odkrywa, że życie cywilne może być równie niebezpieczne jak jej kostiumowa kariera! Aero konfrontuje się z tajemniczą Madame Huang, mierzy się z przerażającym Keystone i odblokuje pierwszą tajemnicę Jadeitowego Monolitu - ale kto kontroluje Kryształowych Wojowników… i dlaczego? Jaki problem ma chłopak Lei z Aero? Zawiera materiał z AERO #1-6.','AERO TP VOL 01 BEFORE THE STORM (9781302919443)','marvel-comics','','','MARVEL COMICS','AERO TP VOL 01 BEFORE THE STORM (9781302919443)','','','',''),(412,1,1,'Aero wreszcie zmierzy się z groźną i tajemniczą Madame Huang! Ale kim ona jest - i czy jej doświadczenie i moc powstrzymają Aero? Śmiertelne plany Huanga zagrażają nie tylko Szanghaju, ale całemu światu! Teraz Lei Ling musi spróbować rozwikłać tajemnicę kryształowych wież i potwornych stworzeń infiltrujących Szanghaj - ale ocalenie miasta przed pewną zagładą może odbyć się kosztem jej tajnej tożsamości! Plus: Aero spotyka jednego z najlepszych i najzdolniejszych w świecie Marvela, gdy Iron Man składa jej niespodziewaną wizytę!','AERO TP VOL 02 MYSTERY OF MADAME HUANG (9781302919450)','marvel-comics','','','MARVEL COMICS','AERO TP VOL 02 MYSTERY OF MADAME HUANG (9781302919450)','','','',''),(413,1,1,'Komiksowa historia gwiazdy MARVEL STUDIOS\' WANDAVISION! Kiedy Reed i Sue Richards z Fantastic Four zatrudniają nową nianię dla swojego syna, Franklina, otrzymują więcej niż się spodziewali w postaci Agathy Harkness - potężnej wiedźmy! Ale syn Agathy, czarnoksiężnik Nicholas Scratch, może okazać się jednym z najbardziej śmiercionośnych wrogów FF! Agatha bierze Scarlet Witch pod swoje mistyczne skrzydła, ale czarodziejka skrywa straszny sekret. Gdy mroczna przepowiednia się spełnia, a Ziemia jest terroryzowana przez nowych apokaliptycznych złoczyńców z przerażającymi mocami, nieprawdopodobna drużyna bohaterów utworzy się, by stoczyć mistyczną wojnę: Magik, Wolverine, Blade, Spirit Rider i Nico Minoru! Saga Midnight Suns zmieni Agathę w nieoczekiwany sposób! Tom zbiera zeszyty FANTASTIC FOUR (1961) #94, #185-186 i #222-223, AVENGERS (1963) #128 oraz MIDNIGHT SUNS #1-5.','AGATHA HARKNESS THE SAGA OF THE SALEM WITCH TP (9781302960070)','marvel-comics','','','MARVEL COMICS','AGATHA HARKNESS THE SAGA OF THE SALEM WITCH TP (9781302960070)','','','',''),(414,1,1,'Piekielnica, która ma ambicje na bycie królową! Belit - samo jej imię wzbudza strach na wybrzeżach Hyborii. Widok jej statku, Tigress, to śmiertelny omen dla każdego miasta, które stanie na drodze królowej piratów. Age of Conan rozpoczyna się się w momencie gdy rodaczka potężnego barbarzyńcy zdradza jak została królową Czarnego Wybrzeża. Nastoletnia Belit ma obsesję na punkcie morza - tak samo jak na punkcie potworów i skarbów, które ją tam wzywają! Kiedy stawia stopę na okręcie przerażającego admirała Atrahasisa, rozpoczyna przygodę, której nie mogła przewidzieć! Czy porywcza natura Belit doprowadzi ją do zwycięstwa, czy jej ambicje zatoną zanim przygoda na dobrze się rozpocznie? Zawiera AGE OF CONAN: BELIT, QUEEN OF THE BLACK COAST #1-5','AGE OF CONAN TP BELIT (9781302916954)','marvel-comics','','','MARVEL COMICS','AGE OF CONAN TP BELIT (9781302916954)','','','',''),(415,1,1,'Poszukuje prawdy - i zemsty! Podróż do hyboryjskich wieków z bohaterem z klasycznej opowieści Conana „Czerwone ćwieki” w opowieści osadzonej tuż przed tą ulubioną przez fanów historią! Zanim Valeria stworzona przez Roberta E. Howarda stała się piratem i najemnikiem - zanim skrzyżowała ścieżki z Conanem i Czerwonym Bractwem - Valeria była młodą kobietą z Akwilonii, domagającą się sprawiedliwości za przestępstwo, które nie zostało ukarane. Ale gdy wkracza do okrutnego świata, stając naprzeciw tym, którzy wątpią w jej umiejętności, znajdzie więcej, niż się spodziewała w swoim pragnieniu zemsty! Zabójcze umiejętności Valerii zostaną wystawione na próbę, a jej zaufanie zostanie zachwiane, gdy ściga zabójcę swojego brata - i staje się siłą, z którą należy się liczyć! Zawiera AGE OF CONAN: VALERIA #1-5.','AGE OF CONAN TP VALERIA (9781302918804)','marvel-comics','','','MARVEL COMICS','AGE OF CONAN TP VALERIA (9781302918804)','','','',''),(416,1,1,'Gdy Ultron kontynuuje swój podbój Ziemi, Black Widow płaci najwyższą cenę w San Francisco, a Captain Marvel wspomaga Captaina Britain w walce o Londyn! Fantastic Four wraca z wycieczki po czasie i przestrzeni, aby ocalić świat! Otto Octavius, Superior Spider-Man uważa, że pokonanie A.I. nie będzie trudne, ale jego duma kroczy przed upadkiem! W Los Angeles „syn Ultrona”, android Victor Mancha, walczy, by udowodnić, że nie jest taki jak jego ojciec. Atak Ultrona zwraca uwagę Defenders, Uncanny Avengers, Wolverine’a i wielu innych. W finale tej historii zobaczycie straszliwy los Hanka Pyma! Tom zbiera zeszyty AVENGERS ASSEMBLE #14AU-15AU, FANTASTIC FOUR (2013) #5AU, FEARLESS DEFENDERS #4AU, SUPERIOR SPIDER-MAN #6AU, ULTRON #1AU, UNCANNY AVENGERS #8AU, WOLVERINE &amp; THE X-MEN #27AU and AGE OF ULTRON #10AI.','AGE OF ULTRON COMPANION TP (9780785184850)','marvel-comics','','','MARVEL COMICS','AGE OF ULTRON COMPANION TP (9780785184850)','','','',''),(417,1,1,'Od lat uniwersum Marvela żyje w strachu przed sztuczną inteligencją znaną jako Ultron, która pewnego dnia może usunąć z Ziemi całe organiczne życie. Ten dzień właśnie nadszedł! Stało się niemożliwe i Ultron przejął władzę nad światem! Kilku ocalałych bohaterów skupia się już tylko na przetrwaniu, gdy Luke Cage odkrywa sekret zwycięstwa Ultrona. Zrozpaczony Kapitan Ameryka prowadzi ostatni atak, gdy Wolverine postanawia dokonać szokującego czynu, który stworzy nowe uniwersum Marvela i sprowadzi na wszystkich katastrofę! Czy bohaterom uda się wszystko naprawić i pokonać Ultrona?\nTom zbiera zeszyty AGE OF ULTRON #1-10, oraz #10AI, AVENGERS ASSEMBLE #14AU-15AU, FANTASTIC FOUR (2012) #5AU, FEARLESS DEFENDERS #4AU, SUPERIOR SPIDER-MAN #6AU, ULTRON #1AU, UNCANNY AVENGERS #8AU i WOLVERINE &amp; THE X-MEN #27AU.','AGE OF ULTRON HC (9780785155652)','marvel-comics','','','MARVEL COMICS','AGE OF ULTRON HC (9780785155652)','','','',''),(418,1,1,'Humanity’s time is over. Submit or perish, because the Age of Ultron has arrived! The artificial intelligence known as Ultron has fought for years to eradicate mankind — and now, it has all but succeeded. The few remaining heroes are battered, broken, almost beaten and left considering desperate measures — some more desperate than others. But when Wolverine breaks ranks and pursues his own plan to defeat Ultron, will his drastic action cause more problems than it solves? Brian Michael Bendis presents the ultimate triumph of the Avengers’ greatest villain in an epic that will shake worlds! Collecting AVENGERS (2010) #12.1 and AGE OF ULTRON #1-10.','AGE OF ULTRON TP (9780785155669)','marvel-comics','','','MARVEL COMICS','AGE OF ULTRON TP (9780785155669)','','','',''),(419,1,1,'Kurt Wagner gwiazdą Age of X-Man! Od Monachium do Hollywood, wszyscy kochają Nightcrawlera, najsłynniejszego celebrytę superbohatera! Żonglowanie obowiązkami członka X-Men z pracą na planach letnich blockbusterów byłoby niemożliwe bez najlepszego członka ekipy w biznesie, kaskaderki Magmy! Osobistego trenera Kyluna! Głównej gwiazdy Megan! I jest Mystique… ale coś nie gra w Tinseltown, a tabloidy odkrywają, że nasza gwiazda ma sekret! Czy popularność Nightcrawlera przetrwa aferę? Czy będzie to ostatnia rola dla Kurta? Zawiera AGE OF X-MAN: THE AMAZING NIGHTCRAWLER #1-5.','AGE OF X-MAN AMAZING NIGHTCRAWLER TP (9781302915773)','marvel-comics','','','MARVEL COMICS','AGE OF X-MAN AMAZING NIGHTCRAWLER TP (9781302915773)','','','',''),(420,1,1,'Apocalypse walczy o zmianę świata w Age of X-Man! Nate Grey stworzył raj dla mutantów - taki w którym nikt nie wie co to miłość. Na szczęście, pojawił się nowy bohater, który poprowadzi rebelię przeciwko regułom narzuconym przez X-Manów - i nauczy czym jest rodzina i miłość. Kimś takim jest En Sabah Nur! Dołącz to Apocalypse’a i jego X-Tracts którzy starają się na nowy nauczyć świat kochać. Ich nowe zadanie zabiera ich do dziczy byłego Związku Radzieckiego, w której grasuje potwór zwany przez mieszkańców “Językiem Czarnoboga” Ale dlaczego Apocalypse i X-Tracts chcą go znaleźć? Czy zrobią to przed Departamentem X? I jakie tak naprawdę miejsce w świecie X-Manów ma Apocalypse? Zawiera AGE OF X-MAN: APOCALYPSE &amp; THE X-TRACTS #1-5.','AGE OF X-MAN APOCALYPSE &amp; X-TRACTS TP (9781302915803)','marvel-comics','','','MARVEL COMICS','AGE OF X-MAN APOCALYPSE & X-TRACTS TP (9781302915803)','','','',''),(421,1,1,'Wejdź w Wiek X-Mana, gdzie idealni bohaterowie chronią idealnego świata. X-Man pomógł w zamianie Ziemi w utopię, gdzie życie w strachu i nienawiści jest już przeszłością. Wszyscy ludzie są zjednoczeni pod sztandarem mutantów, a każdy mutant podziwia X-Men. Jean Grey! Colossus! Storm! X-23! X-Man! Nature Girl! Magneto! I niesamowity Nightcrawler! Gdy światu zagraża niebezpieczeństwo, Cudowni X-Men działają dla dobra ogółu. I nikt nie odważy się sprzeciwić. Ale czy X-Men będą w stanie walczyć w imię porządku, gdy Apocalypse i X-Tracts rozniecają bunt w tym raju zarządzanym żelazną ręką? Może podstępne słowa En Sabah Nura osłabią ich wolę walki i kontrolę nad pokojem? Tom zbiera AGE OF X-MAN: ALPHA i OMEGA, oraz AGE OF X-MAN: THE MARVELOUS X-MEN #1-5.','AGE OF X-MAN MARVELOUS X-MEN TP (9781302915759)','marvel-comics','','','MARVEL COMICS','AGE OF X-MAN MARVELOUS X-MEN TP (9781302915759)','','','',''),(422,1,1,'W Danger Roomie przetrzymywani są najgorsi z najgorszych! Kiedy złamiesz prawo w raju nie trafiasz do jakiegoś więzienia. Trafiasz do Danger Room - więzienia wypełnionego po brzegi najgorszymi szumowinami, które nie potrafiły wpasować się do świata X-Manów. każdy z nich ma powód przez który się tu znalazł. Każdy z nich jest gotowy zabić by przetrwać. Ale to się zmieni, gdy do Danger Room przybywa nowy więzień: Lucas Bishop! Bishop musi obracać się wokół więziennych gangów by dowiedzieć się prawdy leżącej za murami więzienia. Czy może zaufać współwięźniom - w tym córce Magnet, polaris? Czy Bishop będzie musiał uciec na własną rękę? Tak czy inaczej, te mury niedługo runą! Zawiera OF X-MAN: PRISONER X #1-5.','AGE OF X-MAN PRISONER X TP (9781302915797)','marvel-comics','','','MARVEL COMICS','AGE OF X-MAN PRISONER X TP (9781302915797)','','','',''),(423,1,1,'Glob Herman, Armor, Anole I Rockslide wchodzą w Wiek X-Mana! W rajskiej utopii Instytut Wyższego Nauczania Summersa jest najlepszą szkołą dla mutantów na świecie. Obecność dla dzieci mutantów trenujących by stać się następcami cudownych X-Men jest obowiązkowa. Ale nawet w idealnym społeczeństwie nastolatki znajdą okazję do buntu, a nowi uczniowie Instytutu Summersa zaczynają kwestionować autentyczność swoich wspomnień. Czy Glob utrzyma jedność drużyny dość długo, by odkryć sekrety ich świata, gdy opadnie kurtyna? Gdy Wiek X-Mana zacznie się rozpadać, uczniowie będą musieli stawić czoła prawdzie za ich rzeczywistością. Co poświęcą dla wolności? Tom zawiera zeszyty AGE OF X-MAN: NEXTGEN #1-5.','AGE OF X-MAN TP NEXTGEN (9781302915766)','marvel-comics','','','MARVEL COMICS','AGE OF X-MAN TP NEXTGEN (9781302915766)','','','',''),(424,1,1,'X-Tremists utrzymują pokój w Age of the X-Man! Idealny świat nie bierze się z niczego. Musi być utrzymywany. W tym momencie pojawiają się X-Tremists. Psylocke, Iceman, Northstar, Bloc, Jubilee i Moneta chronią ludzi przed zagrożeniami, o których nawet nie wiedzieli że istnieją, między innymi przed najbardziej podstępnym z nich: miłością! Department X kontynuuje swoją pracę eliminowania tych, którzy nie chcą się dopasować, lecz kiedy spotykają ciężarną rebeliantkę, drużyna zaczyna się dzielić! Dodatkowo, dwójka z nich musi starać się nie dać wpaść w sidła miłości, którą sami próbują powstrzymywać. Niektórzy chcą miłości, niektórzy pokoju, a niektórzy chcą patrzeć jak świat płonie. Zawiera AGE OF X-MAN: X-TREMISTS #1-5.','AGE OF X-MAN X-TREMISTS TP (9781302915780)','marvel-comics','','','MARVEL COMICS','AGE OF X-MAN X-TREMISTS TP (9781302915780)','','','',''),(425,1,1,'Kontynuacja przygód Agents of Atlas wprost z lat 50. XX wieku! Niepokojące wizje prowadzą zespół do najciemniejszych głębin Oceanu Atlantyckiego, gdzie czeka Sub-Mariner! Następnie Jimmy Woo i M-11 zostają złapani w szpony najstraszniejszej potęgi w Chinach… śmiertelnego Jade Claw! Potem bohaterowie Atomowej Ery stawiają czoła dzisiejszym najpotężniejszym bohaterom, X-Men i Avengers, w dwóch wielkich opowieściach! Kiedy Afrodyta atakuje Wenus, czy Agenci mogą uratować członka drużyny - i poradzić sobie z prawdą o jej przeszłości? Ponadto Norman Osborn wysyła swoją zabójczą ekipę Thunderbolts, by pokonać naszych Agentów! Zawiera: AGENTS OF ATLAS (2009) #6-11, X-MEN VS. AGENTS OF ATLAS #1-2, AVENGERS VS. ATLAS #1-4, THUNDERBOLTS (1997) #139-140 oraz materiały z ASSAULT ON NEW OLYMPUS PROLOGUE, INCREDIBLE HERCULES #138-141 i HERCULES: FALL OF AN AVENGER #1-2.','AGENTS OF ATLAS COMPLETE COLLECTION TP VOL 02 (9781302922726)','marvel-comics','','','MARVEL COMICS','AGENTS OF ATLAS COMPLETE COLLECTION TP VOL 02 (9781302922726)','','','',''),(426,1,1,'No description','AGENTS OF ATLAS TP COMPLETE COLLECTION 01 (9781302911294)','marvel-comics','','','MARVEL COMICS','AGENTS OF ATLAS TP COMPLETE COLLECTION 01 (9781302911294)','','','',''),(427,1,1,'Najwięksi bohaterowie Azji jednoczą się! Zgodnie z wolą fanów, Nowi Agents of Atlas powracają, gdy Amadeus Cho, Silk, Shang-Chi, Wave, Jimmy Woo i wszyscy twoi ulubieńcy bronią azjatyckiego miasta Pan przed zagrożeniem jednego z klasycznych złoczyńców Marvela! Oto bohaterowie z wielu krajów ścierają się ze sobą, walczą z przerażającymi potworami ramię w ramię oraz - miejmy nadzieję - przy okazji uratują świat! Ale kim jest Izaak Ikeda, Obrońca Pan? Co Mike Nguyen i firma Big Nguyen zaplanowali dla Pan? Najnowszy Giant-Man, Raz Malhotra, dołącza do zabawy, w przygodzie pełnej akcji i romansu! Ale kto kogo całuje? Plus: Oryginalni Agents of Atlas - Namora, M-11, Venus, Gorilla-Man, 3-D Man i Marvel Boy - łączą siły w ściśle tajnej misji! Zawiera Agents of Atlas (2019) #1-5.','AGENTS OF ATLAS TP PANDEMONIUM (9781302920111)','marvel-comics','','','MARVEL COMICS','AGENTS OF ATLAS TP PANDEMONIUM (9781302920111)','','','',''),(428,1,1,'Gwiazdy serialu MARVEL’S AGENTS OF S.H.I.E.L.D. trafiają do uniwersum All-New, All-Different stając w szeregu z bohaterami takimi jak Tony Stark, Spider-Man i Wolverine! Phil Coulson znów jest połączony ze swoją miłością, Lolą – nie, nie z latającym samochodem – ale z płomieniem, który zmienił jego umysł w broń mogącą zniszczyć wszystko! Gdy to przetrwają, Agents of S.H.I.E.L.D. będą musieli wziąć udział w STANDOFF przeciwko New Avengers! Fritz ryzykuje życiem; Simmons walczy o nią; May rusza do ataku, a Quake, Mockingbird i Deathlok dodają grupie superbohaterskiego charakteru. Tylko czy Agents of S.H.I.E.L.D. są gotowi na Granta Warda? Tom zbiera zeszyty AGENTS OF S.H.I.E.L.D. #1-6, oraz materiały z ALL-NEW, ALL-DIFFERENT POINT ONE #1.','AGENTS OF SHIELD TP VOL 01 COULSON PROTOCOLS (9780785196280)','marvel-comics','','','MARVEL COMICS','AGENTS OF SHIELD TP VOL 01 COULSON PROTOCOLS (9780785196280)','','','',''),(429,1,1,'Uniwersum ALIENS w swojej najbardziej drastycznej wersji- w porywającej czerni, bieli, czerwieni... i zieleni!\nMarvel Comics i 20th Century Studios prezentują zabójczą antologię pełną przerażających szczegółów! Wyjątkowi scenarzyści i ulubieni przez fanów artyści łączą siły, by stworzyć nowe opowieści o terrorze Obcych - w tym obejmującą całe pokolenia epopeję od Collina Kelly\'ego, Jacksona Lanzinga i Michaela Dowlinga! Polowanie rozpoczyna się w opowieści o krwi, chwale i najbardziej ekscytujących grach... i horrorze! Poza tym: Legendarny Paul Jenkins (WOLVERINE: ORIGIN, INHUMANS) bada chemię strachu w historii, która pozostawi was z zupełnie nowym i przerażającym spojrzeniem na Xenomorphy!\nTom zbiera zeszyty Alien: Black, White &amp; Blood (2024) 1-4','ALIEN BLACK WHITE AND BLOOD TREASURY ED TP (9781302957032)','marvel-comics','','','MARVEL COMICS','ALIEN BLACK WHITE AND BLOOD TREASURY ED TP (9781302957032)','','','',''),(430,1,1,'Declan Shalvey i Andrea Broccardo przenoszą serię ALIEN na nowe, mrożące krew w żyłach poziomy! Talbot Engineering Inc. jest pod nowym kierownictwem - a jej genialny główny naukowiec, Batya Zahn, zrobi prawie wszystko, aby zabrać swoją rodzinę z lodowego księżyca, gdzie prowadzili badania nad oszczędzaniem wody. Ale w tym zapomnianym zakątku galaktyki jest coś więcej niż tylko lodowcowe źródła. Kiedy odkrywają niezwykły organizm zakuty w lodzie, emocje rosną. To, co ukryte w śniegu, wychodzi na jaw podczas odwilży - i nikt nie powita tej wiosny z radością. Ale Zahn nie chce oddać swojej pracy temu nieoczekiwanemu zagrożeniu bez walki, bez względu na to, jakie okropności wyłaniają się z lodu w czarną noc! Tom zbiera zeszyty ALIEN (2023A) #1-5.','ALIEN BY SHALVEY &amp; BROCCARDO TP VOL 01 THAW (9781302947668)','marvel-comics','','','MARVEL COMICS','ALIEN BY SHALVEY & BROCCARDO TP VOL 01 THAW (9781302947668)','','','',''),(431,1,1,'Daleko w kosmosie istnieje planeta opanowana przez najgorszych zabójców wszechświata. Większość rozsądnych ludzi zbudowałaby barierę i zostawiła ten świat na pastwę potworów. Ale korporacja Weyland-Yutani widzi w tym największy zysk w historii cywilizacji. Co z tego, że kosztuje to kilka ludzkich istnień? Teraz wybrani goście mogą wejść na pokład statku Weyland-Yutani Descendant i odkryć tajemnice legendarnej katastrofy na lodowym księżycu! To podróż, za którą warto umrzeć! Ale kiedy rodzina Yutani postanawia osobiście wziąć udział w inwazji na LV-695, tajemnicza Cole nagle znajduje się w pułapce między lawiną a śmiercią w odmętach- i musi podjąć najtrudniejsze jak dotąd decyzje! Poza tym: Obcy kontra Obcy, królowa ksenomorfów i jej rój zstępują na mroczny świat... a lokalne gatunki walczą o przetrwanie! Tom zbiera zeszyty ALIEN ANNUAL (2023) #1 i ALIEN (2023B) #1-4.','ALIEN BY SHALVEY &amp; BROCCARDO TP VOL 02 DESCENDANT (9781302952303)','marvel-comics','','','MARVEL COMICS','ALIEN BY SHALVEY & BROCCARDO TP VOL 02 DESCENDANT (9781302952303)','','','',''),(432,1,1,'No description','ALIEN TP VOL 01 BLOODLINES (9781302926144)','marvel-comics','','','MARVEL COMICS','ALIEN TP VOL 01 BLOODLINES (9781302926144)','','','',''),(433,1,1,'Świerzy horror z galaktyki koszmarów! Stacja kosmiczna, której zadaniem jest terraformacja planet należy do pewnej sekty. Jej członkowie wkrótce zostają zaatakowani przez xenomorphy! Ludzi uratować może tylko kobieta umierająca na rzadką chorobę. Jej przeciwnikami są najbardziej zabójcze istoty w kosmosie. Jane być może ma przed sobą ostatnie dni życia, ale dała tej kolonii tak wiele, że nie zamierza z oddać jej bez walki! Niestety, wraz z ekspansją potworów, Jane poznaje tajemnice swojej społeczności, które wstrząsają jej światem, a nawet całą sektą w posadach. Czy rozbitkowie znajdą bezpieczną przystań? Czy nie jest jeszcze późno na pomoc? Może powodem istnienia tej stacji jest zniszczenie jej mieszkańców? Tom zbiera zeszyty ALIEN #7-12.','ALIEN TP VOL 02 REVIVAL (9781302926151)','marvel-comics','','','MARVEL COMICS','ALIEN TP VOL 02 REVIVAL (9781302926151)','','','',''),(434,1,1,'Człowiek, maszyna i najbardziej przerażająca istota we wszechświecie! Właśnie jedziecie windą do piekła, a wyjścia nie ma! Mała kolonia androidów osiedliła się w tajemnicy przed światem na Księżycu. Kiedy kompania żołnierzy Zjednoczonego Systemu przybywa do nich z prośbą o pomoc w odzyskaniu biotechnologii na wrogiej planecie, która może być kluczem do ocalenia ludzkości, syntetycy muszą zdecydować, czy perspektywa pokoju między człowiekiem a maszyną jest warta ryzyka. \"Steel Team\" - legendarny, niezniszczalny zespół Syntetycznych Operacji Specjalnych jest jedyną nadzieją Zjednoczonych Systemów, by wykonać misję na niegdyś spokojny Tobler-9. Od czasu tajemniczego wypadku lata wcześniej, Tobler-9 jest uważany za jedno z najbardziej wrogich środowisk w znanym wszechświecie - miejsce, gdzie nic organicznego nie mogło przetrwać... a może jednak? Tom zbiera zeszyty ALIEN (2022) #1-6.','ALIEN TP VOL 03 ICARUS (9781302926168)','marvel-comics','','','MARVEL COMICS','ALIEN TP VOL 03 ICARUS (9781302926168)','','','',''),(435,1,1,'Ekspansja ALIENS rozszerza się w przerażających nowych kierunkach! Miliarder Daniel Grant prowadzi ekspedycję do ojczyzny Obcych! Ale co może być warte podróży do krainy terroru? To jedna planeta, dwie królowe Obcych, miliony głodnych potworów i królewski okup czekający na ocalałych! Następnie, Stanislaw Mayakovsky i jego partner, młody złodziej Gill, projektują cybernetycznego Obcego, aby okraść królową obcych z cennej wydzieliny - ale potężna korporacja chce tego samego! A kiedy Obcy zostaje wykryty na pokładzie stacji kosmicznej orbitującej wokół Ziemi, cała nadzieja na jego zniszczenie w człowieku ze strasznym sekretem! Poza tym: Pełna historia Newta z filmu Aliens i więcej opowieści! Tom zbiera zeszyty ALIENS: GENOCIDE #1-4, ALIENS: HIVE #1-4 i ALIENS: TRIBES, ALIENS: NEWT\'S TALE #1-2 oraz materiały z DARK HORSE INSIDER #14-27, DARK HORSE PRESENTS FIFTH ANNIVERSARY SPECIAL i DARK HORSE PRESENTS (1986) #56.','ALIENS EPIC COLLECT THE ORIGINAL YEARS TP VOL 02 (9781302956318)','marvel-comics','','','MARVEL COMICS','ALIENS EPIC COLLECT THE ORIGINAL YEARS TP VOL 02 (9781302956318)','','','',''),(436,1,1,'Najbardziej przerażające potwory galaktyki przybywają na Ziemię! Lata po wydarzeniach z pierwszych filmów z serii Alien, atak Ksenomorfa w kosmosie skłania Colonial Marines do podjęcia działań. Wkrótce mocno pokiereszowany Hicks i dorosły już Newt zostają wysłani na niebezpieczną misję, której celem jest zlokalizowanie i zniszczenie ojczyzny stworów! Kiedy Ziemia zostaje opanowana przez hordę ksenomorfów, Hicks i Newt muszą dołączyć do grupy partyzantów walczącej o odzyskanie planety. Czy szalony wojskowy może wyszkolić bestie, by zniszczyły swój własny gatunek? I czy stary przyjaciel może pomóc Hicksowi i Newtowi odwrócić losy misji  poprzez schwytanie Królowej Ksenomorfów? Poza tym: Poszukiwanie skarbów w kosmosie staje się bitwą o przetrwanie, gdy atakują Obcy! Tom zbiera zeszyty ALIENS (1988) #1-6, ALIENS (1989) #1-4, ALIENS: EARTH WAR #1-4 i materiały z DARK HORSE PRESENTS (1986) #24 i #42-43. ','ALIENS EPIC COLLECTION ORIGINAL YEARS TP VOL 01 (9781302950682)','marvel-comics','','','MARVEL COMICS','ALIENS EPIC COLLECTION ORIGINAL YEARS TP VOL 01 (9781302950682)','','','',''),(437,1,1,'Gdy Marvel przygotowuje się na inwazję ksenomorfów, odkryj na nowo komiksowe dziedzictwo ALIENS! Oto znajome twarze występują w opowieściach, które rozszerzają filmowy świat! Gdy Hicks i Newt podejmują niebezpieczną misję zniszczenia ojczyzny tych stworzeń, śmiercionośna epidemia powoduje, że Ziemię opanują kosmici! Miliarder Daniel Grant ma oko na królową kosmitów, a naukowiec Stanislaw Mayakovsky musi odzyskać najcenniejszą substancję galaktyki od obcych! Ale czy nawet najlepsza siła bojowa Ziemi może powstrzymać najbardziej przerażające i bezwzględne stworzenia ze wszystkich filmów? Zawiera ALIENS (1988) #1-6; ALIENS (1989) #1-4; ALIENS: EARTH WAR #1-4; ALIENS: GENOCIDE #1-4; ALIENS: HIVE #1-4; ALIENS: TRIBES #1; ALIENS: NEWT\'S TALE #1-2; ALIEN 3 #1-3 i ALIENS: SPACE MARINES #1-12 - plus materiał z DARK HORSE INSIDER (1989) #14-27 i DARK HORSE PRESENTS (1986) #24, #42-43, #56 i FIFTH ANNIVERSARY SPECIAL.','ALIENS OMNIBUS HC VOL 01 LAND CVR (9781302928155)','marvel-comics','','','MARVEL COMICS','ALIENS OMNIBUS HC VOL 01 LAND CVR (9781302928155)','','','',''),(438,1,1,'No description','ALIENS OMNIBUS HC VOL 01 NELSON DM VAR (9781302928162)','marvel-comics','','','MARVEL COMICS','ALIENS OMNIBUS HC VOL 01 NELSON DM VAR (9781302928162)','','','',''),(439,1,1,'Explore new worlds of terror! A rogue scientist\'s genetic experiments create a horrific new alien king! A ragtag unit of Colonial Marines battles a xenomorph infestation on a space station - and the survivors face a pack of bizarre hybrids! An investigator must solve a murder on a deep-space alien-research station! But what dread music will a deranged composer make with an alien\'s screams? And can a synthetic xenomorph rebel against its sadistic creator? Plus: Flash back to an alien attack in the 1950s! And witness the fate of England as aliens overrun the Earth! Collecting Aliens: Colonial Marines (1993) #1-#10, Aliens: Rogue (1993) #1-#4, Aliens: Labyrinth (1993) #1-#4, Aliens: Salvation (1993) #1, Aliens: Music of the Spears (1994) #1-#4, Aliens: Stronghold (1994) #1-#4; material from\nDark Horse Comics (1992) #3-#5, #11-#13, #15-#19; Previews (1993) #1-#12; Previews (1994) #1; and Aliens Magazine (1992, UK) #9-#20.','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 02 ASRAR CVR (9781302928902)','marvel-comics','','','MARVEL COMICS','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 02 ASRAR CVR (9781302928902)','','','',''),(440,1,1,'Explore new worlds of terror! A rogue scientist\'s genetic experiments create a horrific new alien king! A ragtag unit of Colonial Marines battles a xenomorph infestation on a space station - and the survivors face a pack of bizarre hybrids! An investigator must solve a murder on a deep-space alien-research station! But what dread music will a deranged composer make with an alien\'s screams? And can a synthetic xenomorph rebel against its sadistic creator? Plus: Flash back to an alien attack in the 1950s! And witness the fate of England as aliens overrun the Earth! Collecting Aliens: Colonial Marines (1993) #1-#10, Aliens: Rogue (1993) #1-#4, Aliens: Labyrinth (1993) #1-#4, Aliens: Salvation (1993) #1, Aliens: Music of the Spears (1994) #1-#4, Aliens: Stronghold (1994) #1-#4; material from\nDark Horse Comics (1992) #3-#5, #11-#13, #15-#19; Previews (1993) #1-#12; Previews (1994) #1; and Aliens Magazine (1992, UK) #9-#20.','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 02 MENDOZA DM VAR (9781302928919)','marvel-comics','','','MARVEL COMICS','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 02 MENDOZA DM VAR (9781302928919)','','','',''),(441,1,1,'Jeszcze więcej kosmicznej grozy! Oddział żołnierzy dostaje zadanie odbicia stacji kosmicznej! Powraca niezrównany Herk Mondo! Czy piraci mogą pokonać Alienów z pomocą… świni? Alien nawiedza tajemnicze miejsce kultu! Jaja xenomorpha sieją śmierć i choroby! Inspektor musi osądzić, czy potwory są prawdziwe, czy są wytworami jego wyobraźni. Specjalista bada dzieje xenomorphów! Czy nowoutworzony oddział da ludzkości szansę na uwolnienie się od bestii? Co czeka na tych, którzy odważą się wejść na teren opuszczonego cmentarzyska? Dodatkowo: niesamowita historia autorstwa ponad czterdziestu artystów! Tom zbiera zeszyty ALIENS: BERSERKER #1-4, ALIENS: MONDO HEAT, ALIENS: LOVESICK, ALIENS: PIG, ALIENS SPECIAL, ALIENS: HAVOC #1-2, ALIENS: PURGE, ALIENS: ALCHEMY #1-3, ALIEN RESURRECTION #1-2, ALIENS: KIDNAPPED #1-3, ALIENS: SURVIVAL #1-3, ALIENS: GLASS CORRIDOR, ALIENS: STALKER, ALIENS: WRAITH, ALIENS: APOCALYPSE - THE DESTROYING ANGELS #1-4, ALIENS: XENOGENESIS #1-4 ai ALIENS (2009) #1-4 – oraz materiały z DARK HORSE COMICS #22-24, DARK HORSE PRESENTS (1986) #101-102, #117, #121, #140, ANNUAL 1997, A DECADE OF DARK HORSE #3, oraz FREE COMIC BOOK DAY 2009: ALIENS. Dla dorosłych','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 03 PACHECO CVR (9781302928926)','marvel-comics','','','MARVEL COMICS','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 03 PACHECO CVR (9781302928926)','','','',''),(442,1,1,'Jeszcze więcej kosmicznej grozy! Oddział żołnierzy dostaje zadanie odbicia stacji kosmicznej! Powraca niezrównany Herk Mondo! Czy piraci mogą pokonać Alienów z pomocą… świni? Alien nawiedza tajemnicze miejsce kultu! Jaja xenomorpha sieją śmierć i choroby! Inspektor musi osądzić, czy potwory są prawdziwe, czy są wytworami jego wyobraźni. Specjalista bada dzieje xenomorphów! Czy nowoutworzony oddział da ludzkości szansę na uwolnienie się od bestii? Co czeka na tych, którzy odważą się wejść na teren opuszczonego cmentarzyska? Dodatkowo: niesamowita historia autorstwa ponad czterdziestu artystów! Tom zbiera zeszyty ALIENS: BERSERKER #1-4, ALIENS: MONDO HEAT, ALIENS: LOVESICK, ALIENS: PIG, ALIENS SPECIAL, ALIENS: HAVOC #1-2, ALIENS: PURGE, ALIENS: ALCHEMY #1-3, ALIEN RESURRECTION #1-2, ALIENS: KIDNAPPED #1-3, ALIENS: SURVIVAL #1-3, ALIENS: GLASS CORRIDOR, ALIENS: STALKER, ALIENS: WRAITH, ALIENS: APOCALYPSE - THE DESTROYING ANGELS #1-4, ALIENS: XENOGENESIS #1-4 ai ALIENS (2009) #1-4 – oraz materiały z DARK HORSE COMICS #22-24, DARK HORSE PRESENTS (1986) #101-102, #117, #121, #140, ANNUAL 1997, A DECADE OF DARK HORSE #3, oraz FREE COMIC BOOK DAY 2009: ALIENS. Dla dorosłych','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 03 WRIGHTSON DM VAR (9781302928933)','marvel-comics','','','MARVEL COMICS','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 03 WRIGHTSON DM VAR (9781302928933)','','','',''),(443,1,1,'Dołączcie do swojej kolekcji ALIENS ostatni komiks grozy z cyklu! Kiedy szeregowiec Zula Hendricks dezerteruje, by bronić Ziemi przed ksenomorfami, stawia czoła demonom ze swojej przeszłości, jednocześnie walcząc o swoją przyszłość! Oficer inżynier Wascylewski musi użyć wszystkich dostępnych narzędzi, aby przetrwać atak najbardziej zabójczej istoty znanej człowiekowi! Kiedy ich kolonia zostaje ewakuowana, 12-letni Maxon i jego mama muszą dotrzeć do portu kosmicznego - ale między nimi a nim stoją... xenomorphy! Córka Ellen Ripley, Amanda, dołącza do ruchu oporu! Oprócz tego: więcej przerażających historii - w tym pokręcona opowieść zilustrowana przez powracającego do serii ALIENS Sama Kietha! Tom zbiera zeszyty ALIENS: FAST TRACK TO HEAVEN, ALIENS: COLONIAL MARINES - NO MAN LEFT BEHIND, ALIEN: ISOLATION, ALIENS: DEFIANCE #1-12, ALIENS: DEAD ORBIT #1-4, ALIENS: DUST TO DUST #1-4, ALIENS: RESISTANCE #1-4, ALIENS: RESCUE #1-4, ALIEN: THE ORIGINAL SCREENPLAY #1-5 i ALIEN 3: THE UNPRODUCED SCREENPLAY #1-5 oraz materiały z DARK HORSE PRESENTS (2011) #12-17 i FREE COMIC BOOK DAY 2016: ALIENS.','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 04 DANDA DM VAR (9781302928957)','marvel-comics','','','MARVEL COMICS','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 04 DANDA DM VAR (9781302928957)','','','',''),(444,1,1,'Dołączcie do swojej kolekcji ALIENS ostatni komiks grozy z cyklu! Kiedy szeregowiec Zula Hendricks dezerteruje, by bronić Ziemi przed ksenomorfami, stawia czoła demonom ze swojej przeszłości, jednocześnie walcząc o swoją przyszłość! Oficer inżynier Wascylewski musi użyć wszystkich dostępnych narzędzi, aby przetrwać atak najbardziej zabójczej istoty znanej człowiekowi! Kiedy ich kolonia zostaje ewakuowana, 12-letni Maxon i jego mama muszą dotrzeć do portu kosmicznego - ale między nimi a nim stoją... xenomorphy! Córka Ellen Ripley, Amanda, dołącza do ruchu oporu! Oprócz tego: więcej przerażających historii - w tym pokręcona opowieść zilustrowana przez powracającego do serii ALIENS Sama Kietha! Tom zbiera zeszyty ALIENS: FAST TRACK TO HEAVEN, ALIENS: COLONIAL MARINES - NO MAN LEFT BEHIND, ALIEN: ISOLATION, ALIENS: DEFIANCE #1-12, ALIENS: DEAD ORBIT #1-4, ALIENS: DUST TO DUST #1-4, ALIENS: RESISTANCE #1-4, ALIENS: RESCUE #1-4, ALIEN: THE ORIGINAL SCREENPLAY #1-5 i ALIEN 3: THE UNPRODUCED SCREENPLAY #1-5 oraz materiały z DARK HORSE PRESENTS (2011) #12-17 i FREE COMIC BOOK DAY 2016: ALIENS.','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 04 STOKOE CVR (9781302928940)','marvel-comics','','','MARVEL COMICS','ALIENS ORIGINAL YEARS OMNIBUS HC VOL 04 STOKOE CVR (9781302928940)','','','',''),(445,1,1,'Seria Aliens trafia do cyklu What If Marvela! Przygotujcie się na powrót Cartera Burke\'a w zupełnie nowej przygodzie!\nPrzez lata fani legendarnego filmu ALIENS Jamesa Camerona zastanawiali się, czy Carter Burke, człowiek korporacji bardziej znienawidzony niż sami Obcy, rzeczywiście przeżył wydarzenia z kolonii terraformującej Hadley\'s Hope. Teraz odtwórca roli uwielbianego złoczyńcy, Paul Reiser, dołącza do swojego syna Leona i gwiazdorskiego zespołu scenarzystów i producentów, aby powrócić do Hadley\'s Hope i losów człowieka, który powinien był umrzeć!\nTom zbiera zeszyty Aliens: What If...? (2024) 1-5.','ALIENS WHAT IF TP (9781302946586)','marvel-comics','','','MARVEL COMICS','ALIENS WHAT IF TP (9781302946586)','','','',''),(446,1,1,'Umarli Avengers – niech żyją Avengers! Gdy do naszego świata zbliża się kosmiczne zagrożenie, los znów łączy Kapitana Amerykę, Thora, Visiona i Iron Mana – a wraz z nimi grupę młodych herosów, którzy odmłodzą Avengers! Powitajmy w pierwszej lidze Novę, Ms. Marvel i Milesa Moralesa, znanego jako Spider-Man! Jaki złoczyńca pchnął ich wszystkich do zjednoczenia? Czy nowy skład wytrzyma dość długo, aby zapisać się w historii Avengers? Być może nie, gdy rozpoczyna się STANDOFF i wszyscy zapominają o swoich tożsamościach! Potem pojawi się jeszcze zupełnie nowa Wasp! Czy jest przyjacielem, czy może wrogiem? Tom zbiera zeszyty ALL-NEW, ALL-DIFFERENT AVENGERS #1-12; and material from AVENGERS (2015) #0, FREE COMIC BOOK DAY 2015 (AVENGERS) #1 and FREE COMIC BOOK DAY 2016 (CIVIL WAR II) #1.','ALL NEW ALL DIFFERENT AVENGERS HC VOL 01 (9781302904098)','marvel-comics','','','MARVEL COMICS','ALL NEW ALL DIFFERENT AVENGERS HC VOL 01 (9781302904098)','','','',''),(447,1,1,'Umarli Avengers – niech żyją Avengers! Najpotężniejsi ziemscy bohaterowie, Kapitan Ameryka, Thor, Vision i Iron Man nie są już połączeni z żadną drużyną. Ale ich losy łączą się po raz kolejny, gdy Ziemię na cel bierze kosmiczne zagrożenie. Dołączają do nich młodzi bohaterowie, którzy odmłodzą dróżynę. Powitajmy w pierwszej lidze Novę, Ms. Marvel i Milesa Moralesa, znanego jako Spider-Man! Gdy pojawi się Warbringer będą oni muieli zapomnieć o dzielących ich różnicach. Jedno z nich wkrótce pożegna się z drużyną, ale Kapitan i Thor zostaną na dłużej, gdy połączy ich najpotężniejsza miłość świata! Ale jaki złoczyńca doprowadził do zjednoczenia nowej grupy? Tom zbiera zeszyty ALL-NEW, ALL-DIFFERENT AVENGERS #1-6, oraz materiały z AVENGERS #0 i FREE COMIC BOOK DAY 2015 (AVENGERS) #1.','ALL NEW ALL DIFFERENT AVENGERS TP VOL 01 MAGNIFICENT SEVEN (9780785199670)','marvel-comics','','','MARVEL COMICS','ALL NEW ALL DIFFERENT AVENGERS TP VOL 01 MAGNIFICENT SEVEN (9780785199670)','','','',''),(448,1,1,'Żyjący na marginesie Doop nieco zszokował X-Men i czytelników. Ale gdy mocno zaangażował się on w sprawy X-Men i życie Kitty Pryde, Doop znalazł się w centrum uwagi! Gdy trwała BATTLE FOR THE ATOM, miłość do Kitty zmusza Doopa do wciągnięcia Icemana do Doopspace na bardzo dziwne badanie. Wkrótce Doop odkrywa, że zmiennokształtny Raze nie jest Kitty Pryde z przyszłości, ale jego mroczne sekrety powstrzymają Doopa od ujawnienia prawdy! Teraz Doop musi powstrzymać szaleństwo ogarniające powoli cały świat! Czy, gdy Kitty i Doop znajdą się razem w najstraszliwszym punkcie swego życia, dziewczyna przyjmie jego oświadczyny? Tom zbiera zeszyty ALL-NEW DOOP #1-5.','ALL NEW DOOP TP (9780785190424)','marvel-comics','','','MARVEL COMICS','ALL NEW DOOP TP (9780785190424)','','','',''),(449,1,1,'Z gazem do dechy, nowy Ghost Rider Marvela wymierza swoją zemstę na najwyższym biegu. W zaułkach wschodniego Los Angeles panuje chaos wywołany przez brutalność gangów oraz wszechobecne dragi. W tych realiach Robbie Reyes otrzymuje niezwykłe moce, lecz czy ten zwyczajny nastolatek jest w stanie nad nimi zapanować? A może przez nie wejdzie na drogę destrukcji i zagubienia? Gdy cień wojny pada na przestępcze podziemie, ulice wschodniego L.A. opanowane zostają przez napędzane dającym nadludzkie moce narkotykiem doktora Zabo. Ponadto, Mr. Hyde wprowadza w życie swój przebiegły plan rozszerzenia własnego imperium. Robbie poznaje kolejne sekrety swojego opętania, lecz czy zapobiegnie on, by Duch Zemsty nie przekroczył granicy podczas obrony jego najbliższych? Zupełnie nowy Ghost Rider rusza przeciwko Mr. Hyde’owi z tej wysokooktanowej, pędzącej przed siebie historii. Zawiera ALL-NEW GHOST RIDER #1-5.','ALL NEW GHOST RIDER TP VOL 01 ENGINES OF VENGEANCE (9780785154556)','marvel-comics','','','MARVEL COMICS','ALL NEW GHOST RIDER TP VOL 01 ENGINES OF VENGEANCE (9780785154556)','','','',''),(450,1,1,'Guardians w poszukiwaniu Infinity Stones! Wasze ulubione szelmy poszukują potężnych kamieni, ale by je zdobyć, trzeba wstąpić do Nova Corps! Pora założyć złote hełmy, by ocalić wszechświat! Jak Drax poradzi sobie z zultronowanymi kosmitami, gdy nadal odmawia używania pięści? Czy ufamy Rocketowi robiącemu porządki w formacji? Coraz więcej frakcji jest zainteresowane Infinity Stones, gdy do gry wchodzi… Adam Warlock! Jak zdołał powrócić? I dlaczego? Czy ma dobre zamiary? Może chce wykorzystać moc klejnotów do własnych celów? Dowiedzcie się w tej niesamowitej kosmicznej opowieści! Tom zbiera zeszyty GUARDIANS OF THE GALAXY (2017) #146-150.','ALL NEW GUARDIANS OF GALAXY TP VOL 03 INFINITY QUEST (9781302905460)','marvel-comics','','','MARVEL COMICS','ALL NEW GUARDIANS OF GALAXY TP VOL 03 INFINITY QUEST (9781302905460)','','','',''),(451,1,1,'Chmura terrigenu rozwiewa się po świecie, pozostawiając ludzi z mocami i życiami zmienionymi na zawsze. Crystal, księżniczka Inhumans i była członkimi Avengers, prowadzi własną drużynę, aby pomóc jak największej liczbie NuHumans. Reakcje na ten ruch są mocno podzielone, od zachwytu, po gniew. Na Ziemi rozbijają się tajemnicze Skyspears i dodatkowo komplikują życie Crystal. Najgorszy jest jednak dyktator wykorzystujący Inhumans jako broń. Oby trening Gorgona był dobry, bo nawet z pomocą Spider-Mana nowi Inhumans mogą ponieść porażkę! Tom zbiera zeszyty ALL-NEW INHUMANS #1-4, oraz materiały z ALL-NEW, ALL-DIFFERENT POINT ONE #1.','ALL NEW INHUMANS TP VOL 01 GLOBAL OUTREACH (9780785196389)','marvel-comics','','','MARVEL COMICS','ALL NEW INHUMANS TP VOL 01 GLOBAL OUTREACH (9780785196389)','','','',''),(452,1,1,'Crystal i jej nowa grupa rusza do Chun, aby poznać prawdę dotyczącą tajemniczych monolitów znanych jako Skyspears. Jeden z nich obróci Crys przeciwko jej drużynie! Czy z pomocą Spider-Mana Inhumans opanują sytuację i zatrzymają kobietę, która panuje nad wszystkimi czterema żywiołami? Tam gdzie pojawia się Spidey, jest też Kraven, a Ana Kravinoff chce podtrzymać rodzinną tradycję! Zabierze ona wszystkich na polowanie na zaginione afrykańskie plemię Inhumans! Kim oni mogą być? Co łączy ich z Flintem? Jaką zbrodnię popełnił Gorgon? Gdy poznacie prawdę, wszystko zmieni się na zawsze! Tom zbiera zeszyty ALL-NEW INHUMANS #5-11.','ALL NEW INHUMANS TP VOL 02 SKYSPEARS (9780785196396)','marvel-comics','','','MARVEL COMICS','ALL NEW INHUMANS TP VOL 02 SKYSPEARS (9780785196396)','','','',''),(453,1,1,'Jim Hammond, pierwszy Human Torch został doprowadzony na kres szaleństwa przez ostatnie wydarzenia – a teraz Namor musi go uspokoić! W Angli Spitfire i Union Jack walczą z innym rodzajem najeźdźcy… z kosmosu! W 1917 roku bohaterowie I wojny światowej połączyli siły w walce z Marsjanami, a teraz kosmici powrócili! Gdy Invaders ruszają na pomoc, Tanalth the Pursuer szuka odpowiedzi na trapiące go pytania, a Toro opuszcza swój kokon Inhumana z nowymi niebezpiecznymi mocami! Czy nowy Kapitan Ameryka będzie dla niego dostatecznym wsparciem? Killraven, Eternals i Inhumans przyjdą z pomocą w poszukiwaniu rozwiązania tajemnicy Marsjan! Do tego drużyna walczy z Lashem i neonazistami. Co ma to wspólnego z Toro i Iron Crossem? Tom zbiera zeszyty ALL-NEW INVADERS #11-15.','ALL NEW INVADERS TP VOL 03 MARTIANS ARE COMING (9780785192473)','marvel-comics','','','MARVEL COMICS','ALL NEW INVADERS TP VOL 03 MARTIANS ARE COMING (9780785192473)','','','',''),(454,1,1,'Wolverine… mordercą? Laura ciężko pracowała, aby stać się czymś więcej, niż tym do czego ją stworzono, ale to koniec. Wolverine ma krew na rękach. W obliczu tragedii Laura straciła kontrolę. Czy da radę pokonać dręczace ją demony? Czy może zmuszą ją do porzucenia wymarzonego bohaterskiego życia? Wolverine zmierza do pięknego Madripooru, który może pochwalić się piaszczystymi plażami, świetną kuchnią i rozwiniętym przemysłem przestępczym. Czekają na nią piraci, oraz przestępca z przeszłości – czy półświatek wyspy ukrywa architekta upadku Laury? Gościnnie pojawią się Angel, Gambit, oraz Nick Fury! Tom zbiera zeszyty ALL-NEW WOLVERINE #13-18.','ALL NEW WOLVERINE TP VOL 03 ENEMY OF STATE II (9781302902902)','marvel-comics','','','MARVEL COMICS','ALL NEW WOLVERINE TP VOL 03 ENEMY OF STATE II (9781302902902)','','','',''),(455,1,1,'Śmierć nadejdzie z gwiazd! Statek kosmiczny. Umierający pasażer. Dwa słowa, które na zawsze zmienią życie Wolverine. Rozpoczyna się wyścig ze śmiertelną chorobą, a Laura musi walczyć ze złem w mieście objętym kwarantanną. Gdy choroba się rozprzestrzenia, co będzie musiała zrobić Laura, aby pomóc potrzebującym? Wolverine zwróci się o pomoc do dawnych sojuszników i nowych przyjaciół – ale jej poszukiwania odpowiedzi zakończą się walką z Brood! Czy misję Laury zakończy rój krwiożerczych kosmitów? Czy zmienią to Guardians of the Galaxy? Oto najbardziej niesamowita historia Wolverine! Tom zbiera zeszyty ALL-NEW WOLVERINE #19-24. ','ALL NEW WOLVERINE TP VOL 04 IMMUNE (9781302909352)','marvel-comics','','','MARVEL COMICS','ALL NEW WOLVERINE TP VOL 04 IMMUNE (9781302909352)','','','',''),(456,1,1,'X-Factor powraca w nowej formie! Serval Industries – jedna z najpopularniejszych firm elektronicznych, dostawca internetu i producent broni właśnie przedstawiło nową forme przysłużenia się społeczeństwu: All-New X-Factor! Na czele grupy stoi mistrzyni magnetyzmu, Polaris i użyje ona środki oferowane przez firmę, aby uczynić świat lepszym. Ale jej przyrodni brat Quicksilver, notoryczny złodziej Gambit i wielu innych nie ufają jej pracodawcom i ich intencjom. Czy mają rację? X-Factor mają za zadanie pomagać ludziom, ale czy uda im się to, gdy jeden z nich skrywa mroczne sekrety? (Podpowiedź: chodzi o Gambita.) Zobaczcie jak grupa poznaje prawdę o Techno Inc, oraz walczy z Danger i Warlockiem! Oto All-New X-Factor od Serval Industries! Tom zbiera zeszyty ALL-NEW X-FACTOR #1-6.','ALL NEW X-FACTOR TP VOL 01 NOT BRAND X (9780785188162)','marvel-comics','','','MARVEL COMICS','ALL NEW X-FACTOR TP VOL 01 NOT BRAND X (9780785188162)','','','',''),(457,1,1,'The original X-Men’s arrival in the present sent shockwaves through the Marvel Universe, but we’ve only seen the effects on Earth — until now! When an alien race discovers that Jean Grey — once (or future) host of the destructive Phoenix Force — is back, they decide to hold her accountable for Dark Phoenix’s genocide! Now it’s up to the Guardians of the Galaxy to help the All-New X-Men save Jean from twisted intergalactic justice. But will they be enough against the universe’s most powerful army? Back on Earth, the present-day Beast is tortured by his decision to bring the original X-Men forward in time, but can he repair the damage he’s done while the future Brotherhood of Evil Mutants is still gunning for the time-tossed teens? Collecting ALL-NEW X-MEN #22-30 and GUARDIANS OF THE GALAXY (2013) #11-13.','ALL NEW X-MEN HC VOL 03 (9780785198239)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN HC VOL 03 (9780785198239)','','','',''),(458,1,1,'Dimension-hopping and intergalactic adventure are mutant rites of passage, and it’s high time the All-New X-Men took the plunge! First, they’re off to a world like their own, but oddly different, to meet Miles Morales, the Ultimate Spider-Man — and their own counterparts! Welcome to the Ultimate Universe, gang, hope you survive the experience! And in the wake of that encounter, the time-tossed teens get caught up in a cosmic caper over an object of great power. When some of the team are kidnapped by the vicious Mister Knife, the rest must unite with the Guardians of the Galaxy to discover the secrets of the Black Vortex. Will its dark reflections transform the young heroes forever? Action! Adventure! Romance! And a mystery, too, back on Earth: Who — or what — are the Utopians? Collecting ALL-NEW X-MEN (2012) #31-41.','ALL NEW X-MEN HC VOL 04 (9780785199892)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN HC VOL 04 (9780785199892)','','','',''),(459,1,1,'Nienawiść i starch uczyniły świat jeszcze mniej przyjaznym dla mutantów. Gdy mała grupa X-Men wybiera ukrycie, nastoletni mutanci odmawiają im decydowania o ich przyszłości bez nich! Na ich czele staje Scott Summers, który na barkach dźwiga także odpowiedzialność za czyny, których dopuścił się jego starszy odpowiednik. Dołączyli do niego jego towarzysze z przeszłości – Beast, Iceman i Angel – a także All-New Wolverine, Kid Apocalypse i Oya. Razem wyruszają w podróż, szukając przygód i samemu pisząc swoje przeznaczenie! Gdy trafiają oni na Bloba, ich podróż może skończyć się szybciej, niż się zaczęła! Tom zbiera zeszyty ALL-NEW X-MEN (2015) #1-6.','ALL NEW X-MEN INEVITABLE TP VOL 01 GHOSTS OF CYCLOPS (9780785196303)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN INEVITABLE TP VOL 01 GHOSTS OF CYCLOPS (9780785196303)','','','',''),(460,1,1,'The X-Men are shaken to the core by the fallout from BATTLE OF THE ATOM! Kitty Pryde is particularly affected, and her faith in Wolverine’s Jean Grey School is eroded. With her students gone, what is Kitty to do? Meanwhile, X-23 is back, joining the All-New X-Men and…kissing Cyclops?! What does this mean to Jean Grey? When Jean and X-23 are forced to team up against a mysterious force, she’d better figure it out fast! Plus: it’s the 50th Anniversary of the X-Men, ring it inwith some of the greatest creators to ever work on the X-Men! Collecting ALL-NEW X-MEN #18-21, X-MEN GOLD #1 and material from A+X #18.','ALL NEW X-MEN PREMIERE HC VOL 04 ALL DIFFERENT (9780785188605)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN PREMIERE HC VOL 04 ALL DIFFERENT (9780785188605)','','','',''),(461,1,1,'The future Brotherhood of Evil Mutants, last seen in \"Battle of the Atom,\" is back — and they\'re still gunning for yesterday\'s X-Men! But even as the Brotherhood takes its next devastating step against the time-tossed teens, the mysteries surrounding Jean Grey begin to unfold! Jean came back from her Shi\'ar trial...different. What does this mean for her future, for the past of the woman she\'s supposed to become and for the rest of the X-Men? Past, present and future collide when the Future Brotherhood exacts its final judgment on the All-New X-Men! And it\'s mutant magic as only Mighty Marvel could do it as artist Stuart Immonen is joined by a practical hall of fame lineup of comic-book artists! Collecting ALL-NEW X-MEN #25-29.','ALL NEW X-MEN PREMIERE HC VOL 05 ONE DOWN (9780785154334)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN PREMIERE HC VOL 05 ONE DOWN (9780785154334)','','','',''),(462,1,1,'Dimension-hopping is something of an X-Men rite of passage, and it’s about time the All-New X-Men took the plunge! You don’t always have to travel Miles away to visit a new place…but will the Web in which these time-displaced young X-Men find themselves tangled Ultimately bring about their end? Okay, enough subtlety: The All-New X-Men meet Miles Morales, the Ultimate Spider-Man — and this is a showdown you won’t want to miss! Will either universe ever be the same again? Guest-starring scores of Ultimate characters! Plus: It’s Iceman unleashed as young Bobby Drake takes the offensive! And for someone who’s said she doesn’t find him particularly pleasant to be around, X-23 seems to have taken an odd interest in the highflying Angel. Tune in as yesterday’s X-Men continue to explore the fear-fraught future of the present day! Collecting ALL-NEW X-MEN #31-36.','ALL NEW X-MEN PREMIERE HC VOL 06 ULTIMATE ADVENTURE (9780785154341)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN PREMIERE HC VOL 06 ULTIMATE ADVENTURE (9780785154341)','','','',''),(463,1,1,'The time-tossed All-New X-Men are more than teammates, more than best friends — they have become a close-knit family. But the mysterious Black Vortex may sunder their family ties permanently! As the young mutants venture back into space to deal with a galaxy in chaos, they must decipher the Vortex’s secrets — and fast, because the villainous Mr. Knife has kidnapped some of their team! Beast and Kitty travel to Spartax to study the Vortex Book as Storm formulates a plan to break into Mr. Knife’s fortress. But will the Vortex’s cosmic power transform the young mutants into something unrecognizable? Meanwhile, back on Earth, the Utopians hold a secret that will change the future of mutantkind — but who are the Utopians? The All-New X-Men may regret finding out! Collecting ALL-NEW X-MEN #37-41.','ALL NEW X-MEN PREMIERE HC VOL 07 UTOPIANS (9780785192404)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN PREMIERE HC VOL 07 UTOPIANS (9780785192404)','','','',''),(464,1,1,'It\'s a blast from the X-Men\'s past! Professor X\'s original five students - Cyclops, Marvel Girl, Iceman, Angel and Beast - are plucked from the past and brought to the present. But what they find - the state of their future selves, and the state of Xavier\'s dream - is far from the future they dreamed of. How will these young, idealistic heroes react when faced with the crushing knowledge of what their future holds? And how will the embittered X-Men of the present deal with their past coming crashing forward? When the original team comes face to face with their counterparts, it isn\'t a peaceful meeting - and one of the X-Men will be forever changed. Brian Michael Bendis and Stuart Immonen blaze a new trail for the X-Men! Collecting ALL-NEW X-MEN #1-5.','ALL NEW X-MEN TP VOL 01 YESTERDAYS X-MEN (9780785166375)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN TP VOL 01 YESTERDAYS X-MEN (9780785166375)','','','',''),(465,1,1,'Yesterday\'s X-Men continue to adjust to a present day that\'s simultaneously more awe-inspiring and more disturbing than any future the young heroes had ever imagined for themselves. And the situation gets even more dangerous when the villainous duo Mystique and Sabretooth target the young time-travelers — starting with Cyclops! Plus: How will Earth\'s Mightiest Heroes react to the time-swept X-Men? Find out when the Avengers visit the Jean Grey School! But they\'re not the only ones to do so, as the outlaw Uncanny X-Men drop by for a recruiting session. Who will join the adult Cyclops and his revolutionary crew? The answer will shock you! Acclaimed writer Brian Michael Bendis further defines the future — and the past — of the X-Men! Collecting ALL-NEW X-MEN #6-10.','ALL NEW X-MEN TP VOL 02 HERE TO STAY (9780785166382)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN TP VOL 02 HERE TO STAY (9780785166382)','','','',''),(466,1,1,'The time-displaced young X-Men continue to adjust to a present day that’s simultaneously more awe-inspiring and more disturbing than any future the young heroes had ever imagined for themselves. As Jean Grey pushes her powers to the limit, shaking her and the rest of the X-Men to the core, one of the young X-Men breaks rank — and leaves to join the adult Cyclops and his revolutionary crew! And when Mastermind targets the young Jean, will history repeat itself? Plus: When the teens find themselves face-to-face with the Uncanny Avengers, young Cyclops meets the adult version of the brother he thought he’d never see again! They never warned us about this sort of thing in temporal mechanics class! Acclaimed writer Brian Michael Bendis further defines the future — and the past — of the X-Men! Collecting ALL-NEW X-MEN #11-15.','ALL NEW X-MEN TP VOL 03 OUT OF THEIR DEPTH (9780785166399)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN TP VOL 03 OUT OF THEIR DEPTH (9780785166399)','','','',''),(467,1,1,'The X-Men are shaken to the core by the fallout from Battle of the Atom! Kitty Pryde and the All-New X-Men’s faith in Wolverine’s Jean Grey School has been completely eroded — so where have they gone instead, and what will they do? Meanwhile, X-23 joins the All-New X-Men — and sets her hunter’s sights on Cyclops?! What does this mean to Jean Grey? When Jean and X-23 are forced to team up against a mysterious force, she’d better figure it out fast! Then: ring in the X-Men’s 50th anniversary with new stories from some of the greatest creators to ever work on Marvel’s mutants! Collecting ALL-NEW X-MEN #18-21 and X-MEN: GOLD #1.','ALL NEW X-MEN TP VOL 04 ALL DIFFERENT (9780785188612)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN TP VOL 04 ALL DIFFERENT (9780785188612)','','','',''),(468,1,1,'Dimension-hopping is something of an X-Men rite of passage, and it’s about time the All-New X-Men took the plunge! You don’t always have to travel Miles away to visit a new place, but will the tangled Web in which these young time-displaced X-Men find themselves Ultimately bring about their end? Okay, enough subtlety: The All-New X-Men meet Miles Morales, the Ultimate Spider-Man — and this is a showdown you won’t want to miss! Will either universe ever be the same again? Guest-starring scores of Ultimate characters! Plus: It’s Iceman unleashed as young Bobby Drake takes the offensive! And X-23 may be abandoning her loner ways as she takes an interest in the high-flying Angel! Tune in as yesterday’s X-Men continue to explore the fear-fraught future of the present day! Collecting ALL-NEW X-MEN #31-36.','ALL NEW X-MEN TP VOL 06 ULTIMATE ADVENTURE (9780785189695)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN TP VOL 06 ULTIMATE ADVENTURE (9780785189695)','','','',''),(469,1,1,'The time-tossed members of the All-New X-Men are more than teammates, more than best friends…they have become a close-knit family. But the mysterious Black Vortex may sunder their family ties permanently! As the young mutants venture back into space to deal with a galaxy in chaos, they must decipher the Vortex’s secrets — and fast, because the villainous Mister Knife has kidnapped some of their team! Beast and Kitty travel to Spartax to study the Vortex Book, as Storm formulates a plan to break into Mister Knife’s fortress. But will the Vortex’s cosmic power transform the young mutants into something unrecognizable? Meanwhile, back on Earth, the Utopians hold a secret that will change the future of mutantkind…but who are the Utopians? The All-New X-Men may regret finding out! Collecting ALL-NEW X-MEN (2012) #37-41.','ALL NEW X-MEN TP VOL 07 UTOPIANS (9780785192350)','marvel-comics','','','MARVEL COMICS','ALL NEW X-MEN TP VOL 07 UTOPIANS (9780785192350)','','','',''),(470,1,1,'Znacie ją jako X-23, a kilku przyjaciół może mówić do niej Laura. Ale kiedy jej mentor Logan odchodzi, uhonoruje jego dziedzictwo i stanie się zupełnie nowym Wolverine! Oto  pełne przygód życie Laury Kinney, najlepszej w tym co robi, autorstwa scenarzysty Toma Taylora! Laura została stworzona, by być bronią, ale w końcu uciekła od swojej mrocznej przeszłości. Jednak odkrycie tajemnicy jej pochodzenia zmieni jej życie! Laura ma zamiar przyjąć własną podopieczną - ale kim jest dziewczyna o imieniu Gabby i jaki jest jej związek z Laurą? Gdy Wolverine nabiera doświadczenia, poznaje nowych przyjaciół, w tym Doktora Strange, Strażników Galaktyki… i Deadpoola? Ale kim są sieroty X i dlaczego skazali ją na śmierć? Zawiera ALL-NEW WOLVERINE #1-35 i ANNUAL #1 oraz GENERATIONS: WOLVERINE &amp; ALL-NEW WOLVERINE.','ALL-NEW WOLVERINE BY TOM TAYLOR OMNIBUS HC (9781302926441)','marvel-comics','','','MARVEL COMICS','ALL-NEW WOLVERINE BY TOM TAYLOR OMNIBUS HC (9781302926441)','','','',''),(471,1,1,'No description','ALL-NEW WOLVERINE BY TOM TAYLOR OMNIBUS HC KUBERT DM VAR (9781302926458)','marvel-comics','','','MARVEL COMICS','ALL-NEW WOLVERINE BY TOM TAYLOR OMNIBUS HC KUBERT DM VAR (9781302926458)','','','',''),(472,1,1,'Zapnijcie pasy i ruszcie na zupełnie nową przygodę, której bohaterowie pędzą na złamanie karku, by ocalić świat! Obcy atakują miasto, a w najczarniejszej godzinie Captain Marvel atakuje Avengers! Potem nasi bohaterowie trafiają do niewoli, a ich jedyną nadzieją jest Doctor Doom! Armia Red Skulli szykuje się do wojny, grupa zabójców jest bliżej, niż się wydaje i nawet Spider-Man jest w niebezpieczeństwie! Kto stoi za tym szaleństwem, dziurawiąc tkaninę rzeczywistości? Uniwersum Marvela jest w niebezpieczeństwie! Weźcie głęboki oddech, zanim weźmiecie się za lekturę – potem może nie być już powietrza! Avengers zbierają się do akcji! Tom zbiera zeszyty ALL-OUT AVENGERS #1-5 i materiał z FREE COMIC BOOK DAY 2022: SPIDER-MAN/VENOM.','ALL-OUT AVENGERS TP TEACHABLE MOMENTS (9781302947019)','marvel-comics','','','MARVEL COMICS','ALL-OUT AVENGERS TP TEACHABLE MOMENTS (9781302947019)','','','',''),(473,1,1,'Legendarny twórca John Byrne prowadzi jedną ze swoich najlepszych kreacji ku zwycięstwu! Prosto ze stron X-MEN, pierwsza kanadyjska superdrużyna bierze szturmem uniwersum Marvela już na łamach swojego komiksu! Guardian, Shaman, Snowbird, Sasquatch, Aurora, Northstar, Puck i Marrina walczą, by chronić Kanadę przed niesprawiedliwością i złem - w tym Master of the World, maniakalnym alchemikiem Diablo i przerażającym iestiami! Przyjdzie im jednak ponieść porażkę w konfrontacji z groźnymi Omega Flight. A kiedy Alphan upada, czy drużyna może walczyć dalej? Gościnnie: Loki! Hulk! I inni! Tom zbiera zeszyty X-MEN (1963) #109, #120-121 i #139-140, INCREDIBLE HULK (1968) #272, #313 i ANNUAL #8, MACHINE MAN (1978) #18, MARVEL TWO-IN-ONE (1974) #83-84, ALPHA FLIGHT (1983) #1-29, X-MEN AND ALPHA FLIGHT (1985) #1-2, X-MEN/ALPHA FLIGHT (1998) #1-2 oraz materiały z MARVEL TEAM-UP ANNUAL #7.','ALPHA FLIGHT BY JOHN BYRNE OMNIBUS HC (NEW PRINTING) (9781302952716)','marvel-comics','','','MARVEL COMICS','ALPHA FLIGHT BY JOHN BYRNE OMNIBUS HC (NEW PRINTING) (9781302952716)','','','',''),(474,1,1,'Legendarny twórca John Byrne prowadzi jedną ze swoich najlepszych kreacji ku zwycięstwu! Prosto ze stron X-MEN, pierwsza kanadyjska superdrużyna bierze szturmem uniwersum Marvela już na łamach swojego komiksu! Guardian, Shaman, Snowbird, Sasquatch, Aurora, Northstar, Puck i Marrina walczą, by chronić Kanadę przed niesprawiedliwością i złem - w tym Master of the World, maniakalnym alchemikiem Diablo i przerażającym iestiami! Przyjdzie im jednak ponieść porażkę w konfrontacji z groźnymi Omega Flight. A kiedy Alphan upada, czy drużyna może walczyć dalej? Gościnnie: Loki! Hulk! I inni! Tom zbiera zeszyty X-MEN (1963) #109, #120-121 i #139-140, INCREDIBLE HULK (1968) #272, #313 i ANNUAL #8, MACHINE MAN (1978) #18, MARVEL TWO-IN-ONE (1974) #83-84, ALPHA FLIGHT (1983) #1-29, X-MEN AND ALPHA FLIGHT (1985) #1-2, X-MEN/ALPHA FLIGHT (1998) #1-2 oraz materiały z MARVEL TEAM-UP ANNUAL #7.','ALPHA FLIGHT BY JOHN BYRNE OMNIBUS HC DM VAR (NEW PRINTING) (9781302952723)','marvel-comics','','','MARVEL COMICS','ALPHA FLIGHT BY JOHN BYRNE OMNIBUS HC DM VAR (NEW PRINTING) (9781302952723)','','','',''),(475,1,1,'Powrót najlepszego kanadyjskiego superzespołu! Guardian, Puck, Snowbird i Shaman łączą siły! Alpha Flight powraca na scenę! Do jakiego rozłamu doszło między nimi a Aurorą, Northstarem i Nemesis oraz partnerem Aurory, Fangiem? Czy Alpha Flight naprawdę walczy o utrzymanie mutantów z dala od Kanady?! FALL OF X spowodował poważny rozłam w Departamencie H i zmienił zasady gry dla Alpha Flight. Odrodzony zespół musi znaleźć sposób, aby wznieść się na nowe wyżyny - lub zostać zmiażdżonym pod ciężarem niewykonalnej misji! Ale gdy zaskakujące rewelacje na temat nowego Nemezis wstrząsają drużyną, a sytuacja szybko zmienia się na kanadyjskiej północy, czy Alpha Flight może w końcu się zjednoczyć? A może Departament H zamknie program na dobre? Przygotujcie się na poświęcenie, niespodzianki i śmierć! Tom zbiera zeszyty ALPHA FLIGHT (2023) #1-5.','ALPHA FLIGHT DIVIDED WE STAND TP (9781302952457)','marvel-comics','','','MARVEL COMICS','ALPHA FLIGHT DIVIDED WE STAND TP (9781302952457)','','','',''),(476,1,1,'From the pages of AMAZING SPIDER-MAN, get ready for the greatest hero who ever existed — ever! Alpha was having an awesome time of it, till that buzz-kill Spider-Man made him quit being a hero. But that was then, and this is NOW! Josh Fialkov and Nuno Plati tell the tale of a hero who’s about to hit the big time!','ALPHA TP BIG TIME (9780785183877)','marvel-comics','','','MARVEL COMICS','ALPHA TP BIG TIME (9780785183877)','','','',''),(477,1,1,'Najlepsze pokolenie bohaterów Marvela powraca aby powstrzymać jednego ze swoich! Namor Sub-Mariner, władca Atlantydy, po raz kolejny wypowiedział wojnę lądowi - i tym razem chce wygrać za wszelką cenę! Ale nie znajdzie sojuszników w Kapitanie Ameryce, Ludzkiej Pochodni i Zimowym Żołnierzu. Wszyscy trzej walczyli po stronie Namor w II wojnie światowej jako Invaders, ale teraz stają się wrogami! Śmiertelne plany Namora sięgają daleko jak ocean i to Invaders muszą go powstrzymać - ale jaką szansę mają przeciwko byłemu sojusznikowi, który zna ich wszystkie wojenne strategie i taktyki? Ujawniona zostaje tajemnicza historia Namora, Pochodnia zostaje odmieniony -  świat na zawsze się zmieni. Ale czy winy Namora można jeszcze odkupić? Zawiera NAMOR: THE BEST DEFENSE i INVADERS (2019) #1-12.','ALWAYS AN INVADER HC ROSS CVR (9781302927356)','marvel-comics','','','MARVEL COMICS','ALWAYS AN INVADER HC ROSS CVR (9781302927356)','','','',''),(478,1,1,'No description','ALWAYS AN INVADER HC YOUNG DM VAR (9781302927745)','marvel-comics','','','MARVEL COMICS','ALWAYS AN INVADER HC YOUNG DM VAR (9781302927745)','','','',''),(479,1,1,'• Get to know Cho! That’s teen genius Amadeus Cho, the seventh smartest person in the world — but who’s counting?\n• When Cho is declared “Mastermind Excello” by an intelligence contest, his life suddenly spins out of control — and now he’ll need all his smarts just to stay alive!\n• Luckily, Cho — and his adorable coyote pup, Kirby — quickly meet and befriend two of the Marvel Universe’s strongest powerhouses: Hercules and the Incredible Hulk!\n• When Cho investigates his sister’s fate, a complex web begins to unravel. Who has been manipulating him? And why?\n• Can the seventh smartest person on the planet solve the riddle of his own past and future?\n• Collecting material from AMAZING FANTASY (2004) #15; INCREDIBLE HULK (2000) #100; and INCREDIBLE HERCULES #126, #133, #135 and #137.','AMADEUS CHO: GENIUS AT WORK (9781302901011)','marvel-comics','','','MARVEL COMICS','AMADEUS CHO: GENIUS AT WORK (9781302901011)','','','',''),(480,1,1,'U zarania Srebrnej Ery, Stan Lee, Jack Kirby i Steve Ditko - trzy największe komiksowe talenty - stworzyli dziesiątki potworów od Torra po Manoo i jedynego w swoim rodzaju Monsteroso! W historiach pełnych czarów, Marsjan i okultystycznych przygód dr. Druida, wydawało się, że nic nigdy nie spodoba się bardziej czytelnikom. A jednak Lee i Ditko tego dokonali, płynnie przechodząc w nowy rodzaj historii o kosmitach, podróżach w czasie, duchach i atomowych potworach! Dzięki bogato ilustrowanym historiom Ditko ustanowił nowy standard w sztuce komiksowej, a Lee podniósł poprzeczkę jeszcze wyżej dzięki swym iskrzącym scenariuszom. No a w w ostatnim numerze stworzyli takiego gościa o imieniu Spider-Man. Zawiera AMAZING ADVENTURES (1961) # 1-6, AMAZING ADULT FANTASY # 7-14 i AMAZING FANTASY (1962) # 15.','AMAZING FANTASY OMNIBUS HC BRERETON DM VAR NEW PTG (9781302924799)','marvel-comics','','','MARVEL COMICS','AMAZING FANTASY OMNIBUS HC BRERETON DM VAR NEW PTG (9781302924799)','','','',''),(481,1,1,'No description','AMAZING FANTASY OMNIBUS HC NEW PTG (9781302922702)','marvel-comics','','','MARVEL COMICS','AMAZING FANTASY OMNIBUS HC NEW PTG (9781302922702)','','','',''),(482,1,1,'Kaare Andrews (SPIDER-MAN: REIGN) przedstawia zupełnie nową wersję uniwersum Marvela! Tajna agentka Black Widow, nastoletni Spider-Man, Kapitan Ameryka z czasów II wojny światowej - najbardziej ikoniczne wersje waszych ulubionych bohaterów Marvela z całego czasu i przestrzeni - wszyscy budzą się na wyspie intryg, mroku i odległych fantazji. Czy są martwi? Czy śnią? A może naprawdę zostali przeniesieni do innej fantastycznej rzeczywistości? Gdy bohaterowie będą badać swoje niezwykłe otoczenie, będą musieli znaleźć sposób na powrót do domu. To nie jest tylko list miłosny do naszych ulubionych epok Marvela, to powrót kluczowych postaci, które zawsze kochaliśmy, wyrwanych z ich linii czasowych. To jest to, na co czekaliście, Amazing Fantasy na miarę naszych czasów! Tom zbiera zeszyty AMAZING FANTASY (2021) #1-5 i AMAZING FANTASY PRELUDE INFINITY COMIC.','AMAZING FANTASY TP (9781302914561)','marvel-comics','','','MARVEL COMICS','AMAZING FANTASY TP (9781302914561)','','','',''),(483,1,1,'Uniwersum Marvela zmienione, a jednak znajome! Black Widow w szkole szpiegów, nastoletni Spider-Man, Kapitan Ameryka w czasie II wojny światowej. Wszystkie te postacie budzą się nagle na tajemniczej wyspie, na której czekają spiski, niebezpieczeństwa i niewyobrażalne zagrożenia. Czy umarli? Czy to sen, czy jawa? Może rzeczywiście ktoś, lub coś przeniosło ich do innego świata? Czy jest szansa na ucieczkę z tego niepokojącego więzienia? To nie tylko hołd dla ulubionych wersji klasycznych bohaterów. To klasyczni bohaterowie wyrwani ze swojej strefy komfortu w nowym środowisku. Na to czekaliście; komiks z rysunkami Kaare Andrews w powiększonym formacie. Tom zbiera zeszyty AMAZING FANTASY (2021) #1-5 and AMAZING FANTASY PRELUDE INFINITY COMIC (2021) #1.','AMAZING FANTASY TREASURY EDITION TP (9781302931483)','marvel-comics','','','MARVEL COMICS','AMAZING FANTASY TREASURY EDITION TP (9781302931483)','','','',''),(484,1,1,'No description','AMAZING MARY JANE TP VOL 01 DOWN IN FLAMES UP IN SMOKE (9781302920272)','marvel-comics','','','MARVEL COMICS','AMAZING MARY JANE TP VOL 01 DOWN IN FLAMES UP IN SMOKE (9781302920272)','','','',''),(485,1,1,'No description','AMAZING SPIDER-MAN 2099 COMPANION TP (9781302924928)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN 2099 COMPANION TP (9781302924928)','','','',''),(486,1,1,'Continuing their popular ART OF series of movie tie-in books, Marvel presents its latest blockbuster achievement! Featuring exclusive concept artwork, behind-the-scenes photographs, production stills, and in-depth interviews with the cast and crew, THE AMAZING SPIDER-MAN: THE ART OF THE MOVIE is a deluxe keepsake volume that provides an insider’s look into the making of the wall-crawler’s 2012 film directed by Marc Webb, and starring Andrew Garfield, Emma Stone, Rhys Ifans, Denis Leary, Martin Sheen and Sally Field!','AMAZING SPIDER-MAN BEHIND SCENES AND BEYOND WEB HC (9780785168171)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BEHIND SCENES AND BEYOND WEB HC (9780785168171)','','','',''),(487,1,1,'Klon Spider-Mana powrócił! Dzięki oficjalnemu partnerstwu z korporacją Beyond i szkoleniu przez Daughters of the Dragon, Ben Reilly ponownie zakłada strój Spider-Mana! Ale chwileczkę, co się stało z Peterem Parkerem? W tym momencie Ben stał się jedną z najbardziej poszukiwanych i znienawidzonych postaci, a Morbius i Kraven są żądni krwi, podobnie jak nowa przeciwniczka Spider-Mana, Goblin Queen! Czyżby Beyond ukrywało w swojej siedzibie więcej sekretów? Doctor Octopus powraca w wielkim stylu, a Mary Jane łączy siły z Black Cat! Gdy sytuacja Bena staje się coraz bardziej beznadziejna, dwóch Spider-Manów znajduje się na kursie kolizyjnym, a ich konfrontacja zmieni wszystko! Tom zbiera zeszyty AMAZING SPIDER-MAN (2018) #75-93, #78.BEY, #80.BEY, #88.BEY i #92.BEY, MARY JANE &amp; BLACK CAT: BEYOND oraz materiały z AMAZING SPIDER-MAN (2018) #74 i FREE COMIC BOOK DAY 2021: SPIDER-MAN/VENOM.','AMAZING SPIDER-MAN BEYOND OMNIBUS HC ADAMS FIRST ISSUE CVR (9781302949624)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BEYOND OMNIBUS HC ADAMS FIRST ISSUE CVR (9781302949624)','','','',''),(488,1,1,'Klon Spider-Mana powrócił! Dzięki oficjalnemu partnerstwu z korporacją Beyond i szkoleniu przez Daughters of the Dragon, Ben Reilly ponownie zakłada strój Spider-Mana! Ale chwileczkę, co się stało z Peterem Parkerem? W tym momencie Ben stał się jedną z najbardziej poszukiwanych i znienawidzonych postaci, a Morbius i Kraven są żądni krwi, podobnie jak nowa przeciwniczka Spider-Mana, Goblin Queen! Czyżby Beyond ukrywało w swojej siedzibie więcej sekretów? Doctor Octopus powraca w wielkim stylu, a Mary Jane łączy siły z Black Cat! Gdy sytuacja Bena staje się coraz bardziej beznadziejna, dwóch Spider-Manów znajduje się na kursie kolizyjnym, a ich konfrontacja zmieni wszystko! Tom zbiera zeszyty AMAZING SPIDER-MAN (2018) #75-93, #78.BEY, #80.BEY, #88.BEY i #92.BEY, MARY JANE &amp; BLACK CAT: BEYOND oraz materiały z AMAZING SPIDER-MAN (2018) #74 i FREE COMIC BOOK DAY 2021: SPIDER-MAN/VENOM.','AMAZING SPIDER-MAN BEYOND OMNIBUS HC ADAMS KRAVEN DM VAR (9781302949631)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BEYOND OMNIBUS HC ADAMS KRAVEN DM VAR (9781302949631)','','','',''),(489,1,1,'Klon Spider-Mana powrócił! Dzięki oficjalnemu partnerstwu z korporacją Beyond i szkoleniu przez Daughters of the Dragon, Ben Reilly ponownie zakłada strój Spider-Mana! Ale chwileczkę, co się stało z Peterem Parkerem? W tym momencie Ben stał się jedną z najbardziej poszukiwanych i znienawidzonych postaci, a Morbius i Kraven są żądni krwi, podobnie jak nowa przeciwniczka Spider-Mana, Goblin Queen! Czyżby Beyond ukrywało w swojej siedzibie więcej sekretów? Doctor Octopus powraca w wielkim stylu, a Mary Jane łączy siły z Black Cat! Gdy sytuacja Bena staje się coraz bardziej beznadziejna, dwóch Spider-Manów znajduje się na kursie kolizyjnym, a ich konfrontacja zmieni wszystko! Tom zbiera zeszyty AMAZING SPIDER-MAN (2018) #75-93, #78.BEY, #80.BEY, #88.BEY i #92.BEY, MARY JANE &amp; BLACK CAT: BEYOND oraz materiały z AMAZING SPIDER-MAN (2018) #74 i FREE COMIC BOOK DAY 2021: SPIDER-MAN/VENOM.','AMAZING SPIDER-MAN BEYOND OMNIBUS HC RAMOS DM VAR (9781302949648)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BEYOND OMNIBUS HC RAMOS DM VAR (9781302949648)','','','',''),(490,1,1,'Niesamowici autorzy wkraczają w nową erę komiksu! Ben Reilly, klon Spider-Mana powraca! Przeszedł przez piekło, ale z pomocą Beyond Corporation może wrócić do Nowego Jorku i stać się najlepszym Spider-Manem w historii. Ale co stało się z Peterem Parkerem? Co ta zmiana oznacza dla Mary Jane, Black Cat, cioci May i całego Nowego Jorku? Powrót Człowieka-Pająka ściąga uwagę Morbiusa i Kravena, którzy są rządni krwi! Dlatego Ben będzie potrzebował każdej możliwej pomocy i treningu od Daughters of the Dragon! Przygotujcie się na nowego Spider-Mana walczącego z klasycznymi wrogami, oraz z zupełnie nowymi zagrożeniami! Tom zbiera zeszyty AMAZING SPIDER-MAN (2018) #75-80 i #78.BEY.','AMAZING SPIDER-MAN BEYOND TP VOL 01 (9781302932114)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BEYOND TP VOL 01 (9781302932114)','','','',''),(491,1,1,'Nowy Spider-Man kontra jeszcze nowszy Spider-Man! Korporacja Beyond zapłaciła sowicie za prawa do wizerunku Spider-Mana i nie podoba jej się, że po Brooklynie grasuje jakiś nielicencjonowany Człowiek-Pająk. Biznesmeni nasyłają więc Bena Reilly’ego na Milesa Moralesa! W międzyczasie Mary Jane Watson stara się pomóc Peterowi Parkerowi powrócić do zdrowia. Niestety, znika jego współlokator i to ona musi mu pomóc. Z kolei Ciocia May, by ratować swojego bratanka decyduje się nawiązać kontakt ze swoim byłym narzeczonym, Octopusem! Ten z kolei ma na pieńku z Beyond i jej licencjonowanym Spider-Manem. Co z tego wyniknie, gdy Ben i Doctor Octopus zaczną wykorzystywać swoje nowe groźne sztuczki? Dziś Spider-Man nie jest już tylko niesamowity! Tom zbiera zeszyty AMAZING SPIDER-MAN (2018) #80.BEY oraz #81-85.','AMAZING SPIDER-MAN BEYOND TP VOL 02 (9781302932572)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BEYOND TP VOL 02 (9781302932572)','','','',''),(492,1,1,'Atak Doc Ocka wstrząśnie Benem Reilly’m jak nikt i nic do tej pory – z resztą Wami też! Nadchodzi wydarzenie, które czytelnicy zapamiętają na lata. Po walce z Octopusem Kapitan Ameryka i Black Cat muszą dowiedzieć się, czy Peter Parker czuje się na siłach, by znów założyć kostium Spider-Mana! W międzyczasie, Ben zmierzy się z nowym Goblinem, kompletnie nieprzygotowany na to, do czego jest zdolny. Nic nie może przygotować go na atak Goblin Queen! Tymczasem, Black Cat zostaje porwana i tylko Mary Jane jest w stanie jej pomóc! Nie myślcie, że Beyond Corporation ma na swoich usługach tylko jednego bohatera! Poznajcie Slingerów i Hobie’ego Browna w roli Horneta! Tom zbiera zeszyty AMAZING SPIDER-MAN (2018) #86-88 i #88.BEY oraz MARY JANE &amp; BLACK CAT: BEYOND.','AMAZING SPIDER-MAN BEYOND TP VOL 03 (9781302932589)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BEYOND TP VOL 03 (9781302932589)','','','',''),(493,1,1,'Tu kończy się saga “Beyond”! Ben Reilly, licencjonowany i finansowany przez Beyond Corporation Spider-Man przeżył w ostatnich miesiącach więcej, niż jakikolwiek inny Pajęczak. Po potyczce z Benem, Queen Goblin mierzy się z Black Cat! Przygotujcie się na walkę stulecia i próbkę tego jak będą wyglądać rządy królowej goblinów. Daily Bugle jest w rozsypce. Czy Benowi uda się wkroczyć do akcji z zaskoczenia i pokonać swoją nową przeciwniczkę? Czy Peter Parker wydobrzeje, pokona śmierć i pomoże Benowi w boju z potwornościami zza drzwi Z? Do akcji wkraczają Monica Rambeau i Lizard, ale wszystko rozstrzygnie się w pojedynku Spider-Manów! Możecie się zdziwić co tak naprawdę stoi za Beyond Corporation i jakie będzie rozwiązanie tej historii! Tom zbiera zeszyty AMAZING SPIDER-MAN (2018) #89-93 i #92.BEY.','AMAZING SPIDER-MAN BEYOND TP VOL 04 (9781302932596)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BEYOND TP VOL 04 (9781302932596)','','','',''),(494,1,1,'Znani na całym świecie Spider-Mani, Peter Parker i Miles Morales, wkraczają do akcji w ramach crossovera BLOOD HUNT!\nWampiry szaleją po Nowym Jorku, a podczas gdy Avengers są w samym oku cyklonu, ktoś musi zadbać o obywateli miasta. Ale kto? Peter Parker, spektakularny Spider-Man! Ale gdyby wszystko było takie proste. Spidey ma do odegrania ogromną rolę w koszmarnej sadze, która obejmuje losy Morbiusa! Ale czy tym razem Morbius będzie wrogiem czy przyjacielem? I czy Peter będzie musiał go unieszkodliwić, czy ocalić? Poza tym: Miles Morales ma swoje własne bitwy do stoczenia w czasie BLOOD HUNT!\nTom zbiera zeszyty: Amazing Spider-Man: Blood Hunt (2024) 1-3, Amazing Spider-Man (2022) 49, Miles Morales Spider-Man (2023) 21-22.','AMAZING SPIDER-MAN BLOOD HUNT TP (9781302958619)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BLOOD HUNT TP (9781302958619)','','','',''),(495,1,1,'To nowy początek dla Niesamowitego Spider-Mana! Ukrywany przez lata sekret wywraca do góry nogami życie Petera Parkera, zagrażając jego pracy i relacjom z bliskimi! Gdyby tego było mało, Pająk musi poradzić sobie z inwazją obcych (z tajemniczym zwrotem akcji), nowym lokatorem (na codzień lepiej znanym jako złoczyńca Boomerang), nowymi problemami w życiu uczuciowym oraz niebezpiecznym nowym przeciwnikiem! Czy jesteś też gotowy na... Petera Parkera w starciu ze Spider-Manem? Dlaczego ktoś podszywa się pod Petera? Nick Spencer i Ryan Ottley rozpoczynają nową erę w życiu Spider-Mana. Zawiera AMAZING SPIDER-MAN (2018) #1-5 i materiały z FREE COMIC BOOK DAY 2018 (AMAZING SPIDER-MAN).','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 01 BACK BASICS (9781302912314)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 01 BACK BASICS (9781302912314)','','','',''),(496,1,1,'No description','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 02 (9781302912321)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 02 (9781302912321)','','','',''),(497,1,1,'No description','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 03 (9781302914332)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 03 (9781302914332)','','','',''),(498,1,1,'Kiedy Peter musi zmierzyć się z konsekwencjami decyzji Mary Jane, nadciąga ABSOLUTE CARNAGE! Tylko Spider-Man stoi na drodze Carnage, który chce dorwać młodego Dylana Brocka. Co gorsza, każdy, kto kiedykolwiek nosił symbiont Carnage staje się jego celem - w tym Norman Osborn, który jeszcze niedawno był Czerwonym Goblinem! Czy Spider-Man może ocalić Normana przed Carnage? Czy on w ogóle tego chce? Plus: Nieopowiedziane historie pełne szaleństwa i chaosu z ery Czerwonego Goblina! Zawiera AMAZING SPIDER-MAN (2018) #29-31 i RED GOBLIN: RED DEATH #1.','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 06 (9781302917272)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 06 (9781302917272)','','','',''),(499,1,1,'Od miesięcy, a może lat, skrywał się w cieniu, manipulując wydarzeniami zza kulis. Teraz demon znany jako Kindred jest wreszcie gotowy do zemsty - nie na Spider-Manie, ale na Peterze Parkerze! Wskrzesił jednego z najbardziej niepokojących wrogów Spideya: fanatycznego Sin-Eatera! Ale kim jest Sin-Eater i dlaczego tak przeraża jego powrót? Jaka tajemna historia zostanie ujawniona? Kto będzie celem tego złoczyńcy tu i teraz? Lethal Legion powraca, aby zagrozić Wielkiemu Jabłku, ale wkrótce znajdą się na celowniku Sin-Eatera! Czy Spider-Man może powstrzymać mordercę przed kolejnym atakiem? Powinien? A gdy apetyt Sin-Eatera rośnie jeszcze bardziej, zwraca uwagę na… Instytut Ravencroft! Zawiera AMAZING SPIDER-MAN (2018) #44-47 oraz AMAZING SPIDER-MAN: SINS RISING.','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 09 SINS RISING (9781302920241)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 09 SINS RISING (9781302920241)','','','',''),(500,1,1,'Ile trzeba, by złamać Spider-Mana? Nick Spencer i wielu legendarnych twórców świętuje 850 numerów serii AMAZING SPIDER-MAN - wystawiając Pająka na jeszcze większe próby! Zmartwychwstały Pożeracz Grzechów jest potężniejszy dzięki Kindred - i gdy jego działania doprowadzają do zamieszek, Zielony Goblin powraca! Norman Osborn powrócił - a jego burzliwa przeszłość będzie prześladować go i Petera Parkera. Spidey wiele przeszedł przez te wszystkie lata, ale nawet jego najgorsze chwile były dopiero wstępem do tego, co nadejdzie! Czy da sobie radę z niewielką pomocą przyjaciół? Miles Morales, Spider-Woman, Ghost-Spider, Spider-Girl i Madame Web łączą siły - rodzi się Zakon Sieci! Zawiera AMAZING SPIDER-MAN (2018) #48-49, SPIDER-MAN: THE SINS OF NORMAN OSBORN oraz materiały z FREE COMIC BOOK DAY 2020 (SPIDER-MAN / VENOM).','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 10 GREEN GOBLIN RETURNS (9781302920258)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 10 GREEN GOBLIN RETURNS (9781302920258)','','','',''),(501,1,1,'No description','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 11 LAST REMAINS (9781302925871)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 11 LAST REMAINS (9781302925871)','','','',''),(502,1,1,'No description','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 12 SHATTERED WEB (9781302926052)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 12 SHATTERED WEB (9781302926052)','','','',''),(503,1,1,'No description','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 13 KINGS RANSOM (9781302926069)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY NICK SPENCER TP VOL 13 KINGS RANSOM (9781302926069)','','','',''),(504,1,1,'Niewielu scenarzystów umiało tak namącić w życiu Petera Parkera jak zrobił to Nick Spencer! Jego run rozpoczyna się inwazji kosmitów, kłopotliwego sobowtóra i niebezpiecznego współlokatora: nieuczciwego Bumeranga! Sprawy obierają jeszcze bardziej szalony kierunek, gdy do życia Spider-Mana powraca dawna miłość, a jedyny i niezastąpiony J. Jonah Jameson sprowadza na Pająka masę kłoptów będąc jego przyjacielem! Piętrzą się także zagrożenia, za sprawą Enforcers, Taskmastera i Black Anta, Kravena Huntera, Electro i nowego Sinister Sindicate! Carnage sieje chaos, z przyszłości powraca Spider-Man 2099, a Black Cat robi to, co umie najlepiej! Kim jest ten złoczyńca w cieniu? Tom zbiera zeszyty AMAZING SPIDER-MAN (2018) #1-43, #16.HU i #18.HU-20.HU, AMAZING SPIDER-MAN: FULL CIRCLE oraz materiały z FREE COMIC BOOK DAY 2018 (AMAZING SPIDER-MAN/GUARDIANS OF THE GALAXY).','AMAZING SPIDER-MAN BY SPENCER OMNIBUS HC VOL 01 DM VAR (9781302946104)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY SPENCER OMNIBUS HC VOL 01 DM VAR (9781302946104)','','','',''),(505,1,1,'Niewielu scenarzystów umiało tak namącić w życiu Petera Parkera jak zrobił to Nick Spencer! Jego run rozpoczyna się inwazji kosmitów, kłopotliwego sobowtóra i niebezpiecznego współlokatora: nieuczciwego Bumeranga! Sprawy obierają jeszcze bardziej szalony kierunek, gdy do życia Spider-Mana powraca dawna miłość, a jedyny i niezastąpiony J. Jonah Jameson sprowadza na Pająka masę kłoptów będąc jego przyjacielem! Piętrzą się także zagrożenia, za sprawą Enforcers, Taskmastera i Black Anta, Kravena Huntera, Electro i nowego Sinister Sindicate! Carnage sieje chaos, z przyszłości powraca Spider-Man 2099, a Black Cat robi to, co umie najlepiej! Kim jest ten złoczyńca w cieniu? Tom zbiera zeszyty AMAZING SPIDER-MAN (2018) #1-43, #16.HU i #18.HU-20.HU, AMAZING SPIDER-MAN: FULL CIRCLE oraz materiały z FREE COMIC BOOK DAY 2018 (AMAZING SPIDER-MAN/GUARDIANS OF THE GALAXY).','AMAZING SPIDER-MAN BY SPENCER OMNIBUS HC VOL 01 KINDRED CVR (9781302946098)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY SPENCER OMNIBUS HC VOL 01 KINDRED CVR (9781302946098)','','','',''),(506,1,1,'Przez miesiące, a może nawet lata, obrzydliwy Kindred stał w cieniu, manipulując wydarzeniami z daleka. Teraz w końcu jest gotowy do ujawnienia się i zemsty, nie na Spider-Manie, ale na Peterze Parkerze! Aby tego dokonać, wskrzesił fanatycznego Sin-Eatera! Gdy Spidey dostaje lanie swojego życia, nadszedł czas, aby przenieść walkę na teren Kindreda, ale czy Peter będzie musiał zapłacić za to tym co najdroższe? Co gorsza, Norman Osborn powrócił! A dosłowna armia superzłoczyńców - w tym Boomerang, Kingpin, Tombstone, Chameleon i Jack O\'Lantern - rozpoczynają Sinister War! Gdy saga Nicka Spencera osiąga punkt kulminacyjny, jaki będzie przerażający koniec Kindreda? Tom zbiera zeszyty AMAZING SPIDER-MAN (2018) #44-73, #74 (A-B STORIES) i #50.LR-54. LR, AMAZING SPIDER-MAN: SINS RISING PRELUDE, AMAZING SPIDER-MAN: THE SINS OF NORMAN OSBORN, GIANT-SIZE AMAZING SPIDER-MAN: KING\'S RANSOM, GIANT-SIZE AMAZING SPIDER-MAN: THE CHAMELEON CONSPIRACY oraz SINISTER WAR #1-4.','AMAZING SPIDER-MAN BY SPENCER OMNIBUS HC VOL 02 (9781302953645)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY SPENCER OMNIBUS HC VOL 02 (9781302953645)','','','',''),(507,1,1,'Przez miesiące, a może nawet lata, obrzydliwy Kindred stał w cieniu, manipulując wydarzeniami z daleka. Teraz w końcu jest gotowy do ujawnienia się i zemsty, nie na Spider-Mani