SPIDER-MAN BY SPENCER OMNIBUS HC VOL 02 GLEASON DM (9781302953652)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY SPENCER OMNIBUS HC VOL 02 GLEASON DM (9781302953652)','','','',''),(509,1,1,'No description','AMAZING SPIDER-MAN BY SPENCER TP VOL 14 CHAMELEON CONSPIRACY (9781302926076)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY SPENCER TP VOL 14 CHAMELEON CONSPIRACY (9781302926076)','','','',''),(510,1,1,'No description','AMAZING SPIDER-MAN BY SPENCER TP VOL 15 WHAT COST VICTORY (9781302926083)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY SPENCER TP VOL 15 WHAT COST VICTORY (9781302926083)','','','',''),(511,1,1,'Rozpoczyna się nowa era w życiu SPIDER-MANA! Avengers nie chcą mieć do czynienia z Peterem Parkerem! Fantastic Four także ma go dość! Nawet Ciocia May ma do niego urazę. Nikt nie chce go w swoim życiu – nikt poza Doctorem Octopusem! Doc Ock chce dopaść Spider-Mana. Można tylko zakładać, że jego plany są potworne i Pająk pożałuje, jeśli da się złapać. Co sprawiło, że wszyscy nienawidzą Spider-Mana? Jaki wpływ ma to na działania Tombstone’a? Spidey i Tomby stoczą najbrutalniejszą bitwę w swojej historii, a prawdziwe rany Peter odniesie psychicznie! W roku sześćdziesięciolecia debiutu postaci Spider-Mana, do tytułu powraca John Romita Jr. Rok 2022 będzie największym w historii Człowieka – Pająka! Tom zbiera zeszyty AMAZING SPIDER-MAN (2022) #1-5.','AMAZING SPIDER-MAN BY WELLS ROMITA JR TP VOL 01 (9781302932725)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY WELLS ROMITA JR TP VOL 01 (9781302932725)','','','',''),(512,1,1,'Nadchodzą sześćdziesiąte urodziny Spider-Mana, a Marvel rozpoczyna święto! Ktoś z przeszłości Człowieka-Pająka uwięził członków Sinister Six i wykorzystał ją do stworzenia naprawdę przerażającego... Sinister Adaptoida! Czy Spidey zdoła pokonać przebiegłego androida, który posiada moce wszystkich jego najgroźniejszych wrogów? Kim jest twórca Adaptoida? Przygotujcie się na jedną z największych przygód w historii Petera Parkera; nie uwierzycie, jak się ona zakończy! Norman Osborn powraca! Jakie są jego plany wobec Spider-Mana?! Przygotujcie się na najbardziej wstrząsającą zmianę status quo Spider-Mana w ostatnich latach. Nowy strój wygląda znajomo. Czy to szybowiec Goblina?! Tom zbiera zeszyty AMAZING SPIDER-MAN (2022) #6-8.','AMAZING SPIDER-MAN BY WELLS ROMITA JR TP VOL 02 NEW SINISTER (9781302932732)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY WELLS ROMITA JR TP VOL 02 NEW SINISTER (9781302932732)','','','',''),(513,1,1,'Przygotujcie się na kolejny wstrząs w życiu Spider-Mana! Gdy doniosłe wydarzenia z A.X.E. zmieniają całe Uniwersum Marvela, nadchodzi czas, by Spider-Man stanął przed sądem i wszyscy wiemy, który moment z jego przeszłości zaważy na wyroku. Jeśli Peter zdoła się pozbierać, pewnie będzie miał wreszcie czas, by odpocząć. Niestety, Hobgoblin czai się w cieniu! Kto tym razem przyjął tożsamość potwornego gangstera? Jeżeli można cokolwiek powiedzieć o Hobgoblinie, to na pewno to, że o Hobgoblinie nic nie wiadomo! Poza tym: Nadszedł czas, by Spidey założył najlepsze ubrania, bo został zaproszony na Hellfire Galę! Na najgorętszym wydarzeniu towarzyskim na Krakoa wydarzy się coś, co wyśle Spider-Mana i Wolverine\'a na niebezpieczną misję! Tom zbiera zeszyty AMAZING SPIDER-MAN (2022) #9-14. ','AMAZING SPIDER-MAN BY WELLS ROMITA JR TP VOL 03 HOBGOBLIN (9781302933135)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY WELLS ROMITA JR TP VOL 03 HOBGOBLIN (9781302933135)','','','',''),(514,1,1,'Dwa najbardziej niesławne klony Marvela powracają, by zawalczyć o to, co uważają za swoje! Ben Reilly i Madelyne Pryor mają dość i rozpętują piekło! Gdy Chasm i Goblin Queen snują swoją mroczną sieć nad Nowym Jorkiem, Spider-Man i X-Men nie przeczuwają kłopotów! Jeśli Peter Parker ma przetrwać ten nadnaturalny koszmar, będzie musiał przedrzeć się przez Venoma, Chasma, Hallows\' Eve, ale gdy zostanie uwięziony w Limbo, czekają na niego jeszcze hordy demonów! Ale nie są to typowe demony - mówimy tu o piekielnych wersjach jego najstarszych przeciwników! Czy Spidey zdoła jakoś dotrzeć do domu, by ponownie włączyć się do walki i powstrzymać Chasma i Goblin Queen?! I jak Limbo zmieni oblicze miasta?! Tom zbiera zeszyty AMAZING SPIDER-MAN (2022) #15-18, DARK WEB #1 i DARK WEB FINALE #1.','AMAZING SPIDER-MAN BY WELLS TP VOL 04 DARK WEB (9781302947361)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY WELLS TP VOL 04 DARK WEB (9781302947361)','','','',''),(515,1,1,'Niesamowite odpowiedzi na palące pytania! Co takiego zrobił Peter Parker, że zrujnował reputację Spider-Mana? Co się stało miesiące temu między Peterem a Mary Jane Watson? Co czeka ich w najbliższej przyszłości? I kim jest przerażająco wyglądająca postać, która miesza w życiu Człowieka-Pająka? Warto czekać na odpowiedzi! Dodatkowo: DARK WEB jest już za nami, ale widmo upadku będzie prześladowało Spider-Mana przez długi czas. Aby dojść do siebie, Peter i Felicia Hardy, Black Cat, uciekają z miasta do ekskluzywnego spa w Catskills! Z pewnością nikt nie zepsuje ich romantycznego wypadu, próbując ich zabić, prawda? Tom zbiera zeszyty AMAZING SPIDER-MAN (2022) #19-23.','AMAZING SPIDER-MAN BY WELLS TP VOL 05 DEAD LANGUAGE PT 1 (9781302947378)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY WELLS TP VOL 05 DEAD LANGUAGE PT 1 (9781302947378)','','','',''),(516,1,1,'No description','AMAZING SPIDER-MAN BY WELLS TP VOL 06 DEAD LANGUAGE PART 2 (9781302947385)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY WELLS TP VOL 06 DEAD LANGUAGE PART 2 (9781302947385)','','','',''),(517,1,1,'Zeb Wells kontynuuje swoje rządy w serii Amazing Spider-Man!\nNadszedł czas na ślub! A Peter Parker jest... drużbą. Ale jeśli wiecie cokolwiek o komiksach i ślubach, wiecie, że nie jest to dobre połączenie! Innymi słowy, przygotujcie się na punkt kulminacyjny historii budowanej przez ostatnie lata!\nTOM ZBIERA ZESZYTY: Amazing Spider-Man (2022) 32-38.','AMAZING SPIDER-MAN BY WELLS TP VOL 08 SPIDER-MANS FIRST HUNT (9781302953447)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY WELLS TP VOL 08 SPIDER-MANS FIRST HUNT (9781302953447)','','','',''),(518,1,1,'Czy Spidey w końcu spotkał wroga na miarę swoich możliwości? Spider-Man jest pogrążony w żałobie po szokującej śmierci - ale nie brakuje superzłoczyńców, którzy ustawiają się w kolejce, by wpakować do grobu jego! Po pierwsze: Doctor Octopus z nowymi zasobami! Gdy Otto zabiera swoje bardziej śmiercionośne, niż kiedykolwiek macki na szaleństwo w Oscorpie, Spidey nie ma czasu na żałobę? Postawiony pod ścianą, Spider-Man może liczyć tylko na pomoc sojuszników! Następnie biją dzwony weselne, a Peter Parker musi dotrzeć do kościoła na czas - ponieważ jest świadkiem! Janice Lincoln i Randy Robertson wiążą się węzłem małżeńskim i nie ma mowy, aby wszyscy bossowie przestępczości w Nowym Jorku nie postrzegali tego jako okazji do znokautowania ojca panny młodej, Tombstone’a! Tom zbiera zeszyty AMAZING SPIDER-MAN (2022) #27-31.','AMAZING SPIDER-MAN BY ZEB WELLS TP VOL 07 ARMED DANGEROUS (9781302947392)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY ZEB WELLS TP VOL 07 ARMED DANGEROUS (9781302947392)','','','',''),(519,1,1,'Wydarzenie, które wstrząśnie ulicami Nowego Jorku, a Spider-Man jest w samym środku zamieszania! Superprzestępczy krajobraz Nowego Jorku był tykającą bombą zegarową, a teraz w końcu eksploduje! Co wywołało wojnę gangów?! Kto wynajął Shotguna i załatwił Tombstone\'a? I co, jeśli w ogóle, Spider-Man może z tym zrobić? Gdy Nowy Jork staje się otwartym polem bitwy dla bezwzględnego konfliktu super-złoczyńców, Człowiek-Pająk będzie potrzebował niesamowitej drużyny. Ale po której stronie w tej wojnie stanie Tombstone? I czy Wilson Fisk, były Kingpin, nie weźmie w niej udziału? Nie ma szans! Największa i najbardziej brutalna bitwa w historii Spidey’ego nadchodzi. A jeśli myślałeś, że wiesz, do czego zdolni są Madame Masque, Hobgoblin, Beetle i Diamondback, pomyśl jeszcze raz! Tom zbiera zeszyty AMAZING SPIDER-MAN: GANG WAR FIRST STRIKE i AMAZING SPIDER-MAN (2022) #39-44.','AMAZING SPIDER-MAN BY ZEB WELLS TP VOL 09 GANG WAR (9781302954604)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY ZEB WELLS TP VOL 09 GANG WAR (9781302954604)','','','',''),(520,1,1,'Wojna gangów dobiegła końca, ale Nowy Jork nie jest już taki sam. Podczas gdy Peter Parker walczył na wojnie, inne części jego życia toczyły się dalej - i wkrótce odczuje on konsekwencje ich zaniedbania! Electro nie zamierza czekać, aż sam rozwiąże wszystkie swoje problemy! Kiedy klon Petera, Ben Reilly - teraz znany jako Chasm - wydostaje się z Limbo, to Spider-Man musi odnaleźć Bena... i Hallows\' Eve! W międzyczasie, jaka tajemnica rośnie w Ravencroft? Co się dzieje z Normanem Osbornem?! A kiedy w Nowym Jorku szaleją wampiry, ktoś musi zająć się mieszkańcami miasta. Spidey dołącza do BLOOD HUNT! Tom zbiera zeszyty AMAZING SPIDER-MAN (2022) #45-49 oraz materiały z FREE COMIC BOOK DAY 2024: SPIDER-MAN/ULTIMATE UNIVERSE i WEB OF SPIDER-MAN (2024) #1.','AMAZING SPIDER-MAN BY ZEB WELLS TP VOL 10 BREATHE (9781302954611)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY ZEB WELLS TP VOL 10 BREATHE (9781302954611)','','','',''),(521,1,1,'Polaryzujący run Zeba Wellsa w serii Amazing Spider-Man osiąga punkt kulminacyjny wraz z powrotem Green Goblina!\nNajwiększy złoczyńca z przeszłości Spider-Mana powraca i ma zamiar przypomnieć mu - i nam wszystkim - dlaczego tak się go boimy! A jakby Goblin nie wystarczył, Sinister Six też tu jest - wraz z kilkoma innymi problemami, które zniszczą życie Spider-Mana raz na zawsze!\nTOM ZBIERA ZESZYTY: Amazing Spider-Man (2022) 50-54.','AMAZING SPIDER-MAN BY ZEB WELLS TP VOL 11 GOING GREEN (9781302954628)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY ZEB WELLS TP VOL 11 GOING GREEN (9781302954628)','','','',''),(522,1,1,'Superscenarzysta Zeb Wells kontynuuje swój run w Amazing Spider-Man, w którym Tombstone staje się nowym Kingpinem! Ostatni tom prawie zabił Spider-Mana - a inni nie mieli tyle szczęścia. Peter Parker chce po prostu złapać oddech, ale jak zwykle może liczyć tylko na szczęście w nieszczęsciu! Zdradziecki Tombstone musi pokazać innym gangom Nowego Jorku że jest silny i niebezpieczny i nie ma z nim żartów. A najlepszym sposobem na to jest zabicie Spider-Mana! A najłatwiejszym sposobem na dotarcie do Spidey’ego jest porwanie... Petera Parkera! Przygotuj się na najbardziej krwawe starcie w historii serii AMAZING SPIDER-MAN! Tom zbiera zeszyty: Amazing Spider-Man (2022) 55-60.','AMAZING SPIDER-MAN BY ZEB WELLS TP VOL 12 DEAD WRONG (9781302959456)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN BY ZEB WELLS TP VOL 12 DEAD WRONG (9781302959456)','','','',''),(523,1,1,'No description','AMAZING SPIDER-MAN CLONE CONSPIRACY TP (9781302905996)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN CLONE CONSPIRACY TP (9781302905996)','','','',''),(524,1,1,'J. Jonah Jameson posiada dowód na to, że Peter Parker jest Spider-Manem - a to dopiero początek problemów Człowieka-Pająka! Dinozaury walczą z Lizardem na Broadwayu. Doktor Faustus planuje doprowadzić naszego bohatera do szaleństwa. A Molten Man i Punisher powracają do miasta! To tylko kolejny dzień w życiu Spider-Mana! Ale kiedy powraca Green Goblin, wszystko jest możliwe! Sekretna tożsamość Spider-Mana, życie cioci May i Mary Jane - wszystko jest zagrożone! Spidey zawiera również sojusz z Novą, debiutuje Rocket Racer, powraca król przestępczości Silvermane, mamy też Annual z większą liczbą pająków niż ludzi... a Peter Parker oświadcza się Mary Jane! Czy się zgodzi? Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #165-185, AMAZING SPIDER-MAN ANNUAL (1964) #11-12, NOVA (1977) #12 i MARVEL CALENDAR 1978.','AMAZING SPIDER-MAN EPIC COL TP VOL 10 BIG APPLE BATTLEGROUND (9781302955267)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COL TP VOL 10 BIG APPLE BATTLEGROUND (9781302955267)','','','',''),(525,1,1,'No description','AMAZING SPIDER-MAN EPIC COLL TP VOL 02 GREAT RESPONSIBILITY NEW PTG (9781302950576)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLL TP VOL 02 GREAT RESPONSIBILITY NEW PTG (9781302950576)','','','',''),(526,1,1,'John Romita Senior pomaga Stanowi Lee wynieść przygody Spider-Mana na nowy poziom. Zaczynają oni od uczynienia z Green Goblina nemezis Człowieka-Pająka! Potem Rhino, dysponujący ogromną siłą kolos, bezpośrednio zagraża życiu Spider-Mana. To nie koniec; akcja nie zwolni nawet, gdy Spider-Man znajdzie się wśród Avenges, stanie przeciwko Shockerowi, Lizardowi, Kravenowi, oraz nowemu Vulture’owi i nowemu przeciwnikowi zwanemu Kingpinem! Wszyscy jednak wiemy, że sednem tej historii jest Peter Parker i jego rozterki. W tym tomie chłopak wyprowadza się, by zamieszkać z Harry’m Osbornem, zacznie spotykać się z Gwen Stacy, a do jego życia wejdzie spektakularna Mary Jane Watson! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #39-52, AMAZING SPIDER-MAN ANNUAL (1964) #3-4, oraz materiały z NOT BRAND ECHH #2.','AMAZING SPIDER-MAN EPIC COLL TP VOL 03 SPIDER-MAN NO MORE NEW PTG (9781302932497)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLL TP VOL 03 SPIDER-MAN NO MORE NEW PTG (9781302932497)','','','',''),(527,1,1,'No description','AMAZING SPIDER-MAN EPIC COLL TP VOL 06 DEATH CAPTAIN STACY (9781302929084)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLL TP VOL 06 DEATH CAPTAIN STACY (9781302929084)','','','',''),(528,1,1,'Życie Petera Parkera nigdy nie było łatwe, ale powrót jego zmarłej dziewczyny do życia to coś zupełnie innego. Wydawać by się mogło, że nie może być już gorzej, ale to dopiero początek nowej serii kłopotów Spider-Mana! Człowiek-Pająk został sklonowany! W historii, która wstrząsnęła światem komiksów, niegodziwy Jackal sklonował zarówno Gwen Stacy, jak i Spider-Mana, a teraz Spidey musi zmierzyć się z jedną ze swoich największych osobistych tragedii! Następnie, Doc Ock powraca i prowadzi za sobą ducha Hammerheada! To nie są jedyne osoby powracające z grobu. Kingpin chce wskrzesić swojego syna - i może to zrobić, jeśli Spider-Man zginie! Jednakże, nie reanimujemy to tulko różnych postaci i wątków. Związek Petera i Mary Jane rozkwita i wtedy sprawy zaczynają iść jakby lepiej! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #143-164 i AMAZING SPIDER-MAN ANNUAL (1964) #10. ','AMAZING SPIDER-MAN EPIC COLL TP VOL 09 SPIDER-MAN OR SPIDER-CLONE (9781302948740)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLL TP VOL 09 SPIDER-MAN OR SPIDER-CLONE (9781302948740)','','','',''),(529,1,1,'Peter Parker i Mary Jane Watson biorą ślub! Ale Kraven Łowca zamierza upewnić się, że Człowiek-Pająk skończy dwa metry pod ziemią, i to dosłownie! Wszystko zaczyna się od klasycznego spotkania z Wolverinem, które zmienia życie Spidey’ego na zawsze, prowadząc do śmierci jednego z jego najlepszych przyjaciół! W obliczu tragedii Petera dręczą wątpliwości co do jego działań. Miesiąc miodowy trwa krótko, bo Kraven sięga po radykalne środki, by udowodnić swoją wyższość nad największym wrogiem! W trakcie jednej z najbardziej introspektywnych i psychologicznych sag w historii komiksu, Łowca nauczy się, że czym innym jest pokonać Spider-Mana, a co innego oczekiwać, że ten pozostanie na dnie! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #289-294, AMAZING SPIDER-MAN ANNUAL (1964) #20-21, SPIDER-MAN VS. WOLVERINE #1, WEB OF SPIDER-MAN (1985) #29-32 i PETER PARKER, THE SPECTACULAR SPIDER-MAN (1976) #131-132.','AMAZING SPIDER-MAN EPIC COLL TP VOL 17 KRAVENS LAST HUNT (NEW PTG) (9781302950330)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLL TP VOL 17 KRAVENS LAST HUNT (NEW PTG) (9781302950330)','','','',''),(530,1,1,'Spider-Slayers powracają! Spider-Man przeżywa oblężenie, gdy śmiercionośne roboty zaczynają atakować za każdym razem, gdy pojawia się on w miejscu publicznym. Kto stoi za ich nieustannymi atakami? Czy Spidey zdoła odkryć prawdę, gdy na jego drodze staną Electro i Scorpion? Jaki układ zawarła Felicia Hardy, była Black Cat, z Tinkererem? Tymczasem, rodzice Petera Parkera wracają do domu, ale tajemniczy mężczyzna obserwuje każdy ich ruch. Venom staje przed sądem za swoje zbrodnie - ale czy po otwierającym oczy starciu ze Spider-Manem zmieni swoje postępowanie? Poza tym: Styx i Stone w natarciu! Aneks atakuje! Spider-Man i Doctor Strange walczą z demonami w innym wymiarze! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #368-377, AMAZING SPIDER-MAN ANNUAL (1964) #27, SPIDER-MAN/DR. STRANGE: THE WAY TO DUSTY DEATH i SPIDER-MAN SPECIAL EDITION: THE TRIAL OF VENOM.','AMAZING SPIDER-MAN EPIC COLL TP VOL 24 INVASION OF SPIDER SLAYERS (9781302948320)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLL TP VOL 24 INVASION OF SPIDER SLAYERS (9781302948320)','','','',''),(531,1,1,'W roku 1962, na łamach skazanego na anulowanie magazynu, Stan Lee i Steve Ditko zaprezentowali szerokiemu odbiorcy jedną z najsłynniejszych postaci wszechczasów: Spider-Mana! Twórcy postawili na głowie koncept superherosa i głównym bohaterem historii uczynili nastoletniego Petera Parkera, motywowanego poczuciem winy młodego człowieka z mocami pająka, który musi walczyć z przestępcami i szarą codziennością. Ta kombinacja okazała się przepisem na sukces na rynku komiksów. Teraz i wy możecie poznać losy Spider-Mana od pierwszej przygody, dzięki temu tomowi. Czekają na was tragiczne początki Petera Parkera jako bohatera i debiuty takich postaci jak J. Jonah Jameson oraz przestępców pokroju Green Goblina, Doctora Octopusa, Sandmana, Vulture’a i Electro! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #1-17, AMAZING SPIDER-MAN ANNUAL (1964) #1 oraz materiały z AMAZING FANTASY (1962) #15.','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 01 GREAT POWER NEW PTG (9781302946852)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 01 GREAT POWER NEW PTG (9781302946852)','','','',''),(532,1,1,'Jedne z najwcześniejszych i kultowych historii z dziejów Spider-Mana, napisane przez samego Stana Lee!\nDwóch najgroźniejszych przestepców w Nowym Jorku ma za zadanie odszyfrować starożytną skamieniałą tabliczkę – której legenda obiecuje wielką moc! To niekwestionowany klasyk autorstwa dwóch największych twórców Marvela, Stana Lee i Johna Romity Seniora - a to nie wszystko, co mają w zanadrzu! J. Jonah Jameson toczy swoją krucjatę przeciwko Spider-Manowi 24 godziny na dobę i zmusza do tego swoich pracowników, Prowler wkracza na scenę, a wraz z nim Black Widow w swojej definitywnej wersji! Poznajemy także losy rodziców Petera! Poza tym: Kingpin powraca, by zająć się sprawami rodzinnymi! Pojawia się również Gwen Stacy i jej gang – wszyscy oni oszaleją, gdy chory Peter Parker wejdzie na imprezę w swoim kostiumie Spider-Mana!\nTOM ZBIERA ZESZYTY: AMAZING SPIDER-MAN (1963) #68-85 oraz materiały z AMAZING SPIDER-MAN ANNUAL (1964) #5-6.','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 05 SECRET TABLET (9781302957810)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 05 SECRET TABLET (9781302957810)','','','',''),(533,1,1,'Amazing Spider-Man osiąga swój historyczny 200. numer w ekscytującym tomie Epic Collection! Marv Wolfman, Keith Pollard i John Byrne wkroczyli do sieci, aby udowodnić, że Spidey już stał się ulubionym superbohaterem świata. Jasne, są nieustępliwi złoczyńcy, ale prawdziwy dramat pochodzi z życia Petera Parkera. Gdy The Amazing Spider-Man zbliża się do historycznego 200. numeru, schorowana ciocia May czuje się coraz gorzej. Kiedy powraca człowiek, który zabił wujka Bena, Peter staje przed mrożącym krew w żyłach wyborem. Następnie, debiutuje Felicia Hardy – Back Cat, Mysterio tka swoje iluzje, Spidey mierzy się z Doc Ockiem w corocznym pojedynku, a wojna gangów zmusza do połączenia sił z Punisherem! Z odrobiną disco Dazzler, pokochasz każdą stronę. TOM ZBIERA ZESZYTY: THE AMAZING SPIDER-MAN (1963) #186-206 i ANNUAL (1964) #13 oraz THE SPECTACULAR SPIDER-MAN (1979) #1.','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 11 NINE LIVES (9781302960483)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 11 NINE LIVES (9781302960483)','','','',''),(534,1,1,'Uznani twórcy David Michelinie i Todd McFarlane kontynuują swoją serię o Spider-Manie!\nWrogowie, zabójcy i Inferno! Ulubiony przez fanów cykl Davida Michelinie i Todda McFarlane\'a jest kontynuowany, gdy gwiazdorski artysta mierzy się z klasycznymi złoczyńcami Spidey’ego: Mysterio, Green Goblinem, Hobgoblinem, Lizardem, Rhino i Scorpionem - a Spider-Man staje w obliczu brutalnego spotkania z Venomem, swoim najnowszym i najbardziej śmiercionośnym wrogiem! Gdy Manhattan popada w obłęd, Spider-Man musi stawić czoła demonicznemu zagrożeniu ze strony Inferno - ale moce Petera nie mogą uratować jego i MJ przed świąteczną eksmisją! Następnie, Spidey zajmuje się międzynarodowym szpiegostwem, gdy zostaje wciągnięty w spisek Assassin Nation wraz z Silver Sable, Paladinem i Kapitanem Ameryką! Ale kiedy zabójca zostanie ujawniony, kto przeżyje? Poza tym: Gdy Atlantyda atakuje, Spidey i She-Hulk walczą z Abominationem! A klasyczna powieść graficzna rzuca nowe światło na życie Petera i Mary Jane!\nTOM ZBIERA ZESZYTY: AMAZING SPIDER-MAN (1963) #311-325 i ANNUAL #23 oraz MARVEL GRAPHIC NOVEL: AMAZING SPIDER-MAN - PARALLEL LIVES.','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 19 ASSASSIN NATION (9781302957902)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 19 ASSASSIN NATION (9781302957902)','','','',''),(535,1,1,'Doctor Octopus zbiera nowy zespół! Ale kto dołączy do Otto Octaviusa w najbardziej złowrogiej szóstce złoczyńców? Spidey wkrótce się dowie, ale pokonanie drużyny najbardziej bezwzględnych wrogów wystawi go na próbę jakiej jeszcze nie przeszedł - a w następstwie ogromne poczucie odpowiedzialności Petera doprowadzi go do rezygnacji z jego mocy! Czy to już nie jest Spider-Man? Normalne życie nie jest takie wspaniałe, gdy Scorpion atakuje, a Black Cat musi ruszy mu na ratunek. Trzymamy kciuki, żeby Pająk wrócił do akcji do czasu powrotu Venoma, zebrania się Avengers i przybycia Doctora Dooma do miasta! Poza tym: romantyczny wypad Petera i Mary Jane do Szkocji zamienia się w nawiedzony drugi miesiąc miodowy! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #334-350 i SPIDER-MAN: SPIRITS OF THE EARTH.','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 21 RETURN SINISTER SIX (9781302957889)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 21 RETURN SINISTER SIX (9781302957889)','','','',''),(536,1,1,'Jedna z najbardziej burzliwych epok w historii komiksów nabiera tempa, gdy Clone Saga niszczy życie Petera Parkera!\nCzy sąsiedztwo jest wystarczająco duże dla dwóch Spider-Manów? Przekonaj się, gdy najbardziej niesławna saga wrzuca najwyższy bieg! Peter Parker został otruty, a nadzieja na ratunek leży w mackowanych ramionach Doctora Octopusa! Ale Otto może zapłacić bardzo wysoką cenę za ten akt miłosierdzia! W międzyczasie, ciocia May walczy o swoje życie, a Mary Jane zaskakuje wszystkich! Jeśli chodzi o Bena Reilly\'ego, powrót do akcji jest świetny - ale ma swoją cenę! Nie tylko jest prześladowany przez Grim Huntera, ale w cieniu czai się tajemniczy Kaine! Zarówno Spider-Man, jak i Scarlet Spider będą wstrząśnięci powrotem Jackala i kolejnymi kryzysami!\nTom zbiera zeszyty: Web of Spider-Man (1985) 120-123, Spider-Man (1990) 54-56, Amazing Spider-Man (1963) 397-399, Spectacular Spider-Man (1976) 220-222, Spider-Man Unlimited (1993) 8, Spider-Man: Funeral for an Octopus (1995) 1-3, Spider-Man: The Clone Journal (1995) 1.','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 28 WEB LIFE WEB DEATH (9781302960087)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECT TP VOL 28 WEB LIFE WEB DEATH (9781302960087)','','','',''),(537,1,1,'Stan Lee I Steve Ditko stworzyli kulturowy fenomen, AMAZING SPIDER-MAN. Ich idealne połączenie codziennych trosk Petera Parkera z przygodami Spider-Mana było czymś naprawdę wyjątkowym. Po latach udoskonalania tej formuły, przedstawili oni ostateczne arcydzieło ze Spider-Manem: MASTER PLANNER saga! Spider-Man przechodzi przez najbardziej wyniszczające wydarzenie w swojej karierze. Lee i Ditko zdefiniowali w ten sposób ducha postaci inspirującej miliony. Ten tom Epic Collection zawiera tą oraz inne historie: debiut Gwen Stacy, ukończenie liceum przez Petera, walki z Green Goblinem, oraz team-up z inną postacią Lee i Ditko, Doktorem Strange’em. Tom zawiera zeszyty AMAZING SPIDER-MAN (1963) #18-38 i ANNUAL #2.','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 02 GREAT RESPONSIBILITY (9780785195818)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 02 GREAT RESPONSIBILITY (9780785195818)','','','',''),(538,1,1,'Peter Parker staje się przyzwoitką w najdziwniejszym związku w historii Marvela, a może nawet w historii komiksów w ogóle! Tak, ciocia May znalazła sobie nowego adoratora, doktora Otto Octaviusa! Otym może da się zapomnieć, ale Daily Bugle nie ucichnie, gdy Spidey i Dr Octopus połączą siły! Spidey walczy z Ka-Zarem, Vulture’em i Mysterio, ale jego najbardziej śmiertelna bitwa dopiero przed nim: Norman Osborn odzyskał pamięć, więc Green Goblin powrócił! Najgroźniejszy wróg Spider-Mana, jedyny złoczyńca, który odkrył jego tożsamość powraca żądny zemsty, a i ci dwaj zmierzą się w gigantycznym, 58-stronicowym komiksowym arcydziele! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #53-67, SPECTACULAR SPIDER-MAN (1968) #1-2, MARVEL SUPER-HEROES (1967) #14, oraz materiały z NOT BRAND ECHH #6 i #11.','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 04 THE GOBLIN LIVES (9781302950392)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 04 THE GOBLIN LIVES (9781302950392)','','','',''),(539,1,1,'Zawiera zeszyty Amazing Spider-Man (1963) #105-123.\nCiąg dalszy pełnych napięcia przygód najbardziej umęczonego superbohatera komiksowego, Niesamowitego Spider-Mana! Stan Lee, John Romita Sr., Gil Kane oraz Gerry Conway przyniosą Wam zupełnie nowe pomysły, jak na przykład postać Gibbona, ale także zaserwują nam powrót ikonicznych adwersarzy, takich jak Doktor Octopus czy Kraven Łowca. Dramat osiągnie jednak kulminację, gdy Zielony Goblin porwie Gwen Stacy w historii, która wysłała całe pokolenie fanów na terapię i ucementowała imię Goblina jako definicję zła. Nie przegap tego kluczowego rozdziału z historii Spidey’a!','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 07 GOBLINS LAST STAND (9781302904074)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 07 GOBLINS LAST STAND (9781302904074)','','','',''),(540,1,1,'Peter Parker nigdy nie miał łatwego życia i nikt temu nie zaprzeczy. Nikt nie zaprzeczy też, że najlepsze przygody Spider-Mana rozgrywają się, gdy pech uderza z całą siłą! Nową erę dla przeciwników Spider-Mana rozpoczyna półkownik John Jameson naznaczony klątwą wilkołaka! Syn Jonaha zmienia się w Man-Wolfa! Tymczasem, Harry Osborn pogrąża się w otchłani szaleństwa i zmierza ku zielonej masce goblina! Stawkę i napięcie podnosi debiut Punishera, a złowrogi Jackal wprowadza w życie plan, który na zawsze zmieni życie Petera Parkera! Przygotujcie się także na debiut Spider-Mobila zbudowanego przez Human Torcha, nieoczekiwany ślub cioci May i Octopusa, atak Mysterio i wiele innych! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #124-142 oraz GIANT-SIZE SUPER-HEROES #1.','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 08 MAN-WOLF AT MIDNIGHT (9781302933500)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 08 MAN-WOLF AT MIDNIGHT (9781302933500)','','','',''),(541,1,1,'Hobgoblin powrócił! Złoczyńca przeczytał dzienniki Normana Osborna, po czym obrał sobie za cel Mary Jane i ciężarną Liz Osborn! Z kolei Mary Jane ujawnia sekrety swojego dzieciństwa! Skorpion atakuje, gdy J. Jonah Jameson się tego nie spodziewa! Spidey walczy z symbiotycznym kostiumem z kosmosu w pojedynku woli! Kingpin uderza po tym, jak Beyonder zamienia wieżowiec w czyste złoto! Spider-Man stawia czoła kosmicznej mocy Firelorda! Nowy Spider-Slayer atakuje osobę, którą uważa za Spider-Mana: Mary Jane! Robi się wręcz głupio, gdy Spidey musi poradzić sobie ze Spider-Kidem, Frog-Manem i Toadem oraz wytropić złodzieja na... przedmieściach! Powracają Black Fox i Crusher Hogan, a debiutują Silver Sable i Slyde! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #259-272 i ANNUAL #18-19, oraz WEB OF SPIDER-MAN (1985) #1 i #6.','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 15 GHOSTS OF THE PAST (9781302950484)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 15 GHOSTS OF THE PAST (9781302950484)','','','',''),(542,1,1,'Spidey z pomocą przyjaciół stawia czoła kolejnym przeciwnikom! Jeśli uda mu się przetrwa potyczkę z Tri-Sentinelem, to tylko z mocą Captaina Universe! Spider-Man kontra pomocnik! Ale przecież on nigdy nie miał pomocnika. Kim więc jest cyborg Midnight z Secret Empire? Aby dotrzeć do sedna sprawy, Człowiek-Pająk będzie musiał współpracować z innymi bohaterami. Co łączy Moon Knighta, Punishera, Novę, Night Thrashera i Darkhawka? W historii Vibranium Vendetta mamy jeszcze Iron Mana, Black Panthera, Kingpina i Ultrona! Jak Peter Parker poradzi sobie bez problemów z sercem? Dzwońcie po Cardiaca! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #351-360, AMAZING SPIDER-MAN ANNUAL (1964) #25, SPECTACULAR SPIDER-MAN ANNUAL #11, WEB OF SPIDER-MAN ANNUAL #7 i SPIDER-MAN: FEAR ITSELF (1992).','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 22 ROUND ROBIN (9781302950545)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 22 ROUND ROBIN (9781302950545)','','','',''),(543,1,1,'Nadchodzi Carnage! Kiedy zrodzony z Venoma symbiont przekształca psychopatę Cletusa Kasady\'ego w kosmicznego okrutnika, Peter Parker podejmuje najtrudniejszą decyzję w swoim życiu - i zwraca się o pomoc do Venoma! Ale czy Eddie Brock dołączy do walki, czy też będzie kontynuował swoją jednoosobową krucjatę przeciwko Spider-Manowi? Potem, Spider-Man schodzi do legowiska Lizarda - i stawia czoła potężnemu wrogowi z pomocą New Warriors! Gdy Spidey zostaje zaatakowany przez Kravena, Człowiek-Pająk stoczy walkę o duszę swojego przeciwnika! Niespodziewanie, powracają znajome twarze z przeszłości! Spidey musi odtworzyć bolesny fragment swojej przeszłości, ale tylko, jeśli pokona Taskmastera i Red Skulla! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #361-367, AMAZING SPIDER-MAN ANNUAL (1964) #26, AMAZING SPIDER-MAN: SOUL OF THE HUNTER oraz materiały ze SPECTACULAR SPIDER-MAN ANNUAL #12, WEB OF SPIDER-MAN ANNUAL #8 i NEW WARRIORS ANNUAL #2. ','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 23 HERO KILLERS (9781302951047)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 23 HERO KILLERS (9781302951047)','','','',''),(544,1,1,'Symbionty walczą, a Spider-Man jest w ogniu krzyżowym! Carnage, pomiot Venoma, zebrał armię szalonych przeciwników Człowieka-Pająka, by szerzyć swoje przesłanie wrogości, chaosu i hurtowej rzezi: Carrion, Demogoblin, Shriek i Spider-Man Doppelganger! Otoczony i pokonany, Spider-Man musi zwerbować własną grupę superherosów, aby zwalczyć rosnącą falę zła: Black Cat, Cloak i Dagger, Firestar, Kapitan Ameryka, Iron Fist, Deathlok i Venom! Najgorszy wróg Spider-Mana staje się jego sprzymierzeńcem w walce o powstrzymanie czystego zła, jakim jest szalony Carnage! Poza tym, wybuchowy dzień dla Petera Parkera prowadzi go do dzikiego pojedynku z Punisherem i Sabretoothem! Tom zbiera zeszyty Amazing Spider-Man (1963) #378-380, Web of Spider-Man (1985) #101-103, Spider-Man (1990) #35-37, Spectacular Spider-Man (1976) #201-203, Spider-Man/Punisher/Sabretooth: Designer Genes (1993), a także materiały ze Spider-Man Unlimited (1993) #1-2.','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 25 MAXIMUM CARNAGE (9781302950460)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 25 MAXIMUM CARNAGE (9781302950460)','','','',''),(545,1,1,'No description','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 26 LIFETHEFT (9781302930691)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 26 LIFETHEFT (9781302930691)','','','',''),(546,1,1,'Klon Spider-Mana powrócił! Spidey myślał, że jego klon od dawna nie żyje, ale gdzie był człowiek znany teraz jako Ben Reilly przez ostatnie pięć lat? Dlaczego powrócił? I czy jest on złą wersją Petera Parkera, czy może jego lepszą połową? Gdy tajemniczy Judas Traveler i jego towarzysze badają dwa pająki, Ben cieszy się nowym życiem – stając się Scarlet Spiderem i ruszając do akcji przeciwko Venomowi! Peter traci rozum w konfrontacji z Pumą. Czy Daredevil pomoże mu znaleźć spokój? Żadna inna historia o Spider-Manie nie była tak innowacyjna ani niesławna jak Clone Saga z lat 90. i to właśnie tutaj wszystko się zaczyna! Tom zbiera zeszyty WEB OF SPIDER-MAN (1985) #117-119, AMAZING SPIDER-MAN (1963) #394-396, SPIDER-MAN (1990) #51-53, SPECTACULAR SPIDER-MAN (1976) #217-219, SPIDER-MAN UNLIMITED (1993) #7 i dodatki z innych serii.','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 27 THE CLONE SAGA (9781302953669)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN EPIC COLLECTION TP VOL 27 THE CLONE SAGA (9781302953669)','','','',''),(547,1,1,'Someone has Spider-Man in their crosshairs, and the only person in the Marvel Universe who can save him is...Peter Parker\'s sister?! As the web-slinger meets family he never knew, will she end up becoming his greatest ally, or the one who damns him? And what does the Kingpin of Crime have to do with it? This all-new, original graphic novel — written by Eisner Award winner Mark Waid (DAREDEVIL) and acclaimed author James Robinson (Superman), and fully painted by the legendary Gabriele Dell\'Otto (SECRET WAR) — comes to you in a high-end, oversized format. It\'s the web-slinger\'s darkest hour — and greatest triumph!','AMAZING SPIDER-MAN FAMILY BUSINESS OGN HC (9780785184409)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN FAMILY BUSINESS OGN HC (9780785184409)','','','',''),(548,1,1,'The Jackal is back, and he’s conquered mortality; now some of Spider-Man’s firmest friends and fiercest foes are dead no more! Outmatched by his classic enemy’s army, does the wall-crawler have a chance? Should he even stand in the way if Miles Warren holds the key to eternal life? If Peter Parker doesn’t have the answers, ask…Otto Octavius! Shocks reverberate throughout Spidey’s world as Silk gets drawn into the fray by a Spider-Woman back from the grave! Scarlet Spider faces Carrion! And a reborn Prowler works for the Jackal — but what role does the resurrected Madame Web play? All this plus…Gwen Stacy! It’s the most death-defying Spider-Man event of all time! Collecting AMAZING SPIDER-MAN (2015) #19-24, THE CLONE CONSPIRACY #1-5, THE CLONE CONSPIRACY: OMEGA 1, SILK (2015B) #14-17, PROWLER (2016) #1-5 and material from FREE COMIC BOOK DAY 2016 (CAPTAIN AMERICA) #1.','AMAZING SPIDER-MAN HC CLONE CONSPIRACY (9781302903268)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN HC CLONE CONSPIRACY (9781302903268)','','','',''),(549,1,1,'S.H.I.E.L.D. zabiera Petera Parkera w podróż dookoła świata, która przetestuje go jak nigdy dotąd - a przyszłość całej ludzkości legnie w jego rękach! Kim jest tajemniczy więzień w stalowej skrzyni? Nick Spencer i gwiazdorski zespół największych pisarzy i artystów Marvela podejmują wyzwanie stworzenia najdzikszej i najbardziej niekonwencjonalnej historii AMAZING SPIDER-MAN! Gościnnie wystąpią Nick Fury, Wolverine i Peter Porker, spektakularny Spider-Ham! Zawiera: SPIDER MAN: FULL CIRCLE','AMAZING SPIDER-MAN HC FULL CIRCLE (9781302921385)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN HC FULL CIRCLE (9781302921385)','','','',''),(550,1,1,'The Spider-Verse is here! When the Inheritors begin exterminating spider-characters throughout the multiverse, every single Spider-Man ever is needed to save the day! A spider-army gathers — including Miles Morales, Spider-Gwen, Silk, Spider-Woman, Mayday Parker, Kaine, Ben Reilly, Spider-Man 2099, Spider-Ham and scores more — but how can they defeat Morlun’s deadly family when Peter faces a power struggle against a ghost from his past: Doctor Octopus, the Superior Spider-Man?! In the aftermath, Peter returns home to find that Parker Industries has fallen prey to industrial sabotage. Why is the intangible villain known as the Ghost targeting Parker’s staff? And how will Peter’s decisions come home to roost? A huge chapter in the Amazing Spider-Man’s history comes to a close right here! Collecting AMAZING SPIDER-MAN (2014) #7-18 and SUPERIOR SPIDER-MAN #32-33, and material from FREE COMIC BOOK DAY 2014 (GUARDIANS OF THE GALAXY) #1.','AMAZING SPIDER-MAN HC VOL 02 (9780785195375)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN HC VOL 02 (9780785195375)','','','',''),(551,1,1,'The first printed edition of the story previously available in Marvel’s innovative Infinite Comics format! Peter Parker has just returned from being replaced by Dr. Octopus — so now it’s time to eschew Ock’s more villainous tendencies and return to a life of heroic virtue, right? Maybe not! Because suddenly, Peter has lost his memory. He doesn’t know who he is — either as Peter or as Spider-Man. And he’s robbing a bank! With Peter seemingly turned to a life of crime, what does this mean for the hero once known as the Amazing Spider-Man? Gear up for a Spider-Man epic unlike any other as the recently returned wall-crawler travels to a place you never thought possible: the criminal underworld! Collecting AMAZING SPIDER-MAN: WHO AM I? INFINITE COMIC #1-12.','AMAZING SPIDER-MAN HC WHO AM I (9780785184584)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN HC WHO AM I (9780785184584)','','','',''),(552,1,1,'No description','AMAZING SPIDER-MAN LAST REMAINS COMPANION TP (9781302927790)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN LAST REMAINS COMPANION TP (9781302927790)','','','',''),(553,1,1,'No description','AMAZING SPIDER-MAN MICHELINIE MCFARLANE OMNIBUS HC DM VAR (9781302928667)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN MICHELINIE MCFARLANE OMNIBUS HC DM VAR (9781302928667)','','','',''),(554,1,1,'No description','AMAZING SPIDER-MAN MICHELINIE MCFARLANE OMNIBUS HC NEW PTG (9781302928650)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN MICHELINIE MCFARLANE OMNIBUS HC NEW PTG (9781302928650)','','','',''),(555,1,1,'W 1962 roku, Stan Lee i Steve Ditko przedstawili na stronach umierającego miesięcznika jedną z największych ikon amerykańskiej popkultury: niesamowitego Spider-Mana! Stawiając na głowie koncept superbohatera, twórcy obdarzyli supermocami pochodzącymi od pająka nastolatka Petera Parkera nawigującego przez trudny okres szkoły średniej. To połączenie zdobyło serca czytelników. Na łamach czterdziestu zeszytów Lee i Ditko stworzyli cały mikrokosmos Spider-Mana z jego elementami, które znamy od dekad: problemami uczuciowymi, pracownikami Daily Bugle, rodziną i przeciwnikami jakich nie było! Teraz możecie poznać pierwsze przygody Spider-Mana w jednym tomie: Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #1-38, AMAZING SPIDER-MAN ANNUAL (1964) #1-2, STRANGE TALES ANNUAL #2 oraz materiały z AMAZING FANTASY (1962) #15 i FANTASTIC FOUR ANNUAL #1.','AMAZING SPIDER-MAN OMNIBUS HC VOL 01 ALEX ROSS CVR 4TH PTG (9781302945633)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 01 ALEX ROSS CVR 4TH PTG (9781302945633)','','','',''),(556,1,1,'W 1962 roku, Stan Lee i Steve Ditko przedstawili na stronach umierającego miesięcznika jedną z największych ikon amerykańskiej popkultury: niesamowitego Spider-Mana! Stawiając na głowie koncept superbohatera, twórcy obdarzyli supermocami pochodzącymi od pająka nastolatka Petera Parkera nawigującego przez trudny okres szkoły średniej. To połączenie zdobyło serca czytelników. Na łamach czterdziestu zeszytów Lee i Ditko stworzyli cały mikrokosmos Spider-Mana z jego elementami, które znamy od dekad: problemami uczuciowymi, pracownikami Daily Bugle, rodziną i przeciwnikami jakich nie było! Teraz możecie poznać pierwsze przygody Spider-Mana w jednym tomie: Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #1-38, AMAZING SPIDER-MAN ANNUAL (1964) #1-2, STRANGE TALES ANNUAL #2 oraz materiały z AMAZING FANTASY (1962) #15 i FANTASTIC FOUR ANNUAL #1.','AMAZING SPIDER-MAN OMNIBUS HC VOL 01 KIRBY DM VAR 4TH PTG (9781302945640)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 01 KIRBY DM VAR 4TH PTG (9781302945640)','','','',''),(557,1,1,'Tutaj zaczyna się era Stana Lee i Johna Romity! Lee i Romita zmienili ścianołaza w topowy tytuł Marvela dzięki historiom, które podnosiły na duchu, rozdzierały serca i trzymały w napięciu. Od ujawnienia sekretnej tożsamości Zielonego Goblina po niezapomniane wejście Mary Jane Watson, te klasyki definiują Pająka do dziś - z gwiazdorskimi debiutami, takimi jak Kingpin, Rhino i Kapitan Stacy, katastrofalna pierwsze spotkanie Pająka z Avengers, kultowy numer „Spider-Man No More!”, prawdziwa historia rodziców Petera Parkera i epicka walka z Zielonym Goblinem! Zawiera AMAZING SPIDER-MAN (1963) #39-67 i ANNUAL #3-5 oraz SPECTACULAR SPIDER-MAN (1968) #1-2.','AMAZING SPIDER-MAN OMNIBUS HC VOL 02 RAMOS CVR NEW PTG (9781302927943)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 02 RAMOS CVR NEW PTG (9781302927943)','','','',''),(558,1,1,'No description','AMAZING SPIDER-MAN OMNIBUS HC VOL 02 ROMITA DM VAR NEW PTG (9781302927950)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 02 ROMITA DM VAR NEW PTG (9781302927950)','','','',''),(559,1,1,'No description','AMAZING SPIDER-MAN OMNIBUS HC VOL 03 KANE DM VAR NEW PTG (9781302931407)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 03 KANE DM VAR NEW PTG (9781302931407)','','','',''),(560,1,1,'No description','AMAZING SPIDER-MAN OMNIBUS HC VOL 03 MCKONE CVR NEW PTG (9781302931391)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 03 MCKONE CVR NEW PTG (9781302931391)','','','',''),(561,1,1,'Przygody najbardziej zwyczajnego superbohatera, Spider-Mana trwają! Dostarczona przez Stana Lee, Johna Romitę Sr., Gerry\'ego Conwaya, Gila Kane\'a i Rossa Andru saga urzeknie Was jak żaden inny komiks Marvela wcześniej. Green Goblin powrócił! Gwen Stacy zaginęła! A wszystko to prowadzi do konfrontacji na szczycie mostu George\'a Washingtona, która sprawi, że Peter Parker zmieni się na zawsze! To historia, która ugruntowała pozycję Green Goblina jako definicji zła. Nie myślcie, że to jedyny kamień milowy na tych stronach. Ten omnibus zawiera również debiut Punishera, ślub cioci May i Doca Ocka, drogę Harry\'ego Osborna do szaleństwa i nową rolę dla Mary Jane Watson! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #105-142, GIANT-SIZE SUPER-HEROES #1 i MARVEL SUPER-HEROES (1967) #14.','AMAZING SPIDER-MAN OMNIBUS HC VOL 04 (9781302952570)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 04 (9781302952570)','','','',''),(562,1,1,'Przygody najbardziej zwyczajnego superbohatera, Spider-Mana trwają! Dostarczona przez Stana Lee, Johna Romitę Sr., Gerry\'ego Conwaya, Gila Kane\'a i Rossa Andru saga urzeknie Was jak żaden inny komiks Marvela wcześniej. Green Goblin powrócił! Gwen Stacy zaginęła! A wszystko to prowadzi do konfrontacji na szczycie mostu George\'a Washingtona, która sprawi, że Peter Parker zmieni się na zawsze! To historia, która ugruntowała pozycję Green Goblina jako definicji zła. Nie myślcie, że to jedyny kamień milowy na tych stronach. Ten omnibus zawiera również debiut Punishera, ślub cioci May i Doca Ocka, drogę Harry\'ego Osborna do szaleństwa i nową rolę dla Mary Jane Watson! Tom zbiera zeszyty AMAZING SPIDER-MAN (1963) #105-142, GIANT-SIZE SUPER-HEROES #1 i MARVEL SUPER-HEROES (1967) #14.','AMAZING SPIDER-MAN OMNIBUS HC VOL 04 DM VAR (9781302952587)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 04 DM VAR (9781302952587)','','','',''),(563,1,1,'No description','AMAZING SPIDER-MAN OMNIBUS HC VOL 05 KANE DM VAR (9781302927004)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 05 KANE DM VAR (9781302927004)','','','',''),(564,1,1,'No description','AMAZING SPIDER-MAN OMNIBUS HC VOL 05 MEDINA CVR (9781302926991)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 05 MEDINA CVR (9781302926991)','','','',''),(565,1,1,'Kolejny omnibus zbierający klasyczne przygody Spider-Mana!\nPonieważ o to prosiliście, nadchodzi szósta, ponadwymiarowa edycja Omnibusa Amazing Spider-Mana! Co czeka na was w środku? Cały twórczy run Marva Wolfmana, mnóstwo materiałów z F.O.O.M., takich jak profile Stana Lee i Johna Romity, kompletny kalendarz Mighty Marvel Comics z 1978 roku ze Spider-Manem, strony z listami, reklamy, oryginalne grafiki i, o tak, jedne z najlepszych historii Spider-Mana wszechczasów. Nie mogliśmy zapomnieć o oświadczynach Petera, debiucie Black Cat, powrocie Burglara, potężnym Kingpinie i wojnie z podziemiem, która przywraca Punishera na mapę Nowego Jorku. To historie, które pokazują, dlaczego Spider-Man jest najtrwalszą ikoną Marvela!\nTOM ZBIERA ZESZYTY: THE AMAZING SPIDER-MAN (1963) #181-205 &amp; ANNUAL (1964) #13, THE SPECTACULAR SPIDER-MAN ANNUAL (1979) #1 oraz WHAT IF? (1977) #1, #7, #19 oraz materiały z WHAT IF (1977) #8.','AMAZING SPIDER-MAN OMNIBUS HC VOL 06 DM VAR KEITH POLLARD SPIDER-MAN VS DOC OCK (9781302962142)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 06 DM VAR KEITH POLLARD SPIDER-MAN VS DOC OCK (9781302962142)','','','',''),(566,1,1,'Kolejny omnibus zbierający klasyczne przygody Spider-Mana!\nPonieważ o to prosiliście, nadchodzi szósta, ponadwymiarowa edycja Omnibusa Amazing Spider-Mana! Co czeka na was w środku? Cały twórczy run Marva Wolfmana, mnóstwo materiałów z F.O.O.M., takich jak profile Stana Lee i Johna Romity, kompletny kalendarz Mighty Marvel Comics z 1978 roku ze Spider-Manem, strony z listami, reklamy, oryginalne grafiki i, o tak, jedne z najlepszych historii Spider-Mana wszechczasów. Nie mogliśmy zapomnieć o oświadczynach Petera, debiucie Black Cat, powrocie Burglara, potężnym Kingpinie i wojnie z podziemiem, która przywraca Punishera na mapę Nowego Jorku. To historie, które pokazują, dlaczego Spider-Man jest najtrwalszą ikoną Marvela!\nTOM ZBIERA ZESZYTY: THE AMAZING SPIDER-MAN (1963) #181-205 &amp; ANNUAL (1964) #13, THE SPECTACULAR SPIDER-MAN ANNUAL (1979) #1 oraz WHAT IF? (1977) #1, #7, #19 oraz materiały z WHAT IF (1977) #8.','AMAZING SPIDER-MAN OMNIBUS HC VOL 06 KEITH POLLARD SPIDER-MAN COVER (9781302962135)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN OMNIBUS HC VOL 06 KEITH POLLARD SPIDER-MAN COVER (9781302962135)','','','',''),(567,1,1,'On Battleworld, the Amazing Spider-Man is a family man! Peter Parker, his wife, Mary Jane, and their daughter must scrape by to make ends meet — but at least they have each other! And Peter will protect his family at all costs — even if it means suiting up once again and taking on the godlike Regent! But Peter isn’t the only one willing to risk all for the family — and his daughter isn’t about to sit back and let dad have all the fun, either! The Parkers take on Regent in the most controversial Spider-Man story of the year! Plus: true tales of romance on Battleworld! Robbie Reyes and Kamala Khan! A Typhoid Mary, Karen Page and Matt Murdock love triangle! And more! When worlds collide, can their love survive? Collecting AMAZING SPIDER-MAN: RENEW YOUR VOWS #1-5 and SECRET WARS: SECRET LOVE #1.','AMAZING SPIDER-MAN RENEW YOUR VOWS TP (9780785198864)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN RENEW YOUR VOWS TP (9780785198864)','','','',''),(568,1,1,'Zobaczcie jak rozpoczął się historyczny już run Johna Romity Juniora i scenarzysty J. Michaela Straczyńskiego w Spider-Manie! Rozpoczynają od trzęsienia ziemi, wprowadzając do życia Petera Parkera człowieka, który wie bardzo dużo o pochodzeniu Spider-Mana! Zmagając się z separacją z Mary Jane, Peter wraca do korzeni i zostaje nauczycielem w swojej starej szkole! Jak Ciocia May zareaguje na wieść, że jej bratanek jest Człowiekiem-Pająkiem? Spidey kontra Doc Ock, Morlun, Dormammu i wielu innych, u boku Doctora Strange’a, Kapitana Ameryki, oraz… Lokiego? Potem Spider-Man jest świadkiem zamachu na World Trade Center z 11 września 2001 roku, a wkrótce po tych wydarzeniach, dopadają go konsekwencje błędów młodości. Tom zbiera zeszyty AMAZING SPIDERMAN (1999) #30-58, #500-514 i #509 DIRECTOR\'S CUT.','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 01 CAMPBELL CVR (9781302945442)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 01 CAMPBELL CVR (9781302945442)','','','',''),(569,1,1,'Zobaczcie jak rozpoczął się historyczny już run Johna Romity Juniora i scenarzysty J. Michaela Straczyńskiego w Spider-Manie! Rozpoczynają od trzęsienia ziemi, wprowadzając do życia Petera Parkera człowieka, który wie bardzo dużo o pochodzeniu Spider-Mana! Zmagając się z separacją z Mary Jane, Peter wraca do korzeni i zostaje nauczycielem w swojej starej szkole! Jak Ciocia May zareaguje na wieść, że jej bratanek jest Człowiekiem-Pająkiem? Spidey kontra Doc Ock, Morlun, Dormammu i wielu innych, u boku Doctora Strange’a, Kapitana Ameryki, oraz… Lokiego? Potem Spider-Man jest świadkiem zamachu na World Trade Center z 11 września 2001 roku, a wkrótce po tych wydarzeniach, dopadają go konsekwencje błędów młodości. Tom zbiera zeszyty AMAZING SPIDERMAN (1999) #30-58, #500-514 i #509 DIRECTOR\'S CUT.','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 01 DM VAR (9781302945435)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 01 DM VAR (9781302945435)','','','',''),(570,1,1,'J. Michael Straczynski kończy swój niesamowity run - i zmienia wszystko w życiu Spider-Mana! Po pierwsze, Spidey dostaje nowe stanowisko - ale czy wytrzyma z New Avengers? W szokującej historii \"The Other\" okrutny Morlun doprowadza Spider-Mana na skraj śmierci - i nie tylko! Jeśli Peter Parker ma jakąkolwiek nadzieję na przetrwanie, ma dwa wyjścia: ewoluować lub zginąć! Następnie, wybucha Wojna Domowa Bohaterów - i robi się naprawdę niebezpiecznie! Spidey w czerwono-złotej zbroi! Spidey w czerni! Spidey ujawnia swoją tożsamość światu! Ale przygotujcie się na wielkie zakończenie: Gdy ciocia May umiera, co Peter i MJ daliby za jeszcze jeden dzień? Tom zbiera zeszyty AMAZING SPIDER-MAN (1999) #515-545, FRIENDLY NEIGHBORHOOD SPIDER-MAN (2005) #1-4 i #24, MARVEL KNIGHTS SPIDER-MAN (2004) #19-22, SENSATIONAL SPIDER-MAN (2006) #41, SPIDER-MAN: THE OTHER SKETCHBOOK oraz SPIDER-MAN: ONE MORE DAY SKETCHBOOK.','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 02 DEODATO (9781302957759)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 02 DEODATO (9781302957759)','','','',''),(571,1,1,'J. Michael Straczynski kończy swój niesamowity run - i zmienia wszystko w życiu Spider-Mana! Po pierwsze, Spidey dostaje nowe stanowisko - ale czy wytrzyma z New Avengers? W szokującej historii \"The Other\" okrutny Morlun doprowadza Spider-Mana na skraj śmierci - i nie tylko! Jeśli Peter Parker ma jakąkolwiek nadzieję na przetrwanie, ma dwa wyjścia: ewoluować lub zginąć! Następnie, wybucha Wojna Domowa Bohaterów - i robi się naprawdę niebezpiecznie! Spidey w czerwono-złotej zbroi! Spidey w czerni! Spidey ujawnia swoją tożsamość światu! Ale przygotujcie się na wielkie zakończenie: Gdy ciocia May umiera, co Peter i MJ daliby za jeszcze jeden dzień? Tom zbiera zeszyty AMAZING SPIDER-MAN (1999) #515-545, FRIENDLY NEIGHBORHOOD SPIDER-MAN (2005) #1-4 i #24, MARVEL KNIGHTS SPIDER-MAN (2004) #19-22, SENSATIONAL SPIDER-MAN (2006) #41, SPIDER-MAN: THE OTHER SKETCHBOOK oraz SPIDER-MAN: ONE MORE DAY SKETCHBOOK.','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 02 GARNEY DM (9781302957766)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 02 GARNEY DM (9781302957766)','','','',''),(572,1,1,'J. Michael Straczynski kończy swój niesamowity run – zmieniając całe życie Spider-Mana! Najpierw Spidey zmienia mieszkanie – tylko jak wytrzyma z New Avengers jako współlokatorami? W szokującym „The Other” okrutny Morlun niemal doprowadza Spider-Mana do śmierci, a nawet dalej! W tej sytuacji Peter ma tylko dwie opcje: ewoluować, albo umrzeć! Później nadciąga Civil War i nikt nie może zapanować nad biegiem wydarzeń! Spidey w czerwono-złotej zbroi! Spidey w czarnym kostiumie! Spidey zdemaskowany! To jeszcze nic: co poświęcą Peter i MJ, by uratować życie Cioci May? Tom zbiera zeszyty AMAZING SPIDER-MAN (1999) #515-545, FRIENDLY NEIGHBORHOOD SPIDER-MAN (2005) #1-4 and #24, MARVEL KNIGHTS SPIDER-MAN (2004) #19-22, SENSATIONAL SPIDER-MAN (2006) #41, SPIDER-MAN: THE OTHER SKETCHBOOK, oraz SPIDER-MAN: ONE MORE DAY SKETCHBOOK.','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 02 GARNEY DM VAR (9781302924348)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 02 GARNEY DM VAR (9781302924348)','','','',''),(573,1,1,'J. Michael Straczynski kończy swój niesamowity run - i zmienia wszystko w życiu Spider-Mana! Po pierwsze, Spidey dostaje nowe stanowisko - ale czy wytrzyma z New Avengers? W szokującej historii \"The Other\" okrutny Morlun doprowadza Spider-Mana na skraj śmierci - i nie tylko! Jeśli Peter Parker ma jakąkolwiek nadzieję na przetrwanie, ma dwa wyjścia: ewoluować lub zginąć! Następnie, wybucha Wojna Domowa Bohaterów - i robi się naprawdę niebezpiecznie! Spidey w czerwono-złotej zbroi! Spidey w czerni! Spidey ujawnia swoją tożsamość światu! Ale przygotujcie się na wielkie zakończenie: Gdy ciocia May umiera, co Peter i MJ daliby za jeszcze jeden dzień? Tom zbiera zeszyty AMAZING SPIDER-MAN (1999) #515-545, FRIENDLY NEIGHBORHOOD SPIDER-MAN (2005) #1-4 i #24, MARVEL KNIGHTS SPIDER-MAN (2004) #19-22, SENSATIONAL SPIDER-MAN (2006) #41, SPIDER-MAN: THE OTHER SKETCHBOOK oraz SPIDER-MAN: ONE MORE DAY SKETCHBOOK.','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 02 QUESADA DM (9781302957773)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 02 QUESADA DM (9781302957773)','','','',''),(574,1,1,'J. Michael Straczynski kończy swój niesamowity run – zmieniając całe życie Spider-Mana! Najpierw Spidey zmienia mieszkanie – tylko jak wytrzyma z New Avengers jako współlokatorami? W szokującym „The Other” okrutny Morlun niemal doprowadza Spider-Mana do śmierci, a nawet dalej! W tej sytuacji Peter ma tylko dwie opcje: ewoluować, albo umrzeć! Później nadciąga Civil War i nikt nie może zapanować nad biegiem wydarzeń! Spidey w czerwono-złotej zbroi! Spidey w czarnym kostiumie! Spidey zdemaskowany! To jeszcze nic: co poświęcą Peter i MJ, by uratować życie Cioci May? Tom zbiera zeszyty AMAZING SPIDER-MAN (1999) #515-545, FRIENDLY NEIGHBORHOOD SPIDER-MAN (2005) #1-4 and #24, MARVEL KNIGHTS SPIDER-MAN (2004) #19-22, SENSATIONAL SPIDER-MAN (2006) #41, SPIDER-MAN: THE OTHER SKETCHBOOK, oraz SPIDER-MAN: ONE MORE DAY SKETCHBOOK.','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 02 QUESADA VAR (9781302924355)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN STRACZYNSKI OMNIBUS HC VOL 02 QUESADA VAR (9781302924355)','','','',''),(575,1,1,'Tom 4. runu Nicka Spencera w AMAZING SPIDER-MANIE! Gdy Kraven powraca, Spider-Man staje się zwierzyną! Sergei Kravinoff i jego pomocnicy od miesięcy porywali superludzi związanych ze zwierzętami i brakuje im tylko jednego do kolekcji: Pająka. Czego Kraven chce od nich wszystkich? Zostają oni wypuszczeni w Central Parku, a łowy rozpoczynają się. Jednakże nie tylko Kravem jest tu łowcą. Kto ma Spidey’ego na celowniku? Lizard także jest ścigany, ale on ma swój własny przerażający plan! Peter Parker znajdzie się w w naprawdę okropnej sytuacji, ale w grę wchodzi życie mniej lub bardziej niewinnych ludzi, no i… jest Spider-Manem. Nie masz pojęcia jak potoczy się akcja, gdy dojdzie do wielkiej walki! Tom zawiera zeszyty AMAZING SPIDER-MAN (2018) #16-23, #16.HU oraz #18.HU-20.HU.','AMAZING SPIDER-MAN TP 04 HUNTED (9781302914349)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN TP 04 HUNTED (9781302914349)','','','',''),(576,1,1,'When a dead man walks in Harlem, Spider-Man must do something about it — but he’ll have to venture far out of his comfort zone. And in seeking the answers to this Lazarus story, Spidey bites off a little more than he can chew when the trail leads straight to the Santerians! The team of heroes hidden since DAREDEVIL: FATHER heads back into the spotlight, courtesy of MARVEL’S AGENT CARTER writer Jose Molina and superstar artist Simone Bianchi! The web-slinger rediscovers why graveyards are so frightening as his investigation into these uncanny resurrections leads him into terrifying territory. The Santerians are his guide, but together they must journey far from Harlem before this mystery is solved! Peter Parker will be forced into questions of life, death and what lies beyond! Collecting AMAZING SPIDER-MAN (2015) #1.1-1.6.','AMAZING SPIDER-MAN TP AMAZING GRACE (9780785196617)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN TP AMAZING GRACE (9780785196617)','','','',''),(577,1,1,'Peter Parker has gone international, and he’s making his next stop in China — but one of Spider-Man’s most terrifying villains has followed him to Shanghai! And the malevolent Mister Negative has two of Spidey’s former friends in his thrall: the fan-favorite duo Cloak and Dagger! Can our ever-amazing wall-crawler handle two inverted heroes without falling prey to Negative’s influence himself? And Peter’s globetrotting doesn’t end in the Far East — a final showdown with the Zodiac will lead him all across Europe! When Scorpio puts his master plan into motion, there may be no way Spider-Man — or anyone — can stop him from seizing control of the future! Spidey’s neighborhood is bigger than ever, but it’s far from friendly! Collecting AMAZING SPIDER-MAN (2015) #6-11.','AMAZING SPIDER-MAN TP VOL 02 WORLDWIDE (9780785199434)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN TP VOL 02 WORLDWIDE (9780785199434)','','','',''),(578,1,1,'The cross-dimensional craziness of Spider-Verse is over, and Peter Parker has returned home, but that doesn’t mean Spider-Man is safe — not even at his own company! Parker Industries’ security systems can keep out any living thing — but what about a Ghost? That’s right, the infamous super-powered saboteur has invaded Parker Industries and is targeting its staff! But why? One thing is certain: No secret is safe from the Ghost — and no person is safe, either! A huge chapter in the Amazing Spider-Man’s history comes to a close right here, as Peter’s choices as CEO of Parker Industries come home to roost! Plus: two special Spider-Man stories by Marvel’s newest rising stars that will have everyone talking — and a fan-favorite supporting character takes a turn in the spotlight! Collecting AMAZING SPIDER-MAN (2014) #16-18 and ANNUAL (2015) #1.\n\n','AMAZING SPIDER-MAN TP VOL 04 GRAVEYARD SHIFT (9780785193388)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN TP VOL 04 GRAVEYARD SHIFT (9780785193388)','','','',''),(579,1,1,'New York City’s underworld is in a state of flux, and has been since the Kingpin got taken out. Now, a vicious gang war is heating up, and Spider-Man is determined to stop it. But he’s not the only one. Police Captain Yuri Watanabe is trying to curtail the madness — both in her day job, and as the vigilante the Wraith! But do Spidey and Wraith play by the same rules? The two uneasy allies try to keep the gang war from spiraling out of control — but when Hammerhead enters the picture, all bets are off. Soon, Spider-Man finds himself caught between Wraith and a cabal of deadly super criminals! Can Spidey put out the fire, or will the underworld burn? New York City’s crime landscape will never be the same! Collecting AMAZING SPIDER-MAN (2014) #16.1-20.1.','AMAZING SPIDER-MAN TP VOL 05 SPIRAL (9780785193166)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN TP VOL 05 SPIRAL (9780785193166)','','','',''),(580,1,1,'It\'s the chapter you never knew about the story you know by heart! Join Peter Parker as he takes his first steps toward finding his way in the world as Spider-Man! He sought revenge and found responsibility. From that night on, a new life began. Peter\'s not a hero - not yet - but he\'ll get there somehow. But what happens when Peter meets Clash, New York\'s newest menace? Clash is Spidey\'s biggest fan, but what started off as fun and games soon turns deadly serious - and Clash is about to become his first super villain! And as a classic Spidey villain joins in on the fun, J. Jonah\'s Jameson\'s crusade against Spider-Man kicks into overdrive, and Uncle Ben\'s secrets come to light! Dan Slott and Ramón Pérez deliver a new spin on Spider-Man\'s first 60 days! Collecting AMAZING SPIDER-MAN (2014) #1.1-1.5 and material from #1.','AMAZING SPIDER-MAN TP VOL 1.1 LEARNING TO CRAWL (9780785166771)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDER-MAN TP VOL 1.1 LEARNING TO CRAWL (9780785166771)','','','',''),(581,1,1,'No description','AMAZING SPIDERMAN EPIC COLLECTION TP VOL 18 VENOM (9781302911423)','marvel-comics','','','MARVEL COMICS','AMAZING SPIDERMAN EPIC COLLECTION TP VOL 18 VENOM (9781302911423)','','','',''),(582,1,1,'Writers Craig Kyle and Chris Yost return to the X-Men! When Wolverine discovers an old friend is missing, his visit to Canada soon transforms into a hairy situation. The Wendigo virus is running rampant, changing people into flesh-eating monsters! Now, the X-Men and Alpha Flight must fight to stop the growing tide of Wendigos from consuming everything and everyone in their path — a task made harder when an X-Man falls prey to the deadly disease! Desperate, the X-Men take the fight to the Spirit Realm, but how do the Great Beasts fit into this mayhem? And will even the combined forces of the X-Men and Alpha Flight be enough to save Canada from this cannibalistic plague? Plus: Iceman, Firestar and Spider-Man must renew their amazing friendship to save New York City! Collecting AMAZING X-MEN (2014) #7-12.','AMAZING X-MEN TP VOL 02 WORLD WAR WENDIGO (9780785188223)','marvel-comics','','','MARVEL COMICS','AMAZING X-MEN TP VOL 02 WORLD WAR WENDIGO (9780785188223)','','','',''),(583,1,1,'America Chavez is incredible — her origins, her strength, her dimension-shattering star portals! But when the foundation of everything that she believes is shaken, America must stand up and confront the parts of herself she’s been running from. Her life is about to be shattered into a million pieces by a mysterious adversary. When her tormentor is revealed, their face will be shocking, to say the least — but it’s what they reveal that will rock the foundations of all that America knows. And then? It’s just a matter of whether or not to believe them… From writer Kalinda Vazquez (Marvel’s Runaways) and artist Carlos Gomez (AMAZING MARY JANE) comes an explosive, brand-new story all about what made America Chavez who she is — and what she’ll do to protect the ones she loves. COLLECTING: America Chavez: Made In The USA (2021) 1-5','AMERICA CHAVEZ MADE IN USA TP (9781302924454)','marvel-comics','','','MARVEL COMICS','AMERICA CHAVEZ MADE IN USA TP (9781302924454)','','','',''),(584,1,1,'No description','AMERICA TP VOL 02 FAST AND FUERTONA (9781302908829)','marvel-comics','','','MARVEL COMICS','AMERICA TP VOL 02 FAST AND FUERTONA (9781302908829)','','','',''),(585,1,1,'W następstwie wojny anihilacji zdewastowana galaktyka walczy o odbudowę. Korpus Novy zostaje zniszczony, pozostawiając przy życiu tylko Richarda Ridera. Kto powstanie, by strzec galaktyki przed zagrożeniem ze strony Ultrona? Kiedy ojczysty świat Kree zostaje najechany przez techno-organiczny Phalanx, Star-Lord musi poprowadzić drużynę do walki za liniami wroga w składzie, który obejmuje Mantis, Bug, Groota i Rocketa! W międzyczasie nowa Quasar poszukuje tajemniczego wybawcy - a Nova i Gamora zostają przejęci przez Phalanx! Kim jest nawiedzony samotnik zwany Wraith? Czy Warlock z Nowych Mutantów może uwolnić Novę? Czego tak naprawdę chcą Ultron i Phalanx? Zawiera NOVA (2007) #1-12, NOVA ANNUAL (2008) #1, ANNIHILATION: CONQUEST PROLOG, ANNIHILATION: CONQUEST - STARLORD #1-4, ANNIHILATION: CONQUEST - QUASAR #1-4, ANNIHILATION: CONQUEST - WRAITH #1-4, ANNIHILATION: CONQUEST #1-6 i ANNIHILATION SAGA.','ANNIHILATION CONQUEST OMNIBUS HC BRICLOT CVR NEW PTG (9781302929091)','marvel-comics','','','MARVEL COMICS','ANNIHILATION CONQUEST OMNIBUS HC BRICLOT CVR NEW PTG (9781302929091)','','','',''),(586,1,1,'W następstwie wojny anihilacji zdewastowana galaktyka walczy o odbudowę. Korpus Novy zostaje zniszczony, pozostawiając przy życiu tylko Richarda Ridera. Kto powstanie, by strzec galaktyki przed zagrożeniem ze strony Ultrona? Kiedy ojczysty świat Kree zostaje najechany przez techno-organiczny Phalanx, Star-Lord musi poprowadzić drużynę do walki za liniami wroga w składzie, który obejmuje Mantis, Bug, Groota i Rocketa! W międzyczasie nowa Quasar poszukuje tajemniczego wybawcy - a Nova i Gamora zostają przejęci przez Phalanx! Kim jest nawiedzony samotnik zwany Wraith? Czy Warlock z Nowych Mutantów może uwolnić Novę? Czego tak naprawdę chcą Ultron i Phalanx? Zawiera NOVA (2007) #1-12, NOVA ANNUAL (2008) #1, ANNIHILATION: CONQUEST PROLOG, ANNIHILATION: CONQUEST - STARLORD #1-4, ANNIHILATION: CONQUEST - QUASAR #1-4, ANNIHILATION: CONQUEST - WRAITH #1-4, ANNIHILATION: CONQUEST #1-6 i ANNIHILATION SAGA.','ANNIHILATION CONQUEST OMNIBUS HC LANGLEY DM VAR NEW PTG (9781302929107)','marvel-comics','','','MARVEL COMICS','ANNIHILATION CONQUEST OMNIBUS HC LANGLEY DM VAR NEW PTG (9781302929107)','','','',''),(587,1,1,'Kompletne kosmiczne wydarzenie, które przywróciło kosmiczne supergwiazdy Marvela w wybuchowym stylu sci-fi! Annihilus, władca Negative Zone, wypowiedział wojnę reszcie istnienia! A gdy jego niepowstrzymana Fala Anihilacji wdziera się do wszechświata Marvela, niszcząc wszystko na swojej drodze, tylko garstka bohaterów może oprzeć się zniszczeniu! Nova uczy się wojennych sztuczek od Draxa, Silver Surfer szuka pomocy u swojego dawnego mistrza Galactusa, Super-Skrull walczy o życie swojego syna, a Ronan stawia czoła Gamorze i jej wojowniczkom! Armia Novy i Quasara prowadzi szarżę - ale gdy bohaterowie upadają, a Annihilus powstaje, jedyną nadzieją wszechświata może być Thanos, Szalony Tytan! TOM ZBIERA ZESZYTY: Drax the Destroyer (2005) 1-4, Annihilation Prologue (2006), Annihilation: Nova (2006) 1-4, Annihilation: Super-Skrull (2006) 1-4, Annihilation: Ronan (2006) 1-4, Annihilation (2006) 1-6, Annihilation: Heralds of Galactus (2007) 1-2, Annihilation: Nova Corps Files (2006).','ANNIHILATION OMNIBUS HC ANDREA DI VITO DM VAR (9781302963569)','marvel-comics','','','MARVEL COMICS','ANNIHILATION OMNIBUS HC ANDREA DI VITO DM VAR (9781302963569)','','','',''),(588,1,1,'Kosmiczne suergwiazdy Marvela powracają w wielkim stylu! Annihilus, władca Negative Zone idzie na wojnę! Jego niepowstrzymana fala anihilacji niszczy wszystko, co napotka na swojej drodze i tylko garstka bohaterów może ją powstrzymać. Nova poznaje tajniki prowadzenia wojny od Draxa Destroyera, a Silver Surfer prosi o pomoc swego dawnego pana, Galactusa! Super-Scrull walczy o życie syna, gdy Ronan staje przed Gamorą i jej wojowniczkami. Armia Novy i Quasara prowadzą szarżę, ale herosi giną, a Annihilus triumfuje. Czy ostatnią nadzieją wszechświata jest Thanos, szalony tytan? Tom zbiera zeszyty DRAX THE DESTROYER #1-4, ANNIHILATION PROLOGUE, ANNIHILATION: NOVA #1-4, ANNIHILATION: SILVER SURFER #1-4, ANNIHILATION: SUPERSKRULL #1-4, ANNIHILATION: RONAN #1-4, ANNIHILATION #1-6, ANNIHILATION: HERALDS OF GAL