 1-4, Annihilation Prologue (2006), Annihilation: Nova (2006) 1-4, Annihilation: Super-Skrull (2006) 1-4, Annihilation: Ronan (2006) 1-4, Annihilation (2006) 1-6, Annihilation: Heralds of Galactus (2007) 1-2, Annihilation: Nova Corps Files (2006).','ANNIHILATION OMNIBUS HC GABRIELE DELLOTTO CVR (9781302963576)','marvel-comics','','','MARVEL COMICS','ANNIHILATION OMNIBUS HC GABRIELE DELLOTTO CVR (9781302963576)','','','',''),(591,1,1,'Kosmiczni herosi Marvela powracają w wielkim stylu! Annihilus, władca Negative Zone rozpoczyna podbój! Jego niepowstrzymana Annihilation Wave rusza na uniwersum Marvela niszcząc wszystko na swej drodze i tylko garstka bohaterów może jej się przeciwstawić! Gdy Nova poznaje od Draxa sztukę wojny, Silver Surfer wyrusza na poszukiwanie dawnego pana, Galactusa, by prosić go o pomoc, Super-Skrull walczy o życie syna, a Ronan ściera się z Gamorą i jej wojowniczkami! Nova i armia Quasara prowadzą szarżę, ale gdy upadają herosi, a Annihilus triumfuje, jedyną nadzieją wszechświata może być Thanos, szalony tytan! Tom zbiera zeszyty DRAX THE DESTROYER #1-4, ANNIHILATION: PROLOGUE, ANNIHILATION: NOVA #1-4, ANNIHILATION: SILVER SURFER #1-4, ANNIHILATION: SUPER-SKRULL #1-4, ANNIHILATION: RONAN #1-4, ANNIHILATION #1-6, ANNIHILATION: HERALDS OF GALACTUS #1-2 i ANNIHILATION: NOVA CORPS FILES.','ANNIHILATION OMNIBUS HC NEW PTG (9781302921651)','marvel-comics','','','MARVEL COMICS','ANNIHILATION OMNIBUS HC NEW PTG (9781302921651)','','','',''),(592,1,1,'No description','ANNIHILATION SCOURGE TP (9781302921699)','marvel-comics','','','MARVEL COMICS','ANNIHILATION SCOURGE TP (9781302921699)','','','',''),(593,1,1,'Ant-Man otrzymuje małą (i dużą) pomoc od swoich zmieniających rozmiar przyjaciół! Scott łączy siły z Janet Van Dyne, oryginalną Wasp w walce o wolność w wymiarze Z - i Nadią Pym, nową Wasp, w niesamowitej podróży do świata subatomowego! War of the Realms rozlewa się na Ziemię, Scott musi współpracować z innymi gigantycznymi herosami, by stawić czoła lodowym olbrzymom i zmienić losy wojny! Poza tym: Scott i jego córka Cassie, znana jako Stinger, działają ramię w ramię, by ocalić świat od mikroskopijnych wrogów! Ant-Man i Drax wykonują zadania policjantów z Miami! Tom zbiera zeszyty ANT-MAN &amp; THE WASP: LIVING LEGENDS, ANT-MAN AND THE WASP (2018) #1-5, GIANT-MAN #1-3, ANT-MAN (2020) #1-5 i GUARDIANS TEAM-UP #7.','ANT MAN SAGA OF SCOTT LANG TP (9781302950651)','marvel-comics','','','MARVEL COMICS','ANT MAN SAGA OF SCOTT LANG TP (9781302950651)','','','',''),(594,1,1,'No description','ANT-MAN AND WASP TP GROWING PAINS (9781302913816)','marvel-comics','','','MARVEL COMICS','ANT-MAN AND WASP TP GROWING PAINS (9781302913816)','','','',''),(595,1,1,'Nadia Pym, obecna Wasp, stara się pomóc Scottowi Langowi (czyli Ant-Manowi) wrócić do domu do swojej córki. Jednakże mają oni mały problem. Taki malutki. W zasadzie, subatomowy – Scott zgubił się w przestrzeni pomiędzy molekułami! Teraz Nadia jest jego jedyną szansą na ucieczkę z subatomowego wymiaru… jeśli on będzie potrafił się jej podporządkować. Mistrzowski scenarzysta Mark Waid oraz młoda strzelba Marvela Javie Garrón opowiedzą wam o wielkiej przygodzie malutkich rozmiarów. Za każdym razem gdy Ant-Man i Wasp się zmniejszają, napotykają na swojej drodze nową fizykę, nowe istoty i nowe niebezpieczeństwa! Jak bardzo dadzą radę się zmniejszyć, zanim zabraknie im szans na powrót do domu? Oto nauka w stylu Marvela! Zawiera ANT-MAN &amp; THE WASP (2018) #1-5.','ANT-MAN AND WASP TP LOST FOUND (9780785194620)','marvel-comics','','','MARVEL COMICS','ANT-MAN AND WASP TP LOST FOUND (9780785194620)','','','',''),(596,1,1,'Uczcijmy zdumiewające dziedzictwo Ant-Mana z każdą postacią, która kiedykolwiek przyjęła to miano! Powrócimy do przygód z Hankiem Pymem, pierwszym Ant-Manem, podczas jego wczesnych akcji jako bohatera kontrolującego owady! Dołączymy do niesławnego Erica O\'Grady\'ego w nieopisanej dotąd przygodzie rozgrywającej się podczas wydarzeń z SECRET INVASION! W teraźniejszości, ponownie połączymy się ze Scottem Langiem, który próbuje powstrzymać złoczyńcę Black Anta od uwolnienia zabójczego androida Ultrona! Kim jest nowy bohater przybywający z przyszłości, nazywający siebie Ant-Manem? I co może zdziałać przeciwko Ultronowi, który stał się bogiem?! Poza tym: Klasyczne historie, w których Hank jest na łasce grożnego Protektora - i stawia czoła strasznemu Time-Masterowi! Tom zbiera zeszyty ANT-MAN (2022) #1-4 i materiały z TALES TO ASTONISH (1959) #37 i #43.','ANT-MAN ANT-IVERSARY (9781302945428)','marvel-comics','','','MARVEL COMICS','ANT-MAN ANT-IVERSARY (9781302945428)','','','',''),(597,1,1,'Człowiek czynu i człowiek nauki, dr Henry Pym odkrył formułę kurczącą oraz zbudował hełm do kontroli owadów - i dzięki nim stał się zadziwiającym Ant-Manem! Pym wkrótce połączył siły z Janet Van Dyne, uroczą Wasp! Ten mały, ale niepowstrzymany duet superbohaterów stawił czoła szeregowi przestępców, od Scarlet Beetle do Black Knighta! Ale przygody w mikroskopijnym świecie to tylko początek dla najmniejszego bohatera uniwersum Marvela! Wkrótce Ant-Man dołączył do Avengers, jednocześnie stając się nowym herosem, Giant-Manem! Jego pierwsze przygody czekają w tym tomie serii Epic Collection! Tom zbiera zeszyty TALES TO ASTONISH (1959) #27 i #35-59.','ANT-MAN GIANT-MAN EPIC COLLECT TP VOL 01 MAN IN ANT HILL NEW PTG (9781302950354)','marvel-comics','','','MARVEL COMICS','ANT-MAN GIANT-MAN EPIC COLLECT TP VOL 01 MAN IN ANT HILL NEW PTG (9781302950354)','','','',''),(598,1,1,'Twórca słynnej cząstki Pyma, biochemik Henry Pym rozpoczął swoją superbohaterską karierę jako maleńki Ant-Man, ale wkrótce wskoczył w rolę Giant-Mana! Przygody współzałożyciela Avengers i Wasp trwają nadal, w tym albumie! Para bohaterów pokonuje Bestię z Berlina i walczy z innymi przeciwnikami w każdym rozmiarze! Potem, pojawia się nowy Giant-Man! Wszystko za sprawą Billa Foastera, który na łamach własnej serii staje się Black Goliathem! Po tym wszystkim, zobaczymy debiut Scotta Langa jako Ant-Mana, małego bohatera, który zasłużył na szacunek na łamach komiksów i na kinowych ekranach! Tom zbiera zeszyty MARVEL FEATURE (1971) #4-10, POWER MAN #24-25, BLACK GOLIATH #1-5, CHAMPIONS (1975) #11-13, MARVEL PREMIERE #47-48 oraz materiały z TALES TO ASTONISH (1959) #60-69 i IRON MAN (1968) #44. ','ANT-MAN GIANT-MAN EPIC COLLECTION TP VOL 02 ANT-MAN NO MORE (9781302949655)','marvel-comics','','','MARVEL COMICS','ANT-MAN GIANT-MAN EPIC COLLECTION TP VOL 02 ANT-MAN NO MORE (9781302949655)','','','',''),(599,1,1,'Meet 2015\'s silver-screen sensation in waiting - Scott Lang, the astonishing Ant-Man! To save his daughter, Cassie, Scott is forced to return to a life of crime, stealing Hank Pym\'s original costumed identity. But when his noble intentions win the Avengers\' approval, he takes over as the all-new Ant-Man, full-time! Electronics whiz Scott secures a job with Tony Stark, but the size-changing super hero must save Iron Man after a brutal battle with the Hulk. No shrinking violet, Scott holds his own in astonishing adventures with Spider-Man, the Thing and the Avengers. And when Ant-Man and Hawkeye join forces, somebody\'s gonna get it! Collecting MARVEL PREMIERE #47-48, IRON MAN (1968) #131-133 and #151, AVENGERS (1963) #195-196 and #223, MARVEL TEAM-UP (1972) #103, MARVEL TWO-IN-ONE (1974) #87, and material from AVENGERS (1963) #181 and IRON MAN (1968) #125.','ANT-MAN TP SCOTT LANG (9780785192664)','marvel-comics','','','MARVEL COMICS','ANT-MAN TP SCOTT LANG (9780785192664)','','','',''),(600,1,1,'Scott Lang has never exactly been the world’s best super hero. Heck, most people don’t even think he’s been the best Ant-Man! And the last guy invented Ultron and joined the Masters of Evil, so that’s saying something. But when Iron Man calls with a once-in-a-lifetime opportunity, Scott’s going to get a second chance to be the hero he’s always dreamed of becoming! Then, Scott faces off against his old foe the Taskmaster, but who is the mystery villain pulling the strings? And when Ant-Man needs to pull off an impossible break-in, he assembles a new gang…of criminals! Because that’s what heroes do, I guess. Sure, he’s been to prison, had a messy divorce and was…um, dead for a while there. But this time is different! This time nothing is gonna stop the astonishing Ant-Man! Collecting ANT-MAN #1-5.','ANT-MAN TP VOL 01 SECOND CHANCE MAN (9780785193876)','marvel-comics','','','MARVEL COMICS','ANT-MAN TP VOL 01 SECOND CHANCE MAN (9780785193876)','','','',''),(601,1,1,'Zawiązują się sojusze, ludzie giną, a Arańa zmieni się już na zawsze! Co dokładnie stało się z matką Arany, zanim zniknęła wiele lat temu? Prawda na temat przeszłości jej rodziny może okazać się nie do zniesienia dla Anyi Corazon! Tymczasem złe Sisterhood of the Wasp organizuje szczyt złoczyńców, łotrów i bandytów tak wielki, że Arańa będzie musiała rozpędzić imprezę masową! Spider-Man pojawia się w samą porę, by Arańa dowiedziała się, jaka jest przyszłość walki Wasps/Spider-Clan - i co to oznacza dla jej przyszłości! Poza tym: Anya poznaje nowego przyjaciela – Rikki’ego Barnesa, nastoletniego bohatera znanego jako Nomad, kiedy podejmują walkę z Mad Dogiem i Secret Empire! Tom zbiera zeszyty ARAŃA #7-12, SPIDER-MAN &amp; ARAŃA: THE HUNTER REVEALED i materiały z CAPTAIN AMERICA (2004) #602-605. ','ARANA GN TP NIGHT OF HUNTER (9781302947897)','marvel-comics','','','MARVEL COMICS','ARANA GN TP NIGHT OF HUNTER (9781302947897)','','','',''),(602,1,1,'Ze stron serii AMAZING FANTASY nadchodzi spektakularna bohaterka! Jest ścianołazem dla nowego pokolenia - oto Anya Corazon, A.K.A. Arańa! Kiedy licealistka z Brooklynu, Anya, przypadkowo przecina ścieżki z mistycznym Spider Society, zostaje obdarzona magicznym tatuażem, który generuje dziwny, opancerzony egzoszkielet - i daje jej niesamowite moce! Ale gdy Arańa coraz bardziej angażuje się w Spider Society, dowiaduje się o ich starożytnej i tajnej wojnie z bezwzględnym wrogiem. Czy Arańa zostanie Łowcą? Czy może powstrzymać swojego ojca, dociekliwego reportera, przed poznaniem prawdy? A co się stanie, gdy jej nowy wróg przenosi się do jej szkoły?! Poznaj współczesną bohaterkę z sercem pająka! Zawiera AMAZING FANTASY (2004) #1-6 i ARANA #1-6.','ARANA HERE COMES THE SPIDER-GIRL GN-TP (9781302926465)','marvel-comics','','','MARVEL COMICS','ARANA HERE COMES THE SPIDER-GIRL GN-TP (9781302926465)','','','',''),(603,1,1,'Technopolis: an amazing domain of science and wonder created by the visionary genius of brothers Tony and Arno Stark. It’s a real-life utopia, save for one fact: Every resident must wear armor to protect them from a deadly disease. But this near-paradise may be shattered forever when one of its few super heroes is murdered! Can Baron Tony and this domain’s Thor — a hammer-wielding Jim Rhodes — find out who killed Spyder-Man before Technopolis is plunged into civil war? Wilson Fisk is tightening his iron grip on the city’s underbelly — will the Kingpin dethrone a certain genius philanthropist playboy? As the mystery behind the plight of Technopolis unfolds, cracks in Tony’s invincible armor are exposed — and the looming crisis could pit brother against brother. Collecting ARMOR WARS #1-5 and #1/2.','ARMOR WARS WARZONES TP (9780785198642)','marvel-comics','','','MARVEL COMICS','ARMOR WARS WARZONES TP (9780785198642)','','','',''),(604,1,1,'Comics’ most iconic character gets his own coffee-table book chock full of the best Spidey art through the decades! The names of the great artists cascade down through the years: Ditko, Romita Sr., Kane, Andru, Romita Jr., McFarlane, Bagley, Deodato, Garney, Martin and more — from 1962 to today, they’ll all be represented. The finest art — augmented by sketches, pencils and character designs from the Marvel Vault — combined with commentary from the creators who’ve helped shape the web-spinner’s world, will make THE ART OF SPIDER-MAN CLASSIC a book for fans to treasure forever.','ART OF SPIDER-MAN CLASSIC HC (9780785157502)','marvel-comics','','','MARVEL COMICS','ART OF SPIDER-MAN CLASSIC HC (9780785157502)','','','',''),(605,1,1,'War of the Realms, Wojna Królestw, nadchodzi i wszystko zapowiada, że będzie to arcydzieło! Ciesz się zjawiskowością tego wydarzenia i tym co doprowadziło Dziesięć Krolestw na skraj załamania! Naciesz oczy zachwycającymi okładkami i planszami oraz dodatkowymi grafikami stworzonymi przez Russella Dautermana oraz innych utalentowanych twórców pracujących przy runie Jasona Aarona w serii THOR! Wszystko to zostało zebrane wraz z komentarzem scenarzysty oraz informacjami od Dautermana i innych artystów. Nie brak tu specjalnej uwagi dla Odinsona i Jane Foster, każdego z Dziesięciu Królestw oraz Malekitha odpowiedzialnego za ich zagładę! Oto sztuka wojny jakiej jeszcze nie widzieliście!','ART OF WAR OF REALMS TP (9781302917647)','marvel-comics','','','MARVEL COMICS','ART OF WAR OF REALMS TP (9781302917647)','','','',''),(606,1,1,'Wprost z kart INFINITY WARS nadchodzi wielka kosmiczna historia! Angela, siostra Thora. Valkyrie i Annabelle Riggs, które dzielą jedno ciało. Skurge, The Executioner, który wrócił z Hel. Throg, potężna żaba gromu. Kevin Masterson, chłopak, który przejął po ojcu tytuł Thunderstrike\'a. Destroyer, asgardzka zbroja zbudowana do niszczenia Celstiali - obecny właściciel nieznany. Grupa morderców, najemników, bohaterów - oraz żab - zbiera się, by uratować galaktykę przed bronią, z którą sam Thor bałby się zmierzyć! Wnuczka Thanosa, Nebula, chce rządzić galaktyką, i nawet martwi nie staną na jej drodze! W sojuszu z Lokim i ścigani przez Korpus Nova, czy bohaterowie pokonają siły Nebili? Zawiera ASGARDIANS OF THE GALAXY #1-5.','ASGARDIANS OF THE GALAXY TP VOL 01 INFINITY ARMADA (9781302914714)','marvel-comics','','','MARVEL COMICS','ASGARDIANS OF THE GALAXY TP VOL 01 INFINITY ARMADA (9781302914714)','','','',''),(607,1,1,'Asgardians of the Galaxy biorą udział w Wojnie Królestw! Loki obiecał Angeli podarunek w zamian za pomoc w walce z Nebulą – i nadchodzi czas zapłaty! Ale jaki ma to związek z Yondu Udontą i jego nowymi Ravagers? Intryga powoli wychodzi na jaw, gdy drużyna dociera na orbitę Ego, Żywej Planety! Jeśli to rozgniewa Ego, co zrobi jego księżyc? Rozpoczyna się inwazja Malekitha na Midgard, ale Thor zaginął, Odin jest ranny, a Freyja wyjonuje własną misję, to Valkyrie musi stawić czoła zagrożeniu. Jej losy przeplatają się z kimś jeszcze. Co z Annabelle Riggs, śmiertelniczką dzielącą ciało z bogiem? Oprócz tego pojedynek, na który czekaliście: Angela kontra Queen of Heven! Tom zawiera zeszyty ASGARDIANS OF THE GALAXY #6-10.','ASGARDIANS OF THE GALAXY TP VOL 02 WAR OF REALMS (9781302916923)','marvel-comics','','','MARVEL COMICS','ASGARDIANS OF THE GALAXY TP VOL 02 WAR OF REALMS (9781302916923)','','','',''),(608,1,1,'The Terrigen Cloud released by Inhuman king Black Bolt has already rocked the world, but its effects on New York City are far from over! Now, a legendary Golden Age character descends from the skies seeking his own brand of revenge! When Red Raven attacks the Inhumans’ newly settled city of New Attilan, Spider-Man joins a band of fledgling Inhumans to defend it. But just as the winged menace has them all at his mercy, an inspirational hero swoops to their aid! One bird turn deserves another as Sam Wilson, the high-flying All-New Captain America, battles Red Raven! Feathers will fly in this decade-spanning avian adventure penned by Jeff Loveness (The Jimmy Kimmel Show, DEATH OF WOLVERINE: LIFE AFTER LOGAN)! Collecting AMAZING SPIDER-MAN SPECIAL, INHUMAN SPECIAL and ALL-NEW CAPTAIN AMERICA SPECIAL.','ASM INHUMANS ALL NEW CAPTAIN AMERICA INHUMAN ERROR TP (9780785195153)','marvel-comics','','','MARVEL COMICS','ASM INHUMANS ALL NEW CAPTAIN AMERICA INHUMAN ERROR TP (9780785195153)','','','',''),(609,1,1,'Jeden mały superbohater – jedna wielki i wyładowany akcją tom! Scott Lang był rozwiedzionymi pechowym byłym złodziejem. Dopóki nie ukradł Hankowi Pymowi zmniejszającego kostiumu, by móc uratować swoją córkę! Od tego czasu, życie Scotta jest jak przejażdżka rollercoasterem. Lecz czy teraz zdecyduje się on pozostać herosem czy też powróci do byłego życia jako przestępca? A może jedno i drugie? Scott będzie musiał zająć się nowymi interesami, nie do końca godnymi zaufania zleceniodawcami oraz własną córką, która kiedyś była w Avengers! Oprócz tego pojawią się tacy złoczyńcy jak Power Broker czy arcywróg Scotta – Warren Cross, a także żeńska wersja Bettle’a – czy będzie to przyjaciel czy też ktoś zupełnie inny? Cały szybki, wściekły i przezabawny run Nicka Spencera przy postaci Ant-Mana zebrano tutaj! Zawiera ANT-MAN (2015) #1-5 and ANNUAL #1, ANT-MAN: LAST DAYS #1, a także ASTONISHING ANT-MAN #1-13.','ASTONISHING ANT-MAN COMPLETE COLLECTION TP (9781302911324)','marvel-comics','','','MARVEL COMICS','ASTONISHING ANT-MAN COMPLETE COLLECTION TP (9781302911324)','','','',''),(610,1,1,'Mutant Omega i oryginalny X-Man otrzymuje nową solową serię; to Bobby Drake, jakiego nigdy wcześniej nie widzieliście!\nPo wydarzeniach z tegorocznej gali Hellfire, Bobby Drake stawia sobie za cel coraz większe bohaterskie czyny. Ale gdy zmienia się sytuacja, która łączy Icemana z jego lodowym pałacem na Antarktydzie, będzie musiał być sprytniejszy niż kiedykolwiek, aby wykonać swoją misję, zanim antymutancki ruch Orchis zorientuje się, co ich uderzyło!\nTom zbiera zeszyty: Astonishing Iceman (2023) 1-5.','ASTONISHING ICEMAN OUT COLD TP (9781302952495)','marvel-comics','','','MARVEL COMICS','ASTONISHING ICEMAN OUT COLD TP (9781302952495)','','','',''),(611,1,1,'They’re going to kill each other — if the apocalypse doesn’t do them in first! Spider-Man and Wolverine — fellow Avengers, but not each other’s biggest fans — are lost in time…and running out of time. Millions of years in the past, they’re about to be blasted by the meteor that wiped out the dinosaurs. Their only path to safety is an uncontrollable trip through history that will take them to the end of the world — and beyond. But if they’re going to figure out who’s been pulling their strings and get back to their own era, they’ll have to learn to work together. In other words, they’re probably going to die.','ASTONISHING SPIDER-MAN AND WOLVERINE TP (9780785140801)','marvel-comics','','','MARVEL COMICS','ASTONISHING SPIDER-MAN AND WOLVERINE TP (9780785140801)','','','',''),(612,1,1,'“Waves are but water, wind but air. And though lightning be fire…it must answer thunder’s call!” The God of Thunder finds himself battling a mysterious surge of natural catastrophes — hurricanes, tidal waves, earthquakes. At first, the Son of Odin suspects Zephyr, immortal mistress of the winds — but soon, he finds that the climactic upheaval must be attributed to a much larger force: Ego, the Living Planet! Spinning out of the destruction of Asgard, ASTONISHING THOR is an out-of-this-world adventure — and the entire universe hangs in the balance!','ASTONISHING THOR HC (9780785148760)','marvel-comics','','','MARVEL COMICS','ASTONISHING THOR HC (9780785148760)','','','',''),(613,1,1,'Charles Soule oraz cały zestaw najlepszych artystów łączą siły, by ponownie uczynić X-Men Nadzwyczajnymi (eng. Astonishing). Pradawne zło atakuje najpotężniejsze umysły świata. Może przejąć nad nimi kontrolę zanim zdążysz czytać to zdanie, a moment później – może przejąć nas wszystkich! Grupa X-Men odkrywa prawdę czającą się za zagrożeniem, lecz czy dla Psylocke, Old Man Logana, Bishopa, Archangela, Fantomexa, Rogu i Gambita pozostało dużo czasu?\nOto naładowana akcją X-opowieść, której bohaterowie muszą dostać się do wymiaru astralnego i stawić czoła Shadow Kingowi! Lecz kto stanie u jego boku? Gdy Logan zatraci sam siebie, rozpocznie się prawdziwa groza – dla Londynu jak i dla X-Men! By przetrwać, drużyna musi stawić czoła wyrzeczeniom, kłamstwo i… najmroczniejszej prawdzie! Zawiera ASTONISHING X-MEN (2017) #1-6.','ASTONISHING X-MEN BY CHARLES SOULE TP VOL 01 LIFE OF X (9781302908508)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN BY CHARLES SOULE TP VOL 01 LIFE OF X (9781302908508)','','','',''),(614,1,1,'No description','ASTONISHING X-MEN BY CHARLES SOULE TP VOL 02 MAN CALLED X (9781302908515)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN BY CHARLES SOULE TP VOL 02 MAN CALLED X (9781302908515)','','','',''),(615,1,1,'No description','ASTONISHING X-MEN COMPANION TP (9781302922856)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN COMPANION TP (9781302922856)','','','',''),(616,1,1,'Kontynuacja serii powieści graficznych starannie dobranych przez redakcję Marvela, by zaprezentować kluczowe historie napisane i narysowane przez niektórych z najbardziej uznanych twórców Marvela! Joss Whedon - wizjonerski twórca serialu Buffy, Postrach Wampirów, który wyreżyserował filmy \"Avengers\" i \"Avengers: Age of Ultron\" - łączy się z przebojowym artystą Johnem Cassadayem, aby odświeżyć X-Men! Cyclops i Emma Frost ponownie tworzą zespół, kładąc nacisk na ratowanie świata! Ale czy nowe wiadomości dotyczące zmutowanego genu pokrzyżują ich nowe plany nim jeszcze zaczną działać? A jaka zaskakująca niespodzianka czeka X-Men w sercu twierdzy wroga? Wymarzony zespół Whedon / Cassaday przedstawia Wolverine\'a, Kitty Pryde, Bestię i nie tylko w walce z Ordem - oto X-Men ewoluują z niesamowitych do zadziwiających! Zawiera ASTONISHING X-MEN (2004) #1-6.','ASTONISHING X-MEN GIFTED MARVEL SELECT HC (9781302928582)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN GIFTED MARVEL SELECT HC (9781302928582)','','','',''),(617,1,1,'Przebojowy super-zespół Jossa Whedona i Johna Cassaday’ego kończy swoją hitową serię! Sprawy zmieniają się z osobliwych w po prostu dziwaczne dla X-Menów, gdy nieobliczalne zachowanie Emmy Frost wysyła drużynę w nieprzerwaną spiralę upadku, a nowy Hellfire Club wykonuje swój ruch! Poza tym: X-Man przeznaczony do zniszczenia Breakworld zostaje ujawniony! Kto to jest? I czy X-Men będą w stanie ochronić Ziemię przed pewną zagładą z rąk Breakworld? Kiedy to wszystko się skończy, nic już nie będzie takie samo! Nie, naprawdę, mówimy poważnie! TOM ZBIERA ZESZYTY: Astonishing X-Men (2004) 13-24, Giant-Size Astonishing X-Men (2008) 1.','ASTONISHING X-MEN MODERN ERA EPIC COLLECT TP VOL 02 (9781302961114)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN MODERN ERA EPIC COLLECT TP VOL 02 (9781302961114)','','','',''),(618,1,1,'Joss Whedon i John Cassaday zaskakują swoją wizją X-Men!\nPrzebojowa era w dziejach mutantów Marvela powraca! Cyclops i Emma Frost ponownie czynią z X-Men najlepszą super drużynę na świecie, a Wolverine, Kitty Pryde i Beast dołączają do ich starań. Planują zadziwić świat - ale kiedy nieoczekiwane wiadomości o genie mutanta trafią do powszechnej informacji, czy to zniweczy ich marzenia? Gdy popyt na \"lekarstwo dla mutantów\" osiąga poziom bliski zamieszek, X-Men idą łeb w łeb z enigmatycznym Ordem - ale w twierdzy ich wroga czeka na nich zaskakująca niespodzianka! Tragiczna śmierć w Instytucie Xaviera ujawnia, że wśród X-Menów działa szpieg. Ponownie połączona z Professorem X, drużyna zmierzy się z niebezpiecznym nowym wrogiem w ruinach Genoshy... ale sekrety z przeszłości mogą położyć cień na przyszłość drużyny! Poza tym, przygorujcie się na debiut S.W.O.R.D.!\nTOM ZBIERA ZESZYTY: Astonishing X-Men (2004) 1-12.','ASTONISHING X-MEN MODERN ERA EPIC COLLECT VOL 01 TP GIFTED (9781302957971)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN MODERN ERA EPIC COLLECT VOL 01 TP GIFTED (9781302957971)','','','',''),(619,1,1,'The X-Men return to New York City, but it’s not a social call — the Marauders are back! Something from Northstar’s past has resurfaced and is looking for revenge — and when his boyfriend Kyle goes missing, will Northstar choose him or the team? Plus: Karma is losing control of her mind and taking control of the other X-Men — but all that pales in comparison to how this story ends!','ASTONISHING X-MEN NORTHSTAR WEAVER COVER HC (9780785161790)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN NORTHSTAR WEAVER COVER HC (9780785161790)','','','',''),(620,1,1,'Dream-team creators Joss Whedon (TV\'s \"Buffy the Vampire Slayer\") and John Cassaday (Planetary, CAPTAIN AMERICA) present the explosive, all-new flagship X-Men series - marking a return to classic greatness and the beginning of a brand-new era for the X-Men! Cyclops and Emma Frost re-form the X-Men with the express purpose of \"astonishing\" the world. But when breaking news regarding the mutant gene unexpectedly hits the airwaves, will it derail their new plans before they even get started? As demand for the \"mutant cure\" reaches near-riot levels, the X-Men go head-to-head with the enigmatic Ord, with an unexpected ally - and some unexpected adversaries -- tipping the scales!','ASTONISHING X-MEN TP VOL 01 GIFTED (9780785115311)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN TP VOL 01 GIFTED (9780785115311)','','','',''),(621,1,1,'A tragic death at the Xavier Institute reveals a powerful enemy living among the X-Men that they could never have suspected - and no, it\'s not Magneto. Things heat up in a way none of the X-Men ever dreamed, but will teamwork save the day when they can\'t even depend on themselves?','ASTONISHING X-MEN TP VOL 02 DANGEROUS (9780785116776)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN TP VOL 02 DANGEROUS (9780785116776)','','','',''),(622,1,1,'Strap yourselves in, folks! It\'s Joss Whedon and John Cassaday\'s final arc on Astonishing X-Men! After the shocking and brain-smashing events of recent issues, the X-Men are off to protect the Earth from its destruction at the hands of the Breakworld. And when it\'s all over, nothing will ever be the same! No, really, we mean it! Whedon and Cassaday prove they are more than Astonishing: They are unstoppable! Collecting ASTONISHING X-MEN #19-24 and GIANT-SIZE ASTONISHING X-MEN #1.\n\n','ASTONISHING X-MEN TP VOL 04 UNSTOPPABLE (9780785122548)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN TP VOL 04 UNSTOPPABLE (9780785122548)','','','',''),(623,1,1,'The X-Men are called to the scene of a murder that appears to have involved heretofore unknown mutants. The team\'s resident scientist, Beast, discovers that though the victim was indeed a mutant, his mutation appears to be artificially produced. The team races to a spaceship graveyard in Indonesia in their search for the murderer, who they find huddled over the mysterious Ghost Box, preparing to activate it. The murderer reveals himself to also be a mutant, but commits suicide rather than give the X-Men any information as to his, or the Ghost Box\'s, origins. With mysterious, artificially created mutants popping up out of nowhere, the X-Men must struggle to unlock the mysteries of the Ghost Box: What is the device\'s purpose, and why was it sent to Earth?','ASTONISHING X-MEN TP VOL 05 GHOST BOX (9780785127888)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN TP VOL 05 GHOST BOX (9780785127888)','','','',''),(624,1,1,'What do you get when you cross an island full of giant monsters, a telepathic terrorist and a jet full of mad-as-hell mutants? Monstrous action! Mentallo has the perfect plan: take mental control of the denizens of Monster Island and use them to extort his old employers at Roxxon. But when his monsters attack Tokyo at the same time the X-Men are in town helping one of their own cope with a family tragedy, the mutant heroes are drawn into the conflict. Can Wolverine, Cyclops, Emma Frost and Armor take on an entire island of giant monsters? Sharpen your claws, and get ready for a battle of the ages! Collecting ASTONISHING X-MEN (2004) #36, #37, #39 and #41, and material from STRANGE TALES (1951) #89.','ASTONISHING X-MEN TP VOL 07 MONSTROUS (9780785151159)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN TP VOL 07 MONSTROUS (9780785151159)','','','',''),(625,1,1,'Children of the Atom, or something else? A small African town has been hit with a series of bizarre occurrences, as children are born possessing strange and powerful abilities. With the mutant race dwindling, the X-Men are the first on the scene to investigate the phenomenon. When they arrive, what looks to be a concentration of mutant births raises their hopes. But soon, they find themselves confronted by the country’s ruthless leader, who has his own ideas of what the children truly are and how to deal with them. Have the X-Men stumbled across a series of new mutant births, or are they dealing with something far more dangerous?','ASTONISHING X-MEN TP XENOGENESIS (9780785140337)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN TP XENOGENESIS (9780785140337)','','','',''),(626,1,1,'Seria ASTONISHING X-MEN autorstwa Jossa Whedona i Johna Cassadaya od pierwszych numerów stała się hitem, zarówno wśród fanów jak i krytyków, zdobywając kilka branżowych nagród. Whedon (Buffy - postrach wampirów) i Cassaday (Planetary) zgromadzili niewielką obsadę: Cyclops, Beast, Wolverine i Emma Frost wraz z powracającą do drużyny Kitty Pryde, wyznaczając przełomowe tempo na początkowych, przerażających stronach i stawiając naprzeciw drużyny zaskakujące nowe zagrożenie oraz nieoczekiwany powrót ukochanego X-Mana! Opierając się na swoim rozmachu, twórcy podnieśli stawkę w szokującej drugiej połowie serii, tworząc komiks, który trzeba przeczytać! Zawiera ASTONISHING X-MEN (2004) #1-24 i GIANT-SIZE ASTONISHING X-MEN #1.','ASTONISHING X-MEN WHEDON CASSADAY OMNIBUS HC VOL 01 DM VAR NEW PTG (9781302923983)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN WHEDON CASSADAY OMNIBUS HC VOL 01 DM VAR NEW PTG (9781302923983)','','','',''),(627,1,1,'No description','ASTONISHING X-MEN WHEDON CASSADAY OMNIBUS HC VOL 01 NEW PTG (9781302922689)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN WHEDON CASSADAY OMNIBUS HC VOL 01 NEW PTG (9781302922689)','','','',''),(628,1,1,'The chart-topping super-team of Joss Whedon (Marvel Studios’ The Avengers, RUNAWAYS) and John Cassaday (Planetary, CAPTAIN AMERICA) return! Things go from peculiar to just plain bizarre as Emma Frost’s erratic behavior sends the X-Men into a non-stop downward spiral, and the new Hellfire Club makes its move! Plus: the X-Man destined to destroy the Breakworld stands revealed! Who is it? And will the X-Men be able to protect Earth from certain destruction at the hands of the Breakworld? When it’s all over, nothing will ever be the same! No, really, we mean it! Whedon and Cassaday’s complete saga — acclaimed as “Series of the Year” by Wizard magazine and a “Must Have Gift” by TV Guide — is collected across two softcover volumes. Collecting ASTONISHING X-MEN (2004) #13-24 and GIANT-SIZE ASTONISHING X-MEN #1.','ASTONISHING X-MEN WHEDON CASSADAY ULTIMATE COLLECTION TP BOOK 02 (9780785161950)','marvel-comics','','','MARVEL COMICS','ASTONISHING X-MEN WHEDON CASSADAY ULTIMATE COLLECTION TP BOOK 02 (9780785161950)','','','',''),(629,1,1,'Na superbohaterów Marvela czeka wyzwanie rzucone przez najgrożniejszą armię lądów, mórz i oceanów! Nikcemni podwodni monarchowie Ghaur i Llyra planują przyzwanie boga Seta, a lądowi herosi muszą zrobić wszystko, by powstrzymać potwora. Złoczyńcom udaje się pokonać Namora i porwać siedem bohaterek, w tym She-Hulk, Storm i Scarlet Witch, by zostały one żonami siedmiu głów Seta. Armia Atlantydy wchodzi na ląd, a bohaterowie muszą działać jak najszybciej, by pokrzyżować plany jej dowódców. Czy uda im się powstrzymać falę pradawnego zła? Tom zbiera zeszyty NEW MUTANTS (1983) #76, oraz fragment SILVER SURFER ANNUAL #2, IRON MAN ANNUAL #10, AVENGERS WEST COAST #56 i ANNUAL #4, MARVEL COMICS PRESENTS (1988) #26, X-MEN ANNUAL (1970) #13, AMAZING SPIDER-MAN ANNUAL (1964) #23, PUNISHER ANNUAL #2, SPECTACULAR SPIDER-MAN ANNUAL #9, DAREDEVIL ANNUAL #5, AVENGERS ANNUAL #18, NEW MUTANTS ANNUAL #5, X-FACTOR ANNUAL #4, WEB OF SPIDER-MAN ANNUAL #5, THOR ANNUAL #14, a także FANTASTIC FOUR ANNUAL #22.','ATLANTIS ATTACKS TP ORIGINAL EPIC (9781302930318)','marvel-comics','','','MARVEL COMICS','ATLANTIS ATTACKS TP ORIGINAL EPIC (9781302930318)','','','',''),(630,1,1,'No description','AVENGERS &amp; CHAMPIONS TP WORLDS COLLIDE (9781302906139)','marvel-comics','','','MARVEL COMICS','AVENGERS & CHAMPIONS TP WORLDS COLLIDE (9781302906139)','','','',''),(631,1,1,'AVX fall-out: Avengers Academy is closed — indefinitely! And Alchemist, a.k.a. wunderkind industrialist Jeremy Briggs, has offered the students a chance to be normal again — but is there a catch? Who will accept his deal? Years of plot threads explode as your favorite Academy characters face their futures — including the ultimate challenge to the Mettle/Hazmat romance! Can friendships, romances — and the Academy itself — survive? Plus, because you demanded it: the flag football game between Avengers Academy and the Jean Grey School! Guest-starring the staff and students of WOLVERINE &amp; THE X-MEN!','AVENGERS ACADEMY FINAL EXAMS PREMIERE HC (9780785160311)','marvel-comics','','','MARVEL COMICS','AVENGERS ACADEMY FINAL EXAMS PREMIERE HC (9780785160311)','','','',''),(632,1,1,'With the Academy shut down as the staff joins the fight between the Avengers and X-Men, the students are left to pave their own road and face the ultimate temptation. When the team learns of teenaged corporate magnate Jeremy Briggs’ plan to cleanse the world of super heroes with a depowering inoculation, will they join his cause and take his “cure”? When faced with the opportunity to live as ordinary teenagers, it’s every student for himself as they make the biggest decision of their lives! Up against an unthinkable test, will they make the grade in this thrilling conclusion to the Avengers Academy saga?','AVENGERS ACADEMY TP FINAL EXAMS (9780785160328)','marvel-comics','','','MARVEL COMICS','AVENGERS ACADEMY TP FINAL EXAMS (9780785160328)','','','',''),(633,1,1,'No description','AVENGERS ACADEMY TP VOL 03 COMPLETE COLLECTION (9781302923143)','marvel-comics','','','MARVEL COMICS','AVENGERS ACADEMY TP VOL 03 COMPLETE COLLECTION (9781302923143)','','','',''),(634,1,1,'Red Onslaught is broadcasting waves of telepathic hate across the globe — and Marvel’s greatest heroes have turned on their moral axis! What will the Avengers and X-Men find in the Red Skull’s bleak “re-education camps”? What is Tony Stark’s dark secret? And with the heroes “inverted” to evil, who will stand against them? How about an army of villains?! Magneto betrays his alliance, a founding Avenger quits, and Scarlet Witch is forced to join Doctor Doom! And who are Kluh and the Sorceress Supreme? As the Axis of Evil strikes down the heroes, the all-new Astonishing Avengers battle the Uncanny X-Men! Witness an X-Man’s horrifying fate — and an Avenger’s appalling choice! Who will live and die? Who will remain inverted? The shocking climax will crack the Marvel Universe to its core! Collecting AVENGERS &amp; X-MEN: AXIS #1-9.','AVENGERS AND X-MEN TP AXIS (9781302904142)','marvel-comics','','','MARVEL COMICS','AVENGERS AND X-MEN TP AXIS (9781302904142)','','','',''),(635,1,1,'No description','AVENGERS ASSEMBLE GN TP LIVING LEGENDS (9781302916381)','marvel-comics','','','MARVEL COMICS','AVENGERS ASSEMBLE GN TP LIVING LEGENDS (9781302916381)','','','',''),(636,1,1,'No description','100 BULLETS BROTHER LONO THE DELUXE EDITION HC (9781779527431)','dc-comics','','','DC COMICS','100 BULLETS BROTHER LONO THE DELUXE EDITION HC (9781779527431)','','','',''),(637,1,1,'In this new deluxe edition collecting 100 BULLETS #59-80, the Houses of the Trust are warily circling each other, looking for the right angle to take in their impending war, while the remaining Minutemen continue to choose sides—and set up their own battle plans. Then, following Lono’s ascension to warlord for the houses of the Trust, players on both sides ready themselves for the endgame of their private war.','100 BULLETS DELUXE EDITION BOOK 4 HC (9781401238070)','dc-comics','','','DC COMICS','100 BULLETS DELUXE EDITION BOOK 4 HC (9781401238070)','','','',''),(638,1,1,'In the final Deluxe Edition, collecting issues #81-100, more members of The Trust fall, and one family head reaches out to a semi-retired Minuteman for help. And learn the last dark secrets as secrets are revealed about what really caused this war.','100 BULLETS DELUXE EDITION BOOK 5 HC (9781401242718)','dc-comics','','','DC COMICS','100 BULLETS DELUXE EDITION BOOK 5 HC (9781401242718)','','','',''),(639,1,1,'If you were given a gun and 100 untraceable bullets, would you seek vengeance? That\'s the offer Agent Graves presents ordinary citizens, giving them an opportunity to exact revenge on those who wronged them, along with full immunity for their actions - even murder.','100 BULLETS OMNIBUS HC VOL 01 (9781779507426)','dc-comics','','','DC COMICS','100 BULLETS OMNIBUS HC VOL 01 (9781779507426)','','','',''),(640,1,1,'A briefcase. An untraceable gun. One hundred rounds of ammunition. For some, it’s a once-in-a-lifetime chance to pull the trigger and change their lives. But just who is making these actions possible—and why? This volume collects the bloody, shocking conclusion from 100 Bullets #59-100.','100 BULLETS OMNIBUS HC VOL 02 (9781779514868)','dc-comics','','','DC COMICS','100 BULLETS OMNIBUS HC VOL 02 (9781779514868)','','','',''),(641,1,1,'No description','100 BULLETS TP BOOK 01 (2024 EDITION) (9781779525772)','dc-comics','','','DC COMICS','100 BULLETS TP BOOK 01 (2024 EDITION) (9781779525772)','','','',''),(642,1,1,'Dziewiętnaście początkowych numerów nagrodzonej między innymi Eisnerem serii kryminalnej powraca w zupełnie nowej formie. W tych początkowych rozdziałach, Dizzy Cordoba otrzymuje szansę na pomszczenie swojej pomordowanej rodziny. Wtedy, gdy tajemniczy agent Graves kontynuuje rekrutowanie i manipulowanie swoich „klientów”, pytania dotyczące przeszłości tego mężczyzny zaczynają pojawiać się jak grzyby po deszczu. Postacie z którymi miał wcześniej do czynienia ujawniają nowe, interesujące szczegóły. Wreszcie w trzeciej dłuższej historii, Graves wciąga młodego chłopaka o imieniu Loop Hughes w swoją sieć intryg.','100 BULLETS TP VOL 01 (9781401250560)','dc-comics','','','DC COMICS','100 BULLETS TP VOL 01 (9781401250560)','','','',''),(643,1,1,'The second trade paperback in the 100 BULLETS line, this book resumes the tale of the mysterious Agent Graves who offers ordinary wronged people the opportunity to kill with impunity using 100 bullets that he supplies them with. But even as Agent Graves continues to approach and manipulate his \"clients,\" questions about the ghoulish agent start to arise as people from his past begin to appear, revealing interesting information about their former acquaintance. In the end though, these facts only lead to different questions as the mystery behind Agent Graves\' motives deepens.','100 BULLETS TP VOL 02 SPLIT SECOND CHANCE (9781563897115)','dc-comics','','','DC COMICS','100 BULLETS TP VOL 02 SPLIT SECOND CHANCE (9781563897115)','','','',''),(644,1,1,'These stand-alone stories from issues #37-57 of the Eisner Award-winning series spotlight the major players in the story. Plus: the final fate of Loop Hughes!','100 BULLETS TP VOL 03 (9781401257958)','dc-comics','','','DC COMICS','100 BULLETS TP VOL 03 (9781401257958)','','','',''),(645,1,1,'This third collection of this modern noir classic contains an Eisner Award-winning storyline in which the enigmatic Agent Graves pulls a young man by the name of Loop Hughes into his web of intrigue and deception. Armed with one of Agent Graves\' \"special\" briefcases, Loop tracks down his long-lost father and is soon drawn into his dad\'s world of mob enforcement. As Loop acts on his deepest inner desires and violence erupts, Agent Graves\' ulterior motives are chillingly revealed along with more clues about the intricate conspiracy that he is orchestrating.','100 BULLETS TP VOL 03 HANG UP ON THE HANG LOW (9781563898556)','dc-comics','','','DC COMICS','100 BULLETS TP VOL 03 HANG UP ON THE HANG LOW (9781563898556)','','','',''),(646,1,1,'In these stories from 100 BULLETS #59-80, the Houses of the Trust are looking for the right angle in their impending war, while the Minutemen choose sides and make their own battle plans. Then, following Lono’s ascension to warlord for the Houses of the Trust, players on both sides ready themselves for the endgame of their private war.','100 BULLETS TP VOL 04 (9781401257941)','dc-comics','','','DC COMICS','100 BULLETS TP VOL 04 (9781401257941)','','','',''),(647,1,1,'In this final trade paperback collecting issues #81-100, more members of The Trust fall, and one family head reaches out to a semi-retired Minuteman for help. And learn the last dark truths as secrets are revealed about what really caused this war.','100 BULLETS TP VOL 05 (9781401261337)','dc-comics','','','DC COMICS','100 BULLETS TP VOL 05 (9781401261337)','','','',''),(648,1,1,'Reprinting 100 BULLETS #37-42, this sixth trade paperback features six stand-alone chapters, each focused on one of the story\'s main players: Dizzy, Cole, Benito, Lono, Graves, and Wylie. And behind each individual\'s story, the war between Shepherd and Graves continues to escalate, and the uneasy alliance of the 13 Families continues to fracture. Featuring an introduction by fan-favorite writer Greg Rucka (WONDER WOMAN, DETECTIVE COMICS)','100 BULLETS TP VOL 06 SIX FEET UNDER THE GUN (9781563899966)','dc-comics','','','DC COMICS','100 BULLETS TP VOL 06 SIX FEET UNDER THE GUN (9781563899966)','','','',''),(649,1,1,'Brian Azzarello\'s and Eduardo Risso\'s VERTIGO crime saga 100 BULLETS continues its collected editions with 100 BULLETS: SAMURAI, reprinting issues #43-49 of the critically acclaimed and award-winning ongoing series. This seventh volume, featuring the story arcs \"Chill in the Oven\" and \"In Stinked,\" features a new cover by Dave Johnson and an introduction by legendary Argentinean comics writer Carlos Trillo.','100 BULLETS TP VOL 07 SAMURAI (9781401201890)','dc-comics','','','DC COMICS','100 BULLETS TP VOL 07 SAMURAI (9781401201890)','','','',''),(650,1,1,'The unstoppable villains of the groundbreaking weekly series 52 rise again in this volume collecting the 6-issue miniseries! They are the Four Horsemen - War, Pestilence, Famine, Death - living embodiments of the Dread Ages of the distant world of Apokolips, and they mean to remake the Earth in their own image!','52 AFTERMATH THE FOUR HORSEMEN TP (9781401217815)','dc-comics','','','DC COMICS','52 AFTERMATH THE FOUR HORSEMEN TP (9781401217815)','','','',''),(651,1,1,'No description','52 OMNIBUS HC 2022 EDITION (9781779515438)','dc-comics','','','DC COMICS','52 OMNIBUS HC 2022 EDITION (9781779515438)','','','',''),(652,1,1,'No description','52 TP VOL 01 (2024 EDITION) (9781779525857)','dc-comics','','','DC COMICS','52 TP VOL 01 (2024 EDITION) (9781779525857)','','','',''),(653,1,1,'Obfitująca w niezwykłe wydarzenia historia, uznawana za jedną z najlepszym w tym roku w Universum DC, zamyka się w tym pełnym wrażeń tomie! Odkryj ostateczny los gwiazd serii 52 - w komiksie znajdują się numery #27-52!','52 TP VOL 02 (9781401265649)','dc-comics','','','DC COMICS','52 TP VOL 02 (9781401265649)','','','',''),(654,1,1,'No description','52 TP VOL 02 (2024 EDITION) (9781779527622)','dc-comics','','','DC COMICS','52 TP VOL 02 (2024 EDITION) (9781779527622)','','','',''),(655,1,1,'99 DAYS is the story of Antoine Boshoso Davis, who is living the dream as a rookie homicide detective for the LAPD. But 12 years ago he was living a nightmare. As a young Hutu in Rwanda, Antoine was forced to become a child soldier with the rebel Hutu militia. Like so many others he was caught up in the slaughter of a country gone insane – murdering scores of men, women and children with a machete. Antoine fled Rwanda for LA, where he grew into a quiet, sensitive man with a deep need for justice – so he joined the LAPD. But when a serial killer starts stalking the African-American residents of LA – murdering them with a machete – Antoine discovers that his past has come back to haunt him.','99 DAYS HC (9781401230890)','dc-comics','','','DC COMICS','99 DAYS HC (9781401230890)','','','',''),(656,1,1,'','A VERY DC VALENTINES DAY TP (9781401287665)','dc-comics','','','DC COMICS','A VERY DC VALENTINES DAY TP (9781401287665)','','','',''),(657,1,1,'Sześć legendarnych historii: SUPERMAN: PEACE ON EARTH, BATMAN: WAR ON CRIME, SHAZAM: POWER OF HOPE, WONDER WOMAN: SPIRIT OF TRUTH, JUSTICE LEAGUE: SECRET ORIGINS, JUSTICE LEAGUE: LIBERTY AND JUSTICE stworzonych przez Alexa Rossa i Paula Diniego zebranych zostało w tym specjalnym wydaniu absolute!','ABS JUSTICE LEAGUE WORLDS GREATEST SUPERHEROES HC (9781401273705)','dc-comics','','','DC COMICS','ABS JUSTICE LEAGUE WORLDS GREATEST SUPERHEROES HC (9781401273705)','','','',''),(658,1,1,'Written by GRANT MORRISON\nArt and cover by FRANK QUITELY\nThe Eisner Award-winning 12-issue series from Grant Morrison and Frank Quitely is now available in Absolute format! The Man of Steel battles Bizarro, Zibarro and more before facing the final revenge of Lex Luthor. Also includes a bonus sketchbook section and more!','ABSOLUTE ALL STAR SUPERMAN HC (9781401229177)','dc-comics','','','DC COMICS','ABSOLUTE ALL STAR SUPERMAN HC (9781401229177)','','','',''),(659,1,1,'No description','ABSOLUTE ALL-STAR SUPERMAN HC (2024 EDITION) (9781779526083)','dc-comics','','','DC COMICS','ABSOLUTE ALL-STAR SUPERMAN HC (2024 EDITION) (9781779526083)','','','',''),(660,1,1,'W tych napisanych z rozmachem historiach Warrena Ellisa i Bryana Hitcha, Authority przyjdzie walczyć z terrorystami z supermocami. Będą musieli także zatrzymać inwazję z alternatywnego świata i wiele więcej! W środku znajdziecie zeszyty THE AUTHORITY #1-12, PLANETARY/THE AUTHORITY #1, oraz całkiem nową opowieść autorstwa Warrena Ellisa, Bryana Hitcha i Paula Neary’ego!','ABSOLUTE AUTHORITY HC VOL 01 (9781401276478)','dc-comics','','','DC COMICS','ABSOLUTE AUTHORITY HC VOL 01 (9781401276478)','','','',''),(661,1,1,'No description','A