A HC BOOK 01 (2025 EDITION) (9781799500902)','dc-comics','','','DC COMICS','ABSOLUTE PROMETHEA HC BOOK 01 (2025 EDITION) (9781799500902)','','','',''),(711,1,1,'THE SANDMAN, napisany przez scenarzystę Neila Gaimana, był najlepiej przyjętą serią lat ‘90. Połączenie współczesnych mitów z dark fantasy w którym współczesna fikcja, historyczny dramat i legendy nieustannie się przeplatają. THE SANDMAN jest powszechnie uważany za jedną z najbardziej oryginalnych i artystycznie ambitnych dzieł współczesnej ery. Do czasu swojego zakończenia w 1996 roku, wywarł znaczący wpływ na dojrzałość komiksów i został popkulturowym fenomenemem. Teraz DC Comics dumnie prezentuje ten klasyk w formacie Absolute. THE ABSOLUTE SANDMAN VOL. 1 zawiera zeszyty #1-20 THE SANDMAN i przedstawia zupełnie nowe kolorowanie, zatwierdzone przez autora pierwszych 18 zeszytów jak również nigdy nie publikowane materiały z tworzenia serii, oryginalne pomysły na serię oraz galerię designów postaci które rozważali autorzy.','ABSOLUTE SANDMAN HC VOL 01 (9781401210823)','dc-comics','','','DC COMICS','ABSOLUTE SANDMAN HC VOL 01 (9781401210823)','','','',''),(712,1,1,'DC Comics dumnie przedstawia drugi tom klasycznego THE SANDMAN w formacie Absolute! THE ABSOLUTE SANDMAN VOL. 2 zawiera zeszyty 21-39 THE SANDMAN i poprawione kolorowanie wszystkich 19 zeszytów, jak również zupełnie nowe cieniowanie THE SANDMAN #34 od oryginalnego rysownika tego zeszytu, Colleen Doran. Tom zabiera też materiały dodatkowe takie jak nigdy wcześniej niepublikowane historie (jedno prozą, drugie ilustrowane) oraz reprodukcję THE SANDMAN: A GALLERY OF DREAMS, i scenariusz wraz ze szkicami THE SANDMAN #23.','ABSOLUTE SANDMAN HC VOL 02 (9781401210830)','dc-comics','','','DC COMICS','ABSOLUTE SANDMAN HC VOL 02 (9781401210830)','','','',''),(713,1,1,'The third volume collecting Neil Gaiman\'s seminal, award-winning series starring the Dream King in deluxe format. Absolute Sandman Volume 3 presents several key Sandman tales in a slipcased hardcover edition, including \"Brief Lives,\" in which the Sandman\'s sister Delirium prevails upon her older brother to help her find their missing sibling, Destruction. But their journey through the Waking World has dramatic repercussions for their family and also for the relationship between the Sandman and his wayward son, Orpheus.','ABSOLUTE SANDMAN HC VOL 03 (9781401210847)','dc-comics','','','DC COMICS','ABSOLUTE SANDMAN HC VOL 03 (9781401210847)','','','',''),(714,1,1,'Czwarte wydanie Absolute Sandman zawiera nie tylko numer #57-75, ale także masę dodatków i historię z VERTIGO JAM #1! Nie przegap tego pięknego wydania!','ABSOLUTE SANDMAN HC VOL 04 (9781401210854)','dc-comics','','','DC COMICS','ABSOLUTE SANDMAN HC VOL 04 (9781401210854)','','','',''),(715,1,1,'Najnowsze, przepełnione zawartością wydanie SANDMANA zawiera wyróżnione nagrodą Eisnera THE SANDMAN: ENDLESS NIGHTS, oraz DREAM HUNTERS (powieść i komiksowa adaptacja), a także rzadkie SANDMAN MIDNIGHT THEATRE z Wesley’em Doddsem!','ABSOLUTE SANDMAN HC VOL 05 (9781401232023)','dc-comics','','','DC COMICS','ABSOLUTE SANDMAN HC VOL 05 (9781401232023)','','','',''),(716,1,1,'Legendarna seria Neila Gaimana wraca w formacie Absolute. Od narodzin galaktyki do momentu pochwycenia Morfeusza, THE SANDMAN: OVERTURE przedstawia cameo postaci ukochanych przez fanów takich jak Corinthian, Merv Pumpkinhead i, oczywiście, rodzeństwa Morfeusza: Death, Desire, Despair, Delirium, Destruction and Destiny. Tom zawiera THE SANDMAN: OVERTURE #1-6 jako całą serię wraz ze specjalnych wprowadzeniem, szkicami J.H. Williamsa III, oraz nowe materiały i okładkę Williamsa! ','ABSOLUTE SANDMAN OVERTURE HC (9781401280475)','dc-comics','','','DC COMICS','ABSOLUTE SANDMAN OVERTURE HC (9781401280475)','','','',''),(717,1,1,'No description','ABSOLUTE SANDMAN OVERTURE HC (2023 EDITION) (9781779523525)','dc-comics','','','DC COMICS','ABSOLUTE SANDMAN OVERTURE HC (2023 EDITION) (9781779523525)','','','',''),(718,1,1,'No description','ABSOLUTE 