ion. Then, Spider is hot on the trail of the horrifying truth behind the newly elected president’s campaign. Collects issues #19-36.','ABSOLUTE TRANSMETROPOLITAN HC VOL 02 (9781401261153)','dc-comics','','','DC COMICS','ABSOLUTE TRANSMETROPOLITAN HC VOL 02 (9781401261153)','','','',''),(731,1,1,'No description','ABSOLUTE TRANSMETROPOLITAN HC VOL 02 (2023 EDITION) (9781779523174)','dc-comics','','','DC COMICS','ABSOLUTE TRANSMETROPOLITAN HC VOL 02 (2023 EDITION) (9781779523174)','','','',''),(732,1,1,'No description','ABSOLUTE TRANSMETROPOLITAN HC VOL 03 (2025 EDITION) (9781799500544)','dc-comics','','','DC COMICS','ABSOLUTE TRANSMETROPOLITAN HC VOL 03 (2025 EDITION) (9781799500544)','','','',''),(733,1,1,'No description','ABSOLUTE V FOR VENDETTA HC (2023 EDITION) (9781779523396)','dc-comics','','','DC COMICS','ABSOLUTE V FOR VENDETTA HC (2023 EDITION) (9781779523396)','','','',''),(734,1,1,'No description','ABSOLUTE WATCHMEN HC (2023 EDITION) (9781779524492)','dc-comics','','','DC COMICS','ABSOLUTE WATCHMEN HC (2023 EDITION) (9781779524492)','','','',''),(735,1,1,'25 lat temu Jim Lee przedstawił światu legendarny zespół znany jako WildC.A.T.s, który pomógł Image Comics w jego początkach. Teraz, cały run WildC.A.T.s Lee jest zebrany w formacie Absolute. Tom zawiera WILDC.A.T.S #1-13 i#50, CYBERFORCE #1-3, WILDCATS #1 i WILDC.A.T.S/X-MEN: THE SILVER AGE #1. Ta edycja zawiera również poprawione kolory WILDC.A.T.S #1-4, scenariusz WILDCATS #2 i nową okładkę od Jima Lee!','ABSOLUTE WILDCATS BY JIM LEE HC (9781401274955)','dc-comics','','','DC COMICS','ABSOLUTE WILDCATS BY JIM LEE HC (9781401274955)','','','',''),(736,1,1,'In these tales from the start of DC—The New 52, Wonder Woman learns that Queen Hippolyta has kept a secret from her daughter all her life—and when Diana learns who her father is, her life will shatter like brittle clay. The only one more shocked than Diana by this revelation? Bloodthirsty Hera—so why is her sinister daughter, Strife, so eager for the truth to be told? This Absolute edition collects WONDER WOMAN #1-18 and #0.','ABSOLUTE WONDER WOMAN BY AZZARELLO &amp; CHANG HC VOL 01 (9781401268480)','dc-comics','','','DC COMICS','ABSOLUTE WONDER WOMAN BY AZZARELLO & CHANG HC VOL 01 (9781401268480)','','','',''),(737,1,1,'Uznany run Briana Azzarello i Cliffa Chianga w WONDER WOMAN kończy się w tym tomie w formacie Absolute zawierającym WONDER WOMAN #19-35 i #23.2! Najpierw świat trzęsie się w posadach gdy pierworodny Zeusa zostaje wybudzony ze snu. Teraz z rozbitą rodziną i bez przyjaciół, Diana musi poprosić Oriona i Nowych Bogów z New Genesis o pomoc w uratowaniu siebie oraz dziecka Zoli od gniewu jej przyrodniego brata! Następnie życie Wonder Woman zmienia się, gdy zostaje wezwana by zająć miejsce boga wojny. Nie ma jednak czasu zastanawiać się nad konsekwencjami, kiedy jej rodzina przygotowuje natarcie na Olimp!','ABSOLUTE WONDER WOMAN BY AZZARELLO &amp; CHIANG HC VOL 02 (9781401277499)','dc-comics','','','DC COMICS','ABSOLUTE WONDER WOMAN BY AZZARELLO & CHIANG HC VOL 02 (9781401277499)','','','',''),(738,1,1,'No description','ABSOLUTE WONDER WOMAN GODS AND MORTALS HC (9781779511553)','dc-comics','','','DC COMICS','ABSOLUTE WONDER WOMAN GODS AND MORTALS HC (9781779511553)','','','',''),(739,1,1,'Saga Yoricka Browna, ostatniego ocalałego zarazy, która pozbawiła życia każdego ssaka z chromosomem Y. W towarzystwie jego małpki, Ampersanda, tajemniczej rządowej agentki i genialnej genetyk, Yorick podróżuje po świecie szukając utraconej miłości i odpowiedzi na to, dlaczego jest ostatnim mężczyzną na ziemi.','ABSOLUTE Y THE LAST MAN HC VOL 01 (9781401254292)','dc-comics','','','DC COMICS','ABSOLUTE Y THE LAST MAN HC VOL 01 (9781401254292)','','','',''),(740,1,1,'In this second Y: THE LAST MAN Absolute Edition, Yorick’s sister, Hero, tracks him to San Francisco, only to find that he has seemingly succumbed to the male-killing plague. Plus, catch up with Yorick’s monkey Ampersand and learn the origin of Agent 355. Collects issues #21-40, along with a complete script by Brian K. Vaughan and pencil art from issue #32 by Goran Sudzuka.','ABSOLUTE Y THE LAST MAN HC VOL 02 (9781401264918)','dc-comics','','','DC COMICS','ABSOLUTE Y THE LAST MAN HC VOL 02 (9781401264918)','','','',''),(741,1,1,'No description','ABSOLUTE Y THE LAST MAN HC VOL 03 (9781401271008)','dc-comics','','','DC COMICS','ABSOLUTE Y THE LAST MAN HC VOL 03 (9781401271008)','','','',''),(742,1,1,'ACTION COMICS dalej świętuje wydanie tysięcznego numeru prezentując edycję Deluxe niesamowitego komiksu, na punkcie, którego w dniu premiery oszaleli czytelnicy! Wydany w twardej oprawie tom zawiera wszystkie historie z zeszytu, oraz historię Paula Levitza i Neala Adamsa wydaną w ACTION COMICS: 80 YEARS OF SUPERMAN, wszystkie alternatywne okładki, szkice Jima Lee prezentujące nowy wizerunek Supermana, skrypty komiksów, rysunki do zaginionej historii Curta Swana i wiele więcej! Do tego: kompletne reprinty historii z ACTION COMICS #1 i #2.','ACTION COMICS #1000 THE DELUXE EDITION HC (9781401285975)','dc-comics','','','DC COMICS','ACTION COMICS #1000 THE DELUXE EDITION HC (9781401285975)','','','',''),(743,1,1,'At the height of comics\' Silver Age, artist Steve Ditko was winning praise for his spectacular work on Marvel\'s Amazing Spider-Man and Dr. Strange. At the same time, Ditko was also creating powerful tales of another hero: Captain Atom, published by Charlton Comics as part of its \"Action Hero\" line! DC\'s first archive of Charlton material gathers some of Ditko\'s greatest Captain Atom adventures, originally published from 1960-1966 in SPACE ADVENTURES #33-42 and CAPTAIN ATOM #78-82!','ACTION HEROES ARCHIVES HC VOL 01 (9781401203023)','dc-comics','','','DC COMICS','ACTION HEROES ARCHIVES HC VOL 01 (9781401203023)','','','',''),(744,1,1,'No description','ADAM STRANGE BETWEEN TWO WORLDS THE DELUXE EDITION HC (9781779521460)','dc-comics','','','DC COMICS','ADAM STRANGE BETWEEN TWO WORLDS THE DELUXE EDITION HC (9781779521460