ures like a map of Krypton, \"How to Draw Superman\" \"Superman Family Portrait\" and more!','AMAZING WORLD OF SUPERMAN (TABLOID EDITION) HC (9781779509185)','dc-comics','','','DC COMICS','AMAZING WORLD OF SUPERMAN (TABLOID EDITION) HC (9781779509185)','','','',''),(774,1,1,'Love MAD on Cartoon Network? You’ll love this new MAD collection – no television needed! See why having a Super Hero for a neighbor isn’t so great! Survive diabolical episodes of Spy vs. Spy! Experience water parks through the twisted brain of Sergio Aragones. Plus, truly terrible Wii games, cartoons with giant frogs, and a summer’s worth of comics and craziness!','AMAZINGLY STUPID MAD TP (9781401238575)','dc-comics','','','DC COMICS','AMAZINGLY STUPID MAD TP (9781401238575)','','','',''),(775,1,1,'No description','AMAZONS ATTACK TP (9781779527684)','dc-comics','','','DC COMICS','AMAZONS ATTACK TP (9781779527684)','','','',''),(776,1,1,'In these tales from issues #1-5 of the digital-first series, the heroines must unite to stop an invasion by the female Brainiac, who is aided by Duela Dent, Poison Ivy, Catwoman and Harley Quinn!','AME COMI GIRLS TP VOL 02 RISE OF BRAINIAC (9781401246877)','dc-comics','','','DC COMICS','AME COMI GIRLS TP VOL 02 RISE OF BRAINIAC (9781401246877)','','','',''),(777,1,1,'In these stories from issues #5-8, the Ame-Comi universe is under attack! As an intergalactic threat strikes Earth and beyond, can the heroines band together in time to save everyone?','AME COMI GIRLS TP VOL 03 EARTH IN CRISIS (9781401250379)','dc-comics','','','DC COMICS','AME COMI GIRLS TP VOL 03 EARTH IN CRISIS (9781401250379)','','','',''),(778,1,1,'Following the end of World War II, Batman accuses the Justice Society of America of collaborating with the Nazis, which leads to a Congressional investigation that could mean disgrace for the JSA! Collects AMERICA VS. THE JUSTICE SOCIETY #1-4.','AMERICA VS THE JUSTICE SOCIETY OF AMERICA TP (9781401255091)','dc-comics','','','DC COMICS','AMERICA VS THE