 related to an AIDS vaccine, only to learn what inhumane acts are going on. Then, Animal Man is invited to join the Justice League of America, but fears that he may be out of his league.\nOne of the best-loved titles by Grant Morrison, bestselling author of titles including WONDER WOMAN: EARTH ONE, ALL STAR SUPERMAN, BATMAN AND ROBIN, SEVEN SOLDIERS, DOOM PATROL, JLA, THE INVISIBLES, FINAL CRISIS and many more, is repackaged in a new hardcover. Collects ANIMAL MAN #1-13 and a story from SECRET ORIGINS #39.','ANIMAL MAN BY GRANT MORRISON HC VOL 01 30TH ANNIV DLX ED (9781401285470)','dc-comics','','','DC COMICS','ANIMAL MAN BY GRANT MORRISON HC VOL 01 30TH ANNIV DLX ED (9781401285470)','','','',''),(800,1,1,'No description','ANIMAL MAN BY GRANT MORRISON TP VOL 01 (9781401299088)','dc-comics','','','DC COMICS','ANIMAL MAN BY GRANT MORRISON TP VOL 01 (9781401299088)','','','',''),(801,1,1,'Buddy Baker przestał być superbohaterem by poświęcić swój czas rodzinie, jednak czy uda mu się ją uratować, gdy jego córka zacznie manifestować niebezpieczne moce? Gdy świat pochłania Zgnilizna, Animal Man musi zawiązać sojusz z Swamp Thingiem. Gdy straci syna, nie może w spokoju przeżyć żałoby, bo jako słynny aktor, media nie odstępują go na krok. Zawiera:  Animal Man #0-29, Animal Man Annual #1-2 oraz Swamp Thing #12 i #17 plus nowy wstęp od Jeffa Lemire!','ANIMAL MAN BY JEFF LEMIRE OMNIBUS HC (9781401289416)','dc-comics','','','DC COMICS','ANIMAL MAN BY JEFF LEMIRE OMNIBUS HC (9781401289416)','','','',''),(802,1,1,'Art by Chaz Truog, Doug Hazlewood, and others Grant Morrison’s epic run on Animal Man collected in one massive hardcover. Buddy Baker has been experiencing visions of aliens, people transforming into strange pencil-like drawings, and hints of a terrible crisis. As his odyssey of self-discovery gives way to spiritual enlightenment as well as the depths of despair, Buddy meets his maker: a writer named Grant Morrison! Includes Animal Man #1-26 and a tale from Secret Origins #39.','ANIMAL MAN OMNIBUS HC (2022 EDITION) (9781779516329)','dc-comics','','','DC COMICS','ANIMAL MAN OMNIBUS HC (2022 EDITION) (9781779516329)','','','',''),(803,1,1,'In these stories from ANIMAL MAN #38-50, Buddy Baker must make a cross-country drive to reunite with his family in Vermont, but along the way he encounters dangers including the Bear King, a super-human poacher, and an army of robotic soldiers created by S.T.A.R. labs. Plus: The Penalizer leaps from the pages of a popular comic book into action as a real-life vigilante!','ANIMAL MAN TP VOL 05 THE MEANING OF FLESH (9781401242848)','dc-comics','','','DC COMICS','ANIMAL MAN TP VOL 05 THE MEANING OF FLESH (9781401242848)','','','',''),(804,1,1,'In these stories from ANIMAL MAN #51-63, after being killed in a car crash, Animal Man struggles to return to life by climbing the evolutionary ladder one step at a time. But can he reincarnate himself as a creature with any power in time to help his kidnapped son?','ANIMAL MAN TP VOL 06 FLESH AND BLOOD (9781401246792)','dc-comics','','','DC COMICS','ANIMAL MAN TP VOL 06 FLESH AND BLOOD (9781401246792)','','','',''),(805,1,1,'Wielka tragednia spotyka córkę Animal Mana - Maxine. Czy jest to wynikiem spisku rządu? Animal Man wraz z armią szczurów i ptaków atakuje stolicę. Następnie tworzy nową religię i przewodzi grupie wyznawców, których celem jest zabezpieczenie miejsca ludzkości w mistycznej krainie znanej jako Red.','ANIMAL MAN TP VOL 07 RED PLAGUE (9781401251239)','dc-comics','','','DC COMICS','ANIMAL MAN TP VOL 07 RED PLAGUE (9781401251239)','','','',''),(806,1,1,'No description','ANNOTATED SANDMAN HC VOL 01 (2022 EDITION) (9781779515162)','dc-comics','','','DC COMICS','ANNOTATED SANDMAN HC VOL 01 (2022 EDITION) (9781779515162)','','','',''),(807,1,1,'THE ANNOTATED SANDMAN VOL. 2 collects issues #21-39 of Neil Gaiman’s THE SANDMAN, with annotations by Leslie Klinger (The Annotated Sherlock Holmes, The Annotated Dracula) to all the historical and literary references contained in the series. This edition includes the now legendary SEASON OF MISTS storyline, as well as A GAME OF YOU.','ANNOTATED SANDMAN HC VOL 02 (9781401235666)','dc-comics','','','DC COMICS','ANNOTATED SANDMAN HC VOL 02 (9781401235666)','','','',''),(808,1,1,'In THE ANNOTATED SANDMAN VOL. 3, Leslie Klinger provides historical insights into THE SANDMAN #40-55, plus THE SANDMAN SPECIAL #1 and “How They Met Themselves” from VERTIGO: WINTER’S EDGE #3.','ANNOTATED SANDMAN HC VOL 03 (9781401241025)','dc-comics','','','DC COMICS','ANNOTATED SANDMAN HC VOL 03 (9781401241025)','','','',''),(809,1,1,'In this final ANNOTATED SANDMAN volume, Leslie Klinger provides historical insights into THE SANDMAN #57-75, plus a story from VERTIGO JAM #1, appendices and more.','ANNOTATED SANDMAN HC VOL 04 (9781401243227)','dc-comics','','','DC COMICS','ANNOTATED SANDMAN HC VOL 04 (9781401243227)','','','',''),(810,1,1,'No description','ANTI HERO TP (9781401293253)','dc-comics','','','DC COMICS','ANTI HERO TP (9781401293253)','','','',''),(811,1,1,'No description','AQUAMAN &amp; THE FLASH VOIDSONG TP (9781779517050)','dc-comics','','','DC COMICS','AQUAMAN & THE FLASH VOIDSONG TP (9781779517050)','','','',''),(812,1,1,'No description','AQUAMAN 80 YEARS OF THE KING OF THE SEVEN SEAS THE DELUXE EDITION HC (9781779510198)','dc-comics','','','DC COMICS','AQUAMAN 80 YEARS OF THE KING OF THE SEVEN SEAS THE DELUXE EDITION HC (9781779510198)','','','',''),(813,1,1,'Celebrate more than seven decades of the ruler of the seas, king of Atlantis, and Justice League team member: Aquaman! Since his debut in 1941, Aquaman has defeated villains and saved the world on land and in the ocean, and this anthology collects his brightest and darkest moments in the definitive look at his history as a DC Comics Super Hero. Whether it’s Orin or Arthur Curry, Aquaman is a beloved and timeless hero, and we’re pleased to present this collection in honor of his 75th Anniversary.','AQUAMAN A CELEBRATION OF 75 YE