,'','','',''),(821,1,1,'No description','AQUAMAN DEATH OF A PRINCE DLX ED HC (9781779500953)','dc-comics','','','DC COMICS','AQUAMAN DEATH OF A PRINCE DLX ED HC (9781779500953)','','','',''),(822,1,1,'No description','AQUAMAN DEEP DIVES TP (9781779511249)','dc-comics','','','DC COMICS','AQUAMAN DEEP DIVES TP (9781779511249)','','','',''),(823,1,1,'No description','AQUAMAN GREEN ARROW DEEP TARGET TP (9781779516893)','dc-comics','','','DC COMICS','AQUAMAN GREEN ARROW DEEP TARGET TP (9781779516893)','','','',''),(824,1,1,'W rezultacie epickiego “Drowned Earth”, Arthur cierpiący na amnezję zostaje wyrzucony na samotną wyspę i dostaje się pod opiekę młodej kobiety znanej jako Caille, która wydaje się trochę zbyt skora do pocieszania go. I tak jak nauczyły nas horrory, z mieszkańcami wioski na wyspie dzieje się coś dziwnego. Aquaman musi szybko dojść do siebie bo inaczej zamiast rozmawiać z rybkami, będzie z nimi spał. Tom zawiera zeszyty AQUAMAN #43-47 od nowego zespołu scenarzystki Kelly Sue DeConnick i rysownika Robsona Rochy.','AQUAMAN HC VOL 01 UNSPOKEN WATER (9781401292478)','dc-comics','','','DC COMICS','AQUAMAN HC VOL 01 UNSPOKEN WATER (9781401292478)','','','',''),(825,1,1,'Scenarzystka Kelly Sue DeConnick (Captain Marvel, Pretty Deadly) i artysta Robson Rocha rzucają Aquamana na nieznane wody! Arthur Curry dowiaduje się więcej o swoim połączeniu z morzem i własnej naturze. Gdy odzyskuje swoje wspomnienia i dowiaduje się jak utracił pamięć, do jakiego domu powróci? Tego na morzu, czy w wodzie? Do tego: powraca Aqualad, Mera podejmuje trudną decyzję, a Black Mantha spotyka zmarłego ojca! Tom zbiera zeszyty Aquaman #48-52','AQUAMAN HC VOL 02 AMNESTY (9781401295332)','dc-comics','','','DC COMICS','AQUAMAN HC VOL 02 AMNESTY (9781401295332)','','','',''),(826,1,1,'• Aquaman joins up with his old teammates, The Others, to learn who destroyed Atlantis! But as they seek the truth, Black Manta is stalking them all—and Mera learns some dark truths about Aquaman! Don’t miss this second AQUAMAN hardcover!\n• Collects AQUAMAN #7-13.','AQUAMAN HC VOL 02 THE OTHERS (9781401240165)','dc-comics','','','DC COMICS','AQUAMAN HC VOL 02 THE OTHERS (9781401240165)','','','',''),(827,1,1,'Aquaman, who long ago lost contact with his people, must watch as armies emerge from the sea to attack the surface world. The Justice League answers the call to defend the shores from the invading Atlantean horde. But whose side is Aquaman on? With his brother Orm at the head of the undersea army, will Aquaman stand with his Earth-bound superteam? Or his own people? Find out in this exciting hardcover collecting AQUAMAN #0 and 14-16 and JUSTICE LEAGUE #15-17.','AQUAMAN HC VOL 03 THRONE OF ATLANTIS (9781401243098)','dc-comics','','','DC COMICS','AQUAMAN HC VOL 03 THRONE OF ATLANTIS (9781401243098)','','','',''),(828,1,1,'Unfolding from the events of “THRONE OF ATLANTIS” comes a mystery that sends Aquaman to the ends of the Earth to solve an ancient murder – one that will reveal a horrific truth and threaten those closest to him today! Plus, as the Scavenger compiles more Atlantean weaponry and artifacts, Aquaman enlists the aid of The Others to help find one missing relic in the Southwestern United States before his enemies can get to it and possess untold power. Collecting AQUAMAN #17-19 and 21-25.','AQUAMAN HC VOL 04 DEATH OF A KING (N52) (9781401246969)','dc-comics','','','DC COMICS','AQUAMAN HC VOL 04 DEATH OF A KING (N52) (9781401246969)','','','',''),(829,1,1,'“Sea of Storms” is collected from AQUAMAN #26-32 and ANNUAL #2! Aquaman faces a forgotten Atlantean legend: the Karaqan! A massive crustacean of incredible power, the Karaqan once served the King of Atlantis, but now poses one of his greatest threats. And when Aquaman’s trident is stolen, a host of ancient evils is freed from a mysterious portal along with the Greek demigod, Hercules! All this, and Arthur Curry’s high school reunion!','AQUAMAN HC VOL 05 SEA OF STORMS (N52) (9781401250393)','dc-comics',