r the DC Comics Bombshells line of collectibles and comics.','ART OF DC COMICS BOMBSHELLS HC (9781401264697)','dc-comics','','','DC COMICS','ART OF DC COMICS BOMBSHELLS HC (9781401264697)','','','',''),(875,1,1,'When rogue figures from famous works of art come to life and escape their frames, it’s up to Reggie Riot and the agents of Art Ops to track them down before they wreak havoc on the unsuspecting public. But Reggie has secrets of his own that may affect his ability to interact with living works of art—and he wants no part in the agency his mother ran before him. Don’t miss this collection of the first six issues of the new series!','ART OPS TP VOL 01 HOW TO START A RIOT (9781401256876)','dc-comics','','','DC COMICS','ART OPS TP VOL 01 HOW TO START A RIOT (9781401256876)','','','',''),(876,1,1,'These stories from issues #6-12 take the Art Ops team to a fashion show in 1980s New York City that’s more than your average catwalk—and they’ll go halfway around the world to uncover the truth behind a mysterious poly-blend garment. Plus, Danny Doll’s first successful human art experiment astounds the team, leading up to a fateful decision by his wife, Gina.','ART OPS TP VOL 02 POPISM (9781401267414)','dc-comics','','','DC COMICS','ART OPS TP VOL 02 POPISM (9781401267414)','','','',''),(877,1,1,'In the latest ASTRO CITY collection, the Living Nightmare—the embodiment of fear itself—goes up against the Honor Guard, and all its secrets come to light. Plus, Starfighter has been enjoying a hero’s reward for decades. But with dark forces stirring in the cosmos, will he be called back to action? Or are there other paths? Collects ASTRO CITY #13, #22, #25, #27-28, and #31.','ASTRO CITY HONOR GUARD HC (9781401263874)','dc-comics','','','DC COMICS','ASTRO CITY HONOR GUARD HC (9781401263874)','','','',''),(878,1,1,'In this new ASTRO CITY collection, the spotlight falls on Quarrel and Crackerjack as they face a real crisis: what does an aging crimefighter do when time starts to take its toll? Plus, a look into Quarrel’s origins—and the end of the line for one of Astro City’s most stalwart heroes. And what’s a talking gorilla to do when he’s always wanted to be a drummer in a rock ‘n’ roll band? That’s right, you go to Astro City. Collects ASTRO CITY #18-21 and 23-24.','ASTRO CITY LOVERS QUARREL HC (9781401258252)','dc-comics','','','DC COMICS','ASTRO CITY LOVERS QUARREL HC (9781401258252)','','','',''),(879,1,1,'In these tales from ASTRO CITY #11-16, get to know the assistant to one of Astro City’s newest and most powerful mystic heroes, the Silver Adept. Plus, we take a look at the Gentleman Bandit as he continues his life of well-dressed crime as a member of the Menagerie Gang, and meet the proprietor of a roadside killer-robot sanctuary and museum. But the Broken Man isn’t done with our town yet, and he spies on both the Dancing Master and Starbright – a teen super hero whose destiny is entwined with that of his greatest foe!','ASTRO CITY PRIVATE LIVES HC (9781401254599)','dc-comics','','','DC COMICS','ASTRO CITY PRIVATE LIVES HC (9781401254599)','','','',''),(880,1,1,'This new collection starts with a look back at ASTRO CITY’s past in a special 20th anniversary issue. It all began with Samaritan’s dreams of flying—but what is he dreaming of now? Then, a suburban family must face a terrifying alien invasion in “The Menace from Earth.” And finally, the spotlight turns to Steeljack—from “The Tarnished Angel,” one of ASTRO CITY’s most popular stories—and how he’s been getting by the last few years. When he’s hired by a femme fatale from his past, he’ll wind up in deep trouble with no one to turn to. Collects ASTRO CITY #26, 29-30 and 32-34.','ASTRO CITY REFLECTIONS HC (9781401268299)','dc-comics','','','DC COMICS','ASTRO CITY REFLECTIONS HC (9781401268299)','','','',''),(881,1,1,'In these tales from ASTRO CITY #7-10, a major new epic features Winged Victory, Samaritan, and the Confessor. When criminal charges are brought against Winged Victo