BATMAN/FORTNITE – FUNDAMENT (9788328150737)','','','',''),(1408,1,1,'Uniwersum Marvela zderza się ze światem Fortnite! Mieszkańcy wyspy są zamknięci w czymś co wygląda jak niekończąca się wojna i tylko jedna rzecz ma potencjał, aby zmienić ten stan - kryształowy fragment Zero Point, który został wrzucony do świata Marvela. Spider-man i Wolverine tworzą zespół z kilkoma wojownikami Fortnite oraz z nową rekrutką - Shuri. Ich cel to dorwanie nieuchwytnego Zero Shard. Czy zespołowi uda się znaleźć ten artefakt w porę aby zapobiec katastrofie? Czy bohaterowie Marvela i Fortnite realnie powstrzymają Urojony Reżim na tyle długo aby mieć szanse zwycięstwa? Odpowiedź na te pytania poznasz w nowym 5 częściowym komiksie łączącym świat Marvela i Fortnite. Wydanie zawiera: Fortnite X Marvel: Zero War (2022) #1-5 oraz FORTNITE X MARVEL - NEXUS WAR: THOR (2020) #1.','FORTNITE X MARVEL HC ZERO WAR PREMIERE + KOD DO GRY (9781302947934)','marvel-comics','','','MARVEL COMICS','FORTNITE X MARVEL HC ZERO WAR PREMIERE + KOD DO GRY (9781302947934)','','','',''),(1409,1,1,'Komiks NIE posiada kodu do gry.','FORTNITE X MARVEL WOJNA ZEROWA 1/2022','egmont','','','EGMONT','FORTNITE X MARVEL WOJNA ZEROWA 1/2022','','','',''),(1410,1,1,'Komiks NIE posiada kodu do gry.','FORTNITE X MARVEL ZERO WAR #1 (OF 5)','marvel-comics','','','MARVEL COMICS','FORTNITE X MARVEL ZERO WAR #1 (OF 5)','','','',''),(1411,1,1,'Komiks NIE posiada kodu do gry.','FORTNITE X MARVEL ZERO WAR #1 (OF 5) CASSADAY VAR','marvel-comics','','','MARVEL COMICS','FORTNITE X MARVEL ZERO WAR #1 (OF 5) CASSADAY VAR','','','',''),(1412,1,1,'Komiks NIE posiada kodu do gry.','FORTNITE X MARVEL ZERO WAR #1 (OF 5) JIM CHEUNG VAR','marvel-comics','','','MARVEL COMICS','FORTNITE X MARVEL ZERO WAR #1 (OF 5) JIM CHEUNG VAR','','','',''),(1413,1,1,'Komiks NIE posiada kodu do gry.','FORTNITE X MARVEL ZERO WAR #1 (OF 5) MUSTARD VAR','marvel-comics','','','MARVEL COMICS','FORTNITE X MARVEL ZERO WAR #1 (OF 5) MUSTARD VAR','','','',''),(1414,1,1,'K