OMICS','AKIRA 35TH ANNIVERSARY HC BOX SET (9781632364616)','','','',''),(1429,1,1,'No description','AKIRA ART OF WALL BOX SET (9781646514564)','kodansha-comics','','','KODANSHA COMICS','AKIRA ART OF WALL BOX SET (9781646514564)','','','',''),(1430,1,1,'No description','BATTLE ANGEL ALITA COMPLETE SERIES BOX SET (9781632367112)','kodansha-comics','','','KODANSHA COMICS','BATTLE ANGEL ALITA COMPLETE SERIES BOX SET (9781632367112)','','','',''),(1431,1,1,'Dwoje złodziei próbuje przeżyć w Night City i zarobić na imprezy z kradzieży części i oprogramowania. Jedno z nich marzy o zostaniu władcą półświatka. Drugie szuka celu. Czegoś, co nada życiu sens, jakiejś misji, powołania… Kiedy podążają za marzeniami, ich drogi się rozchodzą.\nJedno jest dla nic pewne; by przeżyć w Night City, trzeba walczyć i dostosowywać się do nowych warunków.','CYBERPUNK 2077 BIG CITY DREAMS HC (9781506726861)','dark-horse','','','DARK HORSE','CYBERPUNK 2077 BIG CITY DREAMS HC (9781506726861)','','','',''),(1432,1,1,'Nadia, pracująca jako sanitariuszka w prywatnej firmie Trauma Team International, jest jedyną ocalałą z nieudanej akcji ratunkowej. Kiedy zgadza się na powrót do pracy, odkrywa, że jej kolejna misja polega na znalezieniu Apexa, człowieka, który zabił jej kolegów z pracy. Musi on zostać przechwycony z drapacza chmur pełnego wrogów i rywali Apexa.','CYBERPUNK 2077 TRAUMA TEAM TP (9781506716015)','dark-horse','','','DARK HORSE','CYBERPUNK 2077 TRAUMA TEAM TP (9781506716015)','','','',''),(1433,1,1,'Nierozważny dziennikarz pragnący obnażyć skalę korupcji w Night City otrzymuje szansę, by spełnić marzenie. Ktoś wysadził siedzibę pewnej potężnej korporacji, a plotka głosi, że był to nie kto inny jak niesławny Johnny Silverhand. Wielu mówi o tym, że Johnny zginął w eksplozji, a jego ciało przykryły gruzy wysadzonego budynku. Dziennikarz musi odnaleźć zwłoki Silverhanda. Czy rzeczywiście zmarł, czy może jest przy życiu?\nOryginalna powieść graficzna od CD Projekt Red! ','CYBERPUNK 2077 WHERES JOHNNY HC (9781506726250)','dark-horse','','','DARK HORSE','CYBERPUNK 2077 WHERES JOHNNY HC (9781506726250)','','','',''),(1434,1,1,'W radzie miasta pojawił się nowy project forsowany przez developerów – na terenach kontrolowanych przez gang Valentinos ma powstać luksusowe osiedle dla bogatych dekadentów, a starzy mieszkańcy mają zostać przesiedleni do zabytkowego budynku. Projekt w życie ma wprowadzić trójka cyberpunków działających w tajemnicy przed radnymi. Kret wewnątrz firmy, kelnerka, która serwuje coś więcej niż jedzenie, urzędnik z tajemnicami, które mogą go zniszczyć – wszyscy zostaną zdemaskowani!\nTom zbiera zeszyty #1-4 miniserii.\n„Gra komputerowa Cyberpunk może mieć swoje problemy, ale zapewniam was, świat, w którym się rozgrywa jest pełen potencjału, a ten komiks to udowadnia!” - Comicbook.com','CYBERPUNK 2077 YOU HAVE MY WORD TP (9781506725666)','dark-horse','','','DARK HORSE','CYBERPUNK 2077 YOU HAVE MY WORD TP (9781506725666)','','','',''),(1435,1,1,'Podczas rutynowej zmiany samotny konserwator jest świadkiem starcia między tajemniczą kobietą, a gangiem Maelstrom. Uciekająca kobieta wręcza mu chip. Aby ją znaleźć i odczytać dane, wyrusza on w szaloną podróż przez obskurne części miasta, jak i niebezpieczne pustkowia. Na jego drodze stają całe masy nietuzinkowych bohaterów z Johnnym Silverhandem na czele. Wreszcie odkryje czym jest prawdziwa miłość i dlaczego nigdy nie będzie ona możliwa. Przynajmniej nie w miejscu takim jak Night City.','CYBERPUNK 2077 YOUR VOICE TP (9781506726236)','dark-horse','','','DARK HORSE','CYBERPUNK 2077 YOUR VOICE TP (9781506726236)','','','',''),(1436,1,1,'The sold out first volume of ELEPHANTMEN is now back in print and now includes the sold out ZERO issue with art by LADR?–NN, as well as an all-new sketchbook section, and the ENGLISH &amp; MEDIA STUDIES backmatter from the single issues! Collects ELEPHANTMEN #0-7','ELEPHANTMEN TP VOL 01 WOUNDED ANIMALS REVISED EDITION (9781607063377)','image-comics','','','IMAGE COMICS','ELEPHANTMEN TP VOL 01 WOUNDED ANIMALS REVISED EDITION (9781607063377)','','','',''),(1437,1,1,'Nominowany do Eisnera artysta JASON SHAWN ALEXANDER (Abe Sapien: The Drowning, Queen and Country) przenosi nas w przyszłość osiemdziesiąt lat po wielkim kryzysie. Świat jest teraz znacznie mroczniejszym i przerażającym miejscem. Coranne White to była żołnierz, która obecnie działa jako szpieg na czarnym rynku, jest kurierem danych, ma depresję i walczy z alkoholizmem. Karząca samą siebie kobieta raz jeszcze musi wstać na nogi, gdy dowiaduje się od jednego ze swoich nieżyjących przyjaciół, iż szalony miliarder postanowił wskrzeszać zmarłych. EMPTY ZONE to opowieść o Coranne walczącej z nieumarłymi monstrami oraz błędami przeszłości.\n\"…to coś zupełnie innego niż wszystko co dotąd czytałem.\" -- Mike Mignola (HELLBOY)\n\"Co za wspaniała książka.\" -- Brian K. Vaughan (SAGA)\nZawiera EMPTY ZONE #1-5','EMPTY ZONE TP VOL 01 CONVERSATIONS WITH THE DEAD (9781632155481)','image-comics','','','IMAGE COMICS','EMPTY ZONE TP VOL 01 CONVERSATIONS WITH THE DEAD (9781632155481)','','','',''),(1438,1,1,'ADVANCE SOLICIT! Deadly bounty hunters, doomed lovers, and sharp teeth. Corinne and Hank come to Berlin targeting another of Oni\'s laboratories. They find more than they were bargaining for when they encounter they city\'s bloody subterranean secret. Collects EMPTY ZONE #6-10.','EMPTY ZONE TP VOL 02 INDUSTRIAL SMILE (9781632157195)','image-comics','','','IMAGE COMICS','EMPTY ZONE TP VOL 02 INDUSTRIAL SMILE (9781632157195)','','','',''),(1439,1,1,'No description','FRANK MILLERS RONIN TP BLACK LABEL (9781401290979)','dc-comics','','','DC COMICS','FRANK MILLERS RONIN TP BLACK LABEL (9781401290979)','','','',''),(1440,1,1,'W niedalekiej przyszłości wszystkie potrzeby ludzkości są zaspokajane przez na wpół boską sztuczną inteligencję znaną jako Azoth, a upokarzającym zajęciem, jakim jest serwisowanie go zajmuje się Cassandra Price. Nadejście Azotha całkowicie ograbiło ludzkość z dusz, ale życie Cassandry zmienia się, gdy zostaje ona wciągnięta do wnętrza Azotha. Trafia do świata zbudowanego z magii i danych. Poznaje tam grupę dziewczyn walczących z tajemniczymi potworami o naprawę świata, ale te nie wiedzą jak ten świat ma wyglądać. Dlaczego została wybrana? Czym jest omnipotentny Hermeticorp? Kto stworzył świat Azotha? Kim są te dziewczyny? Tom zbiera zeszyty #1-6.','GODDESS MODE TP (9781401294113)','dc-comics','','','DC COMICS','GODDESS MODE TP (9781401294113)','','','',''),(1441,1,1,'No description','HEAVY LIQUID TP (9781534314047)','image-comics','','','IMAGE COMICS','HEAVY LIQUID TP (9781534314047)','','','',''),(1442,1,1,'Dredd heads Californee way! As part of a judicial exchange program, Dredd is sent packing to Mega-City Two, a sprawling city covering 5,000 square miles of the Californian West Coast and centered in what was once known as Los Angeles, where he soon discovers that they do things differently there.','JUDGE DREDD MEGA CITY TWO TP (9781631400803)','idw-publishing','','','IDW PUBLISHING','JUDGE DREDD MEGA CITY TWO TP (9781631400803)','','','',''),(1443,1,1,'Edycja prezentująca wszystkie historie komiksowe zrealizowane przez Moebiusa do połowy lat 80., a przygotowana w 1986 roku specjalnie dla czytelnika amerykańskiego. Kolekcja, znana pod potoczną nazwą „Moebius USA”, zawiera również kolorowe wersje komiksów opublikowanych pierwotnie w formie czarno-białej. Starannie przygotowane „amerykańskie” albumy Moebiusa cieszyły się za Oceanem tak dużym powodzeniem, że w 2012 roku francuski wydawca postanowił zaprezentować je w tej samej postaci również rodzimej publiczności.\nMoebius to artystyczny pseudonim Jeana Girauda, francuskiego scenarzysty i rysownika komiksowego, mistrza opowiadania obrazem. Najsłynniejsze dzieła Girauda to Blueberry, Incal, Arzach. Współtworzył także scenografie do filmów Obcy, Tron oraz Piąty Element.','MISTRZOWIE KOMIKSU ŚLEPA CYTADELA, PRZYSTANEK NA FARAGONESCJI, THE LONG TOMORROW (9788328135055)','egmont','','','EGMONT','MISTRZOWIE KOMIKSU ŚLEPA CYTADELA, PRZYSTANEK NA FARAGONESCJI, THE LONG TOMORROW (9788328135055)','','','',''),(1444,1,1,'No description','NO GUNS LIFE GN VOL 01 (9781974710454)','viz-media','','','VIZ MEDIA','NO GUNS LIFE GN VOL 01 (9781974710454)','','','',''),(1445,1,1,'ZWYCIEZCA NAGDORY EISNERA W KATEGORII “NAJLEPSZY KOMIKS INTERNETOWY” WRESZCIE UKAZUJE SIĘ DRUKIEM!\nPonieważ sprzedawcy, fani oraz sam Robert Kirkman tego żądali, internetowa sensacja od PanelSyndicate.com autorstwa BRIANA K. VAUGHANA (SAGA, PAPER GIRLS) oraz MARCOSA MARTINA (The Amazing Spider-Man, Doctor Strange: The Oath) wreszcie ukazuje się drukiem i to od razu w przepięknym, twardookładkowym wydaniu deluxe, prezentującym historię w oryginalnym formacie.\nLata po tym, gdy cyfrowa chmura rozpadła się i ujawniła wszystkie nasze najgorsze sekrety, akcja THE PRIVATE EYE osadzona jest w niedalekiej przyszłości, gdzie każdy ma tajną tożsamość. Podążać będziemy wraz z detektywem bez licencji, który właśnie wpadł na trop największej sprawy w całym jego życiu. Ten klimatyczny komiks science-fiction z domieszką tajemnic odkryje najgłębsze zakamarki prywatności z przerażającą dokładnością.\nZawiera THE PRIVATE EYE #1-10','PRIVATE EYE DELUXE ED HC (9781632155726)','image-comics','','','IMAGE COMICS','PRIVATE EYE DELUXE ED HC (9781632155726)','','','',''),(1446,1,1,'Aż dziwne, że ten komiks nie ukazał się w Polsce wcześniej. W wyniku połączenia sił nieocenionego Ricka Remendera (Deadly Class, Głębia) i jednego z najoryginalniejszych współczesnych rysowników, Seana Gordona Murphyego (Batman: Biały Rycerz, Chrononauci) otrzymujemy bezkompromisowy energetyczny cyberpunk z ninja i samurajami. A wszystko w ekskluzywnym, jednotomowym wydaniu, w powiększonym formacie i z ekscytującymi materiałami dodatkowymi.','TOKYO GHOST (9788366512344)','non-stop-comics','','','NON STOP COMICS','TOKYO GHOST (9788366512344)','','','',''),(1447,1,1,'SPECJALNA CENA NA ZACHĘTE – 9,99$! Wyspy Los Angeles, rok 2089: ludzkośćjest całkowicie uzależniona od technologii. Dostać wirtualnego kopa to jeden z ostatnich powodów, dla których warto żyć, ponieważ całą resztę przejęły we władanie gangi. Do kogo jednak zwracają się złoczyńcy, gdy potrzebne jest im zwiększenie wpływów? Nasi bohaterowie - Led Dent oraz Debbie Decay – otrzymują zadanie, które sprawi iż opuszczą znajome rejony Los Angeles I wybiorą się do ostatniego miejsca na Ziemi, które niemal całkowicie pozbawione jest nowoczesnych technologii: do Ogrodniczego Narodu Tokyo. Zawiera TOKYO GHOST #1-5.','TOKYO GHOST TP VOL 01 ATOMIC GARDEN (9781632156631)','image-comics','','','IMAGE COMICS','TOKYO GHOST TP VOL 01 ATOMIC GARDEN (9781632156631)','','','',''),(1448,1,1,'Following the destruction of the Garden Nation of Japan, Constable Led Dent returns to his brutal beat, having succumbed to his inner demons. But as he stalks the streets of the Isles of Los Angeles, enforcing the corporate new world order, he\'s haunted by a ghost from Tokyo. Collects TOKYO GHOST #6-10.','TOKYO GHOST TP VOL 02 COME JOIN US (9781632159144)','image-comics','','','IMAGE COMICS','TOKYO GHOST TP VOL 02 COME JOIN US (9781632159144)','','','',''),(1449,1,1,'Pierwszy z pięciu tomów cyberpunkowej, transhumanistycznej serii autorstwa Warrena Ellisa z rysunkami Daricka Robertsona. Akcja dzieje się prawdopodobnie w XXIII wieku w mieście przyszłości. Główny bohater, Pająk Jeruzalem, niegdyś słynny dziennikarz, wraca po kilku latach spędzonych na dobrowolnym wygnaniu w górach, by wywiązać się z umowy ze swoim wydawcą. Trafia do świata, z którego wygnały go „choroba, nienawiść i śmierć Prawdy”, by jeszcze raz spróbować opisać rzeczywistość w stylu gonzo będącym połączeniem relacji z wydarzeń z osobistymi, swobodnymi przemyśleniami autora. Pierwszym zadaniem Pająka jest przygotowanie materiału z dzielnicy Anioł 8, gdzie doszło do starć pomiędzy przekształconymi genetycznie mieszkańcami pod wodzą Freda Chrystusa a policją. Relacja Pająka nadawana na żywo wpływa na bieg wydarzeń, a bohater popada w kłopoty... Warren Ellis jest brytyjskim scenarzystą komiksowym i pisarzem, znanym w Polsce z takich serii jak Moon Knight, Thunderbolts, The Authority oraz komiksu Avengers – Wojna bez końca.','TRANSMETROPOLITAN, TOM 1 (9788328134072)','egmont','','','EGMONT','TRANSMETROPOLITAN, TOM 1 (9788328134072)','','','',''),(1450,1,1,'Drugi tom cyberpunkowej, transhumanistycznej serii autorstwa Warrena Ellisa z rysunkami Daricka Robertsona. Akcja dzieje się Mieście przyszłości. Główny bohater, Pająk Jeruzalem, niegdyś słynny dziennikarz, wraca po kilku latach spędzonych na dobrowolnym wygnaniu w górach, by wywiązać się z umowy ze swoim wydawcą. Trafia do świata, z którego wygnały go „choroba, nienawiść i śmierć Prawdy”, by jeszcze raz spróbować opisać rzeczywistość w stylu gonzo będącym połączeniem relacji z wydarzeń z osobistymi, swobodnymi przemyśleniami autora. Pająk zaczyna boleśnie odczuwać presję wynikającą z faktu, że znów stał się sławy. Jest coraz bardziej rozgoryczony. Miota się pomiędzy napadami depresji a narkotycznymi wizjami. Wie, że musi znaleźć sposób na opisanie najważniejszego tematu roku, nadchodzących wyborów prezydenckich. Uzbrojony jedynie w swój intelekt i czarne poczucie humoru, rozpoczyna swoistą grę z otaczającym go zewsząd politycznym. Szuka sposobu, żeby przebić się przez propagandę i zbliżyć do prawdy. Czy jednak opinia publiczna zechce docenić te wysiłki? Warren Ellis jest brytyjskim scenarzystą komiksowym i pisarzem, znanym w Polsce z takich serii jak Moon Knight, Thunderbolts, The Authority oraz komiksu Avengers – Wojna bez końca. Komiks dla dorosłych.','TRANSMETROPOLITAN, TOM 2 (9788328134188)','egmont','','','EGMONT','TRANSMETROPOLITAN, TOM 2 (9788328134188)','','','',''),(1451,1,1,'Trzeci tom cyberpunkowej, transhumanistycznej serii autorstwa Warrena Ellisa z rysunkami Daricka Robertsona. Historia dziennikarza śledczego Pająka Jeruzalema i jego walki o przetrwanie w Mieście, w którym, za swoje publikacje w „Słowie”, jest z równą zaciekłością kochany i nienawidzony. Od momentu objęcia urzędu przez nowego prezydenta Pająk ma prawdziwe kłopoty. Uśmiechnięty poprzysiągł go zniszczyć. A wcześniej całkowicie skompromitować. W Mieście, w którym wszystko można kupić, ukraść lub wyprodukować, tylko Prawda jest towarem deficytowym, a Jeruzalem jest jedynym człowiekiem, który zdecydował się utrzymać ją na rynku – bez względu na cenę.','TRANSMETROPOLITAN, TOM 3 (9788328134195)','egmont','','','EGMONT','TRANSMETROPOLITAN, TOM 3 (9788328134195)','','','',''),(1452,1,1,'Czwarty tom cyberpunkowej, transhumanistycznej serii autorstwa Warrena Ellisa z rysunkami Daricka Robertsona. Historia dziennikarza śledczego i jego walki o Prawdę w skorumpowanym świecie. Pająk Jeruzalem zepchnięty do podziemia wraz ze swymi lojalnymi (i paskudnymi) asystentkami, pozbawiony wszelkich wygód i zaszczuty niczym królik na torze psich wyścigów, przygotowuje się do partyzanckiej wojny medialnej z samym prezydentem Stanów Zjednoczonych Garym Callahanem, człowiekiem gotowym na wszystko!','TRANSMETROPOLITAN, TOM 4 (9788328141254)','egmont','','','EGMONT','TRANSMETROPOLITAN, TOM 4 (9788328141254)','','','',''),(1453,1,1,'Pająk Jeruzalem stracił pracę, mieszkanie i ubezpieczenie. Co więcej, właśnie zdiagnozowano u niego nieuleczalne zakażenie mózgu, które najpewniej w ciągu roku zmieni go w śliniące się warzywo. Asystentki szczerze go nienawidzą, a płatni zabójcy wynajęci przez prezydenta Stanów Zjednoczonych zaraz go dopadną. Lecz mimo bólu Pająk ma uśmiech na twarzy. Dlaczego? Bo czuje, że luźne wątki morderstwa i korupcji wkrótce się ze sobą splotą i że Prawda jest po jego stronie. ','TRANSMETROPOLITAN, TOM 5 (9788328141261)','egmont','','','EGMONT','TRANSMETROPOLITAN, TOM 5 (9788328141261)','','','',''),(1454,1,1,'Lata temu Killjoysi walczyli przeciwko tyranom z megakorporacji Better Living Industries i ta walka kosztowała ich życie. Przetrwała tylko jedna osoba – tajemnicza Girl. Dzisiaj, następcy oryginalnych Killjoysów działają na terenie Pustyni, gdzie BLI systematycznie pozbawia ludzkość jej indywidualnego charakteru. Gdy walka o wolność zaostrza się, Girl postanawia raz jeszcze założyć pelerynę i raz na zawsze pozbyć się korporacji BLI. Zawiera The True Lives of the Fabulous Killjoys #1–6','TRUE LIVES OF FABULOUS KILLJOYS TP (9781595824622)','dark-horse','','','DARK HORSE','TRUE LIVES OF FABULOUS KILLJOYS TP (9781595824622)','','','',''),(1455,1,1,'Pełna wdzięku, zabawna opowieść Asteriksa o tym, co przydarzyło się kilkuletniemu Obeliksowi. Wszyscy wiedzą, że Obeliks, kiedy był mały, wpadł do kociołka druida i od tamtej pory nie musi pić magicznego napoju, by mieć nadludzką siłę. Nie było jednak powszechnie wiadome, jak do tego doszło... Albert Uderzo we wstępie do albumu wspomina, jak powstała ta historia:\nTekst albumu został napisany przez René Goscinnego do numeru 291 dziennika PILOTE, wydanego 20 maja 1965 r. Dziennikowi towarzyszył wówczas slogan \"Pilote - O rany! Co za dziennik!\" (jak twierdzą niektórzy, czasopismo to reprezentuje złoty wiek komiksu francuskiego). Głównym tematem owego numeru była epoka galo-rzymska.\nTemat ten, rozwinięty w wielkiej Pilotoramie (rozkładówce planszowej), zapowiadała już okładka dziennika, przedstawiająca zilustrowaną przez J.L. Devaux słynną, choć niefortunną bitwę pod Alezją.Obok tytułu, nieodmiennie, jak co tydzień, Obeliks trzyma kartusz z datą oraz numerem gazety i pochylony nad sceną mruczy pod nosem: \"Gdybym tam był, nie poszłoby im tak gładko!!!\" Słowa Obeliksa nie są oczywiście dla nikogo tajemnicą. Nieco dalej, od strony 10 aż do 15 Greg z Achillesem Piętą wykładają prawdziwą historię Galów. Uczestniczy w niej Talonus Minuta, legionista CMXII manipuły XLVI centurii, nr matrykuły OOVII.\nOczywiście autorzy Asteriksa nie mogli przejść obojętnie wobec tego zagadnienia. Pozostając więc w tematyce asteriksowskiej, René Goscinny napisał dla dziennika tekst wyjaśniający, jak Obeliks wpadł do kociołka druida, kiedy był mały. Zilustrowałem go trzema skromnymi rysunkami.\n\"Asteriks\" ukazywał się mniej więcej od sześciu lat i w takim mniej więcej wieku bohater występował w tym opowiadaniu. Niedawno przeczytałem je z wielką przyjemnością i z dużą dawką emocji, bo niemal o nim zapomniałem.\nWłaśnie z myślą o licznych czytelnikach, którzy nie mieli okazji zapoznać się z nim w tamtych czasach, postanowiliśmy wydać je w postaci albumu, z większą liczbą ilustracji.\nByłem bardzo wzruszony, wracając jeszcze raz do tekstu mego starego przyjaciela, René Goscinnego. Teraz pozostało mi już tylko wyrażenie ostatniego życzenia: obyście czytali z taką samą przyjemnością, z jaką ja tekst ilustrowałem.','ASTERIKS 0 JAK OBELIKS WPADŁ DO KOCIOŁKA DRUIDA, KIEDY BYŁ MAŁY (9788328166851)','egmont','','','EGMONT','ASTERIKS 0 JAK OBELIKS WPADŁ DO KOCIOŁKA DRUIDA, KIEDY BYŁ MAŁY (9788328166851)','','','',''),(1456,1,1,'Dawno, dawno temu pokonany przez Juliusza Cezara pod Alezją Wercyngetoryks rzucił do stóp zwycięskiego Rzymianina swoją broń. Wśród wspaniałego oręża była imponująca tarcza, którą z pola bitwy zabrał pewien rzymski łucznik. Wkrótce jednak żołnierz przegrał tarczę w domino. Jej nowy właściciel, legionista, został przyłapany bez przepustki i musiał oddać zdobycz podpitemu centurionowi. Ten zaś oddał ją pewnemu sprzedawcy wina za amforę trunku, który z kolei...\nJakiś czas później Juliusz Cezar zostaje zaalarmowany, że w Arwernii nadal dochodzi do ataków na Rzymian. Postanawia zatem złamać opór podbitego ludu i ostatecznie go upokorzyć. Chce pojawić się w Gergowii, stolicy Arwernii, niesiony na tarczy Wercyngetoryksa. Ale tarczę trzeba najpierw znaleźć...','ASTERIKS 11 TARCZA ARWERNÓW (9788323724759)','egmont','','','EGMONT','ASTERIKS 11 TARCZA ARWERNÓW (9788323724759)','','','',''),(1457,1,1,'Komiks wydany we Francji w 1968 roku z okazji zimowej olimpiady w Grenoble. Do rzymskiego obozu Akwarium nadchodzi wiadomość, że Klaudiusz Twardzielus, mistrz sportu, został wybrany, by reprezentować Rzym na Igrzyskach Olimpijskich. Nieustraszeni Galowie także chcą wziąć udział w zawodach, ale w Igrzyskach wolno uczestniczyć tylko rdzennym Grekom i wolnym obywatelom helleńskim. Dlatego sprytni Galowie mianują się na ten czas Rzymianami i typują do startu Asteriksa i Obeliksa. Okazuje się jednak, że zawodnicy nie mogą stosować żadnych środków dopingujących, a za taki należy uznać magiczny wywar. Mimo to postanawiają się nie poddawać i decydują, że wystartuje sam Asteriks. Niestety, bez magicznego wywaru Asteriks przegrywa kolejne konkurencje. Dopiero dzięki podstępowi Panoramiksa Galowie kolejny raz udowadniają, że są niepokonani.','ASTERIKS 12 NA IGRZYSKACH OLIMPIJSKICH (9788328170599)','egmont','','','EGMONT','ASTERIKS 12 NA IGRZYSKACH OLIMPIJSKICH (9788328170599)','','','',''),(1458,1,1,'Do jedynej galijskiej wioski, która nie płaci podatków Rzymianom, przybywa wódz Amoralfiks, by ukryć pieniądze przed rzymskimi poborcami. Wódz Asparanoiks postanawia pomóc rodakowi i przechować kociołek pełen sestercji. Zleca to zadanie Asteriksowi. Dzielny wojownik czuwa całą noc, by nad ranem przekonać się, że pieniądze zniknęły! Asparanoiks uważa, że cała wioska straciła honor i skazuje Asteriksa na wygnanie. Wraz z nim osadę opuszczają wierni przyjaciele - Obeliks i Idefiks. Asteriks i Obeliks nie mogą pogodzić się z perspektywą życia w niesławie, postanawiają więc jak najszybciej zarobić pieniądze i zwrócić je Amoralfiksowi. Chwytają się wszystkich sposobów: szukają gotówki w obozie rzymskim Delirium, napadają na piratów, handlują dzikami, walczą na arenie z gladiatorami, próbują swych sił w teatrze, grają na wyścigach. Gdy w żaden sposób nie udaje im się napełnić kociołka, pozostaje ostateczne rozwiązanie - napad na bank rzymski...','ASTERIKS 13 ASTERIKS I KOCIOŁEK (9788328170902)','egmont','','','EGMONT','ASTERIKS 13 ASTERIKS I KOCIOŁEK (9788328170902)','','','',''),(1459,1,1,'Kiedy Juliusz Cezar podbił Hiszpanię i już planował swój triumf w Rzymie, okazało się, że jedna, jedyna osada stawia opór najeźdźcom... Cezar postanawia osobiście zająć się problemem i by zmusić wodza Cebullanke Y Grzankę do posłuszeństwa Rzymowi, porywa jego syna Pepe. Chłopiec zostaje wysłany do obozu Rabarbarum w Galii. W czasie podróży daje się legionistom we znaki, aż w końcu ucieka im w armorykańskim lesie i wpada... wprost na brzuch Obeliksa. Asteriks postanawia zabrać chłopca do wioski. Pepe jest rozkapryszonym, nieznośnym dzieckiem – gryzie, kopie i domaga się specjalnych względów. I choć nasi Galowie nie zamierzają oddać chłopca Rzymianom, szybko dochodzą do przekonania, że Pepe powinien zostać przekazany rodzinie. Zadanie mają wykonać Asteriks i Obeliks. Rozpoczyna się pełna przygód podróż do Hiszpanii. Bohaterowie nie wiedzą jednak, że towarzyszący im hiszpański wieśniak Panietaniec y Mostawinion to Klaudiusz Niemocjusz, który tylko czeka, by przechwycić Pepe i wywieźć do Rabarbarum.','ASTERIKS 14 W HISZPANII (9788328170605)','egmont','','','EGMONT','ASTERIKS 14 W HISZPANII (9788328170605)','','','',''),(1460,1,1,'W znanej nam galijskiej wiosce panują dobre obyczaje, wzajemna życzliwość i zgoda. W Rzymie natomiast senatorowie i Cezar rozgrywają polityczne porachunki. Władca imperium żąda pieniędzy i wojska na nowe wyprawy, ale opozycja uważa, że należy najpierw zaprowadzić porządek w krajach już podbitych. Właściwie chodzi konkretnie o małą wioskę w Armoryce, która niezmiennie stawia opór legionom. Rzymianie wiedzą, że siłą nie są w stanie złamać Galów, dopóki ci ostatni mają magiczny wywar druida Panoramiksa. Cezar zwołuje więc naradę, podczas której rodzi się chytry plan pokonania Galów za pomocą perfidnej intrygi. Do wioski Asteriksa wyrusza Tuliusz Destrukcjusz, wytrawny siewca niezgody, z zamiarem skłócenia Galów, by stali się całkowicie niezdolni do wspólnego działania. Już pierwszego dnia Tuliusz odnosi spore sukcesy, a na skutki plotek, obelg i podważania wszelkich autorytetów nie trzeba długo czekać.','ASTERIKS 15 NIEZGODA (9788323761341)','egmont','','','EGMONT','ASTERIKS 15 NIEZGODA (9788323761341)','','','',''),(1461,1,1,'Czy Asteriks z Obeliksem kiedykolwiek oddali przysługę Imperium Rzymskiemu? Czy na ucztę w galijskiej wiosce mógł zostać zaproszony Rzymianin? Odpowiedzi na te pytania znajdują się w kolejnym tomie przygód dzielnych wojowników. Tym razem wyruszają oni do górzystego kraju Helwetów, by odnaleźć i przywieźć do domu kwiat szarotki, zwany srebrną gwiazdką.Bohaterowie poznają nowy kraj i zwyczaje jego mieszkańców: umiłowanie porządku, punktualność i dyskrecję. Niestety, wyprawa do Helwecji to nie jest wycieczka krajoznawcza. Śladem Asteriksa i Obeliksa podążają żołnierze wysłani przez rzymskich namiestników, którzy za wszelką cenę chcą udaremnić powrót bohaterów do Galii. Za tym wszystkim kryje się prawdziwie kryminalna intryga – z próbą zabójstwa i wątkiem korupcyjnym. Jednak Galów nawet w największych opałach nie opuszcza dobry humor.','ASTERIKS 16 U HELWETÓW (9788328158276)','egmont','','','EGMONT','ASTERIKS 16 U HELWETÓW (9788328158276)','','','',''),(1462,1,1,'Kiedy mimo wielokrotnych prób legionom Juliusza Cezara nie udało się podbić Galów z jednej jedynej armorykańskiej osady, władca Rzymu postanowił zmienić taktykę. Doszedł do wniosku, że skoro Galów nie można pokonać, należy ich ucywilizować, czyli „odgalizować”. Temu celowi ma służyć wspaniałe, nowe osiedle wybudowane w bezpośrednim sąsiedztwie osady Asteriksa i Obeliksa. Stąd rzymskie obyczaje, prawo i kultura będą się udzielać Galom, stopniowo zmieniając ich w obywateli Rzymu i dobrowolnych poddanych Cezara. Pewnej nocy rozpoczyna się wyrąb lasu pod plac budowy…Czy plan Juliusza Cezara ma szansę powodzenia, skoro nawet pies Obeliksa, Idefiks, nie znosi, kiedy ktoś „krzywdzi” drzewa w puszczy?','ASTERIKS 17 OSIEDLE BOGÓW (9788328158733)','egmont','','','EGMONT','ASTERIKS 17 OSIEDLE BOGÓW (9788328158733)','','','',''),(1463,1,1,'Przy okazji zakupów w stolicy Galii Lutecji Asparanoiks i jego małżonka Dobromina składają wizytę krewnym – Homeopatiksowi i Galantynie. Wódz osady niezwyciężonych Galów nie przepada za swoim szwagrem, człowiekiem zamożnym i światowym. Podczas wytwornej, lecz suto zakrapianej, kolacji między gospodarzem i gościem wywiązuje się zawzięta dyskusja na temat życiowych priorytetów. Asparanoiks uważa, że nie sukces i pieniądze decydują o szczęściu w życiu, lecz sława! By przekonać Homeopatiksa, że nie ma wśród Galów dzielniejszych ludzi niż mieszkańcy jego wioski, wódz obiecuje, że wkrótce zaprosi szwagra do siebie i ugości go potrawką przyprawioną liśćmi laurowymi z wieńca Juliusza Cezara! Asteriks i Obeliks, na których spada to karkołomne zadanie, wyruszają zatem do Rzymu, aby zdobyć tytułowe laury Cezara.','ASTERIKS 18 LAURY CEZARA (9788323761280)','egmont','','','EGMONT','ASTERIKS 18 LAURY CEZARA (9788323761280)','','','',''),(1464,1,1,'W czasie szalejącej burzy w wiosce Galów zjawia się przedziwny wędrowiec. Nazywa się Gaduliks i jest wróżbitą. Poproszony o przepowiednię, ujawnia, że… po burzy nastanie piękna pogoda, a Galowie wkrótce się pokłócą! Obie wróżby spełniają się błyskawicznie! Na nic zdają się argumenty Asteriksa, który próbuje przywołać współmieszkańców do rozsądku i przekonać ich, że wróżbita to zwykły oszust. Rozbudzona w Galach chęć poznania wyroków losu wywołuje całą serię zabawnych zdarzeń. Gaduliks wygodnie urządza się na pobliskiej leśnej polanie (by swoją obecnością w wiosce nie drażnić Asteriksa i Obeliksa). Codziennie – w tajemnicy jedni przed drugimi – odwiedzają go mieszkańcy wioski. Każdy wraca jak zaczarowany, a kiedy sam Obeliks robi się dziwnie rozmarzony, Asteriks rusza do lasu, by sprawdzić, co tam się dzieje…','ASTERIKS 19 WRÓŻBITA (9788328152649)','egmont','','','EGMONT','ASTERIKS 19 WRÓŻBITA (9788328152649)','','','',''),(1465,1,1,'Każdy rzymski legionista, któremu udało się przetrwać dwudziestoletnią służbę wojskową, dostawał od Juliusza Cezara niewielką posiadłość ziemską w podbitych krajach. Taki dar otrzymał również Romeomontekus, mimo że jako nałogowy pijak i awanturnik nieustannie sprawiał problemy swoim przełożonym, a w dodatku obrażał samego Cezara. Czyżby władca Rzymu był nadzwyczaj wspaniałomyślny? A może raczej perfidnie mściwy – skoro w akcie darowizny zapisał żołnierzowi wioskę niezwyciężonych Galów w Armoryce! Romeomontekus jednak nie miał okazji się o tym przekonać, bo błyskawicznie sprzedał podarunek Cezara oberżyście Ortopediksowi. Gdy szczęśliwy nowy właściciel wraz z rodziną dociera do wioski, rozpoczyna się pełna zwrotów akcji przygoda, w której przyjaźń Asteriksa i Obeliksa zostanie poddana próbie…','ASTERIKS 21 PODARUNEK CEZARA (9788328170162)','egmont','','','EGMONT','ASTERIKS 21 PODARUNEK CEZARA (9788328170162)','','','',''),(1466,1,1,'Dwaj Galowie, których zadaniem jest noszenie na tarczy wodza Asparanoiksa zatruli się nieświeżą rybą… Tak zaczyna się kolejna awantura między mieszkańcami galijskiej wioski. Brak świeżych ryb sprawia, że Asteriks i Obeliks wypływają w morze. A ponieważ nie mają żadnego doświadczenia jako rybacy – zamiast zarzucić sieć, po prostu ją wyrzucają. Potem zaczyna się sztorm i łódź bohaterów zaczyna płynąć w nieznanym kierunku. Kiedy dobija do jakiegoś lądu, Galowie są tak głodni, że zajadają się… indykiem nadziewanym niedźwiedziem! Przystrojonych w pióropusze tubylców biorą za Rzymian, potem za Traków albo Kreteńczyków i usilnie starają się opowiedzieć dziwnym mieszkańcon nieznanej krainy, kim są. Kiedy jednak wódz wioski zamierza ożenić Obeliksa ze swoją córką, przyjaciele wsiadają do dziurawej łodzi i odpływają – byle dalej. Na morzu napotykają wikingów i trafiają do ich krainy – jako przedstawiciele nowego świata!','ASTERIKS 22 WIELKA PRZEPRAWA (9788323761365)','egmont','','','EGMONT','ASTERIKS 22 WIELKA PRZEPRAWA (9788323761365)','','','',''),(1467,1,1,'W galijskiej wiosce panuje dziwna atmosfera. W obecności Obeliksa wszyscy wymieniają porozumiewawcze spojrzenia i uśmieszki… Sprawa jednak szybko się wyjaśnia – z okazji urodzin Obeliksa jego przyjaciele przygotowali niespodziankę – możliwość poturbowania całego legionu rzymskiego z obozu Rabarbarum. Obeliks jest uszczęśliwiony i szczerze wzruszony, a Rzymianie… zdruzgotani! Złe wieści docierają do Juliusza Cezara, a ten pod wpływem młodego doradcy Kajusa Ekonomikusa postanawia raz na zawsze pozbawić Galów chęci do walki, czyniąc z nich niezdolnych do czynu dekadentów. W tym celu Ekonomikus przybywa do osady Obeliksa i za 200 sestercji kupuje od niego pierwszy menhir. Dalsze wypadki są zgodne z prawami wolnego rynku, którym rządzą podaż, popyt, nastroje przedsiębiorców i konsumentów oraz specjaliści od kreowania potrzeb.','ASTERIKS 23 OBELIKS I SPÓŁKA (9788328152656)','egmont','','','EGMONT','ASTERIKS 23 OBELIKS I SPÓŁKA (9788328152656)','','','',''),(1468,1,1,'Przez pewną galijską wioskę, podobną do osady Asteriksa, przebiega głęboki rów. Wykopali go sami mieszkańcy, by raz na zawsze odciąć się od sąsiadów z drugiej strony... Dwaj wodzowie wzajemnie się obrażają, czym skutecznie podsycają konflikt, aż do momentu, kiedy doradca jednego z nich, Paskudniks, wpada na pomysł, by sprowadzić Rzymian i przejąć pełną władzę.\nNa szczęście dzięki córce wodza, Fanzynie, i synowi drugiego wodza – Komiksowi – wieści docierają do Asparanoiksa, który postanawia nie dopuścić do tego, by Rzymianie dyktowali warunki Galijczykom.\nDo podzielonej wioski docierają Asteriks, Obeliks i druid Panoramiks, by wspomóc rodaków w potrzebie. Niestety, za późno – Rzymianie, którym zdrajca Paskudniks obiecał galijskich niewolników, szykują się do zajęcia części osady...','ASTERIKS 25 WIELKI RÓW (9788328152670)','egmont','','','EGMONT','ASTERIKS 25 WIELKI RÓW (9788328152670)','','','',''),(1469,1,1,'Kolejny album przezabawnych przygód niezwyciężonych Galów! Bard Kakofoniks cierpi na dziwną przypadłość – za każdym razem, gdy wydobywa z siebie głos, zaczyna padać deszcz. Okazuje się jednak, że jego choroba może być dla niektórych zbawienna – w dalekich Indiach panuje susza i jedynie Kakofoniks może sprowadzić tam obfite opady. Jeśli mu się nie uda, miejscowa księżniczka Reszehezada zostanie złożona w ofierze. Bard wraz z Asteriksem i Obeliksem oraz indyjskim fakirem wyruszają w długą i pełną niebezpieczeństw podróż. Czy zdążą na czas sprowadzić deszcz?','ASTERIKS 28 U RESZEHEZADY (9788323747567)','egmont','','','EGMONT','ASTERIKS 28 U RESZEHEZADY (9788323747567)','','','',''),(1470,1,1,'Juliusz Cezar otrzymuje od jednego z dowódców niezwykły podarunek – Kakofoniksa – słynnego galijskiego barda. Nieświadomy sytuacji bohater jest przekonany, że czekają go występy. Jednak Cezar nie okazuje zainteresowania muzycznym talentem Kakofoniksa i po stwierdzeniu, że ten nie nadaje się na gladiatora, postanawia rzucić go na pożarcie lwom w czasie igrzysk.\nNa ratunek spieszą Asteriks i Obeliks i, by dostać się do Koloseum, w którym ma być stracony ich towarzysz, postanawiają zostać gladiatorami.','ASTERIKS 3 ASTERIKS GLADIATOR (9788328166141)','egmont','','','EGMONT','ASTERIKS 3 ASTERIKS GLADIATOR (9788328166141)','','','',''),(1471,1,1,'Długo wyczekiwany, premierowy album o przygodach niezwyciężonych Galów! Piktowie to mieszkańcy starożytnej Szkocji, przerażający wojownicy z licznych klanów, których miano, nadane przez Rzymian, dosłownie oznacza „malowani ludzie”. Asteriks u Piktów jest, zgodnie z najlepszą tradycją przygód najsłynniejszego z Galów, barwną podróżą do krainy bogatych obyczajów oraz opowieścią o ludziach, którzy słynęli ze znakomitych gier słownych i gagów. Na forach czytelniczych czynione są zakłady i toczą się zażarte dyskusje... Whisky? Rzucanie pni? Dudy? Nazwiska na Mac? Początki Muru Hadriana i pochodzenie potwora z Loch Ness wreszcie ujawnione? A może nawet, kto wie, Galowie w kiltach... Totalna niespodzianka! Zwłaszcza że to pierwszy album stworzony przez nowych autorów – scenarzystę Jeana-Yvesa Ferriego oraz rysownika Didiera Conrada.','ASTERIKS 35 U PIKTÓW (9788328166110)','egmont','','','EGMONT','ASTERIKS 35 U PIKTÓW (9788328166110)','','','',''),(1472,1,1,'Dwa lata po sukcesie Asteriksa u Piktów postacie stworzone przez René Goscinnego i Alberta Uderzo powracają w nowym albumie napisanym przez Jean-Yvesa Ferriego i narysowanym przez Didiera Conrada. Znajdziecie tu wszystkie składniki magicznego napoju Asteriksa: historia Rzymu i dzieje Galów zostaną przejrzane i skorygowane przy użyciu gagów i kalamburów! Na Teutatesa! W październiku 2015 roku cała Galia będzie zajęta... czytaniem Papirusu Cezara!','ASTERIKS 36 PAPIRUS CEZARA (9788328166165)','egmont','','','EGMONT','ASTERIKS 36 PAPIRUS CEZARA (9788328166165)','','','',''),(1473,1,1,'Asteriks i Obeliks powracają wraz ze swoją 39. przygodą. Razem z najsłynniejszym z galijskich druidów, Panoramiksem, przygotowują się do wyruszenia w długą i tajemniczą podróż w poszukiwaniu dziwnej i przerażającej istoty – gryfa!\n\nSeria francuskich komiksów, wymyślona w 1959 roku przez scenarzystę i mistrza humoru René Goscinny’ego oraz rysownika Alberta Uderzo, od chwili premiery w październiku 1959 roku na łamach magazynu „Pilote” podbiła serca najpierw Francuzów i Belgów, a potem – stopniowo – reszty świata, stając się jednym z fenomenów kultury popularnej XX wieku.\n\nW tym roku świętujemy 60. urodziny słynnych Galów – Asteriksa, Obeliksa i ich przyjaciół.\"','ASTERIKS 39 ASTERIKS I GRYF (9788328160873)','egmont','','','EGMONT','ASTERIKS 39 ASTERIKS I GRYF (9788328160873)','','','',''),(1474,1,1,'Juliusz Cezar przybywa z wizytą do Aleksandrii i swej ukochanej Kleopatry. Między królewską parą dochodzi do sporu, czyj naród jest potężniejszy. Oburzona pychą Cezara Kleopatra zakłada się, że w trzy miesiące wybuduje wspaniały pałac na jego cześć i tym samym udowodni mu nieustająca wielkość Aleksandrii i jej mieszkańców. Cezar bez namysłu zgadza się na zakład, pewien, że Kleopatra przegra. Królowa powierza to karkołomne zadanie najlepszemu w Aleksandrii architektowi, Numerobisowi. Jeśli mu się nie powiedzie, zostanie rzucony krokodylom na pożarcie. Numerobis jest załamany i choć nie wierzy w sukces, przystępuje do budowy. Gdy w Aleksandrii zjawiają się dzielni Galowie - Asteriks i Obeliks - plan budowy pałacu zyskuje szansę powodzenia...','ASTERIKS 5 KLEOPATRA (9788328167261)','egmont','','','EGMONT','ASTERIKS 5 KLEOPATRA (9788328167261)','','','',''),(1475,1,1,'Rzymianie nie ustają w próbach podporządkowania sobie ostatniej opornej galijskiej osady! Tym razem planują podstępnie wykorzystać stary galijski obyczaj walki wodzów. Gdy jeden z wodzów wyzywa drugiego na pojedynek - ten nie może odmówić, a pokonany oddaje się wraz z całym ludem pod rządy zwycięzcy. Asparanoiksa ma pokonać kolaborujący z Rzymem galijski wódz Kolaboriks. Aby tak się stało, Asparanoiks nie może się napić dającego nadludzką siłę magicznego wywaru, który sporządza druid Panoramiks. Rzymianie szykują więc na druida zasadzkę w lesie, gdy ten idzie po zioła potrzebne do sporządzenia napoju. Jednak podstęp się nie udaje, gdyż czujni Asteriks i Obeliks w porę ich przepędzają. Niestety Obeliks tak niefortunnie rzuca menhirem, że głaz, zamiast w Rzymian, trafia Panoramiksa. Od tego uderzenia druidowi pomieszało się w głowie i nie pamięta receptury magicznego wywaru. Zbliżająca się walka wodzów wydaje się być dla nich przegrana. Jednak Galowie nie poddają się i wpadają na przebiegły pomysł...','ASTERIKS 6 WALKA WODZÓW (9788328170575)','egmont','','','EGMONT','ASTERIKS 6 WALKA WODZÓW (9788328170575)','','','',''),(1476,1,1,'Czy wiecie, co to jest strach? Dawni wikingowie nie wiedzieli. Postanowili zatem wyprawić się na południe, by mieszkające tam ludy nauczyły ich trząść się ze strachu jak osiki. Cóż, bitni Normanowie trafili akurat na Galów, którzy też nie wiedzieli, czym jest strach. Na szczęście w wiosce pojawił się młodziutki krewny wodza Asparanoiksa - Skandaliks, który okazał się straszliwym tchórzem. Tylko od niego wikingowie mogą się dowiedzieć, co oznacza wyrażenie \"bać się\", a jedynym sposobem na zdobycie tej wiedzy jest porwanie młodego Gala.','ASTERIKS 9 NORMANOWIE (9788328170896)','egmont','','','EGMONT','ASTERIKS 9 NORMANOWIE (9788328170896)','','','',''),(1477,1,1,'Drugie wydanie niezwykle popularnej na całym świecie serii komiksowej. Premierowe odcinki przygód sześcioletniego Calvina, który wierzy, że jego pluszowa zabawka Hobbes to prawdziwy tygrys, ukazywały na łamach wielu gazet w latach 1986–1995. Do dziś, mimo że autor zakończył pracę nad serią, ukazują się wznowienia w prasie, albumy zbiorcze i edycje kolekcjonerskie. Kiedy Bill Watterson porzucił pracę agencji reklamowej, by poświęcić się tworzeniu komiksów, nie przypuszczał, że po niemal 30 latach jego humor będzie nadal tak znakomicie odbierany. Przygody Calvina i Hobbesa śmieszą, bawią i często zmuszają do refleksji. Każdy z albumów serii składa się z luźno powiązanych historyjek, które można czytać w dowolnej kolejności. Calvin na co dzień zmaga się z rodzicami i ich ambicjami wychowawczymi, panią Kornik, która usiłuje go okiełznać w szkole oraz koleżanką Zuzią – istotą z obcej planety. A kiedy marzy, staje się bohaterskim astronautą Spiffem – odkrywcą nowych planet i pogromcą potworów.','CALVIN I HOBBES 2 COŚ SIĘ ŚLINI POD ŁÓŻKIEM WYDANIE II (9788323747703)','egmont','','','EGMONT','CALVIN I HOBBES 2 COŚ SIĘ ŚLINI POD ŁÓŻKIEM WYDANIE II (9788323747703)','','','',''),(1478,1,1,'Obyczajowa komedia w konwencji magicznego realizmu. Emilka jest mimem. Mieszka w niewidzialnym domu i nie umie wydawać dźwięków. Zaprzyjaźnia się z Natalią, niewidomą gitarzystką lekkoduchem. Wciąż wpada w nowe, przedziwne kłopoty. Komiks to mieszanka absurdalnego humoru z czułą opowieścią o relacjach międzyludzkich pokazujący, że świat można też postrzegać w nietypowy, niekonwencjonalny sposób. Komiks autorstwa scenarzysty Macieja Kura (autora serii „Kajko i Kokosz – Nowe Przygody” oraz „Lil i Put”) oraz rysowniczki Magdaleny „Meago” Kani.','EMILKA SZA - JAK WIELE TO NIC? (9788328160989)','egmont','','','EGMONT','EMILKA SZA - JAK WIELE TO NIC? (9788328160989)','','','',''),(1479,1,1,'Dowcipny, wytworny, elegancki i zwyczajnie zachwycający. Garfield urodził się (gdzieżby indziej) w kuchni włoskiej restauracji, w 1978 roku. Kiedy właściciel oddał go do sklepu zoologicznego, Garfield myślał, że już po nim. Ale udało mu się... Bo tego wiekopomnego dnia pewien pechowy dżentelmen, niejaki Jon Arbuckle, stanął w progu sklepu. Wierzcie lub nie, ale Garfield ważył wtedy niecałe 2,5 kilograma. Jednak dzięki cudownie obsesyjnej pasji do makaronów szybko stał się pierwszym grubym kotem Ameryki.','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 1 (9788328156739)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 1 (9788328156739)','','','',''),(1480,1,1,'Władca Lazanii panuje nad światem! Życie Garfielda pełne jest akcji. Tyle tylko, że obraca się wokół lodówki. Czy więc studiuje listę rzeczy, których dzisiaj nie ma zamiaru robić, czy testuje pierwsze prawo fizyki – „Ciała w spoczynku mają tendencję pozostawania w spoczynku”, czy wyzywa Odiego na konkurs nicnierobienia, możecie być pewni, że kiedy nadejdzie pora posiłku, Garfieldowi nie zabraknie energii.','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 10 (9788328159181)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 10 (9788328159181)','','','',''),(1481,1,1,'Ulubiony pręgowany tłuścioch wraca po kolejną czubatą porcję zabawy i jedzenia! Gdy Garfield gra w „rozgnieć pająka”, gdy winą za zjedzone ciasteczka obciąża swojego niewidzialnego przyjaciela Clive’a lub przeprowadza testy upadkowe Odiego, aby sprawdzić, czy „Sprężysty” to odpowiedni przydomek dla nieszczęsnego szczeniaka, kocisko zawsze roztacza wokół siebie aurę specyficznej miłości – i wesołości.\n\nGarfieldowy cykl TŁUSTYCH KOCICH TRÓJPAKÓW stanowi kolekcję komiksowych pasków zebranych w nowym kolorowym wydaniu. Garfield zmieniał się odrobinę na przestrzeni lat, ale jedno pozostało niezmienne: jego gigantyczny apetyt na jedzenie i zabawę. W tym tomie czeka was dużo szaleńczej radości z nienasyconym kotem w roli głównej – ponieważ nigdy dosyć mu psot!','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 11 (9788328159198)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 11 (9788328159198)','','','',''),(1482,1,1,'To już dwunasty album z tym leniwym kotem. Garfield nigdy nie odkłada na jutro tego, co może zjeść dzisiaj. Korpulentny kot lubi lazanię, adoruje anchois, nie biczy się na bekon. Przekąski pożera na pełny etat, wciąż jednak potrafi w ciasny rozkład dnia wcisnąć jedną czy drugą maratońską drzemkę. Czy kiedykolwiek się zmieni? Oczywiście, jeśli tylko Jon umówi się na randkę z supermodelką, a Odie dostanie Nagrodę Nobla.','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 12 (9788328150676)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 12 (9788328150676)','','','',''),(1483,1,1,'Zamknijcie lazanie! Przykujcie kurczaki! I trzymajcie się za boki... Ulubiony gruby kot Ameryki powraca – głodniejszy, śmieszniejszy, bardziej zadziorny i leniwy, i ogólnie bardziej uroczy niż kiedykolwiek! Złośliwy zwierzak wraca do starych sztuczek i kilku nowych przy okazji. Napada harcerkę, ucieka ze schroniska dla zwierząt, flirtuje ze swoją dziewczyną Arlene i oczywiście dokucza Odiemu, Jonowi i Nermalowi. Przecież złośliwość to jego całe życie!\nGarfieldowy cykl TŁUSTYCH KOCICH TRÓJPAKÓW stanowi kolekcję komiksowych pasków zebranych w nowym, kolorowym wydaniu. Garfield zmieniał się trochę na przestrzeni lat, ale jedno pozostało niezmienne: jego gigantyczny apetyt na jedzenie i poczucie humoru. Czeka was dużo szaleńczej radości z nienasyconym kotem, ponieważ nigdy dosyć zabawy.','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 2 (9788328135581)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 2 (9788328135581)','','','',''),(1484,1,1,'Czworonożny futrzany balon, którego czule nazywamy Garfieldem, zawsze chce więcej. A daje z siebie, co może, żeby w tym solidnym tomie zrywać boki ze śmiechu. Czy tłucze Odiego gazetą, ciska w Jona ciastem, stosuje dietę „tyle kawy, ile tylko wypijesz”, czy przemyka do samolotu, Garfield zawsze dba o to, żeby jego nieszczęsny właściciel się nie nudził, a wygłodniali czytelnicy znaleźli powód do śmiechu.','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 3 (9788328167346)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 3 (9788328167346)','','','',''),(1485,1,1,'Czworonożny futrzany balon, którego czule nazywamy GARFIELDEM, zawsze chce więcej. A daje z siebie, co może, żebyśmy czytając ten solidny tom zrywali boki ze śmiechu.','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 4 (9788328167353)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 4 (9788328167353)','','','',''),(1486,1,1,'Gdy właściciela nie ma w domu, kot tańcuje – zwłaszcza jeśli tym kotem jest Garfield, otyły praktyk zamętu i chaosu. Chociaż jednocześnie Garfield czerpie tyle samo – lub więcej – satysfakcji z czynionych zniszczeń, kiedy Jon jest na miejscu. Ataki na listonosza, mordowanie pizzy, dręczenie psa czy „delikatne” przypominanie Jonowi, że czas już na posiłek – wszystko to brzmi świetnie! ','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 5 (9788328142343)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 5 (9788328142343)','','','',''),(1487,1,1,'Garfieldowy cykl TŁUSTYCH KOCICH TRÓJPAKÓW stanowi kolekcję komiksowych pasków zebranych w nowym, kolorowym wydaniu w tłumaczeniu Piotra W. Cholewy. Garfield zmieniał się trochę na przestrzeni lat, ale jedno pozostało niezmienne: jego gigantyczny apetyt na jedzenie i poczucie humoru. Czeka was dużo szaleńczej radości z nienasyconym kotem, bo nigdy dosyć zabawy.','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 6 (9788328142350)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 6 (9788328142350)','','','',''),(1488,1,1,'Tłusty żartowniś nie rezygnuje i chwyta każdą okazję, żeby ponabijać się z Jona! Przez lata Garfield zdążył wyciąć wiele numerów swojemu nieszczęsnemu – i nieporadnemu – właścicielowi: przykleił mu telefon do ucha, wysmarował podeszwy tłuszczem, a kiedy Jon zasnął, ostrzygł go na irokeza (wiadomo, tego wina, kto sobie drzemkę ucina). Ale to tylko żarty. W głębi serca Garfield wie, że potrzebuje Jona. Kto inny zapłaciłby dostawcy pizzy? Usiądźcie wygodnie, rozluźnijcie się i przyłączcie do tłustego kocura na superobfitą ucztę prześmiesznych i szalonych wybryków!\n\nGarfieldowy cykl TŁUSTYCH KOCICH TRÓJPAKÓW stanowi kolekcję komiksowych pasków zebranych w nowym, kolorowym wydaniu w tłumaczeniu Piotra W. Cholewy. Garfield zmieniał się trochę na przestrzeni lat, ale jedno pozostało niezmienne: jego gigantyczny apetyt na jedzenie i poczucie humoru. Czeka was dużo szaleńczej radości z nienasyconym kotem, bo nigdy dosyć zabawy!','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 7 (9788328197275)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 7 (9788328197275)','','','',''),(1489,1,1,'Garfield uwielbia jedzenie. Niezależnie od tego, czy dusi stek bitą śmietaną, czy ściga uciekającego pączka, wielki łasuch jest zawsze w swojej żarłokowej chwale! Jeśli Garfield kocha jedzenie, to czego nienawidzi najbardziej? Diety! Pręgowany kot musi cierpieć, gdy usłyszy zniewagę od dietetycznej karmy dla kotów: „Hej, grubasie! Zjedz to!”. Ale nie obawiaj się, Garfield zawsze umie sobie to odbić, wykrecając się dowcipem lub uderzeniem w tył głowy Jona. Z przyjemnością pochłaniaj ten pikantny wybór kocich komiksów!\nGarfieldowy cykl TŁUSTYCH KOCICH TRÓJPAKÓW stanowi kolekcję komiksowych pasków zebranych w nowym, kolorowym wydaniu w tłumaczeniu Piotra W. Cholewy. Garfield zmieniał się trochę na przestrzeni lat, ale jedno pozostało niezmienne: jego gigantyczny apetyt na jedzenie i poczucie humoru. Czeka was dużo szaleńczej radości z nienasyconym kotem, bo nigdy dosyć zabawy!','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 8 (9788328198302)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 8 (9788328198302)','','','',''),(1490,1,1,'Dla Garfielda życie jest przygodą. Nie jest może fanem wycieczek na łono natury – jedyne krowy, jakie toleruje, to krówki – zawsze jednak jest chętny do zabawy. Czy zwycięża w grze w chowanego z niezbyt rozgarniętym psem Odiem, czy znajduje nową motywację dla turlania kłębka włóczki, czy skacze na drewnianej podłodze albo toczy walkę z klopsem, nigdy nie rezygnuje z ciekawych rozrywek.\nA więc niech zaczną się igrzyska! Garfieldowy cykl TŁUSTYCH KOCICH TRÓJPAKÓW stanowi kolekcję komiksowych pasków zebranych w nowym, kolorowym wydaniu w tłumaczeniu Piotra W. Cholewy. Garfield zmieniał się trochę na przestrzeni lat, ale jedno pozostało niezmienne: jego gigantyczny apetyt na jedzenie i poczucie humoru. Czeka was dużo szaleńczej radości z nienasyconym kotem, bo nigdy dosyć zabawy!','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 9 (9788328198319)','egmont','','','EGMONT','GARFIELD. TŁUSTY KOCI TRÓJPAK, TOM 9 (9788328198319)','','','',''),(1491,1,1,'Jest 52 rok przed narodzeniem Chrystusa. Cała Lutecja jest podbita przez Rzymian… Cała? Nie! Grupa nieugiętych zwierząt dowodzona przez Idefiksa nadal opiera się najeźdźcy!\nPo pokonaniu galijskiego przywódcy Kamulogena przez generała Labienusa dzielny piesek Idefiks organizuje ruch oporu, żeby bronić galijskiego miasta przed rzymskim okupantem. Idefiks wraz ze swoją przyjaciółką Frygą, kocicą Przecherą i buldogiem Rygoriksem przychodzi z pomocą tym, którzy ponieśli konsekwencje rzymskiej okupacji… Na Teutatesa, tak im dadzą popalić, że Rzymianie zapomną od tego języka (łacińskiego) w gębach!','IDEFIKS I NIEUGIĘCI TOM 1 W TEJ DZIELNICY ŻADNEJ ŁACINY (9788328155282)','egmont','','','EGMONT','IDEFIKS I NIEUGIĘCI TOM 1 W TEJ DZIELNICY ŻADNEJ ŁACINY (9788328155282)','','','',''),(1492,1,1,'Czwarty album z serii Kajko i Kokosz - Nowe Przygody, zatytułowany „Zaćmienie o zmierzchu”. Kiedy zbliża się zaćmienie, nikt nie może spać spokojnie. Kajko i Kokosz, prześladowani przez tajemniczą i groźną zjawę. Mirmił i Lubawa, których odwiedza Wojmił przynoszący niezwykłą wiadomość. Łamignat, próbujący odnaleźć swoją maczugę. Nawet Zbójcerze podejrzewają, że coś opętało Hegemona, bo zachowuje się zupełnie inaczej, niż zwykle. Aby opanować sytuację, Kajko i Kokosz będą musieli wziąć udział w wielkiej wyprawie, łyknąć specjalny eliksir Jagi i zorganizować… wesele. Aby do zmierzchu! Kontynuacji kultowej serii Janusza Christy podjęli się – w swoim stylu, ale z wielkim szacunkiem dla ducha oryginału – znani polscy scenarzyści i rysownicy: Maciej Kur, Sławomir Kiełbus i Piotr Bednarczyk. Album jest drugą po „Królewskiej konnej”, pełnometrażową opowieścią z cyklu Kajko i kokosz - Nowe Przygody.','KAJKO I KOKOSZ - NOWE PRZYGODY, TOM 4 ZAĆMIENIE O ZMIERZCHU (9788328198746)','egmont','','','EGMONT','KAJKO I KOKOSZ - NOWE PRZYGODY, TOM 4 ZAĆMIENIE O ZMIERZCHU (9788328198746)','','','',''),(1493,1,1,'KAJKO I KOKOSZ pojawili się na łamach trójmiejskiej popołudniówki „Wieczór Wybrzeża” w 1972 i stali się jednymi z najbardziej rozpoznawalnych bohaterów polskiej popkultury. Cykl Janusza Christy (1934-2008) opowiada o dwóch wojach – dzielnym i rozważnym Kajku oraz żarłocznym i nieco samolubnym Kokoszu, którzy bronią Mirmiłowa oraz przeżywają mnóstwo zabawnych przygód. ','KAJKO I KOKOSZ - ZŁOTA KOLEKCJA TOM 1 (9788328166455)','egmont','','','EGMONT','KAJKO I KOKOSZ - ZŁOTA KOLEKCJA TOM 1 (9788328166455)','','','',''),(1494,1,1,'Kajko i Kokosz pojawili się na łamach trójmiejskiej popołudniówki „Wieczór Wybrzeża” w 1972 r. i stali się jednymi z najbardziej rozpoznawalnych bohaterów polskiej popkultury. Cykl Janusza Christy (1934-2008) opowiada o dwóch wojach – dzielnym i rozważnym Kajku oraz żarłocznym i nieco samolubnym Kokoszu, którzy bronią Mirmiłowa oraz przeżywają mnóstwo zabawnych przygód. ZŁOTA KOLEKCJA to wyjątkowa, jubileuszowa edycja z okazji 50-lecia serii.\n\nKolekcja składa się z sześciu tomów, w których zebrane zostaną wszystkie komiksy „Kajko i Kokosz” – w kolejności chronologicznej i poddane renowacji kolorystycznej. Dodatkiem do każdego albumu jest obszerne posłowie Krzysztofa Janicza, zawierające wiele cennych informacji i ciekawostek o historii serii oraz samym Januszu Chriście. Czytelnicy znajdą też liczne archiwalne zdjęcia, okładki, ilustracje i szkice.\n\nTom drugi kolekcji zawiera długą historię „Szranki konkury” poprzedzoną wstępem dziennikarki „Dziennika Bałtyckiego” Grażyny Antoniewicz.','KAJKO I KOKOSZ - ZŁOTA KOLEKCJA TOM 2 (9788328149830)','egmont','','','EGMONT','KAJKO I KOKOSZ - ZŁOTA KOLEKCJA TOM 2 (9788328149830)','','','',''),(1495,1,1,'Kajko i Kokosz pojawili się na łamach trójmiejskiej popołudniówki „Wieczór Wybrzeża” w 1972 i stali się jednymi z najbardziej rozpoznawalnych bohaterów polskiej popkultury. Cykl Janusza Christy (1934-2008) opowiada o dwóch wojach – dzielnym i rozważnym Kajku oraz żarłocznym i nieco samolubnym Kokoszu, którzy bronią Mirmiłowa oraz przeżywają mnóstwo zabawnych przygód. ZŁOTA KOLEKCJA to wyjątkowa, jubileuszowa edycja z okazji 50-lecia serii. Kolekcja składa się z sześciu tomów, w których zebrane zostaną wszystkie komiksy „Kajko i Kokosz” – w kolejności chronologicznej i poddane renowacji kolorystycznej. Dodatkiem do każdego albumu jest obszerne posłowie Krzysztofa Janicza, zawierające wiele cennych informacji i ciekawostek o historii serii oraz samym Januszu Chriście. Czytelnicy znajdą też liczne archiwalne zdjęcia, okładki, ilustracje i szkice.','KAJKO I KOKOSZ - ZŁOTA KOLEKCJA TOM 3 (9788328149847)','egmont','','','EGMONT','KAJKO I KOKOSZ - ZŁOTA KOLEKCJA TOM 3 (9788328149847)','','','',''),(1496,1,1,'Kajko i Kokosz zostali rodzicami. Przybranymi co prawda, ale jednak. A wszystko zaczęło się od jajka. Przyjaciele znaleźli je w lesie, a to, co się z niego wykluło, podbiło serca wojów, ale i zmasakrowało spokój niejednego mieszkańca Mirmiłowa, a zwłaszcza kasztelana tego szlachetnego grodu. Mowa oczywiście o smoku Milusiu, nad którym nawet Kajko i Kokosz nie potrafią zapanować. Szczególnie gdy smoczek-jarosz wpada w panikę na widok myszy. Kiedy w końcu miarka się przebiera i Mirmił traci cierpliwość do wyskoków Milusia, skazuje niesfornego zwierzaka i jego opiekunów na wygnanie. Cała trójka próbuje zadomowić się w leśnej głuszy, ale nie jest to wcale takie proste. Zwłaszcza gdy podstępni Zbójcerze próbują porwać straszliwą smoczą bestię i wykorzystać ją do swoich niecnych celów... Zamach na Milusia to kolejny album najpopularniejszej serii komiksowej autorstwa Janusza Christy (1934-2008). Cykl opowiada o dwóch wojach - dzielnym i rozważnym Kajku oraz żarłocznym i samolubnym Kokoszu, którzy bronią Mirmiłowa przed atakami Zbójcerzy pod wodzą Hegemona oraz przeżywają całą masę zabawnych przygód. Na lekturze komiksów Janusza Christy - humorystycznych, pełnych błyskotliwych dialogów, dynamicznych rysunków i niezapomnianych bohaterów - wychowywało się kilka pokoleń polskich czytelników. Christa opublikował ponad 30 albumów komiksowych i do dziś pozostaje jednym z najpopularniejszych polskich twórców tego gatunku.','KAJKO I KOKOSZ – ZAMACH NA MILUSIA (9788328166356)','egmont','','','EGMONT','KAJKO I KOKOSZ – ZAMACH NA MILUSIA (9788328166356)','','','',''),(1497,1,1,'Kajko i Kokosz pojawili się na łamach trójmiejskiej popołudniówki „Wieczór Wybrzeża” w 1972 i stali się jednymi z najbardziej rozpoznawalnych bohaterów polskiej popkultury. Cykl Janusza Christy (1934–2008) opowiada o dwóch wojach – dzielnym i rozważnym Kajku oraz żarłocznym i nieco samolubnym Kokoszu, którzy bronią Mirmiłowa oraz przeżywają mnóstwo zabawnych przygód.','KAJKO I KOKOSZ – ZŁOTA KOLEKCJA TOM 4 (9788328149854)','egmont','','','EGMONT','KAJKO I KOKOSZ – ZŁOTA KOLEKCJA TOM 4 (9788328149854)','','','',''),(1498,1,1,'„Kajko i Kokosz – We Krajinie Borostraszkōw\" (czyli „W Krainie Borostworów\") to drugi album przetłumaczony na język śląski (przed laty nakładem wydawnictwa Egmont w sprzedaży ukazał się album „Kajko i Kokosz – Szkoła furganio\").\n\nCykl opowiada o dwóch wojach – dzielnym i rozważnym Kajku oraz żarłocznym i samolubnym Kokoszu, którzy bronią Mirmiłowa przed atakami niecnych Zbójcerzy pod wodzą Hegemona i przeżywają masę zabawnych przygód. Komiks powstawał w latach 70. i 80. XX wieku i był jedną z wizytówek czasopisma młodzieżowego „Świat Młodych”. W 2003 roku wydawnictwo Egmont Polska wznowiło serię, a dzięki tej reedycji wszystkie części komiksu ukazały się po raz pierwszy w kolorze. Mieszkańcy Mirmiłowa uwielbiają zabawy, a w wymyślaniu pretekstów do świętowania są prawdziwymi mistrzami. Właśnie skończyli obchody Dnia Dobroci dla Krów, a już zaczynają cieszyć się z najważniejszej uroczystości – ku czci Czystej Wody. Tymczasem Zbójcerze mają już plan, jak zakłócić mirmiłowianom ten piękny i radosny czas, a w efekcie – przejąć władzę nad ich grodem. Kapral wyznacza ochotnika do misji samobójczej: zbójcerz słynący z unikania wszelkich form mycia się i czyszczenia ma wskoczyć do studni w Mirmiłowie i skazić jej wodę po wsze czasy. O dziwo plan Kaprala zostaje zrealizowany w stu procentach! Woda zostaje zatruta, a gród – pozbawiony życiodajnego płynu. Co robić? Rozwiązanie podsuwa Czarownica Jaga: czystą wodę i szczęśliwość może przywrócić grodowi tylko Pani Przyroda, która mieszka w Krainie Borostworów – dalekiej i dzikiej. Z taką misją mogą wyruszyć tylko oni – dwaj niezawodni wojowie Kajko i Kokosz.\n\nNiezwykły, wyjątkowo barwny i dosadny język śląski w połączeniu z unikalnym humorem Chirsty to znakomita zabawa, a przy okazji materiał pomocniczy przy kultywacji tego języka.','KAJKO I KOKOSZ (EDYCJA ŚLĄSKA) WE KRAJINIE BOROSTRASZKŌW (9788328149373)','egmont','','','EGMONT','KAJKO I KOKOSZ (EDYCJA ŚLĄSKA) WE KRAJINIE BOROSTRASZKŌW (9788328149373)','','','',''),(1499,1,1,'W spokojnym grodzie księcia Mirmiła nie dzieje się dobrze. Władcę denerwuje plaga nadmiernie rozmnożonych kur, nadworny szambelan spiskuje, a zrzędliwa żona nie pozwala księciu na jedyną rozrywkę zdolną ukoić nerwy - na picie miodu z rodowego skarbu: Złotego Pucharu. Na dodatek do grodu przybywa kompania zbrojnych obwiesi spod znaku Czarnego Trójkąta. Po wizycie niebezpiecznych gości znikają wszystkie kury (co Mirmił przyjmuje z ulgą), kilka tłustych krów (cóż, zdarza się) oraz Złoty Puchar - a tego książę, jak sam twierdzi, nie będzie w stanie przeżyć! Zrozpaczony, wysyła swoich najlepszych wojów, Kajka i Kokosza, by odnaleźli jego skarb, bo inaczej umrze ze zgryzoty.','KAJKO I KOKOSZ, TOM 1 ZŁOTY PUCHAR, CZĘŚĆ 1 (9788328166325)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 1 ZŁOTY PUCHAR, CZĘŚĆ 1 (9788328166325)','','','',''),(1500,1,1,'Nieopodal Mirmiłowa własną warownię zbudowali niegodni miana rycerzy okrutni Zbójcerze, których wodza, Krwawego Hegemona, najbardziej złościło, kiedy słyszał, że nie ma poczucia humoru. Pewnego dnia postanowił zdobyć gród kasztelana Mirmiła, a atak rozpocząć od opanowania Klubo-Gospody, aby tym posunięciem szybko złamać ducha obrońców. Dzięki Kajkowi i Kokoszowi szturm zostaje odparty, dlatego Hegemon wymyśla sposób na pozbycie się obu wojów z grodu. Namawia kasztelana, aby ten spełnił swe największe marzenie i wraz z przybocznymi wyruszył na Łysą Górę znajdującą się w kraju Omsów, gdzie czarownice nauczą go latać.','KAJKO I KOKOSZ, TOM 10 SZKOŁA LATANIA (9788328170537)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 10 SZKOŁA LATANIA (9788328170537)','','','',''),(1501,1,1,'Zbliża się wielki turniej, dlatego kasztelan Mirmił cierpi na coraz ostrzejszy ból głowy. Nie dość, że na darmo ogłosił soboty wolnymi, bo żona i tak nie pozwala mu się wysypiać, nie dość, że nie może spokojnie zająć się wędkowaniem, bo mieszkańcy grodu hałasują i płoszą ryby w fosie, to jeszcze Zbójcerze wymyślają co i rusz nowe sposoby na podbijanie Mirmiłowa. I jeszcze to Święto Barana! Każdy kasztelan ma, zgodnie z tradycją, wystawić na baranich zawodach własnego zawodnika. A w Mirmiłowie nie ma ani jednego barana! Na szczęście są wierni wojowie Kajko i Kokosz, którzy wyruszą w góry i może tam znajdą zawodnika, który świetnie bodzie? Gorzej, że na pomysł wystawienia własnego barana wpadli też Zbójcerze. Wielki turniej tuż tuż! Kajko i Kokosz to najpopularniejsza seria komiksowa autorstwa Janusza Christy (1934-2008). Cykl opowiada o dwóch wojach - dzielnym i rozważnym Kajku oraz żarłocznym i samolubnym Kokoszu, którzy bronią Mirmiłowa przed atakami niecnych Zbójcerzy i przeżywają całą masę zabawnych przygód. Komiks powstawał w latach 70. i 80. XX wieku i był jedną z wizytówek czasopisma młodzieżowego „Świat Młodych”. W 2003 roku wydawnictwo Egmont Polska wznowiło serię, wydało również 3 edycje specjalne komiksu w językach regionalnych. Przygody Kajka i Kokosza doczekały się także adaptacji dla miłośników gier planszowych (Wielki Wyścig) i gier komputerowych (Twierdza Czarnoksiężnika). W 2016 r. ukazał się pierwszy tom nowych przygód Kajka i Kokosza stworzony przez młodych polskich scenarzystów i rysowników komiksowych w hołdzie dla Janusza Christy.','KAJKO I KOKOSZ, TOM 11 WIELKI TURNIEJ (9788328166301)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 11 WIELKI TURNIEJ (9788328166301)','','','',''),(1502,1,1,'Kajko czy Kokosz? Który z wojów dostanie skierowanie na wczasy? Obaj zasłużyli, ale Referent do Spraw Turystyki i Wypoczynku przywiózł tylko jedno skierowanie... Na szczęście Lubawa, żona kasztelana Mirmiła, jest nie tylko gospodarną, ale i mądrą kobietą, wpada więc na pomysł, by na turystyczną wyspę plemienia Ranów wysłać oficjalnie Kajka, a Kokosz dołączyłby do niego na gapę. Przyjaciele jadą więc na wypoczynek, który, jak się okaże, wymaga wyjątkowo dużo wysiłku, bo i problemów jest niemało na wczasach. Wszystko zaczyna się od konfliktu z arcykapłanem boga Porewita (oraz miłośnikiem miodu i hipnozy), a później wojowie lądują w warowni wikingów. Na szczęście wieści o ich krwiożerczości okazują się mocno przesadzone. A w tym samym czasie w okolicy Mirmiłowa Zbójcerze knują, jak wykorzystać nieobecność obrońców grodu i wreszcie go zdobyć... Na wczasach to kolejny album najpopularniejszej serii komiksowej autorstwa Janusza Christy (1934-2008). Cykl opowiada o dwóch wojach - dzielnym i rozważnym Kajku oraz żarłocznym i samolubnym Kokoszu, którzy bronią Mirmiłowa przed atakami niecnych Zbójcerzy pod wodzą Hegemona i przeżywają całą masę zabawnych przygód. Komiks powstawał w latach 70. i 80. XX wieku i był jedną z wizytówek czasopisma młodzieżowego „Świat Młodych”. W 2003 roku wydawnictwo Egmont Polska wznowiło serię, a dzięki tej reedycji wszystkie części komiksu ukazały się po raz pierwszy w kolorze. Egmont wydał również 3 edycje specjalne komiksu w językach regionalnych: tom Wielki Turniej w gwarze góralskiej (Ogromniasto gońba), Szkoła latania w gwarze śląskiej (Szkoła furganio) i Na wakacjach po kaszubsku (Na latowisku). Przygody Kajka i Kokosza doczekały się także adaptacji dla miłośników gier planszowych (Wielki Wyścig) i gier komputerowych (Twierdza Czarnoksiężnika). W 2016 r. ukazał się pierwszy tom nowych przygód Kajka i Kokosza stworzony przez młodych polskich scenarzystów i rysowników komiksowych w hołdzie dla Janusza Christy.','KAJKO I KOKOSZ, TOM 12 NA WCZASACH (9788328166332)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 12 NA WCZASACH (9788328166332)','','','',''),(1503,1,1,'Smokowi Milusiowi wyrastają skrzydła, zatem Kajko i Kokosz postanawiają nauczyć latać swego pupila. Stosują różne niebezpieczne metody, ale jak Miluś nie potrafił fruwać, tak nadal nie potrafi, za to jego opiekunowie co rusz lądują z łóżkach z niebezpiecznymi ranami. Tymczasem Zbójcerze znów sposobią się do wykonania swego planu, który w skrócie brzmi: \"na plasterki!\". Zastawiają pułapkę na Mirmiła, ale przez przypadek wpada w nią Miluś, co jeszcze bardziej podoba się Wielkiemu Hegemonowi. W zamian za uwolnienie smoka, żąda wielkiego okupu w złocie. Ale czy mieszkańcy Mirmiłowa są na tyle bogaci, by spełnić żądanie herszta Zbójcerzy?','KAJKO I KOKOSZ, TOM 14 SKARBY MIRMIŁA (9788328170544)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 14 SKARBY MIRMIŁA (9788328170544)','','','',''),(1504,1,1,'Zbójcerze wymyślają plan zdobycia Mirmiłowa - używają swego chorego Kaprala jako broni biologicznej. Dla zarażonego Kasztelana jedynym ratunkiem jest cudowna woda ze źródła Pochwista. Po wodę wyruszają Kajtek i Koko w towarzystwie smoka Milusia. Niestety źródło jest zatrute i aby przełamać czar, trzeba pokonać wiele przeszkód. Tymczasem Zbójcerze, dowiedziawszy się, że gród został pozbawiony ochrony najdzielniejszych wojów, szykują się do ataku... Kajko i Kokosz bawią kolejne pokolenie fanów dobrego komiksu.','KAJKO I KOKOSZ, TOM 15 CUDOWNY LEK (9788328170049)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 15 CUDOWNY LEK (9788328170049)','','','',''),(1505,1,1,'Zbliża się setna rocznica założenia Mirmiłowa, która ma być hucznie uczczona, a w ramach zabaw odbędzie się przyciągający fanów z najdalszych zakątków kraju zlot czarownic - megagwiazd plemiennej kultury popularnej. A że w przeddzień uroczystości Kajkowi i Kokoszowi udało się schwytać Wielkiego Hegemona, ten w zamian za uwolnienie przyrzekł prowadzić w swoim zamku pensjonat dla gości z odległych stron. Ale wcale nie zamierza zrezygnować z planów podbicia Mirmiłowa. W tajemnicy sprzymierza się z bandyckim plemieniem Rarogów, by przy ich wsparciu zawładnąć skarbami grodu. Nie przypuszcza wszakże, że własne plany snuje też podły wódz Rarogów, Walwuch.','KAJKO I KOKOSZ, TOM 16 FESTIWAL CZAROWNIC (9788328170056)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 16 FESTIWAL CZAROWNIC (9788328170056)','','','',''),(1506,1,1,'Mieszkańcy Mirmiłowa uwielbiają zabawy, a w wymyślaniu pretekstów do świętowania są prawdziwymi mistrzami. Właśnie skończyli obchody Dnia Dobroci dla Krów, a już zaczynają cieszyć się z najważniejszej uroczystości - ku czci Czystej Wody. Tymczasem Zbójcerze mają już plan, jak zakłócić mirmiłowianom ten piękny i radosny czas, a w efekcie - przejąć władzę nad ich grodem. Kapral wyznacza ochotnika do misji samobójczej: zbójcerz słynący z unikania wszelkich form mycia się i czyszczenia ma wskoczyć do studni w Mirmiłowie i skazić jej wodę po wsze czasy. O dziwo - plan Kaprala zostaje zrealizowany w stu procentach! Woda zostaje zatruta, a gród - pozbawiony życiodajnego płynu. Co robić? Rozwiązanie podsuwa Czarownica Jaga: czystą wodę i szczęśliwość może przywrócić grodowi tylko Pani Przyroda, która mieszka w Krainie Borostworów - dalekiej i dzikiej. Z taką misją mogą wyruszyć tylko oni - dwaj niezawodni wojowie Kajko i Kokosz. Komiksy Janusza Christy o wojach z Mirmiłowa powstawały w latach 70. i 80. XX wieku i były jedną z wizytówek czasopisma młodzieżowego „Świat Młodych”. W 2003 roku wydawnictwo Egmont Polska wznowiło serię, wydało również 3 edycje specjalne komiksu w językach regionalnych: tom Wielki Turniej w gwarze góralskiej (Ogromniasto gońba), Szkoła latania w gwarze śląskiej (Szkoła furganio) i Na wakacjach po kaszubsku (Na latowisku). Przygody Kajka i Kokosza doczekały się także adaptacji dla miłośników gier planszowych (Wielki Wyścig) i gier komputerowych (Twierdza Czarnoksiężnika). W 2016 r. ukazał się pierwszy tom nowych przygód Kajka i Kokosza stworzony przez młodych polskich scenarzystów i rysowników komiksowych w hołdzie dla Janusza Christy.','KAJKO I KOKOSZ, TOM 18 W KRAINIE BOROSTWORÓW (9788328158092)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 18 W KRAINIE BOROSTWORÓW (9788328158092)','','','',''),(1507,1,1,'Zbójcerze co prawda ciągle knują niecne plany i wojenne podżegania, ale nawet kolektywnie wymyślony plan rozbicia bramy Mirmiłowa łbem Ofermy spalił na panewce, bo obrońcy grodu wywiesili na murach pewien święty napis. Dlatego Hegemon postanowił skorzystać z kupionej niegdyś od złego czarnoksiężnika tajnej broni, którą do Mirmiłowa ma przemycić - jak zwykle zgłaszający się na ochotnika - Oferma. Tym razem, aby wpuszczono go do Mirmiłowa, prosi o azyl, a podanie uzasadnia tym, że nie odpowiadał mu stosowany przez Zbójcerzy system społeczny. Błaga, aby go reedukować oraz wychować w pokoju i trzeźwości. Łatwowierni grodzianie przyjmują go, a wtedy szpieg otwiera worek z tajną bronią...','KAJKO I KOKOSZ, TOM 19 MIRMIŁ W OPAŁACH (9788328158108)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 19 MIRMIŁ W OPAŁACH (9788328158108)','','','',''),(1508,1,1,'W spokojnym grodzie księcia Mirmiła nie dzieje się dobrze. Władcę denerwuje plaga nadmiernie rozmnożonych kur, nadworny szambelan spiskuje, a zrzędliwa żona nie pozwala księciu na jedyną rozrywkę zdolną ukoić nerwy - na picie miodu z rodowego skarbu: Złotego Pucharu. Na dodatek do grodu przybywa kompania zbrojnych obwiesi spod znaku Czarnego Trójkąta. Po wizycie niebezpiecznych gości znikają wszystkie kury (co Mirmił przyjmuje z ulgą), kilka tłustych krów (cóż, zdarza się) oraz Złoty Puchar - a tego książę, jak sam twierdzi, nie będzie w stanie przeżyć! Zrozpaczony, wysyła swoich najlepszych wojów, Kajka i Kokosza, by odnaleźli jego skarb, bo inaczej umrze ze zgryzoty.','KAJKO I KOKOSZ, TOM 2 ZŁOTY PUCHAR, CZĘŚĆ 2 (9788328158900)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 2 ZŁOTY PUCHAR, CZĘŚĆ 2 (9788328158900)','','','',''),(1509,1,1,'W spokojnym grodzie księcia Mirmiła nie dzieje się dobrze. Władcę denerwuje plaga nadmiernie rozmnożonych kur, nadworny szambelan spiskuje, a zrzędliwa żona nie pozwala księciu na jedyną rozrywkę zdolną ukoić nerwy - na picie miodu z rodowego skarbu: Złotego Pucharu. Na dodatek do grodu przybywa kompania zbrojnych obwiesi spod znaku Czarnego Trójkąta. Po wizycie niebezpiecznych gości znikają wszystkie kury (co Mirmił przyjmuje z ulgą), kilka tłustych krów (cóż, zdarza się) oraz Złoty Puchar - a tego książę, jak sam twierdzi, nie będzie w stanie przeżyć! Zrozpaczony, wysyła swoich najlepszych wojów, Kajka i Kokosza, by odnaleźli jego skarb, bo inaczej umrze ze zgryzoty.','KAJKO I KOKOSZ, TOM 3 ZŁOTY PUCHAR, CZĘŚĆ 3 (9788328158931)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 3 ZŁOTY PUCHAR, CZĘŚĆ 3 (9788328158931)','','','',''),(1510,1,1,'W Mirmiłowie panuje taka nuda, że wojowie Kajko i Kokosz planują morderstwo - zastanawiają się, jak zabić czas. Dlatego z radością przyjmują prośbę brata swojego księcia - księcia Wojmiła - i wyruszają do jego nadmorskiego grodu, by wesprzeć go w walce z sąsiadem. A sąsiad ten, bogaty Mszczuj, ma piękną córkę Fochnę, w której kochają się wszyscy rycerze, nie dostrzegając, jak jest głupia i kapryśna. Na jej widok Wojmił porzuca wojenne zamiary i postanawia zdobyć rękę panny. Na nieszczęście takie same plany ma inny przyjaciel naszych bohaterów, niezbyt mądry rycerz-poeta Wit. Obaj proszą Kajka i Kokosza o pomoc w wygraniu konkurów. A Fochna stawia przed zalotnikami zadania nie do wykonania, wymagające odbycia pełnej niebezpieczeństw podróży na kraniec świata.','KAJKO I KOKOSZ, TOM 6 SZRANKI I KONKURY, CZĘŚĆ 3 (9788328159853)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 6 SZRANKI I KONKURY, CZĘŚĆ 3 (9788328159853)','','','',''),(1511,1,1,'Żyjący w Mirmiłowie zbój Łamignat ma problem - nie wyrobił kwartalnej normy rabowania bogaczy i rozdawania łupu ubogim, bo w okolicy brakuje bogaczy. Jednak rozliczający go z wyników pracy książę Mirmił sam ma podobny problem - on z kolei nie wyrobił kwartalnej normy potyczek i bitew z wrogim plemieniem Omsów. A tu, jak na złość, ze stolicy przyjechał królewski kanclerz, by rozliczyć poddanych Mirmiła ze stanu prac. Oj, wszyscy będą musieli się natrudzić, aby osiągnąć zaplanowaną normę. Kajko i Kokosz też nie będą mogli się obijać, bo wykryją aferę, mającą doprowadzić do detronizacji swego ukochanego księcia.','KAJKO I KOKOSZ, TOM 7 WOJE MIRMIŁA, CZĘŚĆ 1 (9788328166318)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 7 WOJE MIRMIŁA, CZĘŚĆ 1 (9788328166318)','','','',''),(1512,1,1,'Żyjący w Mirmiłowie zbój Łamignat ma problem - nie wyrobił kwartalnej normy rabowania bogaczy i rozdawania łupu ubogim, bo w okolicy brakuje bogaczy. Jednak rozliczający go z wyników pracy książę Mirmił sam ma podobny problem - on z kolei nie wyrobił kwartalnej normy potyczek i bitew z wrogim plemieniem Omsów. A tu, jak na złość, ze stolicy przyjechał królewski kanclerz, by rozliczyć poddanych Mirmiła ze stanu prac. Oj, wszyscy będą musieli się natrudzić, aby osiągnąć zaplanowaną normę. Kajko i Kokosz też nie będą mogli się obijać, bo wykryją aferę, mającą doprowadzić do detronizacji swego ukochanego księcia.','KAJKO I KOKOSZ, TOM 8 WOJE MIRMIŁA, CZĘŚĆ 2 (9788328158122)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 8 WOJE MIRMIŁA, CZĘŚĆ 2 (9788328158122)','','','',''),(1513,1,1,'Żyjący w Mirmiłowie zbój Łamignat ma problem - nie wyrobił kwartalnej normy rabowania bogaczy i rozdawania łupu ubogim, bo w okolicy brakuje bogaczy. Jednak rozliczający go z wyników pracy książę Mirmił sam ma podobny problem - on z kolei nie wyrobił kwartalnej normy potyczek i bitew z wrogim plemieniem Omsów. A tu, jak na złość, ze stolicy przyjechał królewski kanclerz, by rozliczyć poddanych Mirmiła ze stanu prac. Oj, wszyscy będą musieli się natrudzić, aby osiągnąć zaplanowaną normę. Kajko i Kokosz też nie będą mogli się obijać, bo wykryją aferę, mającą doprowadzić do detronizacji swego ukochanego księcia.','KAJKO I KOKOSZ, TOM 9 WOJE MIRMIŁA, CZĘŚĆ 3 (9788328158139)','egmont','','','EGMONT','KAJKO I KOKOSZ, TOM 9 WOJE MIRMIŁA, CZĘŚĆ 3 (9788328158139)','','','',''),(1514,1,1,'Kajko i Kokosz – Zamach na Milusza (czyli Zamach na Milusia) to drugi album przetłumaczony na język kaszubski (przed laty nakładem wydawnictwa Egmont ukazał się album Kajko i Kokosz – Na latowiskù).\nCykl opowiada o dwóch wojach – dzielnym i rozważnym Kajku oraz żarłocznym i samolubnym Kokoszu, którzy bronią Mirmiłowa przed atakami niecnych Zbójcerzy pod wodzą Hegemona i przeżywają masę zabawnych przygód. Komiks powstawał w latach 70. i 80. XX wieku i był jedną z wizytówek czasopisma młodzieżowego „Świat Młodych”. W 2003 roku wydawnictwo Egmont Polska wznowiło serię, a dzięki tej reedycji wszystkie części komiksu ukazały się po raz pierwszy w kolorze. Kajko czy Kokosz? Który z wojów dostanie skierowanie na wczasy? Obaj zasłużyli, ale Referent do Spraw Turystyki i Wypoczynku przywiózł tylko jedno skierowanie... Na szczęście Lubawa, żona kasztelana Mirmiła, jest nie tylko gospodarną, ale i mądrą kobietą, wpada więc na pomysł, aby na turystyczną wyspę plemienia Ranów wysłać oficjalnie Kajka, a Kokosz dołączyłby do niego na gapę. Przyjaciele jadą więc na wypoczynek, który, jak się okaże, wymaga wyjątkowo dużo wysiłku, bo i problemów jest niemało na wczasach. Wszystko zaczyna się od konfliktu z arcykapłanem boga Porewita (oraz miłośnikiem miodu i hipnozy), a później wojowie lądują w warowni wikingów. Na szczęście wieści o ich krwiożerczości okazują się mocno przesadzone. A w tym samym czasie w okolicy Mirmiłowa Zbójcerze knują, jak wykorzystać nieobecność obrońców grodu i wreszcie go zdobyć...\n\nNiezwykły język kaszubski w połączeniu z unikalnym humorem Chirsty to znakomita zabawa, a przy okazji materiał pomocniczy przy kultywacji tego języka.','KAJKO I KOKOSZ, ZAMACH NA MILUSZA (PO KASZUBSKU) (9788328141063)','egmont','','','EGMONT','KAJKO I KOKOSZ, ZAMACH NA MILUSZA (PO KASZUBSKU) (9788328141063)','','','',''),(1515,1,1,'Wznowienie albumu z nową okładką autorstwa Sławomira Kiełbusa.\n„Kajko i Kokosz” Janusza Christy (1934–2008) to jedna z najsławniejszych polskich serii komiksowych. W przezabawny sposób opowiada o przygodach dwóch słowiańskich wojów – mądrego i uczciwego Kajka oraz silnego i samolubnego Kokosza – służących kasztelanowi Mirmiłowi. Dwaj przyjaciele dzielnie bronią Mirmiłowa przed atakami niecnych zbójcerzy, raz po raz wpadając w tarapaty. „Kajko i Kokosz – Opowieści z Mirmiłowa” to oficjalna kontynuacja tej kultowej serii.\nAlbumy zawierają po kilka krótkich historyjek, tworzonych przez znanych polskich rysowników. Komiksy tworzone są w różnych stylach, a ich głównymi bohaterami często są drugoplanowe postacie oryginalnej serii. Zawsze jednak pozostają wierne duchowi oryginalnych komiksów Janusza Christy, z ich pełną humoru i przygód akcją oraz cartoonową kreską.','KAJKO I KOKOSZ. OPOWIEŚCI Z MIRMIŁOWA. ŁAMIGNAT STRASZLIWY (9788328155787)','egmont','','','EGMONT','KAJKO I KOKOSZ. OPOWIEŚCI Z MIRMIŁOWA. ŁAMIGNAT STRASZLIWY (9788328155787)','','','',''),(1516,1,1,'Wznowienie albumu z nową okładką autorstwa Sławomira Kiełbusa. „Kajko i Kokosz” Janusza Christy (1934–2008) to jedna z najsławniejszych polskich serii komiksowych.\nW przezabawny sposób opowiada o przygodach dwóch słowiańskich wojów – mądrego i uczciwego Kajka oraz silnego i samolubnego Kokosza – służących kasztelanowi Mirmiłowi. Dwaj przyjaciele dzielnie bronią Mirmiłowa przed atakami niecnych zbójcerzy, raz po raz wpadając w tarapaty. „Kajko i Kokosz – Opowieści z Mirmiłowa” to oficjalna kontynuacja tej kultowej serii.','KAJKO I KOKOSZ. OPOWIEŚCI Z MIRMIŁOWA. OBŁĘD HEGEMONA (9788328155770)','egmont','','','EGMONT','KAJKO I KOKOSZ. OPOWIEŚCI Z MIRMIŁOWA. OBŁĘD HEGEMONA (9788328155770)','','','',''),(1517,1,1,'Kajko i Kokosz” Janusza Christy (1934–2008) to jedna z najsławniejszych polskich serii komiksowych. W przezabawny sposób opowiada o przygodach dwóch słowiańskich wojów – mądrego i uczciwego Kajka oraz silnego i samolubnego Kokosza – służących kasztelanowi Mirmiłowi. Dwaj przyjaciele dzielnie bronią Mirmiłowa przed atakami niecnych zbójcerzy, raz po raz wpadając w tarapaty. „Kajko i Kokosz – Opowieści z Mirmiłowa” to oficjalna kontynuacja tej kultowej serii.','KAJKO I KOKOSZ. OPOWIEŚCI Z MIRMIŁOWA. ROZRÓBY I ROMANSE (9788328155794)','egmont','','','EGMONT','KAJKO I KOKOSZ. OPOWIEŚCI Z MIRMIŁOWA. ROZRÓBY I ROMANSE (9788328155794)','','','',''),(1518,1,1,'Komiksowa adaptacja słynnego filmu „101 dalmatyńczyków”! Dla czytelników małych i dużych! Kolejny tom kolekcji klasycznych baśni Disneya, w której znajdują się takie tytuły jak „Król Lew” czy „Mulan”. Dalmatyńczyki Pongo i Czika to szczęśliwi rodzice piętnaściorga szczeniaków.\nSielankowe rodzinne życie bohaterów zostaje przerwane, gdy ktoś uprowadza ich potomstwo! Porwane maluchy, wraz z osiemdziesięcioma czterema innymi szczeniakami, trafiają do zamku diabolicznej Cruelli De Mon. Na szczęście, dzięki unikalnej metodzie psiej komunikacji zwanej „szczekaniem o zmierzchu”, zrozpaczonym rodzicom udaje się ustalić miejsce przetrzymywania dzieci. Pongo i Czika wyruszają w pełną zwrotów akcji i niebezpieczeństw misję ratunkową.','KLASYCZNE BAŚNIE DISNEYA: 101 DALMATYŃCZYKÓW (9788328161375)','egmont','','','EGMONT','KLASYCZNE BAŚNIE DISNEYA: 101 DALMATYŃCZYKÓW (9788328161375)','','','',''),(1519,1,1,'Przeznaczona dla małych i dużych czytelników komiksowa adaptacja wspaniałej filmowej opowieści „Król Lew”! Pierwszy tom kolekcji klasycznych baśni Disneya, w której znajdą się takie tytuły jak „101 dalmatyńczyków” czy „Mulan”. Młody lew Simba nie może się doczekać, kiedy zostanie królem Lwiej Ziemi. Jednak knowania jego przepełnionego zazdrością stryja Skazy zmuszają bohatera do ucieczki.\nW dżungli Simba zapomina o ciążących na nim obowiązkach i zaczyna wieść beztroskie życie – do czasu, gdy na swojej drodze spotyka starego znajomego, który przypomina mu o naukach ojca. Simba wraca w rodzinne strony, aby odzyskać należne mu miejsce w wielkim Kręgu Życia… Komiks o młodym lwie to wzruszająca opowieść o dorastaniu, uświadamianiu sobie, co jest w życiu najważniejsze, i walce o sprawiedliwość.','KLASYCZNE BAŚNIE DISNEYA: KRÓL LEW (9788328156784)','egmont','','','EGMONT','KLASYCZNE BAŚNIE DISNEYA: KRÓL LEW (9788328156784)','','','',''),(1520,1,1,'Komiksowa adaptacja kinowego hitu „Mała Syrenka”! Kolejny tom kolekcji klasycznych baśni Disneya, w której znajdują się takie tytuły jak „Król Lew”, „Mulan” czy „Zakochany kundel”. Arielka to syrenka, która wbrew zakazowi ojca postanawia poznać świat znajdujący się nad powierzchnią oceanu. Podczas jednej z takich wypraw zakochuje się w przystojnym księciu. Aby stać się człowiekiem, Arielka zawiera pakt z przebiegłą morską wiedźmą Urszulą, przez co naraża na niebezpieczeństwo nie tylko siebie, ale też całą podmorską krainę rządzoną przez jej ojca, króla Trytona. Czy Arielka znajdzie w sobie dość odwagi, żeby stawić czoło złu i spełnić marzenia?\nWzruszający komiks o determinacji, odwadze, poświęceniu i miłości, która wszystko zwycięża.','KLASYCZNE BAŚNIE DISNEYA: MAŁA SYRENKA (9788328149939)','egmont','','','EGMONT','KLASYCZNE BAŚNIE DISNEYA: MAŁA SYRENKA (9788328149939)','','','',''),(1521,1,1,'Przeznaczona dla małych i dużych czytelników komiksowa adaptacja wspaniałej filmowej opowieści „Mulan”! Hunowie przedarli się przez Wielki Mur! Wydaje się, że nic nie jest wstanie zatrzymać najeźdźców dowodzonych przez demonicznego Szan Ju. Tylko ktoś o niezwykłej odwadze i ogromnym harcie ducha może uchronić Chiny przed klęską. Taka osoba wkrótce się ujawni, a jej tożsamość zaskoczy wszystkich… Komiks o konsekwentnym realizowaniu marzeń i łamaniu stereotypów.','KLASYCZNE BAŚNIE DISNEYA: MULAN (9788328159648)','egmont','','','EGMONT','KLASYCZNE BAŚNIE DISNEYA: MULAN (9788328159648)','','','',''),(1522,1,1,'Komiksowa adaptacja wspaniałego filmu kinowego „Zakochany kundel”, który pokochali widzowie w każdym wieku! Kolejny tom kolekcji klasycznych baśni Disneya, w której znajdują się takie tytuły jak „Król Lew” czy „Mulan”. Los psa bywa ciężki... Narodziny dziecka właścicieli często wywracają życie czworonogów do góry nogami! Boleśnie przekonuje się o tym urocza cocker spanielka o imieniu Lady, która jeszcze niedawno była oczkiem w głowie swoich opiekunów, a dziś musi spać w budzie, nosić kaganiec i drzeć koty z parą złośliwych... kotów. Na szczęście pewnego dnia spotyka uroczego kundla – Trampa. W trakcie ich wspólnej przygody Lady zasmakuje uroków beztroskiego życia, a Tramp odkryje, co to znaczy być „wiernym jak pies”.\n\nKomiks ten to poruszająca opowieść o sile miłości, przyjaźni i walce dobra ze złem.','KLASYCZNE BAŚNIE DISNEYA: ZAKOCHANY KUNDEL (9788328159679)','egmont','','','EGMONT','KLASYCZNE BAŚNIE DISNEYA: ZAKOCHANY KUNDEL (9788328159679)','','','',''),(1523,1,1,'Komiksowa adaptacja kinowego hitu „Aladyn”! Kolejny tom kolekcji klasycznych baśni Disneya, w której znajdują się takie tytuły jak „Król Lew”, „Mulan” czy „Zakochany kundel”.\nBaśniowym Agrabahem rządzi dobrotliwy sułtan, którego córka Dżasmina za kilka dni musi wyjść za mąż, jak nakazuje prawo. W tym samym mieście żyje złodziejaszek o imieniu Aladyn. Pewnego dnia w jego ręce wpada czarodziejska lampa, w której mieszka dżin. Sympatyczny młodzieniec wreszcie spełnia swoje wielkie marzenie: zostaje księciem i zdobywa serce Dżasminy. Nie wie jednak, że władzę w państwie – a potem w całym wszechświecie! – zamierza przejąć przebiegły wezyr Dżafar. Czy pomysłowemu Aladynowi uda się pokrzyżować plany złego wezyra?\nWzruszający komiks o biedzie i bogactwie, o pragnieniu poznania świata i o miłości pomimo wszystko.','KLASYCZNE BAŚNIE DISNEYA. ALADYN (9788328149946)','egmont','','','EGMONT','KLASYCZNE BAŚNIE DISNEYA. ALADYN (9788328149946)','','','',''),(1524,1,1,'Chłopiec Ptyś ma spaniela Billa... A może należałoby powiedzieć, że to Bill ma Ptysia, bo chwilami nie wiadomo, kto tu jest sprytniejszy i gra pierwsze skrzypce. Sympatyczni bohaterowie robią dowcipy wszystkim – sobie nawzajem, kolegom, innym zwierzętom... Kłopoty zaczynają się, gdy ofiarami kawałów padają rodzice chłopca, a nawet policjanci. Niektórzy ludzie nie mają poczucia humoru, na szczęście Ptyś i Bill są tak rozbrajający, że wiele rzeczy uchodzi im na sucho!','KOMIKSY SĄ SUPER!. PTYŚ I BILL TOM 10 NIE MA JAK LENIUCHOWANIE (9788328149526)','egmont','','','EGMONT','KOMIKSY SĄ SUPER!. PTYŚ I BILL TOM 10 NIE MA JAK LENIUCHOWANIE (9788328149526)','','','',''),(1525,1,1,'Oto prawdziwe „diabełki”: Nina i jej brat Tomek. Ciągle rozrabiają i wszędzie ich pełno – są po prostu nieznośni. Dokuczają nie tylko innym, ale też sobie nawzajem. Broniąc się przed numerami wycinanymi mu przez siostrę, Tomek zaczął się uważać za bohatera ratującego świat przed kosmitami. A kto według niego jest najgroźniejszym obcym? Oczywiście Nina! Z takimi bohaterami nie będziesz się nudził podczas lektury komiksu!','KOMIKSY SĄ SUPER. DIABEŁKI TOM 1 ZABAWY NIE Z TEJ ZIEMI (9788328155206)','egmont','','','EGMONT','KOMIKSY SĄ SUPER. DIABEŁKI TOM 1 ZABAWY NIE Z TEJ ZIEMI (9788328155206)','','','',''),(1526,1,1,'Jedna z pierwszych opowieści o legendarnym kowboju, który jeszcze nie jest sławnym rewolwerowcem, dlatego złoczyńcy uważają go za żółtodzioba!\n\nLucky Luke zgadza się przyjąć posadę szeryfa w Red City. Nazwa miasta pochodzi od koloru ziemi, która podobno jest czerwona, bo wsiąkła w nią krew wielu poprzednich stróżów prawa... Już w czasie podróży do odległego miasteczka Samotny Kowboj ma nieliche kłopoty, a w gnieździe bandytów będzie jeszcze gorzej! Czy zdoła zaprowadzić porządek tam, gdzie dotąd nikomu to się nie udało? Przed najszybszym strzelcem Dzikiego Zachodu seria bezpardonowych starć ze sprytnym i bezwzględnym mistrzem kart Patem Pokerem, który nie zawaha się przed żadnym draństwem, aby uniknąć więzienia!\n\nSerię „Lucky Luke” wymyślił znakomity francuski scenarzysta i rysownik Morris (właśc. Maurice de Bevere, 1923–2001), który później zaprosił do współpracy sławnego pisarza René Goscinnego (1926–1977). Po śmierci obu ojców Samotnego Kowboja scenariusze i rysunki kolejnych odcinków cyklu są tworzone przez licznych kontynuatorów.\"','LUCKY LUKE KONTRA PAT POKER TOM 5 (9788328159297)','egmont','','','EGMONT','LUCKY LUKE KONTRA PAT POKER TOM 5 (9788328159297)','','','',''),(1527,1,1,'Lucky Luke, słynny pogromca bandytów, jest największą legendą Dzikiego Zachodu... ale tylko do czasu, gdy pojawia się Allan Pinkerton. Jego doskonale zorganizowana agencja detektywistyczna tropi przestępców wszelkiego typu – od drobnych oszustów po krwawych desperados. Co więcej, Pinkerton dostępuje zaszczytu utworzenia ochrony osobistej prezydenta Lincolna. Czy w takiej sytuacji Samotny Kowboj jest jeszcze potrzebny? A może lepiej będzie mu na emeryturze? Chyba jednak nie wszyscy są zadowoleni z nowych porządków, a już na pewno nie Daltonowie!\n\nCykl „Lucky Luke” był przez wiele lat tworzony przez mistrzów komiksu Morrisa i Goscinnego, a po ich śmierci jest kontynuowany przez uznanych francuskich autorów, m.in. Achdégo, który narysował ilustracje do kilkunastu serii humorystycznych, takich jak „Big Twin”, „Esmeralda” czy „Kid Lucky”.\n\nScenariusz tego albumu stworzyli dwaj znani także w Polsce pisarze: Daniel Pennac („Mała handlarka prozą”, „Wszystko dla potworów”, „Jak powieść”) i Tonino Benacquista („Malavita”).','LUCKY LUKE KONTRA PINKERTON TOM 74 (9788328150522)','egmont','','','EGMONT','LUCKY LUKE KONTRA PINKERTON TOM 74 (9788328150522)','','','',''),(1528,1,1,'Samotny Kowboj dociera na niezaludnione tereny Oklahomy. Ziemie zakupione od Indian mają stanowić teren do skolonizowania. Skomplikowana akcja musi zostać przeprowadzona z poszanowaniem reguł fair play, żeby wszyscy mieli równe szanse w walce o swoją część. To trudne i praktycznie niewykonalne zadanie przypada oczywiście Lucky Luke’owi. Zanim Oklahoma przywita swoich nowych mieszkańców, w ruch pójdą wszelkie możliwe mechanizmy podstępu, intryga będzie gonić intrygę, a stosujący nieuczciwe praktyki zawodnicy przekonają się na własnej skórze, że nie warto zadzierać z legendą Dzikiego Zachodu.','LUCKY LUKE TOM 14 NA PODBÓJ OKLAHOMY (9788328141353)','egmont','','','EGMONT','LUCKY LUKE TOM 14 NA PODBÓJ OKLAHOMY (9788328141353)','','','',''),(1529,1,1,'Samotny Kowboj razem ze swoim przyjacielem Jolly Jumperem muszą na jakiś czas opuścić prerie i kaniony, żeby wziąć udział w wyścigu po Missisipi i ochronić statek parowy, który ma bezpiecznie przepłynąć najbardziej kapryśną rzekę świata. Przy okazji najszybszy rewolwerowiec walczy z opryszkami próbującymi opóźnić tę podróż, a czasem nawet wysadzić statek. Czy Lucky Luke’owi spodoba się życie pośród fal i żeglowanie od portu do portu?\nSerię Lucky Luke wymyślił znakomity francuski rysownik Morris (właśc. Maurice de Bevere, 1923–2001), który później tworzył ją wraz ze sławnym pisarzem René Goscinnym (1926–1977). Po śmierci Goscinnego scenariusze kolejnych odcinków serii były przygotowywane przez uznanych francuskich autorów.','LUCKY LUKE TOM 16 W GÓRĘ MISSISIPI (9788328142473)','egmont','','','EGMONT','LUCKY LUKE TOM 16 W GÓRĘ MISSISIPI (9788328142473)','','','',''),(1530,1,1,'Daltonowie uciekli z więzienia! Nic nowego. Ale Lucky Luke już ma tego dość i nie chce ich ścigać. Może dlatego tym razem bardzo trudno dorwać braci. W końcu tak rosną w siłę, że pasiak Daltonów staje się symbolem trwogi. Inni bandyci narzekają, że nie ma dla nich pracy. Gdy bracia Daltonowie pojawiają się na horyzoncie, miasta pustoszeją, a banki bez przymusu otwierają swoje sejfy. Kto by pomyślał, że w tej historii największą rolę odegra pies… Czy Lucky Luke’owi uda się złapać bandytów?\n\nSerię \"Lucky Luke\" wymyślił znakomity francuski scenarzysta i rysownik Morris (właśc. Maurice de Bevere, 1923–2001), który później zaprosił do współpracy sławnego pisarza René Goscinny’ego (1926–1977). Po śmierci obu ojców Samotnego Kowboja scenariusze i rysunki kolejnych odcinków cyklu są tworzone przez licznych kontynuatorów.','LUCKY LUKE TOM 17 NA TROPIE DALTONÓW (9788328198067)','egmont','','','EGMONT','LUCKY LUKE TOM 17 NA TROPIE DALTONÓW (9788328198067)','','','',''),(1531,1,1,'Druga część przygód Lucky Luke’a – legendarnego kowboja Dzikiego Zachodu! Luke nigdy nie omija rodeo, kiedy więc trafia do miasteczka, gdzie odbywają się zawody w ujeżdżaniu koni i łapaniu cielaków na lasso, natychmiast zgłasza się do rywalizacji. Jednak tym razem czeka go trudne zadanie, bo za przeciwnika ma mistrza rodeo, który lubi grać nieuczciwie! Później Samotny Kowboj odwiedza Desperado City, miasto opanowane przez braci Pistol – znakomitych strzelców i sprytnych złoczyńców. W trzeciej opowieści Lucky Luke robi pewnemu poszukiwaczowi złota niewinny dowcip, który staje się przyczyną ogromnego zamieszania...\n\nSerię „Lucky Luke\" wymyślił znakomity francuski scenarzysta i rysownik Morris (właśc. Maurice de Bevere, 1923–2001), który później zaprosił do współpracy sławnego pisarza René Goscinny’ego (1926–1977). Po śmierci obu ojców Samotnego Kowboja scenariusze i rysunki kolejnych odcinków cyklu są tworzone przez licznych kontynuatorów.','LUCKY LUKE TOM 2 RODEO (9788328196902)','egmont','','','EGMONT','LUCKY LUKE TOM 2 RODEO (9788328196902)','','','',''),(1532,1,1,'Tym razem Lucky Luke staje oko w oko z... chłopcem. Jednak to nie byle jakie dziecko, tylko Billy Kid, jeden z najsławniejszych rewolwerowców Dzikiego Zachodu! Na jego widok drży całe miasteczko. Samotny Kowboj będzie musiał rozstrzygnąć, czy to tylko źle wychowany dzieciak, czy prawdziwy przestępca. Ale czy można traktować poważnie kogoś, kto zasypia, słuchając bajek, je tylko czerwone karmelki i pije kakao?\n\nSerię „Lucky Luke” wymyślił znakomity francuski scenarzysta i rysownik Morris, który później zaprosił do współpracy sławnego pisarza René Goscinny’ego. Po śmierci obu ojców Samotnego Kowboja scenariusze i rysunki kolejnych odcinków cyklu są tworzone przez licznych kontynuatorów.','LUCKY LUKE TOM 20 BILLY KID (9788328198227)','egmont','','','EGMONT','LUCKY LUKE TOM 20 BILLY KID (9788328198227)','','','',''),(1533,1,1,'Kolejny album o legendzie Dzikiego Zachodu autorstwa dwóch sław: Morrisa i Goscinnego!','LUCKY LUKE TOM 23 DALTONOWIE WCIĄŻ UCIEKAJĄ (9788328150539)','egmont','','','EGMONT','LUCKY LUKE TOM 23 DALTONOWIE WCIĄŻ UCIEKAJĄ (9788328150539)','','','',''),(1534,1,1,'Jeden z pierwszych albumów o Lucky Luke’u, wesołym kowboju, który przemierzając Dziki Zachód pomaga wszystkim, którzy potrzebują wsparcia.\nW okolicach Nugget City od dawna działa szajka napadająca na dyliżanse przewożące złoto. Samotny Kowboj ratuje życie konwojentowi cennego transportu i na miejscu rabunku znajduje trop mogący prowadzić do złoczyńców. Teraz nic go nie powstrzyma przed wymierzeniem sprawiedliwości! Później podąży do Meksyku śladem poszukiwanego przez prawo znanego rzezimieszka zwanego Papierosowym Cezarem. Pościg zawiedzie Luke’a wprost na arenę korridy, gdzie nasz bohater na oczach setek widzów będzie musiał stawić czoło nie tylko podstępnemu bandycie, ale też rozwścieczonym bykom...\n\nSerię „Lucky Luke” wymyślił znakomity francuski scenarzysta i rysownik Morris (właśc. Maurice de Bevere, 1923–2001), który później zaprosił do współpracy sławnego pisarza René Goscinnego (1926–1977). Po śmierci obu ojców Samotnego Kowboja scenariusze i rysunki kolejnych odcinków cyklu są tworzone przez licznych kontynuatorów.','LUCKY LUKE TOM 3 ARIZONA (9788328150348)','egmont','','','EGMONT','LUCKY LUKE TOM 3 ARIZONA (9788328150348)','','','',''),(1535,1,1,'Dziki Zachód może odetchnąć – Meksykanie porwali braci Daltonów! Ale nie ma tego dobrego, co by na złe nie wyszło… Daltonowie uczą swoich nowych towarzyszy prawdziwie nowoczesnego podejścia do zawodu bandyty i okazują się znakomitymi nauczycielami. W efekcie Lucky Luke musi podążyć za Rio Grande, aby uwolnić Meksyk od plagi Daltonów.','LUCKY LUKE TOM 31 TORTILLA DLA DALTONÓW (9788328135376)','egmont','','','EGMONT','LUCKY LUKE TOM 31 TORTILLA DLA DALTONÓW (9788328135376)','','','',''),(1536,1,1,'Kolejny tom humorystycznego cyklu przygód komiksowego kowboja Lucky Luke’a, którego postać wymyślili sławni autorzy francuscy – Morris i René Goscinny.','LUCKY LUKE TOM 39 ŁOWCA NAGRÓD (9788328118416)','egmont','','','EGMONT','LUCKY LUKE TOM 39 ŁOWCA NAGRÓD (9788328118416)','','','',''),(1537,1,1,'Kolejny tom opowieści o najsławniejszym komiksowym kowboju.','LUCKY LUKE TOM 57 NITROGLICERYNA (9788328119123)','egmont','','','EGMONT','LUCKY LUKE TOM 57 NITROGLICERYNA (9788328119123)','','','',''),(1538,1,1,'Najsłynniejszy komiksowy kowboj znowu w akcji! Znika pełen pasażerów dyliżans kompanii przewozowej Wells Fargo. Nie odnajdują się ani podróżujący nim ludzie, ani przesyłki, ani sam pojazd. Dyrektor firmy wie, że jeszcze jeden taki niewyjaśniony przypadek, a kompania będzie musiała ogłosić upadłość. Prosi niezawodnego Lucky Luke’a, aby wyruszył wraz z następnym dyliżansem i rozwiązał zagadkę. Do Samotnego Kowboja przyłącza się słynna Calamity Jane, dama o niecodziennych manierach. Czy tym dwóm legendom Dzikiego Zachodu uda się wyjaśnić tajemnicę zaginionego dyliżansu? Seria Lucky Luke została stworzona przez dwóch mistrzów frankofońskiego rynku komiksowego: pisarza René Goscinnego (1926–1977) oraz rysownika Morrisa (właśc. Maurice de Bevere, 1923–2001). Po śmierci Goscinnego scenariusze kolejnych odcinków serii były tworzone przez kontynuatorów takich jak holenderski autor Lo Hartog Van Banda (np. Ambrosius, Supermax).','LUCKY LUKE TOM 61 POLOWANIE NA DUCHY (9788328135321)','egmont','','','EGMONT','LUCKY LUKE TOM 61 POLOWANIE NA DUCHY (9788328135321)','','','',''),(1539,1,1,'Jedna z najśmieszniejszych historii o legendarnym bohaterze Dzikiego Zachodu! Lucky Luke zostaje poproszony o pomoc we wzniesieniu niezwykle ważnej budowli – pierwszego mostu na szerokiej rzece Missisipi, której rwące wody utrudniają komunikację między wschodnią a zachodnią częścią Stanów Zjednoczonych. Samotny Kowboj nie zna się na stawianiu mostów, lecz jest specjalistą od rozprawiania się z przestępcami, a szybko okazuje się, że właśnie oni są główną przeszkodą w realizacji zleconego przez amerykański rząd projektu...\n\nSeria „Lucky Luke\" została stworzona przez dwie legendy frankofońskiego rynku komiksowego: pisarza René Goscinnego (1926–1977) oraz rysownika Morrisa (właśc. Maurice de Bevere, 1923–2001). Po śmierci Goscinnego scenariusze kolejnych odcinków serii były tworzone przez kontynuatorów takich jak duet autorski Xavier Fauche i Jean Léturgie (\"Bzik\", \"Percevan\").','LUCKY LUKE TOM 63 MOST NA MISSISIPI (9788328196919)','egmont','','','EGMONT','LUCKY LUKE TOM 63 MOST NA MISSISIPI (9788328196919)','','','',''),(1540,1,1,'Kolejna z humorystycznych opowieści o kowboju strzelającym szybciej od własnego cienia. Angielski dżentelmen Waldo Badmington (znany czytelnikom z albumu \"Żółtodziób\") prosi Lucky Luke’a o pomoc w odnalezieniu swojego kamerdynera, który zaginął w Jukonie podczas wielkiej gorączki złota nad rzeką Klondike. Dwaj bohaterowie wyruszają na odległy kraniec Kanady. Przed nimi szalenie trudna przeprawa przez góry i śniegi. Na miejscu okazuje się, że cały region wydobycia złota znajduje się w rękach groźnego bandyty. Czy jest on odpowiedzialny także za zniknięcie kamerdynera? Waldo i Luke będą musieli przejrzeć sprytną grę łotra, aby rozwikłać kryminalną zagadkę!\n\nSeria \"Lucky Luke\" została stworzona przez dwie legendy frankofońskiego rynku komiksowego: pisarza René Goscinnego (1926–1977) oraz rysownika Morrisa (właśc. Maurice de Bevere, 1923–2001). Po śmierci Goscinnego scenariusze kolejnych odcinków serii były tworzone przez kontynuatorów takich jak Jean Léturgie (\"Bzik\", \"Percevan\") czy Yann Le Pennetier (\"Thorgal – Młodzieńcze Lata\", \"Thorgal – Louve\").','LUCKY LUKE TOM 65 KLONDIKE (9788328198074)','egmont','','','EGMONT','LUCKY LUKE TOM 65 KLONDIKE (9788328198074)','','','',''),(1541,1,1,'Daltonowie znowu trafiają za kratki, ale nie zamierzają zbyt długo tam pozostać. W więzieniu poznają nawiedzonego proroka, który okaże się dla nich wielkim ciężarem zarówno podczas ucieczki, jak i złodziejskiej działalności poza murami zakładu karnego. Lucky Luke rusza w pościg za zbiegami, jednak nie może ich odnaleźć! Gdzie ukryli się Daltonowie? Odpowiedź znajdziemy w pewnym miasteczku, gdzie nie ma ani banku, ani saloonu... Samotny Kowboj będzie musiał się natrudzić, aby rozwikłać zagadkę zniknięcia braci!','LUCKY LUKE TOM 68 PROROK (9788328198098)','egmont','','','EGMONT','LUCKY LUKE TOM 68 PROROK (9788328198098)','','','',''),(1542,1,1,'Nieśmiertelny bohater Dzikiego Zachodu powraca w kolejnym starciu z bandycką rodzinką Daltonów! Lucky Luke dostaje propozycję występów w słynnym przedstawieniu westernowym Buffalo Billa. Ale czy Samotnemu Kowbojowi zależy na sławie? Chyba raczej woli łapanie przestępców i swobodne wędrówki po bezkresnej prerii. Tymczasem Daltonowie godzą się na podobną ofertę, ponieważ zostaje połączona z możliwością ucieczki z więzienia! Co wyniknie z nagłej kariery bandytów? Jak sobie poradzą z ogromną popularnością? Obserwując poczynania czterech braci, Lucky Luke będzie miał niezły ubaw! Seria „Lucky Luke” została stworzona przez dwie legendy frankofońskiego rynku komiksowego: pisarza René Goscinnego oraz rysownika Morrisa. Po śmierci Goscinnego scenariusze kolejnych odcinków serii były tworzone przez kontynuatorów takich jak szwajcarski dziennikarz i satyryk radiowo-telewizyjny Patrick Nordmann.','LUCKY LUKE TOM 70 LEGENDA ZACHODU (9788328198234)','egmont','','','EGMONT','LUCKY LUKE TOM 70 LEGENDA ZACHODU (9788328198234)','','','',''),(1543,1,1,'Pojedynek Lucky Luke’a z Billym Kidem zostaje przerwany, bo Samotny Kowboj dostaje pilne wezwanie do Waszyngtonu. Senatorowie proszą go o eskortowanie Rutherforda Hayesa, kandydata na prezydenta, podczas trasy wyborczej po Dzikim Zachodzie. Pan Hayes rzeczywiście potrzebuje ochrony, bo na jego życie czyha morderca wynajęty przez kontrkandydata do fotela prezydenckiego. Na szczęście Luke nie bez przyczyny jest nazywany człowiekiem, który strzela szybciej od własnego cienia. Czy jednak pan Hayes zdoła bezpiecznie wrócić do Waszyngtonu? I czy Billy Kid będzie cierpliwie czekał, aż nasz bohater znajdzie czas na dokończenie pojedynku?\nCykl Lucky Luke był przez wiele lat tworzony przez mistrzów komiksu Morrisa i Goscinnego, a po ich śmierci jest kontynuowany przez uznanych francuskich autorów. Rysownik Achdé jest współtwórcą kilkunastu serii humorystycznych, między innymi Big Twin, Esmeralda czy Kid Lucky. Laurent Gerra to jeden z najsławniejszych we Francji kabareciarzy i komików radiowych, który postanowił pisać scenariusze do Lucky Luke’a jako wielki miłośnik tego cyklu.','LUCKY LUKE TOM 73 CZŁOWIEK Z WASZYNGTONU (9788328142480)','egmont','','','EGMONT','LUCKY LUKE TOM 73 CZŁOWIEK Z WASZYNGTONU (9788328142480)','','','',''),(1544,1,1,'Po nieudanym napadzie Daltonowie znów wpadają w ręce Lucky Luke’a i trafiają do więzienia. Joe wymyśla plan ucieczki, ale pozostali bracia mają dość przywództwa małego szaleńca i się buntują. W tej sytuacji sprytny Joe proponuje, że nowym szefem bandy zostanie ten z nich, który po wydostaniu się zza krat pierwszy zdobędzie milion dolarów. Od tej pory każdy z desperados działa na własną rękę. Lucky Luke’a ponownie rusza w pościg za zbiegami, jednak tym razem ma utrudnione zadanie, bo musi podążać aż czterema tropami w cztery różne miejsca. A to dopiero początek jego kłopotów, ponieważ bracia wykażą się talentami, których nie ujawniali, gdy działali razem. Samotny Kowboj zastosuje więc nowe metody walki z bandytami – metody niezbyt pasujące do obrońcy prawa... Cykl „Lucky Luke” był przez wiele lat tworzony przez mistrzów komiksu Morrisa i Goscinnego, a po ich śmierci jest kontynuowany przez uznanych francuskich autorów, m.in. Achdé, który narysował ilustracje do kilkunastu serii humorystycznych, takich jak „Big Twin”, „Esmeralda” czy „Kid Lucky”. Scenariusz tego albumu napisali dwaj znani także w Polsce pisarze: Daniel Pennac („Mała handlarka prozą”, „Wszystko dla potworów”, „Jak powieść”) i Tonino Benacquista („Malavita”).','LUCKY LUKE TOM 76 SAMOTNY JEŹDZIEC (9788328159280)','egmont','','','EGMONT','LUCKY LUKE TOM 76 SAMOTNY JEŹDZIEC (9788328159280)','','','',''),(1545,1,1,'Lucky Luke spotyka Jacka, starego znajomego, który znany jest ze ściągania na siebie nieszczęść. Przyjaciel prosi Samotnego Kowboja, aby ten bezpiecznie przeprowadził przez bezdroża Dzikiego Zachodu jego mającą przybyć z Europy rodzinę. Okazuje się, że są to Żydzi aszkenazyjscy, którzy musieli wyemigrować z terenów rozbiorowej Polski, by szukać szczęścia w Nowym Świecie. Na wędrowców będzie czekać wiele niebezpieczeństw na pustyniach i terenach Indian, ale największym wyzwaniem okażą się dla Luke’a sami niezwykli przybysze...\nCykl Lucky Luke był przez wiele lat tworzony przez mistrzów komiksu Morrisa i Goscinnego, a po ich śmierci jest kontynuowany przez uznanych francuskich autorów. Rysownik Achdé jest współtwórcą kilkunastu serii humorystycznych takich jak Big Twin, Esmeralda czy Kid Lucky. Z kolei Jul napisał scenariusze do wielu komiksów, m.in. Silex and the city.','LUCKY LUKE TOM 80 ZIEMIA OBIECANA (9788328127456)','egmont','','','EGMONT','LUCKY LUKE TOM 80 ZIEMIA OBIECANA (9788328127456)','','','',''),(1546,1,1,'Kolejna opowieść o najsłynniejszym komiksowym kowboju!','LUCKY LUKE TOM 9 SZYNY NA PRERII (9788328135314)','egmont','','','EGMONT','LUCKY LUKE TOM 9 SZYNY NA PRERII (9788328135314)','','','',''),(1547,1,1,'Trzeci tom serii o pełnym szalonych zabaw dzieciństwie najsławniejszej z komiksowych legend Dzikiego Zachodu. Poznajemy pierwsze przygody sprytnego urwisa, który kiedyś będzie rewolwerowcem szybszym od własnego cienia. Niesforny Lucky Luke marzy o życiu kowboja i chwytaniu desperados. Nie rozumie, dlaczego tylu rzeczy nie może robić, chociażby grać w pokera. Podoba mu się jasnowłosa Joannie, ale aż dostaje ciarek na myśl o małżeństwie. Na szczęście czeka go jeszcze wiele radosnych lat, zanim stanie się dorosły! Ale nawet wtedy co jakiś czas będzie powracał do dzieciństwa dzięki niecodziennym wydarzeniom takim jak spotkanie z pewnym sprzedawcą zabawek...','LUCKY LUKE. KID LUCKY TOM 3 STATUA SQUAW (9788328160279)','egmont','','','EGMONT','LUCKY LUKE. KID LUCKY TOM 3 STATUA SQUAW (9788328160279)','','','',''),(1548,1,1,'Komiks dla wielbicieli Minecrafta. Tyler to chłopiec, jakich wielu, jego życie zmienia się jednak, gdy wraz z rodziną przeprowadza się do nowego miasta. Na szczęście ma grupę zaufanych przyjaciół, którzy zawsze czekają na niego w świecie Minecrafta! Wspólnie z Evanem, Candace, Tobim i Grace przeżywają niezliczone przygody w Świecie Podstawowym. Tym razem postanawiają sprawdzić swoje siły w ostatecznym wyzwaniu, jakim jest… stawienie czoła straszliwemu Smokowi Kresu!\n\nScenariusz wyszedł spod pióra Sfé R. Monster („Eth’s Skin”), a rysunki przygotowała Sarah Graley („Glitch”, „Donut the Destroyer”).','MINECRAFT, TOM 1 (9788328196377)','egmont','','','EGMONT','MINECRAFT, TOM 1 (9788328196377)','','','',''),(1549,1,1,'Kolejna emocjonująca przygoda w świecie Minecrafta! Witajcie ponownie w EverRealm – w świecie gry, w którym zgrana paczka przyjaciół zamierza zdobyć podwodną świątynię! Gdy ich plany krzyżują rówieśnicy lubiący znęcać się nad innymi (zarówno w grze, jak i w świecie rzeczywistym), Evan, Tyler, Tobi, Candace i Grace są zmuszeni znaleźć sposób, by poradzić sobie w trudnej sytuacji. Zaatakowani przez piratów nieoczekiwanie stają w obliczu jeszcze poważniejszego zagrożenia, wszyscy zdają sobie jednak sprawę z tego, że aby osiągnąć swój cel, muszą sobie zaufać i nauczyć się współpracować. Scenariusz wyszedł spod pióra Sfé R. Monster („Eth’s Skin”), a rysunki przygotowała Sarah Graley („Glitch”, „Donut the Destroyer”).','MINECRAFT, TOM 2 (9788328196384)','egmont','','','EGMONT','MINECRAFT, TOM 2 (9788328196384)','','','',''),(1550,1,1,'Candace, Evan, Grace, Tobi i Tyler przeżywają liczne przygody w Świecie Podstawowym. Pewnego dnia trafiają na tajemniczy uszkodzony portal. Przenosi on ich do dziwnego i cudownego zakątka Netheru, którego wcześniej nie znali. W jego eksplorowaniu ma im pomóc ich specjalistka od Netheru, Grace. Jednak w obliczu nowych zagrożeń Grace odkrywa, że brzemię wiary, jaką pokładają w niej jej przyjaciele, zanadto ją przytłacza. Gracze trafiają do niesamowitego bastionu, w którym na każdym kroku czają się nowe zagrożenia… ale tym razem muszą im stawić czoła bez pomocy swojej ekspertki. Wygląda jednak na to, że aby poradzić sobie z nowymi zagrożeniami, przyjaciele będą musieli ponownie połączyć siły…\n\nScenariusz wyszedł spod pióra Sfé R. Monster („Eth’s Skin”), a rysunki przygotowała Sarah Graley („Glitch”, „Donut the Destroyer”).','MINECRAFT, TOM 3 (9788328152359)','egmont','','','EGMONT','MINECRAFT, TOM 3 (9788328152359)','','','',''),(1551,1,1,'Komiks na podstawie popularnej gry Minecraft.\nWejdź do Świata Podstawowego i razem z bohaterami przeżyj emocjonującą przygodę. Cahira i Orion to bliźnięta uczące się sztuki polowania na potwory pod okiem Senana Skrupulatnego. Po trudnej walce ich mentor pada ofiarą zaklętego withera – od tej pory rodzeństwo jest zdane tylko na siebie! Brat i siostra wyruszają na misję, aby przywrócić swojego mistrza do życia, a po drodze znajdują niespodziewanego sojusznika. Trafiają do podziemnego domu dziewczyny o imieniu Atria skazanej na los przynęty dla potworów. Cahira i Orion przekonują ją, by dołączyła do nich i wykorzystała swoje zdolności do zwabienia zaklętego withera… Ona zaś chce się nauczyć, jak chronić się przed mobami, które pragną ją dopaść.','MINECRAFT: NA PASTWĘ MOBÓW TOM 1 (9788328170551)','egmont','','','EGMONT','MINECRAFT: NA PASTWĘ MOBÓW TOM 1 (9788328170551)','','','',''),(1552,1,1,'Druga część przygód z serii „Minecraft: Na pastwę mobów” na podstawie popularnej gry komputerowej. Po ocaleniu swojego mentora, pożartego przez withera, łowcy potworów Cahira i Orion wyruszają na wyprawę, aby rozwiązać tajemnicę ciążącej na ich przyjaciółce klątwy, która powoduje, że dziewczynka przyciąga moby jak magnes. Aby znaleźć lekarstwo na przypadłość Atrii, muszą odnaleźć dawną rywalkę Senana. Okazuje się jednak, że sprawy wyglądają inaczej, niż mogłoby się zdawać. Chociaż wielka rezydencja i kocia fontanna wielkiej magini są wyjątkowo urocze, jej lochy skrywają mroczny sekret – miażdżarkę mobów! A podczas wizyty w mieście dzielne bliźnięta zapoczątkują lawinę wydarzeń, która doprowadzi do zombie apokalipsy. Czy uda im się ocalić miasto i jego pechowych mieszkańców? Autorką scenariusza i rysunków jest Kirsten Gudsnuk.','MINECRAFT: NA PASTWĘ MOBÓW TOM 2 (9788328152342)','egmont','','','EGMONT','MINECRAFT: NA PASTWĘ MOBÓW TOM 2 (9788328152342)','','','',''),(1553,1,1,'Bohaterami tej historii są Bartłomiej i jego syn Karmelek. Książeczki charakteryzują się prostotą opowieści oraz akwarelowymi ilustracjami i stanowią wspaniałe połączenie komiksu z klasyczną książeczką z obrazkami. W pierwszej opowieści Bartłomiej chce zostać bohaterem w oczach synka i zabrać go w niezwykłe miejsce, gdzie dotrą pierwsi. Dokądkolwiek jednak trafiają, okazuje się, że koledzy Karmelka już tam byli.\nDzięki wzruszającym opowieściom i pięknym ilustracjom książeczki zachwycą czytelników w każdym wieku. To doskonały prezent dla ojców i dzieci jako pierwsze spotkanie z komiksem.','MÓJ PIERWSZY KOMIKS 5+. BARTŁOMIEJ I KARMELEK. NAJLEPSZE MIEJSCE (9788328160910)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. BARTŁOMIEJ I KARMELEK. NAJLEPSZE MIEJSCE (9788328160910)','','','',''),(1554,1,1,'Zabawny komiks przygodowy dla najmłodszych, w którym poznajemy wesołą gromadę bohaterów: dziobaka Toto, kolczatkę Chichi, koalę Wawa i nietoperza Riri.\nDziobak to prawdziwy cudak. Jest pokryty futrem, ma dziób jak kaczka, ogon bobra i płetwiaste łapy. Dwie godziny dziennie spędza w wodzie, pochłaniając olbrzymie ilości robaków, larw, a niekiedy także małych ryb. Na resztę dnia zaszywa się w swojej jamce, do której wejście prowadzi od strony lądu.','MÓJ PIERWSZY KOMIKS 5+. DZIOBAK TOTO TOM 1 DZIOBAK TOTO I MAGICZNE DRZEWO (9788328150362)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. DZIOBAK TOTO TOM 1 DZIOBAK TOTO I MAGICZNE DRZEWO (9788328150362)','','','',''),(1555,1,1,'To drugi album opisujący przygody sympatycznego dziobaka Toto i jego przyjaciół. Wielkouch jest poważnie ranny! Leśny doktor w celu sporządzenia lekarstwa wysyła dziobaka Toto i jego przyjaciół na wyprawę, z której mają powrócić z dwoma włosami Bunyipa. Ale Bunyip jest potworem! Strasznym, wielkim i okrutnym... A do tego ma podły charakter!','MÓJ PIERWSZY KOMIKS 5+. DZIOBAK TOTO TOM 2 DZIOBAK TOTO I PAN MGIEŁ (9788328150379)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. DZIOBAK TOTO TOM 2 DZIOBAK TOTO I PAN MGIEŁ (9788328150379)','','','',''),(1556,1,1,'Czy znacie już rodzinę pana Borsuka i pani Lisicy? Najmłodsza z rodzeństwa, Malinka, siostra Szperaczka i Borka, prezentuje swoje przygody.\nMalinka uwielbia zabawy ze starszym rodzeństwem. Zawsze ma mnóstwo pomysłów i jeszcze więcej energii... Czasami aż za dużo. A przede wszystkim Malinka chce się bawić!\nTa pierwsza część przygód Malinki skierowana jest do najmłodszych czytelników.','MÓJ PIERWSZY KOMIKS 5+. MALINKA CHCE SIĘ BAWIĆ TOM 1 (9788328156555)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. MALINKA CHCE SIĘ BAWIĆ TOM 1 (9788328156555)','','','',''),(1557,1,1,'Wielkie wiosenne porządki zakończone! Kiedy miotły i szczotki poszły w kąt, płochliwy Kret postanawia skorzystać z pięknego dnia i wybiera się nad rzekę. Jeszcze nie wie, że po drodze czeka go zaskakujące spotkanie ze złośliwym Szczurem, który zna całą okolicę jak własną kieszeń; a także z zarozumiałym Ropuchem, którego zachcianki bywają bardzo nieszczęsne w skutkach. Wygląda na to, że nowa pora roku będzie dla Kreta wyjątkowo burzliwa i pełna emocji.','MÓJ PIERWSZY KOMIKS 5+. O CZYM SZUMIĄ WIERZBY TOM 1 W PUSZCZY (9788328150393)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. O CZYM SZUMIĄ WIERZBY TOM 1 W PUSZCZY (9788328150393)','','','',''),(1558,1,1,'Szczur i Kret prawie zapomnieli o strachu, jakiego najedli się podczas wyprawy do puszczy... Emocje opadły, a dwaj przyjaciele znaleźli wytchnienie w ciepłej, bezpiecznej i przytulnej norze Borsuka, który w labiryncie podziemnych korytarzy szykuje im moc niespodzianek. Tymczasem nadchodzi pora powrotu do domu, gdzie czeka ich kolejne zaskoczenie. Ropuch oszalał! Oszalał na punkcie prędkości, warkotu silnika, zapachu oleju i benzyny... Krótko mówiąc – automobil odebrał mu rozum! Aby przywrócić zmysły porywczemu płazowi, jego przyjaciele postanawiają zastosować nadzwyczajne środki. Ale czy to wystarczy?','MÓJ PIERWSZY KOMIKS 5+. O CZYM SZUMIĄ WIERZBY TOM 2 AUTO, ROPUCH, BORSUK (9788328150409)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. O CZYM SZUMIĄ WIERZBY TOM 2 AUTO, ROPUCH, BORSUK (9788328150409)','','','',''),(1559,1,1,'Podczas gdy Kret i Szczur zażywają upragnionego spokoju, Ropuch cierpi męki w mrocznym i przesiąkniętym wilgocią lochu. Za bezgraniczną, szaloną miłość do pewnego automobilu nieszczęśnik został skazany na dwadzieścia lat więzienia! A jak powiedział Kret: „Dwadzieścia lat to kawał czasu. Zwłaszcza dla płaza!”. Jednak nasz dzielny zwierzak nie z takich opresji wychodził cało. Dzięki wrodzonemu urokowi, nieprzeciętnej inteligencji, a przede wszystkim niebywałej hojności Ropuch wymyka się zza krat i rusza w pełną niebezpieczeństw drogę ku wolności. A będzie ona kręta i pełna wybojów! Czy dla wyrwania się z okowów bohater jest gotów poświęcić to, co ma najcenniejszego, czyli... godność?','MÓJ PIERWSZY KOMIKS 5+. O CZYM SZUMIĄ WIERZBY TOM 3 WIELKA UCIECZKA (9788328154896)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. O CZYM SZUMIĄ WIERZBY TOM 3 WIELKA UCIECZKA (9788328154896)','','','',''),(1560,1,1,'Seria komiksów dla dzieci opowiada o przygodach króliczej rodziny Rabatków: cioci Cynii, tacie Narcyzie i jego pięciorgu dzieciach, którzy mieszkają na szczycie pięknego zielonego wzgórza. To sympatyczna, lekka i pełna humoru historia z przebogatymi kolorowymi ilustracjami, które aż kipią od szczegółów cieszących oko nie tylko najmłodszych. Pełne zaskakujących detali i pastelowych kolorów rysunki są znakomitym dopełnieniem opowieści.\nW pierwszym tomie króliczki obchodzą ważne święto – urodziny Stokrotka – i w wielkiej tajemnicy przygotowują dla niego przyjęcie niespodziankę.\n\nNa podstawie serii we Francji powstał serial animowany „Rodzina Rabatków”, który był emitowany w Polsce.','MÓJ PIERWSZY KOMIKS 5+. OPOWIEŚCI Z BUKOWEGO LASU TOM 1 URODZINY (9788328160903)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. OPOWIEŚCI Z BUKOWEGO LASU TOM 1 URODZINY (9788328160903)','','','',''),(1561,1,1,'Sowa Luna poszukuje chórzystów, którzy wystąpią na koncercie słynnego kociego śpiewaka Romea. Różyczka Rabatek jest wielką miłośniczką jego talentu. Razem z braćmi wyrusza na wyprawę przez las, żeby spełnić swoje największe marzenie... Zaśpiewać ze swoim idolem!\nRodzina Rabatków powraca na kartach komiksu. Wesołe króliczki zapraszają do wspólnej zabawy w swoim baśniowym, kolorowym świecie.','MÓJ PIERWSZY KOMIKS 5+. OPOWIEŚCI Z BUKOWEGO LASU TOM 2 CHÓR (9788328152724)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. OPOWIEŚCI Z BUKOWEGO LASU TOM 2 CHÓR (9788328152724)','','','',''),(1562,1,1,'„Wyprawa po skarb” to pierwszy album, który powstał we współpracy Loïca Jouannigota z Michelem Plessixem. Zapada wieczór i cała rodzina Rabatków zasiada przy kominku, żeby posłuchać mrożącej krew w żyłach opowieści Narcyza o skarbie zakopanym przez bezlitosnego pirata Krasnorosta. Następnego dnia wczesnym rankiem pięcioro króliczątek postanawia wyprawić się nad rzekę w okolice słynnej Zatoki Życzliwości, gdzie według rodzinnej legendy jest ukryty skarb. Nagle… Niesłychane! W piasku odnajdują butelkę, w której ktoś umieścił tajemniczą mapę. Dzielna drużyna Rabatków natychmiast postanawia ruszyć na poszukiwanie cennego skarbu piratów.\nCzy w starym, opuszczonym młynie straszy duch? Czy mech na drzewach chce nam coś powiedzieć? I co mogą oznaczać tajemnicze symbole w podziemnym tunelu pod skałą?\n„Wyprawa po skarb” poniesie was ku wspaniałej przygodzie w towarzystwie nieustraszonego rodzeństwa Rabatków!','MÓJ PIERWSZY KOMIKS 5+. OPOWIEŚCI Z BUKOWEGO LASU TOM 3 WYPRAWA PO SKARB (9788328154933)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. OPOWIEŚCI Z BUKOWEGO LASU TOM 3 WYPRAWA PO SKARB (9788328154933)','','','',''),(1563,1,1,'Komiks z serii „Opowieści z Bukowego Lasu” o przygodach rodziny Rabatków. W tym roku podczas wielkiego kiermaszu odbędzie się niezwykły konkurs muzyczny. Rodzeństwo Rabatków zamierza wziąć w nim udział i już nawet rozpoczęło intensywne próby, które idą wprost... koncertowo! Ale uwaga... Pewien paskudny aligator Doremi Fasido i jego kompani próbują pomieszać im szyki. Króliczątka muszą być bardzo ostrożne. Stawienie czoła bandzie złośliwców wymaga nie lada sprytu i odwagi!','MÓJ PIERWSZY KOMIKS 5+. OPOWIEŚCI Z BUKOWEGO LASU TOM 4 KRÓLICZA MELODIA (9788328154940)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. OPOWIEŚCI Z BUKOWEGO LASU TOM 4 KRÓLICZA MELODIA (9788328154940)','','','',''),(1564,1,1,'W komiksie o Borsuku i Lisicy poznajemy historię nietypowej rodziny: pana Borsuka i jego trojga dzieci oraz pani Lisicy i jej córki. Borek, Szperaczek i Róża w jednym zgadzają się całkowicie: borsuki i lisy nie są stworzone do wspólnego życia! Jednak ich rodzice są innego zdania. Na domiar złego pan Borsuk i pani Lisica postanawiają zamieszkać razem w jednej norze!\n\nSeria cieszy się we Francji wielką popularnością. Jest także lekturą szkolną dla najmłodszych.\nWedług dziennika „Le Monde” historia pana Borsuka i pani Lisicy to „przepełniona humorem i czułością piękna lekcja tolerancji”.\n\nNa podstawie komiksu powstał film animowany wyświetlany w polskiej telewizji pod tytułem „Jak borsuk z lisem”.','MÓJ PIERWSZY KOMIKS 5+. PAN BORSUK I PANI LISICA TOM 1 SPOTKANIE (9788328160880)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. PAN BORSUK I PANI LISICA TOM 1 SPOTKANIE (9788328160880)','','','',''),(1565,1,1,'Borek, Szperaczek i Róża w jednym zgadzają się całkowicie: borsuki i lisy nie są stworzone do życia razem! Jednak ich rodzice są innego zdania. Na domiar złego pan Borsuk i pani Lisica postanawiają zamieszkać we wspólnej norze! W drugim tomie pojawia się niespodziewany gość. Spowoduje zamieszanie w tej niezwykłej rodzinie borsuków i lisów, które nigdy się nie nudzą.\n\nBorek, Szperaczek i Róża w jednym zgadzają się całkowicie: borsuki i lisy nie są stworzone do życia razem! Jednak ich rodzice są innego zdania. Na domiar złego pan Borsuk i pani Lisica postanawiają zamieszkać we wspólnej norze! W drugim tomie pojawia się niespodziewany gość, który spowoduje zamieszanie w tej niezwykłej rodzinie borsuków i lisów, które nigdy się nie nudzą.','MÓJ PIERWSZY KOMIKS 5+. PAN BORSUK I PANI LISICA TOM 2 ROZGARDIASZ (9788328160927)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. PAN BORSUK I PANI LISICA TOM 2 ROZGARDIASZ (9788328160927)','','','',''),(1566,1,1,'Nadeszła jesień. Róża, Szperaczek i Borek postanowili zorganizować regaty na rzece. Ale muszą najpierw zbudować łódkę, co nie jest tak trudne, jak dogadanie się, jak ta łódka ma wyglądać. Czy uda im się w końcu wziąć udział w przygodzie żeglarskiej? Ludzkie charaktery w zwierzęcych maskach, zabawne perypetie i próba zmierzenia się z innością, która zamiast dzielić, łączy naszych sympatycznych bohaterów. Według dziennika „Le Monde” historia pana Borsuka i pani Lisicy to „przepełniona humorem i czułością piękna lekcja tolerancji”.','MÓJ PIERWSZY KOMIKS 5+. PAN BORSUK I PANI LISICA TOM 3 ALE ZAŁOGA (9788328150638)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. PAN BORSUK I PANI LISICA TOM 3 ALE ZAŁOGA (9788328150638)','','','',''),(1567,1,1,'Nadchodzi zima! Borsuki gromadzą zapasy, robią się senne i coraz częściej poszukują spokoju. Borek marzy o ciepłym łóżku w przytulnej norce, tymczasem Róża woli hasać w głębokim śniegu. Czy tak różne potrzeby da się ze sobą pogodzić? Przecież jakoś trzeba przetrwać tę zimę!\nLudzkie charaktery w zwierzęcych maskach, zabawne perypetie i próba zmierzenia się z innością, która zamiast dzielić, łączy naszych sympatycznych bohaterów.\nWedług dziennika „Le Monde” historia pana Borsuka i pani Lisicy to „przepełniona humorem i czułością piękna lekcja tolerancji”.','MÓJ PIERWSZY KOMIKS 5+. PAN BORSUK I PANI LISICA TOM 4 ANI CHWILI WYTCHNIENIA! (9788328150645)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. PAN BORSUK I PANI LISICA TOM 4 ANI CHWILI WYTCHNIENIA! (9788328150645)','','','',''),(1568,1,1,'Nadchodzi zima i wszystkie leśne zwierzęta są pochłonięte przygotowaniami: gromadzą zapasy, urządzają legowiska i żegnają się z sąsiadami. Pan Zrzędek próbuje zamieść zeschnięte liście z ganku swojego domu, ale ciągle ktoś mu w tym przeszkadza... Znakomicie dobrana kolorystyka idealnie oddaje atmosferę panującą tuż przed nadejściem zimy. Złote światło, brązowe liście wielkich drzew i zamglone niebo, a do tego ciepłe wnętrza przytulnych domków ukrytych w gęstym lesie.\n\nTo pogodny, ciepły i zabawny komiks dla najmłodszych, który z pewnością sprawi przyjemność także dorosłym czytelnikom.','MÓJ PIERWSZY KOMIKS 5+. W CIENIU DRZEW. JESIEŃ PANA ZRZĘDKA (9788328160897)','egmont','','','EGMONT','MÓJ PIERWSZY KOMIKS 5+. W CIENIU DRZEW. JESIEŃ PANA ZRZĘDKA (9788328160897)','','','',''),(1569,1,1,'W zbiorczym tomie znalazły się opowieści komiksowe autorstwa Mamy Muminków, Tove Jansson! Tove Jansson była znakomitą pisarką, autorką powieści i opowiadań o mieszkańcach Doliny Muminków, ale także rysowniczką. Nie tylko ilustrowała swoje książki, ale też stworzyła cykl komiksowych opowieści o sympatycznych trollach.\nPo komiksową serię powinien sięgnąć każdy miłośnik przygód przyjaciół z Doliny Muminków.\n\nPierwszy tom zawiera 11 czarno-białych opowiadań komiksowych: „Rabusie”, „Życie rodzinne”, „Muminki na Riwierze”, „Wyspa Muminków”, „Niebezpieczna zima”, „Zabawa w udawanie”, „Nowy dom Muminka”, „Nowe życie Muminków”, „Zakochany Muminek”, „Dżungla w Dolinie Muminków” oraz „Muminki i Marsjanie”.','MUMINKI, TOM 1 (9788328159037)','egmont','','','EGMONT','MUMINKI, TOM 1 (9788328159037)','','','',''),(1570,1,1,'Przygody sympatycznego psa Billa i jego pana – małego chłopca Ptysia. Humorystyczna seria dla dzieci i dorosłych. Album zbiorczy zawiera trzy tomy oryginalne: \"\"Bill, na psa urok!\"\", \"\"Bill zbzikował\"\" i \"\"Globtroterzy\"\". Ptyś ciągle ma kłopoty – w szkole powoduje wypadek dyrektora, ucieka przed strażnikami parków miejskich, dowiaduje się, że każdy musi robić w życiu coś ważnego... A co ważnego może robić kilkuletnie dziecko? Oj, może... Wygłupiać się z ukochanym psem, szaleć z przyjacielem i wymyślać rzeczy, które doprowadzają dorosłych do rozpaczy. Tata narzeka na drożyznę, mama wścieka się, że mężczyźni nie doceniają kobiet, ale Ptyś i jego spaniel Bill bardziej interesują się robieniem papierowych samolotów i zapełnianiem żołądka pysznościami. Jednak pewnego dnia czeka ich przygoda największa z możliwych: podróż dookoła świata! Pomysłodawcą serii był legendarny belgijski autor Jean Roba (1930–2006; m.in. \"Sprycjan i Fantazjusz\"), który tworzył ją od 1959 do 2001 roku. W 2003 roku cykl przejął francuski rysownik Laurent Verron (\"Le Maltais\",\"Odilon Verjus\", \"Fugitifs\"), a po nim scenarzysta Christophe Cazenove (\"Sisters\", \"Kasia i jej kot\") i grafik Jean Bastide (\"Sherlock Holmes Society\", \"Wojna Sambre’ów\").','PTYŚ I BIL, TOM 6 BILL, NA PSA UROK! (9788328196452)','egmont','','','EGMONT','PTYŚ I BIL, TOM 6 BILL, NA PSA UROK! (9788328196452)','','','',''),(1571,1,1,'Wesołe przygody szalonego psa Billa i jego pana – chłopca Ptysia. Album zbiorczy zawiera trzy tomy oryginalne: „Psie życie”, „Uwaga, wesoły pies!” i „Zabawy Billa”.\n\nPtyś lubi bawić się z innymi dziećmi, ale jego najwierniejszym kompanem jest spaniel Bill. Razem wymyślają psikusy, razem sędziują mecze piłkarskie, razem szukają czterolistnych koniczyn i puszczają latawce. Kiedy jednak trzeba wykąpać nieznoszącego wody Billa, Ptyś staje po stronie rodziców. Lecz sprytny spaniel też potrafi postawić na swoim, choćby po to, żeby zdobyć ulubione przysmaki! Obaj również mają swoje słabości – chłopiec bardzo wstydzi się rozmawiać z dziewczynkami, a pies nie może się powstrzymać przed ukrywaniem kości w najdziwniejszych miejscach... Nie ma dnia, żeby Ptyś i Bill nie wyczyniali szaleństw albo nie grali dorosłym na nerwach!\n\nPomysłodawcą serii był legendarny belgijski autor Jean Roba (1930–2006; m. in. „Sprycjan i Fantazjusz”), który tworzył ją od 1959 do 2001 roku. W 2003 roku cykl przejął francuski rysownik Laurent Verron („Le Maltais”, „Odilon Verjus”, „Fugitifs”), a po nim scenarzysta Christophe Cazenove („Sisters”, „Kasia i jej kot”) i grafik Jean Bastide („Sherlock Holmes Society”, „Wojna Sambre’ów”).','PTYŚ I BIL, TOM 8 ZABAWY BILLA (9788328196476)','egmont','','','EGMONT','PTYŚ I BIL, TOM 8 ZABAWY BILLA (9788328196476)','','','',''),(1572,1,1,'Skrząca się humorem seria gagów zarówno dla dzieci, jak i dorosłych.','PTYŚ I BILL, TOM 1 DO ATAKU! (9788328166974)','egmont','','','EGMONT','PTYŚ I BILL, TOM 1 DO ATAKU! (9788328166974)','','','',''),(1573,1,1,'Drugi tom skrzącej się humorem serii gagów zarówno dla dzieci, jak i dorosłych. Ptyś chodzi do podstawówki. Nie przepada za szkołą ani warzywami, uwielbia za to szalone pomysły i wygłupy. Ma też wielką i niczym nieskrępowaną wyobraźnię. A że jego najlepszym przyjacielem jest skory do żartów pies Bill, więc każdy ich dzień jest wypełniony przygodami. Nie tylko zabawa w Indianę Jonesa czy budowa ogromnego zamku ze śniegu, ale nawet przygotowanie zwykłego obiadu to dla bohaterów okazja do nieziemskiej zabawy, podczas której często wpadają w kłopoty!\nPomysłodawcą serii był legendarny belgijski autor Jean Roba (1930–2006; m.in. Sprycjan i Fantazjusz), który tworzył ją od 1959 do 2001 roku. Album zbiorczy zawiera trzy tomy oryginalne: Śmiech to zdrowie!, Buff Halo Bill? i Cztery pory roku.','PTYŚ I BILL, TOM 2 ŚMIECH TO ZDROWIE! (9788328134645)','egmont','','','EGMONT','PTYŚ I BILL, TOM 2 ŚMIECH TO ZDROWIE! (9788328134645)','','','',''),(1574,1,1,'Przygody pomysłowego chłopca i jego szalonego psa. Humorystyczna seria dla dzieci i dorosłych. Album zbiorczy zawiera trzy tomy oryginalne: „Koncert na trzy osoby i psa”, „Nie ma jak spacer!” i „Błyskotliwy Bill”.\nPtyś i jego spaniel Bill nie potrafią bez siebie żyć i pomagają sobie zawsze, kiedy trzeba. Obaj też mają mnóstwo zwariowanych pomysłów, które nie umilają życia innym osobom... Na szczęście rodzice chłopca są przyzwyczajeni do błazeństw swoich pupili, a sami też od czasu do czasu zrobią coś wesołego i szalonego. Cała rodzinka jest siebie warta!','PTYŚ I BILL, TOM 9 KONCERT NA TRZY OSOBY I PSA (9788328149519)','egmont','','','EGMONT','PTYŚ I BILL, TOM 9 KONCERT NA TRZY OSOBY I PSA (9788328149519)','','','',''),(1575,1,1,'Drugi album bestsellerowej serii o słynnych niebieskich skrzatach! Tom zawiera dwie opowieści: „Smerf Naczelnik\" i „Smerfosymfonia\". Ze Smerfami tak już bywa, że kiedy Papy Smerfa nie ma w wiosce, jego mali podopieczni nieznośnie harcują... Tym razem zaczynają się kłócić, który z nich powinien zostać przywódcą podczas nieobecności mądrego czarodzieja. Postanawiają urządzić wybory. Pewien sprytny Smerf obiecuje pozostałym niebieskim skrzatom, że spełni wszystkie ich zachcianki, jeśli wybiorą go szefem wioski! Czy ktoś taki okaże się dobrym naczelnikiem, czy tyranem? I czy wierność można zdobyć rozdawaniem orderów oraz dodatkowych porcji smerfojagód?\n\nSmerfy wymyślił belgijski scenarzysta i grafik Pierre Culliford (1928–1992), używający pseudonimu Peyo. Obecnie autorami serii są następcy Peyo, w tym jego syn Thierry.','SMERF NACZELNIK, TOM 2 (9788328142299)','egmont','','','EGMONT','SMERF NACZELNIK, TOM 2 (9788328142299)','','','',''),(1576,1,1,'Pierwszy tomik zupełnie nowej serii o Smerfach. Przeznaczona jest dla najmłodszych czytelników i pomaga im w przezwyciężeniu wszelkiego rodzaju lęków i problemów. Każdy album jest uzupełniony zrozumiale napisanymi radami dla rodziców, jak mają rozmawiać z dzieckiem, aby pomóc mu w kłopotach emocjonalnych. Także same dzieci mogą korzystać z tych wskazówek. Strachuś boi się wszystkiego, jednak najgorzej jest nocą – nie może zasnąć, bo czuje obezwładniający strach przed ciemnością. W dodatku jego krzyki sprawiają, że cała wioska budzi się raz za razem. Na szczęście innym Smerfom i Papie nie brakuje pomysłów, jak pomóc biednemu przyjacielowi! Dzięki temu komiksowi nauczysz się mierzyć ze swoimi lękami i je przezwyciężać!\n\nSmerfy wymyślił belgijski scenarzysta i grafik Pierre Culliford (1928–1992) używający pseudonimu Peyo. Seria dla najmłodszych jest współtworzona przez jego syna Thierry’ego.','SMERFY I ŚWIAT EMOCJI 1 - SMERF, KTÓRY BAŁ SIĘ CIEMNOŚCI (9788328159525)','egmont','','','EGMONT','SMERFY I ŚWIAT EMOCJI 1 - SMERF, KTÓRY BAŁ SIĘ CIEMNOŚCI (9788328159525)','','','',''),(1577,1,1,'Drugi tomik zupełnie nowej serii o Smerfach. Przeznaczona jest dla najmłodszych czytelników i pomaga im w przezwyciężeniu wszelkiego rodzaju lęków i problemów. Każdy album jest uzupełniony zrozumiale napisanymi radami dla rodziców, jak mają rozmawiać z dzieckiem, aby pomóc mu w kłopotach emocjonalnych. Także same dzieci mogą korzystać z tych wskazówek. Ciamajda robi wszystko nie tak, jak trzeba, dlatego nikt nie chce korzystać z jego pomocy. Biedaczek czuje się niepotrzebny w wiosce Smerfów. Robi się coraz smutniejszy i przestaje wierzyć w siebie. Ale pewnego dnia Papa Smerf powierza mu misję najwyższej wagi... Dzięki temu komiksowi nauczysz się wierzyć w siebie!\n\nSmerfy wymyślił belgijski scenarzysta i grafik Pierre Culliford (1928–1992) używający pseudonimu Peyo. Seria dla najmłodszych jest współtworzona przez jego syna Thierry’ego.','SMERFY I ŚWIAT EMOCJI 2 - SMERF, KTÓRY BYŁ NIEZDARNY (9788328159532)','egmont','','','EGMONT','SMERFY I ŚWIAT EMOCJI 2 - SMERF, KTÓRY BYŁ NIEZDARNY (9788328159532)','','','',''),(1578,1,1,'Trzeci tom opowieści o Smerfach, która ma pomagać najmłodszym czytelnikom w przezwyciężaniu wszelkiego rodzaju lęków i problemów. Każdy album jest uzupełniony zrozumiale napisanymi wskazówkami dla dzieci i ich rodziców, jak radzić sobie z kłopotami emocjonalnymi. Nadeszła pora obiadu, ale Łasuch, który przecież zawsze pierwszy przybiega na posiłek, tym razem nie jest głodny! Okazuje się, że ma pełny brzuch, bo potajemnie zjadł deser przeznaczony dla wszystkich Smerfów. Jako karę Papa Smerf nakazuje mu przygotować nowy deser – i to dla całej wioski... Przed Łasuchem trudne zadanie, które okaże się wręcz niebezpieczne, ponieważ w sprawę wmiesza się straszny czarownik Gargamel! Dzięki temu komiksowi nauczysz się, jak zdrowo jeść! Smerfy wymyślił belgijski scenarzysta i grafik Pierre Culliford (1928–1992) używający pseudonimu Peyo. Seria dla najmłodszych jest współtworzona przez jego syna Thierry’ego.','SMERFY I ŚWIAT EMOCJI 3 - SMERF, KTÓRY LUBIŁ TYLKO DESER (9788328159549)','egmont','','','EGMONT','SMERFY I ŚWIAT EMOCJI 3 - SMERF, KTÓRY LUBIŁ TYLKO DESER (9788328159549)','','','',''),(1579,1,1,'Czwarta część serii o Smerfach, która pomaga najmłodszym czytelnikom w przezwyciężaniu lęków. Każdy album jest uzupełniony zrozumiale napisanymi wskazówkami dla dzieci i ich rodziców, jak radzić sobie z kłopotami emocjonalnymi. Smerfetka jest jedyną dziewczyną w wiosce Smerfów. Chciałaby pomagać pracującym kolegom lub robić z nimi coś ciekawego, ale chłopcy jej nie potrzebują albo nie wierzą, że mogłaby im dorównać w jakiejś dziedzinie sportu... Wolą dawać Smerfetce kwiaty, ale ona ma już dość kwiatów! Żeby wreszcie móc robić coś innego niż zazwyczaj, wpada na zabawny pomysł. Jaki? Sami sprawdźcie! Dzięki temu komiksowi dzieci poznają pojęcie szacunku dla odmienności! Smerfy wymyślił belgijski scenarzysta i grafik Pierre Culliford (1928–1992) używający pseudonimu Peyo. Seria dla najmłodszych jest współtworzona przez jego syna Thierry’ego.','SMERFY I ŚWIAT EMOCJI 4 - SMERFETKA JEST TAKIM SAMYM SMERFEM JAK INNE (9788328159556)','egmont','','','EGMONT','SMERFY I ŚWIAT EMOCJI 4 - SMERFETKA JEST TAKIM SAMYM SMERFEM JAK INNE (9788328159556)','','','',''),(1580,1,1,'Szósty tom serii o Smerfach, która ma pomagać najmłodszym czytelnikom w przezwyciężeniu lęków i problemów. Każdy album jest uzupełniony wskazówkami dla dzieci i ich rodziców, jak radzić sobie z kłopotami emocjonalnymi. Prawie każdy Smerf jest w czymś dobry, na przykład Osiłek to znakomity sportowiec. Jednak jest też Smerf zmyślający na potęgę i chwalący się rzeczami, których nigdy nie zrobił. Kłamie, a potem się wstydzi, gdy prawda wychodzi na jaw. Czy ktoś taki może w jakikolwiek sposób okazać się przydatny społeczności Smerfów? Dzięki temu komiksowi zrozumiesz, że warto mówić prawdę!','SMERFY I ŚWIAT EMOCJI 6 - SMERF, KTÓRY CIĄGLE KŁAMAŁ (9788328160200)','egmont','','','EGMONT','SMERFY I ŚWIAT EMOCJI 6 - SMERF, KTÓRY CIĄGLE KŁAMAŁ (9788328160200)','','','',''),(1581,1,1,'Siódmy tom serii o Smerfach, która ma pomagać najmłodszym czytelnikom w przezwyciężeniu lęków i problemów. Każdy album jest uzupełniony wskazówkami dla dzieci i ich rodziców, jak radzić sobie z kłopotami emocjonalnymi.\nPewien Smerf ciągle się spieszy, ciągle myśli o czymś nowym. Brakuje mu cierpliwości, a bez niej niczego nie da się porządnie zrobić ani nauczyć. Co więcej, jego zachowanie może zaszkodzić postronnym osobom, o czym boleśnie przekonuje się kilka Smerfów... Czy kolejne niepowodzenia spowodują, że niecierpliwy bohater się zmieni? Dzięki temu komiksowi dowiesz się, jakie skutki może mieć brak cierpliwości!','SMERFY I ŚWIAT EMOCJI 7 - SMERF, KTÓRY BYŁ NIECIERPLIWY (9788328150560)','egmont','','','EGMONT','SMERFY I ŚWIAT EMOCJI 7 - SMERF, KTÓRY BYŁ NIECIERPLIWY (9788328150560)','','','',''),(1582,1,1,'Ósmy tom serii o Smerfach, która ma pomagać najmłodszym czytelnikom w przezwyciężeniu swoich lęków oraz w zapoznaniu się z problemami współczesnego świata, takimi jak ekologia. Każdy album jest uzupełniony wskazówkami dla dzieci i ich rodziców, jak radzić sobie z kłopotami emocjonalnymi i dnia codziennego. W słoneczne dni Smerfy lubią urządzać zabawy na łonie natury, ale jeden z małych bohaterów wszędzie śmieci, brudzi i wyrzuca niebezpieczne przedmioty, gdzie popadnie. Nic sobie nie robi z uwag innych Smerfów, szybko jednak się przekona, do czego może doprowadzić jego nieodpowiedzialne zachowanie...\n\nDzięki temu komiksowi dowiesz się, dlaczego trzeba dbać o przyrodę! Smerfy wymyślił belgijski scenarzysta i grafik Pierre Culliford (1928–1992), używający pseudonimu Peyo.\n\nSeria dla najmłodszych jest pisana przez jego syna Thierry’ego Culliforda oraz Falzara, a za rysunki odpowiada Antonello Dalena, ilustrator znany m.in. z „Ernesta i Rebeki”, „W.I.T.C.H.” czy komiksów z Kaczorem Donaldem.','SMERFY I ŚWIAT EMOCJI 8 - SMERF, KTÓRY ŚMIECIŁ (9788328150577)','egmont','','','EGMONT','SMERFY I ŚWIAT EMOCJI 8 - SMERF, KTÓRY ŚMIECIŁ (9788328150577)','','','',''),(1583,1,1,'Dziewiąty tom serii o Smerfach, która ma pomagać najmłodszym czytelnikom w przezwyciężeniu własnych lęków. Każdy album jest uzupełniony wskazówkami dla dzieci i ich rodziców, jak radzić sobie z kłopotami emocjonalnymi. Smerf Wędkarz uwielbia łowić ryby, ale tylko dla sportu, bo zaraz potem je wypuszcza. Pewnego dnia poznaje pięknego motylka. Zostają przyjaciółmi i wszystko robią razem. Uwielbiają się bawić, a każda chwila jest dla nich przyjemnością. Niestety nic nie trwa wiecznie... Dzięki temu komiksowi dowiesz się, jak radzić sobie ze śmiercią bliskiej osoby.\n\nSmerfy wymyślił belgijski scenarzysta i grafik Pierre Culliford (1928–1992), używający pseudonimu Peyo. Seria dla najmłodszych jest pisana przez jego syna Thierry’ego Culliforda oraz Falzara, a za rysunki odpowiada Antonello Dalena, ilustrator znany m.in. z „Ernesta i Rebeki”, „W.I.T.C.H.” czy komiksów z Kaczorem Donaldem.','SMERFY I ŚWIAT EMOCJI 9 - SMERF, KTÓRY STRACIŁ PRZYJACIELA (9788328150584)','egmont','','','EGMONT','SMERFY I ŚWIAT EMOCJI 9 - SMERF, KTÓRY STRACIŁ PRZYJACIELA (9788328150584)','','','',''),(1584,1,1,'Trzecia część cyklu Smerfy i wioska dziewczyn, który nawiązuje do wydarzeń przedstawionych w kinowym filmie o bohaterach z Zaczarowanego Lasu. Papa Smerf i Wierzba wybierają się na wielki zlot czarodziei. Zawsze, gdy ci mądrzy przywódcy obu osiedli Smerfów wyruszają w podróż, ich mali podopieczni wpadają w kłopoty... Pewnego dnia dziewczyny z leśnej wioski wraz z przebywającą u nich w gościnie Smerfetką spotykają w puszczy kruka. Kruka niezwykłego, bo umiejącego mówić i dawać rady! Czy jednak są to rady mądre? A przede wszystkim: po co czarodziejski ptak przybył do krainy Smerfów?','SMERFY I WIOSKA DZIEWCZYN TOM 3 KRUK (9788328142282)','egmont','','','EGMONT','SMERFY I WIOSKA DZIEWCZYN TOM 3 KRUK (9788328142282)','','','',''),(1585,1,1,'Czwarta część cyklu „Smerfy i wioska dziewczyn”, który nawiązuje do wydarzeń przedstawionych w kinowym filmie o bohaterach z Zaczarowanego Lasu. Przysłany przez Gargamela gadający kruk został pokonany, ale w wyniku jego podstępnych działań spłonęły nadrzewne domki dziewczyn... Teraz podopieczne mądrej Wierzby muszą szukać nowego miejsca do życia. W towarzystwie przyjaciół z wioski chłopaków wyruszają w daleką wędrówkę przez lasy, góry i bagna. Czy znajdą wymarzoną krainę? Na tej pełnej niebezpieczeństw drodze spotkają też olbrzymiego potwora, jakiego nigdy wcześniej nie widziały!\n\nSmerfy wymyślił belgijski scenarzysta i grafik Pierre Culliford (1928–1992) używający pseudonimu Peyo. Jego komiksy zostały zaadaptowane na potrzeby filmów o przygodach niebieskich skrzatów. Obecnie autorami nowych opowieści o Smerfach są następcy Peyo, w tym jego syn Thierry.','SMERFY I WIOSKA DZIEWCZYN TOM 4 NOWY POCZĄTEK (9788328142336)','egmont','','','EGMONT','SMERFY I WIOSKA DZIEWCZYN TOM 4 NOWY POCZĄTEK (9788328142336)','','','',''),(1586,1,1,'Piąta część cyklu „Smerfy i wioska dziewczyn”, który nawiązuje do wydarzeń przedstawionych w kinowym filmie o bohaterach z Zaczarowanego Lasu.\nMięta jest Smerfką, która bardzo chciałaby poznać tajniki stosowania ziół i zostać pomocnicą naczelniczki Wierzby. Niestety, jej wiedza o roślinach, także tych drapieżnych, wciąż jest niewielka, dlatego niefrasobliwym zachowaniem powoduje, że przywódczyni wioski dziewczyn zostaje ranna. Aby ją uzdrowić, Mięta z przyjaciółkami będą musiały wyruszyć na koniec świata, gdzie znajduje się cudowne źródło. Czekają je niezwykłe i straszne przygody! Czy śmiałym Smerfkom uda się osiągnąć cel?','SMERFY I WIOSKA DZIEWCZYN TOM 5 KIJ WIERZBY (9788328152007)','egmont','','','EGMONT','SMERFY I WIOSKA DZIEWCZYN TOM 5 KIJ WIERZBY (9788328152007)','','','',''),(1587,1,1,'Kolejna opowieść o wesołych Smerfach, małych mieszkańcach wioski zagubionej w ogromnym lesie.\nSmerfy dobrze przygotowały się do zimy – zebrały zapasy żywności i drewna na opał. Nie przewidziały tylko jednego: najstraszliwszej od lat śnieżycy! Naszym bohaterom grozi wielkie niebezpieczeństwo – ich wioska może zostać całkowicie zasypana. Co gorsza, w chwili nadejścia zawiei kilka Smerfów znalazło się poza domem. Czy uda im się znaleźć jakieś schronienie? A nawet jeśli, to jak poradzą sobie bez jedzenia? Czy ktokolwiek im pomoże?','SMERFY TOM 39 SMERFY I ŚNIEŻYCA (9788328152946)','egmont','','','EGMONT','SMERFY TOM 39 SMERFY I ŚNIEŻYCA (9788328152946)','','','',''),(1588,1,1,'Czwarty album przygód Smerfów, niezwykłych istot, które zostały pokochane przez dzieci na całym świecie.\n\nTom zawiera trzy opowieści: „Jajko i Smerfy”, „Fałszywy Smerf” i „Setny Smerf”. Zbliża się Święto Smerfów, na które mieszkańcy wioski zagubionej w zaczarowanym lesie zawsze przygotowują coś niecodziennego. Tym razem postanawiają zrobić ciasto, do którego potrzebne jest jajko... Tyle że trzeba się po nie wybrać tam, gdzie są kury, czyli do ludzkich siedzib. A kiedy już Smerfom udaje się zdobyć jajko, okazuje się, że jest bardzo niezwykłe – i dopiero wtedy zaczynają się prawdziwe kłopoty naszych bohaterów... Potem Smerfy będą musiały się bronić przed okrutną zemstą czarownika Gargamela, a w końcu Laluś znajdzie nowego Smerfa... po drugiej stronie lustra!\n\nSmerfy wymyślił belgijski scenarzysta i grafik Pierre Culliford (1928–1992) używający pseudonimu Peyo. Obecnie autorami serii są następcy Peyo, w tym jego syn Thierry.','SMERFY TOM 4 JAJKO I SMERFY (9788328150317)','egmont','','','EGMONT','SMERFY TOM 4 JAJKO I SMERFY (9788328150317)','','','',''),(1589,1,1,'Piąty album przygód Smerfów, niezwykłych istot, które zostały pokochane przez dzieci na całym świecie. Tom zawiera dwie opowieści: „Smerfy i Krakukas” oraz „Smerf inny niż wszystkie”.\nPapa Smerf pracuje nad miksturą mającą zwiększyć plony smerfojagód, jednak eksperyment wymyka się spod kontroli i czarodziej wpada w poważne tarapaty. Niedługo potem wioska bohaterów zostaje zaatakowana przez straszliwego ptaka! Skąd się wziął ten potwór? Czy uda się go pokonać? Następnie poznamy Smerfa, który jest znudzony życiem w gronie przyjaciół i pragnie wyruszyć w podróż dookoła świata. Jak daleko zajdzie? Jakie niebezpieczeństwa napotka na swojej drodze?','SMERFY TOM 5 SMERFY I KRAKUKAS (9788328150324)','egmont','','','EGMONT','SMERFY TOM 5 SMERFY I KRAKUKAS (9788328150324)','','','',''),(1590,1,1,'Następny tom szalonych przygód małych mieszkańców wioski zagubionej pośrodku wielkiego lasu. Tym razem dojdzie do wydarzeń, które nie przystoją spokojnym Smerfom! A jaka będzie przyczyna rozróby? Otóż każda rzecz ma własną nazwę. Co jednak począć, gdy różne Smerfy zaczynają nadawać tym samym rzeczom odmienne nazwy? Która jest lepsza? Od różnicy zdań blisko jest do kłótni, od kłótni jeden krok do bójki, a od niej do... No właśnie, jak daleko posuną się zawzięte Smerfy? Oto wielka i hałaśliwa awantura rozpoczęta zwykłym sporem o to, jak należy nazywać korkociąg! W dalszej części albumu nastąpi przegląd smerfich zmagań sportowych – oczywiście na wesoło!','SMERFY TOM 9 AWANTURA W WIOSCE SMERFÓW (9788328142305)','egmont','','','EGMONT','SMERFY TOM 9 AWANTURA W WIOSCE SMERFÓW (9788328142305)','','','',''),(1591,1,1,'Zuchwała buntowniczka Toska i jej brat, muzyk Rinaldo, są sierotami. Wraz z wiernym sokołem Argo mieszkają w kryjówce w sercu toskańskiego lasu. Toska, uzbrojona w procę, łuk i strzały, zawsze staje po stronie słabszych. Podczas wyprawy do zamku Castelguelfo rodzeństwo spotyka Lucillę, jedyną córkę tamtejszego księcia. To spotkanie zapoczątkuje serię niezwykłych przygód i odmieni życie całej trójki!\n\nAutorami serii są znani wloscy scenarzyści i ilustratorzy Teresa Radice i Stefano Turconi, autorzy m.in. przygodowych serii \"Violette around the world\" i \"Forbidden Harbour\".','TOSKA Z LASU TOM 1 PANNY, ZŁODZIEJE, RYCERZE I MINSTRELE (9788328154810)','egmont','','','EGMONT','TOSKA Z LASU TOM 1 PANNY, ZŁODZIEJE, RYCERZE I MINSTRELE (9788328154810)','','','',''),(1592,1,1,'Drugi tom przygodowej serii o nastoletniej buntowniczce ze średniowiecznej Italii – Tosce i jej przyjaciołach. Podczas gdy pan na Castelguelfo szykuje się do wojny z nikczemnym Gautierem z Brienne, jego córka Lucilla wymyka się z rodzinnego zamku i poznaje świat w towarzystwie zakonnika Cosimo oraz swoich nowych znajomych – Toski i Rinalda. W drodze troje bohaterów przeżywa wspaniałe przygody, ale gdy wojna jest tuż-tuż, na każdym kroku czai się niebezpieczeństwo…','TOSKA Z LASU TOM 2 SPISKI, UCIECZKI, TAJEMNICE I PORWANIA (9788328154827)','egmont','','','EGMONT','TOSKA Z LASU TOM 2 SPISKI, UCIECZKI, TAJEMNICE I PORWANIA (9788328154827)','','','',''),(1593,1,1,'Drugi (po „Człowieku, który zabił Lucky Luke’a”) z umieszczonych poza główną serią albumów o Samotnym Kowboju autorstwa Matthieu Bonhomme’a.\nLucky Luke dowiaduje się, że jest poszukiwany listem gończym! Nie wie, za co miałoby go ścigać ramię sprawiedliwości, ale podobnych wątpliwości nie mają bezwzględni bandyci i groźni Apacze, którzy chcą zgarnąć ogromną nagrodę. A to nie koniec kłopotów naszego bohatera, bo ten zwykle stroniący od kobiet samotnik wpada w oko trzem pięknym siostrom... Czy wyjaśni się sprawa zagadkowego wystawienia listu gończego za na wskroś uczciwym rewolwerowcem i czy Luke ulegnie czarowi miłości?\n\nCykl o Lucky Luke’u był przez wiele lat tworzony przez mistrzów komiksu Morrisa i Goscinnego, a po ich śmierci jest kontynuowany przez uznanych francuskich artystów. Co pewien czas pojawiają się także albumy specjalne, w których przedstawiane są autorskie wizje przygód Samotnego Kowboja. Tak właśnie jest z opowieściami Matthieu Bonhomme’a, francuskiego scenarzysty i rysownika znanego z takich serii jak „Esteban” czy „Le Petit Prince”.','WANTED LUCKY LUKE! (9788328154919)','egmont','','','EGMONT','WANTED LUCKY LUKE! (9788328154919)','','','',''),(1594,1,1,'Specjalne wydanie zbiorcze komiksu opartego na hitowym serialu telewizyjnym! Śledź losy Jacka Bauera, który by chronić prezydenta musi powstrzymać morderce z dawnej Jugosławii, walczy z kartelem narkotykowym i radykałami, a nawet chaosem powstałym przez ekonomiczne i ekologiczne wyzwania! Tom zawiera komiksy 24: One Shot, 24: Midnight Sun, 24: Stories, 24: Cold Warriors oraz prequel 24: Nightfall.','24 OMNIBUS TP (9781613779033)','idw-publishing','','','IDW PUBLISHING','24 OMNIBUS TP (9781613779033)','','','',''),(1595,1,1,'What’s to Love: The Freaky Friday trope is turned on its head with an Ooo-sized twist. Paul Tobin and Colleen Coover, the team behind the Eisner Award-winning Bandette, writing Adventure Time with artist Wook Jin Clark (Megagogo)? It’s a match made in comic book heaven!\nWhat It Is: Finn is suffering from Quest Deficiency and needs his pals to help him find a righteous quest that will fulfill all his adventuring needs! The back of a questing board might seem like the easiest answer, but our hero is about to find out that the easy way out can create a ton of trouble. It’s a race against time as Finn and his merry band of questing cohorts fight to complete this switch-a-roo of a mission before the land of Ooo completely destroys itself. Collects the complete six-issue miniseries in an oversized hardcover.','ADVENTURE TIME FLIP SIDE MATHEMATICAL HC (9781608867134)','boom-studios','','','BOOM! STUDIOS','ADVENTURE TIME FLIP SIDE MATHEMATICAL HC (9781608867134)','','','',''),(1596,1,1,'(W) Christopher Hastings (A) Ian McGinty (CA) Shelli Paroline, Braden Lamb\nJake just wants to have a nice relaxing weekend without any adventures. Not too much to ask for, right? Too bad the Governor of Ghost-A- Rica has plans of his own and that means releasing his ghost minions to steal the youth of all the citizens in Ooo. It\'s a battle for youth, literally! Collects issues #50-54.\nSC, 7x10, 112pgs, FC SRP: $14.99\n\nPlanowana data premiery: 08.03.2017','ADVENTURE TIME TP VOL 11 (9781608869466)','boom-studios','','','BOOM! STUDIOS','ADVENTURE TIME TP VOL 11 (9781608869466)','','','',''),(1597,1,1,'Angel staje się celebrytą, gdy otrzymuje własny program telewizyjny. Nie oznacza to jednak, że pokazują tam jego polowania na potwory!\nBalansowanie między życiem gwiazdy a życiem wampira nie jest proste, a kiedy spotyka tajemniczą figurę z Sunnydale, okazuje się, że jest w śmiertelnym niebezpieczeństwie!\nNominowany do Nagrody Eisnera scenarzysta Christopher Cantwell (Iron Man, Dr. Doom, AMC\'s Halt and Catch Fire) i nominowany do Russ Manning Award artysta Daniel Bayliss (Jim Henson\'s Labyrinth: Coronation) przedstawiają nowe przygody w uniwersum Buffy!\nTom zbiera zeszyty Angel #1-4.','ANGEL TP VOL 01 (9781684158461)','boom-studios','','','BOOM! STUDIOS','ANGEL TP VOL 01 (9781684158461)','','','',''),(1598,1,1,'Katara i Sokka powracają do domu pośród ludzi plemienia wody. Są zaskoczeni, gdy odkrywają, że ich wioska zamieniła się w tętniące życiem miasto! Za przemianą stoi Malina z północy, która planuje zjednoczyć wszystkie wodne plemiona. Na jej drodze stoi Gilak i jego buntownicy. Katara musi teraz działać, by ocalić swój dom przez wojną i zniszczeniem! By to osiągnąć, dziewczyna musi pogodzić własną nostalgię i strach przed nowym.\nNiniejszy album, Avatar: The Last Airbender-North and South Gene’a Luen Yanga i Gurihiru zbiera w jednym tomie części pierwszą, drugą i trzecią.','AVATAR LAST AIRBENDER NORTH &amp; SOUTH OMNIBUS TP (9781506721675)','dark-horse','','','DARK HORSE','AVATAR LAST AIRBENDER NORTH & SOUTH OMNIBUS TP (9781506721675)','','','',''),(1599,1,1,'Aang and friends must join together once again as the four nations\' tenuous peace is threatened by an impasse between Fire Lord Zuko and Earth King Kuei! As the world heads toward another devastating war, Aang\'s friendship with Zuko throws him into the middle of the conflict! Available for the first time in an omnibus format, this is the official continuation of the Avatar: The Last Airbender series from Nickelodeon .','AVATAR LAST AIRBENDER OMNIBUS TP THE PROMISE (9781506717845)','dark-horse','','','DARK HORSE','AVATAR LAST AIRBENDER OMNIBUS TP THE PROMISE (9781506717845)','','','',''),(1600,1,1,'Avatar Aang i jego przyjaciele obchodzą święto Air Nomada, które nie było świętowana przez ponad sto lat. Jednakże, tajemnicze wizyty ducha Avatara Yangchena prowadzą Aanga do rafinerii wybudowanej na świętej ziemi Airbenderów. Wkrótce wszyscy znajdują się w niebezpieczeństwie, gdy niebezpieczny antyczny demon wybudza się i pragnie siać chaos!\nTen tom jest omnibusem w miękkiej oprawie zbierającym trzy części The Rift, będące kontynuacją hitu Nickelodeona - Avatar: The Last Airbender!','AVATAR LAST AIRBENDER RIFT OMNIBUS TP (9781506721712)','dark-horse','','','DARK HORSE','AVATAR LAST AIRBENDER RIFT OMNIBUS TP (9781506721712)','','','',''),(1601,1,1,'Immediately following the Avatar\'s adventures chronicled in The Promise, this remarkable omnibus that collects parts 1-3 of The Search, from Airbender creators Michael Dante DiMartino and Bryan Konietzko!','AVATAR LAST AIRBENDER SEARCH OMNIBUS TP (9781506721729)','dark-horse','','','DARK HORSE','AVATAR LAST AIRBENDER SEARCH OMNIBUS TP (9781506721729)','','','',''),(1602,1,1,'Lud Ognia prześladuje wizja spełnienia się przepowiedni Kemurikage, tajemniczych, na wpół legendarnych istot: obalić Zuko, inaczej kraj upadnie! Avatar Aang i jego przyjaciele towarzyszą Zuko i jego rodzinie w drodze do stolicy, nieświadomi zagrożenia jakie na nich czeka u celu. Niepokoje społeczne rosną, gdy New Ozai Society przygotowuje swoje działania przeciwko rodzinie królewskiej, a dzieci zaczynają znikać w niewyjaśnionych okolicznościach.\nPowróćcie do świata Avatar: The Last Airbender--Smoke and Shadow z nowym omnibusem zbierający trzy części historii w jednym tomie.','AVATAR LAST AIRBENDER SMOKE &amp; SHADOW OMNIBUS TP (9781506721682)','dark-horse','','','DARK HORSE','AVATAR LAST AIRBENDER SMOKE & SHADOW OMNIBUS TP (9781506721682)','','','',''),(1603,1,1,'Co mają ze sobą wspólnego piraci, więzienia i lawenda? Wszystkie pojawiają się w zbiorze historii z serii Avatar: The Last Airbender! Te trzy zamknięte opowieści, w których pojawiają się ulubione postacie z oryginalnego serialu animowanego, zostały po raz pierwszy zebrane w jednym zestawu.\nKontynuujmy przygodę z uwielbianym serialem telewizyjnym Avatar komiksowymi przygodami jego bohaterów napisanymi przez Faith Erin Hicks i narysowanymi przez Petera Matery’ego, z kolorami Adele Matery i literami Jimmy\'ego Betancourta z ComiCraft, we współpracy z oryginalnymi twórcami Michaelem Dante DiMartino i Bryanem Konietzko z Avatar Studios!\nZestaw zbiera Katara and the Pirate\'s Silver, Toph Beifong\'s Metalbending Academy i Suki, Alone.','AVATAR LAST AIRBENDER TP BOX SET (9781506732053)','dark-horse','','','DARK HORSE','AVATAR LAST AIRBENDER TP BOX SET (9781506732053)','','','',''),(1604,1,1,'No description','BATMAN ADVENTURES CAT GOT YOUR TONGUE TP (9781779510808)','dc-comics','','','DC COMICS','BATMAN ADVENTURES CAT GOT YOUR TONGUE TP (9781779510808)','','','',''),(1605,1,1,'Written and drawn by the masterminds behind Batman: The Animated Series, Paul Dini and Bruce Timm, this epic reveals the origins of Harley Quinn as she proves her love to The Joker by trying to eliminate the Dark Knight on her own! Now in a deluxe format with exclusive extras and bonus material!','BATMAN ADVENTURES MAD LOVE DELUXE ED HC (9781401255121)','dc-comics','','','DC COMICS','BATMAN ADVENTURES MAD LOVE DELUXE ED HC (9781401255121)','','','',''),(1606,1,1,'Pierwsze dziesięć numerów klasycznej serii idealnej dla czytelników w każdym wieku, powraca w nowej kolekcji! Nie przegap opowieści o Mrocznym Rycerzu wraz z udziałem Jokera, Penguina, Catwoman, Scarecrowa, Killer Croca, Clayface\'a, Riddlera i innych! ','BATMAN ADVENTURES TP VOL 01 (9781401252298)','dc-comics','','','DC COMICS','BATMAN ADVENTURES TP VOL 01 (9781401252298)','','','',''),(1607,1,1,'No description','BATMAN THE ADVENTURES CONTINUE TP (9781779507891)','dc-comics','','','DC COMICS','BATMAN THE ADVENTURES CONTINUE TP (9781779507891)','','','',''),(1608,1,1,'NA PODSTAWIE AKTORSKIEJ ADAPTACJI ANIME DOSTĘPNEJ NA NETFLIXIE!\nOryginalna historia rozgrywa się w roku 2171. Grupa łowców nagród ze statku kosmicznego Bebop poszukuje dawnego załoganta, który ma na sobie kamizelkę zapewniającą niesamowite szczęście.\nTom zbiera zeszyty #1-4. ','COWBOY BEBOP TP VOL 01 (9781787737877)','titan-comics','','','TITAN COMICS','COWBOY BEBOP TP VOL 01 (9781787737877)','','','',''),(1609,1,1,'Some of the best all-ages Batman stories ever are back in this new title collecting BATMAN ADVENTURES #2 and 27, BATMAN: GOTHAM ADVENTURES #2 and 4, and a short tale from ADVENTURES IN THE DC UNIVERSE #3. Guest-starring Catwoman, The Joker, Two-Face and more!','DC COMICS PRESENTS BATMAN ADVENTURES #1','dc-comics','','','DC COMICS','DC COMICS PRESENTS BATMAN ADVENTURES #1','','','',''),(1610,1,1,'No description','DC MEETS HANNA BARBERA TP VOL 01 (9781401276041)','dc-comics','','','DC COMICS','DC MEETS HANNA BARBERA TP VOL 01 (9781401276041)','','','',''),(1611,1,1,'Co się stanie gdy spotkają się Flash i Speed Buggy? Czy kiedy Super Sons zmierzyli się z Dynomuttem? Czy Black Lightning przetnie swoją drogę z Hong Kong Phooey’em? I coś się stanie z Aquamanem gdy pozna innego mieszkańca głębin, Jabberjawa? Zawiera THE FLASH/SPEED BUGGY SPECIAL #1, SUPER SONS/DYNOMUTT SPECIAL #1, BLACK LIGHTNING/ SPECIAL #1 i AQUAMAN/JABBERJAW SPECIAL #1.','DC MEETS HANNA BARBERA TP VOL 02 (9781401286286)','dc-comics','','','DC COMICS','DC MEETS HANNA BARBERA TP VOL 02 (9781401286286)','','','',''),(1612,1,1,'Doktor powraca w komiksowym debiucie klasycznego przeciwnika z lat 70.! Po ucieczce z rąk Płaczących Aniołów i Autonów w Londynie z 1960 roku, Dziesiąty i Trzynasta Doktor muszą połączyć siły po raz kolejny, by ocalić współczesną Ziemię od przejęcia władzy przez Skithrę i klasycznych wodnych wrogów, Sea Devils! Kto jeszcze może im pomóc? Może Rose Tyler, przywódca ruchu oporu? Tom zbiera zeszyty Doctor Who Comics #1-4.','DOCTOR WHO ALTERNATING CURRENT TP (9781787733121)','titan-comics','','','TITAN COMICS','DOCTOR WHO ALTERNATING CURRENT TP (9781787733121)','','','',''),(1613,1,1,'Celebrate the fiftieth-anniversary of Doctor Who anew with an epic adventure featuring the Doctor\'s first eleven incarnations! Writers Scott &amp; David Tipton are joined by some of the greatest artists of the Doctor\'s comic book past and present to tell a story that shakes the Doctor to his core! Collects Doctor Who: Prisoners of Time #1-12.\nPlanowana data premiery: 20.01.2016','DOCTOR WHO PRISONERS OF TIME TP (9781782767749)','titan-comics','','','TITAN COMICS','DOCTOR WHO PRISONERS OF TIME TP (9781782767749)','','','',''),(1614,1,1,'No description','DOCTOR WHO ROAD TO 13TH DOCTOR TP (9781785869310)','titan-comics','','','TITAN COMICS','DOCTOR WHO ROAD TO 13TH DOCTOR TP (9781785869310)','','','',''),(1615,1,1,'Collecting the eleventh Doctor\'s adventures from the pages of Doctor Who Magazine! The Child of Time features adventures alongside Amy Pond. Hunter of the Burning Stone features the 50th-anniversary story, and The Blood of Azrael features the an epic adventure alongside Clara Oswald!','DOCTOR WHO TP CHILD OF TIME (9781846534607)','panini','','','PANINI','DOCTOR WHO TP CHILD OF TIME (9781846534607)','','','',''),(1616,1,1,'No description','DOCTOR WHO TP CLOCKWISE WAR (9781846539695)','panini','','','PANINI','DOCTOR WHO TP CLOCKWISE WAR (9781846539695)','','','',''),(1617,1,1,'No description','DOCTOR WHO TP MISTRESS OF CHAOS (9781846533860)','panini','','','PANINI','DOCTOR WHO TP MISTRESS OF CHAOS (9781846533860)','','','',''),(1618,1,1,'Oto pierwszy w historii event komiksowy w uniwersum Firefly. Szeryf Mal Reynolds musi powstrzymać korporację Blue Sun przed uruchomieniem zastępów mechanicznych stróżów prawa. Czy tym razem pomoże mu załoga Serenity? Może już jest za późno? Tom zbiera zeszyty Firefly Blue Sun Rising #0, oraz Firefly #21-22.','FIREFLY BLUE SUN HC VOL 01 (9781684156597)','boom-studios','','','BOOM! STUDIOS','FIREFLY BLUE SUN HC VOL 01 (9781684156597)','','','',''),(1619,1,1,'Scenarzysta Josh Lee Gordon (Firefly: Bad Company) i artysta Fabiana Mascolo (Yasmeen) przedstawiają nową erę w dziejach Firefly, pełną nowych bohaterów, przygód i niespodzianek. Minęło dwadzieścia lat, odkąd oryginalna załoga Serenity zajmowała się szmuglowaniem kontrabandy, przewożeniem podróżników, oraz potyczkami z Alliance. Każde z nich jest teraz w innym miejscu. Zoe Washburne i jej córka Emma trafiają na pokład Serenity, i poszukują chętnych do załogi, by znów ruszyć w podróż po zmienionym wszechświecie. Czeka na nich wstrząsające odkrycie. Razem jednak, poznają nowych przyjaciół, spotkają się z tymi starymi, oraz będą budować nowe związki. Nowa przyszłość z trudnej przeszłości. Tom zbiera zeszyty Firefly: Brand New \'Verse #1-6.','FIREFLY BRAND NEW VERSE HC (9781684158096)','boom-studios','','','BOOM! STUDIOS','FIREFLY BRAND NEW VERSE HC (9781684158096)','','','',''),(1620,1,1,'BOOM! Studios wraz ze scenarzystą i reżyserem Jossem Whedonem (Buffy the Vampire Slayer, Avengers) przedstawiają popkulturowy fenomen, „Firefly” w najbardziej wyczekiwanym komiksie. Opowiada on o rodzinie, lojalności, tożsamości i cenie odkupienia. Greg Pak (Mech Cadet Yu, Star Wars) i Dan McDaid (Judge Dredd: Mega City Zero) zabiorą was z powrotem na pole bitwy, gdzie w czasie Unification War rozpoczęła się podróż Mal. Tom zawiera zeszyty #1-4.','FIREFLY HC VOL 01 UNIFICATION WAR (9781684153220)','boom-studios','','','BOOM! STUDIOS','FIREFLY HC VOL 01 UNIFICATION WAR (9781684153220)','','','',''),(1621,1,1,'Joss Whedon, twórca Buffy przedstawia historię, w której ujawnione zostają tajne tożsamości i najmroczniejsze sekrety; bohaterowie dokonują napadów, lekceważą autorytety, unikają śmierci i pędzą przez kosmos jak przystało na bandę najemników, wyrzutków i uciekinierów. Poszukują przygód w tym sequelu Firefly i Serenity. Tom zbiera zeszyty Serenity: Those Left Behind #1-3, Serenity: Better Days #1-3,, oraz Serenity: The Shepherd \'s Tale OGN.','FIREFLY LEGACY EDITION TP VOL 01 (9781684153206)','boom-studios','','','BOOM! STUDIOS','FIREFLY LEGACY EDITION TP VOL 01 (9781684153206)','','','',''),(1622,1,1,'BOOM! Studios przedstawia drugą część Firefly Legacy Edition. W jednym tomie zebrano wszystkie wydane wcześniej komiksy Serenity. Żaden fan nie może przegapić tej kontynuacji filmu Jossa Whedona, ciepło przyjętego Serenity, po raz pierwszy zebranej w jednym miejscu! Wszechśwait stoi u progu wojny, a Kapitan Mal i załoga uciekają przed starym wrogiem. Wszyscy trafiają w najdalszy zakątek wszechświata, a powrót może okazać się bardzo ryzykowny… ale kto zdołałby się przeciwstawić Malcolmowi Reynoldsowi! Tom zbiera zeszyty Leaves on the Wind #1-6, \'The Warrior and the Wind\' z Dark Horse FCBD 2016, oraz No Power in the \'Verse #1-6.','FIREFLY LEGACY EDITION TP VOL 02 (9781684153084)','boom-studios','','','BOOM! STUDIOS','FIREFLY LEGACY EDITION TP VOL 02 (9781684153084)','','','',''),(1623,1,1,'Simon Tam zrobi wszystko, by uratować swoją młodszą siostrę przed Alliance… może to kosztować go jego majątek, karierę, rodziców i idealne życie na Central Planets.\nPora na Opowieść Wigilijną w stylu Firefly! Samolubne zachowanie Jayne ściąga jej na głowę trzy duchy, które przedstawią jej przeszłość, nieznaną teraźniejszość i przyszłość.\nUznani twórcy, scenarzyści David M. Booher (Canto) i Jeff Jensen (Green River Killer: A True Detective), artyści Andrés Genolet (Runaways), Vincenzo Federici (Red Sonja), Jordi Pérez (Xena: Warrior Princess) i Fabiana Mascolo (The Dark Crystal: Age of Resistance) przedstawiają komiks, którego nie może przegapić żaden fan Firefly.\nTom zbiera zeszyty Firefly: River Run #1 i Firefly: Holiday Special #1.','FIREFLY RIVER RUN HC (9781684158331)','boom-studios','','','BOOM! STUDIOS','FIREFLY RIVER RUN HC (9781684158331)','','','',''),(1624,1,1,'Joss Whedon (Buffy the Vampire Slayer, Marvel’s The Avengers) przedstawia nową erę Firefly wraz z opowiedzieniem historii Unification War! Załoga Serenity jest podzielona. Kapitan Malcolm “Mal” Reynolds i jego pierwsza officer Zoe Washburn zostają aresztowani za zbrodnie popełnione w czasie Unification War, a reszta załogi musi wybrać stronę w tym konflikcie. Mal i Zoe nie godzą się na to i po ucieczce od Unifikatorów, łowców nagród wysłanych przez rząd, by doprowadzić ich przed sąd trafiają na odległą planetę, gdzie mają tylko wspomnienia o swoich błędach. Wojna może wydobyć zło nawet z najlepszych ludzi, a ich podróż do odkupienia zmieni relacje między nimi a załogą, rodziną i sobą nawzajem, gdy pojawia się dylemat: naprawić przeszłość, czy walczyć o przyszłość? Tom zbiera zeszyty #5-8.','FIREFLY UNIFICATION WAR HC VOL 02 (9781684154340)','boom-studios','','','BOOM! STUDIOS','FIREFLY UNIFICATION WAR HC VOL 02 (9781684154340)','','','',''),(1625,1,1,'In this two-in-one collection, see stories inspired by the classic animated TV series starring history’s finest families. Meet Fred, Wilma, Pebbles and Dino all over again! Visit the high-flying Jetsons one more time! Collects issues #1-6.\n\nPlanowana data premiery: 03.05.2017','FLINTSTONES AND JETSONS TP VOL 01 (9781401272401)','dc-comics','','','DC COMICS','FLINTSTONES AND JETSONS TP VOL 01 (9781401272401)','','','',''),(1626,1,1,'No description','JETSONS TP (9781401280253)','dc-comics','','','DC COMICS','JETSONS TP (9781401280253)','','','',''),(1627,1,1,'No description','JUSTICE LEAGUE UNLIMITED GALACTIC JUSTICE TP (9781779506733)','dc-comics','','','DC COMICS','JUSTICE LEAGUE UNLIMITED GALACTIC JUSTICE TP (9781779506733)','','','',''),(1628,1,1,'No description','JUSTICE LEAGUE UNLIMITED GIRL POWER TP (9781779510150)','dc-comics','','','DC COMICS','JUSTICE LEAGUE UNLIMITED GIRL POWER TP (9781779510150)','','','',''),(1629,1,1,'Zanurz się w treści pierwszego tomu naszej bestsellerowej, współczesnej serii Mighty Morphin Power Rangers series. Po uwolnieniu się spod kontroli umysłu Rity Repulsy, Tommy Oliver – Zielony Wojownik – dołączył do Power Ranwers by walczyć z siłami zła i innymi plagami atakującymi Angel Grove. Niestety, pozorny spokój i nadzieje na normalne życie szybko znikają, lecz dzięki swoim nowym przyjaciołom chłopak wciąż ma nadzieję na lepsze jutro. Zawiera numery #1-4 oraz prequelowy #0.\n„Balansując w swym komiksie pomiędzy nowym i starym, twórcy dali fanom dokładnie to czego chcieli – strasznie dobrą opowieść z Power Ranwers” – IGN.com','MIGHTY MORPHIN POWER RANGERS TP VOL 01 (9781608868933)','boom-studios','','','BOOM! STUDIOS','MIGHTY MORPHIN POWER RANGERS TP VOL 01 (9781608868933)','','','',''),(1630,1,1,'Witajcie w Ponyville, miejscu gdzie mieszkają Twilight Sparkle, Rainbow Dash, Rarity, Fluttershy, Pinkie Pie, Applejack oraz cała reszta waszych ulubionych kucyków! Coś jednak jest nie porządku, ponieważ część mieszkańców zaczyna zachowywać się bardzo, ale to bardzo dziwnie. Czas wezwać Mane Six by znalazły źródło tych dziwactw, zanim będzie za późno!','MY LITTLE PONY FRIENDSHIP IS MAGIC TP VOL 01 (9781613776056)','idw-publishing','','','IDW PUBLISHING','MY LITTLE PONY FRIENDSHIP IS MAGIC TP VOL 01 (9781613776056)','','','',''),(1631,1,1,'By pokonać wroga zagrażający kucykom na całym świecie, do walki stają znane nam kucyki i pierwsze pokolenie My Little Pony sprzed lat! Dawno temu, zła czarownica Hydia szukała sposobu na zniszczenie kucyków. Dziś, jej wnuczki Grackle i Dyre powracają, by dokonać tego, co nie udało się jej. Kiedy szkoła przyjaźni zmaga się z przepełnieniem, Starlight Glimmer i Mane Six ruszają z pomocą! Przybywają Violet Shiver, Shadow Storm i Black Belle! Te kucyki nie są tym, czym się wydają. Tak naprawdę pracują dla Grackle i Dyre! Czy przepełnione nienawiścią wiedźmy i ich sojusznicy będą w stanie doprowadzić swój plan do końca i zagrozić kucykom? Czy zło zdoła zatriumfować nad siłą przyjaźni?','MY LITTLE PONY GENERATIONS TP (9781684057948)','idw-publishing','','','IDW PUBLISHING','MY LITTLE PONY GENERATIONS TP (9781684057948)','','','',''),(1632,1,1,'No description','MY LITTLE PONY PONYVILLE MYSTERIES TP VOL 01 (9781684053933)','idw-publishing','','','IDW PUBLISHING','MY LITTLE PONY PONYVILLE MYSTERIES TP VOL 01 (9781684053933)','','','',''),(1633,1,1,'No description','ORPHAN BLACK DEVIATIONS TP (9781631409868)','idw-publishing','','','IDW PUBLISHING','ORPHAN BLACK DEVIATIONS TP (9781631409868)','','','',''),(1634,1,1,'Helsinki. Spoken in hushed tones, the word means almost certain death for the clones of Project Leda. Learn the dark secrets of this codename in this special event miniseries by co-creators John Fawcett and Graeme Manson.','ORPHAN BLACK HELSINKI TP (9781631405839)','idw-publishing','','','IDW PUBLISHING','ORPHAN BLACK HELSINKI TP (9781631405839)','','','',''),(1635,1,1,'Sarah’s life was changed dramatically after witnessing the suicide of a woman who looked just like her. Sarah learned that, not only were she and the woman clones, but there were others just like them, and dangerous factions at work set on capturing them all. Now, the mysterious world of Orphan Black widens, with new layers of the conspiracy being peeled back in this miniseries by co-creators John Fawcett and Graeme Manson! Collects issues #1–5.','ORPHAN BLACK TP VOL 01 (9781631404108)','idw-publishing','','','IDW PUBLISHING','ORPHAN BLACK TP VOL 01 (9781631404108)','','','',''),(1636,1,1,'No description','PENNY DREADFUL THE AWAKING TP VOL 01 (9781785855276)','titan-comics','','','TITAN COMICS','PENNY DREADFUL THE AWAKING TP VOL 01 (9781785855276)','','','',''),(1637,1,1,'(W) Krysty Wilson-Cairns &amp; Various (A) Louie De Martinis\nThe hit television series is presented in comics for the first time! This prequel reveals the terrifying events that led Vanessa to try and find her missing childhood friend, Mina Harker, and exposes the true nature of the vampiric monsters infesting Victorian London. Beautifully realized by Louie De Martinis, and written by the scriptwriters of the hit show! Collects issues #1-5.\nSC, 7x10, 128pgs, FC $14.99\n\nPlanowana data premiery: 28.12.2016','PENNY DREADFUL TP (9781785853685)','titan-comics','','','TITAN COMICS','PENNY DREADFUL TP (9781785853685)','','','',''),(1638,1,1,'Psycho Rangers powracają! Stworzeni przez Karone, gdy była jeszcze Astronemą, Psycho Rangers zostali zaprogramowani, by nienawidzić Power Rangers. Zostali pokonani wielkim kosztem, ale teraz powrócili i są bardziej morderczy niż wcześniej. Kto stoi za ich powrotem i jakie są jego plany? Czy Lost Galaxy Pink Ranger Karone i jej brat, In Spce Red Ranger Andros powstrzymają ich nim podbiją wszechświat? Komiks autorstwa Paula Allora (Teenage Mutant Ninja Turtles, Clue) i ulubionego rysownika czytelników, Giuseppe Cafaro (Suicide Squad, Power Rangers: Soul of the Dragon)!','POWER RANGERS PSYCHO PATH ORIGINAL GN (9781684154586)','boom-studios','','','BOOM! STUDIOS','POWER RANGERS PSYCHO PATH ORIGINAL GN (9781684154586)','','','',''),(1639,1,1,'Power Rangers udali się do Nowego Jorku, by odnaleźć swojego zaginionego przyjaciela Tommy’ego Olivera – Zielonego Rangera – wkrótce jednak okazuje się, że połączył on siły ze Shredderem i jego Foot Clanem! Rangerzy muszą jeszcze stoczyć walkę z innym „sojusznikiem” – Wojowniczymi Żółwiami Ninja! Czy obie drużyny znajdą wspólny język i ocalą świat przed zagładą? Scenarzysta Ryan Parrott (Power Rangers: Necessary Evil) i rysownik Simone di Meo (Power Rangers: Beyond The Grid) prezentują wspólną przygodę Power Rangers i Teenage Mutant Ninja Turtles. Tom zbiera całą pięciozeszytową miniserię.','POWER RANGERS TEENAGE MUTANT NINJA TURTLES TP VOL 01 (9781684155866)','boom-studios','','','BOOM! STUDIOS','POWER RANGERS TEENAGE MUTANT NINJA TURTLES TP VOL 01 (9781684155866)','','','',''),(1640,1,1,'ROZPOCZYNA SIĘ ERA NIEOGRANICZONEJ MOCY – TYLKO LORD DRAKKON MOŻE OCALIĆ NOWĄ DRÓŻYNĘ POWER RANGERS!\nTylko oryginalni Power Rangers, dziś znani jako Omega Rangers – Jason Trini i Zack mogą pokonać nowe kosmiczne zagrożenie. Ich tajną bronią jest… straszliwy Lord Drakkon?! Czy Drakkon okaże się wiernym sojusznikiem, czy może zdradzi nas wszystkich?\nTom zbiera zeszyty Power Rangers #1-4.','POWER RANGERS TP VOL 01 (9781684156726)','boom-studios','','','BOOM! STUDIOS','POWER RANGERS TP VOL 01 (9781684156726)','','','',''),(1641,1,1,'Po tym, jak tajemnicza kapsuła rozbija się na Ziemi, Morphin Master Teens przybierają nowe, niebezpieczne i potężne formy!\nCzy skorumpowany były sprzymierzeniec okaże się ich zgubą, czy może Rangerzy uratują swojego przyjaciela i ochronią ostatnią Masterforge przed zniszczeniem?\nOdkryjcie prawdę o Phantom Rangerze, Morphin Masters, Power Rangers i Morphin Grid, na którą fani czekali całe lata!','POWER RANGERS UNIVERSE HC (9781684158492)','boom-studios','','','BOOM! STUDIOS','POWER RANGERS UNIVERSE HC (9781684158492)','','','',''),(1642,1,1,'No description','RWBY JUSTICE LEAGUE TP (9781779515308)','dc-comics','','','DC COMICS','RWBY JUSTICE LEAGUE TP (9781779515308)','','','',''),(1643,1,1,'No description','RWBY TP (9781779503015)','dc-comics','','','DC COMICS','RWBY TP (9781779503015)','','','',''),(1644,1,1,'ADVANCE SOLICITED FOR SEPTEMBER 2016! In the wake of his wife’s brutal murder, Opie returns to Oswald Lumber in the hope of leaving the club — and criminal activity — behind. Meanwhile, one of Chibs’ old IRA foes returns for revenge...and the Sons will have to decide how deep loyalty really runs. Volume 6 links seasons 1 and 2 of Kurt Sutter’s critically acclaimed television series. Collects issues #23-24 and the oversized final issue #25.','SONS OF ANARCHY TP VOL 06 (9781608868490)','boom-studios','','','BOOM! STUDIOS','SONS OF ANARCHY TP VOL 06 (9781608868490)','','','',''),(1645,1,1,'Kolejny album przedstawiający dzieje bohaterów kultowego serialu telewizyjnego „Star Trek”! W tym tomie załogi z klasycznego serialu „Star Trek” oraz seriali „Następne pokolenie”, „Voyager” i „Stacja kosmiczna” zostają przeniesione w czasie i zmuszone do rywalizacji w turnieju, narzuconym im przez tajemniczą istotę znaną jako Q. Najsłynniejsi dowódcy Gwiezdnej Floty spotykają się po raz pierwszy w największym wydarzeniu łączącym światy różnych seriali! Autorami scenariusza do albumu są amerykański scenarzysta oraz historyk komiksu Scott Tipton („Star Trek”, „Doctor Who”) i David Tipton („Star Trek: The Next Generation - Intelligence Gathering”), natomiast rysunki wykonał włoski rysownik David Messina („Catwoman”).','STAR TREK - KONFLIKT Q (9788328160507)','egmont','','','EGMONT','STAR TREK - KONFLIKT Q (9788328160507)','','','',''),(1646,1,1,'Pierwszy tom serii opowiadającej o przygodach bohaterów kultowego Star Treka! USS „Enterprise” opuścił Ziemię przed czterema laty. Członkowie jego załogi odwiedzili nowe, obce światy, pokonywali nieprawdopodobnych przeciwników i podejmowali decyzje, mające wpływ na losy wszechświata. Ale teraz, niemal u kresu swojej wyprawy, muszą stawić czoła największemu wyzwaniu. Dołącz do załogi statku „Enterprise” pod koniec ich pięcioletniej misji, w której biorą udział postacie z pierwszego serialu telewizyjnego – kapitan James T. Kirk, pierwszy oficer Spock, komandor porucznik Scotty, doktor Bones, porucznicy Uhura, Sulu i Chekov.\n\nZa scenariusz tomu odpowiadają: Jackson Lanzing („Green Arrow”, „Nightwing”), Colin Kelly („Gotham City Garage”), Brandon Easton („Transformers”), Jody Houser („Doctor Who”) i Jim McCann („Hawkeye”). Autorami rysunków są: Stephen Thompson („Fantastyczna Czwórka”), Martin Coccolo („Sinestro”), Silvia Califano („Sędzia Dredd”), Kieran McKeown („Wonder Woman”).','STAR TREK - ROK PIĄTY (9788328160484)','egmont','','','EGMONT','STAR TREK - ROK PIĄTY (9788328160484)','','','',''),(1647,1,1,'No description','STARGATE ATLANTIS TP VOL 02 (9781945205156)','american-mythology','','','AMERICAN MYTHOLOGY','STARGATE ATLANTIS TP VOL 02 (9781945205156)','','','',''),(1648,1,1,'No description','STEVEN UNIVERSE ONGOING TP VOL 02 PUNCHING UP (9781684151349)','boom-studios','','','BOOM! STUDIOS','STEVEN UNIVERSE ONGOING TP VOL 02 PUNCHING UP (9781684151349)','','','',''),(1649,1,1,'No description','STEVEN UNIVERSE ORIGINAL GN VOL 02 ANTI GRAVITY (9781608869961)','boom-studios','','','BOOM! STUDIOS','STEVEN UNIVERSE ORIGINAL GN VOL 02 ANTI GRAVITY (9781608869961)','','','',''),(1650,1,1,'Zobaczcie jak dzieciaki z Hawkins w Indianie, znane z serialu Stranger Things mierzą się z mitycznymi potworami z kart podręcznika do gry Dungeons and Dragons na długo, nim zagroził im Demogorgon! Zobaczcie jak gra definiuje dzieciństwo Mike\'a, Lucasa, Willa i Dustina. Zobaczcie jak dzieciaki stają się zgraną drużyną z każdą kolejną kampanią i szeregiem niesamowitych przygód, które nauczą ich co tak naprawdę jest ważne w życiu i jak radzić sobie z przeciwnościami losu. Przeczytajcie ten list miłosny do gry RPG, która ma swoich fanów na całym świecie. Tom zbiera całą czteroczęściową miniserię.','STRANGER THINGS &amp; DUNGEONS &amp; DRAGONS TP (9781506721071)','dark-horse','','','DARK HORSE','STRANGER THINGS & DUNGEONS & DRAGONS TP (9781506721071)','','','',''),(1651,1,1,'W kolejnym spin-offie do Stranger Things, hołdu dla kultury lat 80., Erica i jej wróg-przyjaciel wyruszają na poszukiwania zaginionej papugi. Dwójka będzie musiała współpracować, by odnaleźć ptaka, albo zmierzyć się z konsekwencjami. Przekonują się, że nawet najbystrzejsza osoba potrzebuje czasem pomocy od czasu do czasu.\n„Idealny dodatek do hitu Netflixa!” – Infinite Earths.','STRANGER THINGS ERICA THE GREAT TP (9781506714547)','dark-horse','','','DARK HORSE','STRANGER THINGS ERICA THE GREAT TP (9781506714547)','','','',''),(1652,1,1,'Sprawdźcie trzy pierwsze Stranger Things Holiday Specials w jednym zestawie. Te historie są tak samo wzruszające i chwytające za serce jak i przerażające. Trzy oddzielne historie dobre na każdy czas: Eleven poznaje ulubione świąteczne historie swoich przyjaciół. Will opowiada pozostałym chłopcom najstraszniejszą historię halloweenową jaką widziało Hawkins, a oficerowie Powell i Callahan badają dziwne wydarzenia, które będą mieli szczęście przeżyć.\nTom zbiera zeszyty Halloween Special, Winter Special i Summer Special!','STRANGER THINGS HOLIDAY SPECIALS TP (9781506734583)','dark-horse','','','DARK HORSE','STRANGER THINGS HOLIDAY SPECIALS TP (9781506734583)','','','',''),(1653,1,1,'Czy jesteście gotowi na jeszcze więcej nostalgii do horrorów z lat 80? Oto, co oferuje tom zbierający Stranger Things: The Other Side, oraz Stranger Things: Science Camp.\nDowiedzmy się jak Will przeżył w mrocznym wymiarze demo gorgona, oraz co robił Dustin na obozie letnim.\nAlbum zawiera Stranger Things Volume 1: The Other Side, oraz Stranger Things Volume 4: Science Camp. ','STRANGER THINGS LIBRARY ED HC VOL 01 (9781506727622)','dark-horse','','','DARK HORSE','STRANGER THINGS LIBRARY ED HC VOL 01 (9781506727622)','','','',''),(1654,1,1,'Poznajcie przerażające, inspirowane latami 80. horrory z wydanych w twardej oprawie Stranger Things: Six i Stranger Things: Into the Fire.\nCzeka na Was przerażający obraz planów wdrażanych przez laboratorium Brennera, które doprowadziły do wydarzeń z serialu. Poznajcie inne dzieci z umiejętnościami telepatycznymi, które więziono w laboratorium w Hawkins. Zobaczcie jak zdecydowały się walczyć o wolność i jak poprowadziło to do katastrofy. ','STRANGER THINGS LIBRARY ED HC VOL 02 (9781506727639)','dark-horse','','','DARK HORSE','STRANGER THINGS LIBRARY ED HC VOL 02 (9781506727639)','','','',''),(1655,1,1,'Ten album zawiera aż trzy ekscytujące historie ze świata Stranger Things. To idealny prezent dla każdego młodego fana serialowego megahitu Netflixa.\nTom zbiera Zombie Boys, The Bully i Erika the Great.\n\'\'Te komiksy ze Stranger Things to lektura obowiązkowa dla fanów serialu, ponieważ starają się odpowiedzieć na pytania, które nasuwają się najbardziej oddanym fanom.\'\' - Comic Watch.','STRANGER THINGS OMNIBUS AFTERSCHOOL ADVENTURES TP (9781506727738)','dark-horse','','','DARK HORSE','STRANGER THINGS OMNIBUS AFTERSCHOOL ADVENTURES TP (9781506727738)','','','',''),(1656,1,1,'Cztery pierwsze historie z serii Stranger Things w jednym tomie. Podróż z Willem do innego wymiaru, grupa nastolatków z supermocami ucieka z laboratorium w Hawkins. Czekają na nas także przygody Dustina i Suzie na obozie naukowym!\nTom zawiera Stranger Things: The Other Side, Stranger Things: Six, Stranger Things: Into the Fire i Stranger Things: Science Camp.','STRANGER THINGS OMNIBUS TP VOL 01 (9781506727646)','dark-horse','','','DARK HORSE','STRANGER THINGS OMNIBUS TP VOL 01 (9781506727646)','','','',''),(1657,1,1,'No description','STRANGER THINGS THE BULLY GN TP (9781506714530)','dark-horse','','','DARK HORSE','STRANGER THINGS THE BULLY GN TP (9781506714530)','','','',''),(1658,1,1,'Dustin przybywa do obozu letniego Camp Know Where, by poznać nowych przyjaciół spoza rodzinnego Hawkins. Mimo docinków niekoleżeńskich kujonów, postanawia zbadać dziwne zjawiska, które mogą zagrozić młodym naukowcom i ich opiekunom. Tajemnicza postać pragnie zmącić spokój leśnej głuszy. Kiedy opiekunowie zaczynają znikać, nie pomoże fizyka rakietowa. Dustin pozan za to lepiej Suzie i innych obozowiczów.','STRANGER THINGS TP VOL 04 SCIENCE CAMP (9781506715766)','dark-horse','','','DARK HORSE','STRANGER THINGS TP VOL 04 SCIENCE CAMP (9781506715766)','','','',''),(1659,1,1,'Jest styczeń 1985 roku. Dzieciaki z Hawkins przeżyły walkę z mind flayerem, ale Will i Joyce nadal nie mogą się pozbierać po śmierci Boba Newby’ego. Przyjaciele Willa są zbyt zajęci swoimi dziewczynami, by dostrzec jego ból. Kiedy chłopak i pan Clarke odnajdują w szpargałach Boba tajemniczą mapę, Will zbiera przyjaciół, by ruszyć ku nowej przygodzie! Tom zbiera czteroczęściową mini serię.','STRANGER THINGS TP VOL 05 TOMB OF YBWEN (9781506725543)','dark-horse','','','DARK HORSE','STRANGER THINGS TP VOL 05 TOMB OF YBWEN (9781506725543)','','','',''),(1660,1,1,'Kolekcja zawiera trzy pierwsze powieści dla młodzieży z serii Stranger Things. Znajdziecie tu także dwustronny plakat.\nZnajdziecie tu Stranger Things: Zombie Boys, Stranger Things: Bully, oraz Stranger Things: Erika the Great.\n“Komiksy Stranger Things są pozycją obowiązkową dla fanów serialu. Przede wszystkim dlatego, że odpowiadają na pytania wiernych widzów.” – Comic Watch.','STRANGER THINGS YA BOXED SET (9781506727721)','dark-horse','','','DARK HORSE','STRANGER THINGS YA BOXED SET (9781506727721)','','','',''),(1661,1,1,'No description','TEEN TITANS GO DC SUPER HERO GIRLS EXCHANGE STUDENTS TP (9781779508911)','dc-comics','','','DC COMICS','TEEN TITANS GO DC SUPER HERO GIRLS EXCHANGE STUDENTS TP (9781779508911)','','','',''),(1662,1,1,'No description','TEEN TITANS GO UNDEAD TP (9781779507853)','dc-comics','','','DC COMICS','TEEN TITANS GO UNDEAD TP (9781779507853)','','','',''),(1663,1,1,'Nowa miniseria rozgrywająca się w oryginalnym uniwersum Transformers! Jakie sekrety wyjdą na jaw i jak zmienia one postrzeganie naszej ukochanej serii z lat 80.?\nGdy wojna o Cybertron rozgorzała na dobre pomiędzy Autobotami Optimusa Prime’a a Megatronem i jego Decepticonami, Shockwave lokalizuje nowe zagrożenie na drodze Decepticonów do podbicia planety: Megatrona we własnej osobie! Gdy Optimus z grupą robotów rusza na orbitę, by ochronić Cybertron przed niebezpiecznym pasem asteroidów, Megatron rósza ze swoim oddziałem za nimi! Jakie są prawdziwe cele Prime’a? Dlaczego jest to na rękę Shockwave’owi? Co ma to wszystko wspólnego z sekretem ukrytym na XI-wiecznej Ziemi?\nTom zbiera miniserię Transformers \'84: Secret and Lies, oraz one-shot Transformers \'84 #0.','TRANSFORMERS 84 TP SECRETS &amp; LIES (9781684057320)','idw-publishing','','','IDW PUBLISHING','TRANSFORMERS 84 TP SECRETS & LIES (9781684057320)','','','',''),(1664,1,1,'No description','TRANSFORMERS AUTOCRACY TRILOGY TP (9781684050741)','idw-publishing','','','IDW PUBLISHING','TRANSFORMERS AUTOCRACY TRILOGY TP (9781684050741)','','','',''),(1665,1,1,'The Spotlight falls on Orion Pax, Thundercracker, Megatron, Bumblebee, Trailcutter, and Hoist in this collection of six individual stories that explain an important moment in each character\'s life. From the distant past to current events each story adds to Cybertronian lore. Collecting all the hit TRANSFORMERS Spotlight issues!','TRANSFORMERS PRELUDE TP (9781613777169)','idw-publishing','','','IDW PUBLISHING','TRANSFORMERS PRELUDE TP (9781613777169)','','','',''),(1666,1,1,'For years, FBI agents Fox Mulder and Dana Scully toiled in the X-Files Unit, a one-office division of the Bureau dealing with cases deemed unsolvable and related to unexplained phenomena. Eventually, both agents left the FBI and began new lives in peaceful anonymity. However, recent events prompted them to return to the Bureau and the X-Files. Contains the stories','X-FILES (2016) TP VOL 01 REVIVAL (9781631407833)','idw-publishing','','','IDW PUBLISHING','X-FILES (2016) TP VOL 01 REVIVAL (9781631407833)','','','',''),(1667,1,1,'Before the FBI, before the X-Files, they were just two teenagers in search of the truth. On Martha’s Vineyard, a young Fox Mulder investigates something strange happening on the island, while in San Diego, 13-year-old Dana Scully looks into the shocking murder of her teacher. Two kids, two mysteries, one conspiracy that threatens the future of humanity.','X-FILES ORIGINS TP (9781631408458)','idw-publishing','','','IDW PUBLISHING','X-FILES ORIGINS TP (9781631408458)','','','',''),(1668,1,1,'No description','XENA WARRIOR PRINCESS CLASSIC YEARS OMNIBUS TP (9781524103309)','dynamite-entertainment','','','DYNAMITE ENTERTAINMENT','XENA WARRIOR PRINCESS CLASSIC YEARS OMNIBUS TP (9781524103309)','','','',''),(1669,1,1,'(W) John Layman, Keith Champagne (A) Fabiano Neves, Noah Salonga (CA) Stjepan Sejic\nXena: Warrior Princess returns! Dynamite Entertainment proudly collects the swashbuckling Xena comic book adventures from 2006-2007, including the complete \"Contest of Pantheons\" and \"Dark Xena\" storylines written by bestselling writer John Layman (Chew), plus the special \"Strange Visitor\" story from Xena Annual #1. Join Xena and her fan-favorite allies Gabrielle, Joxer, and Autolycus as they become embroiled in a feud reaching all the way up to the heavens, courtesy of the machinations of the ruthless Callisto! Also, Gabrielle makes a request of the Gods and learns a heartwrenching lesson about the care with which one must make a wish... leading to an unsettling change in Xena herself. Finally, the cast encounters a strange being from another world!\nSC, 7x10, 240pgs, FC SRP: $24.99\n\nPlanowana data premiery: 18.01.2017','XENA WARRIOR PRINCESS OMNIBUS TP VOL 01 (9781524102517)','dynamite-entertainment','','','DYNAMITE ENTERTAINMENT','XENA WARRIOR PRINCESS OMNIBUS TP VOL 01 (9781524102517)','','','',''),(1670,1,1,'Owen Barbarzyńca został przeklęty. Do końca życia musi dokonywać bohaterskich czynów. Jego wierny, żądny krwi topór stał się jego przewodnikiem moralnym z choroba alkoholową. Razem wędrują po świecie, skazani na pomaganie innym. Jest jednak coś, czego Owen nienawidzi bardziej, niż zasad moralnych: to czarownice. Przedstawiamy brutalny, ale pełen dobrego humoru komiks o tym, ile przemocy może dokonać człowiek, który musi czynić dobro? Przekonacie się na stronach BARBARICA! ','BARBARIC HC VOL 01 (9781638490081)','vault-comics','','','VAULT COMICS','BARBARIC HC VOL 01 (9781638490081)','','','',''),(1671,1,1,'It’s the thirtieth anniversary of THE DARK KNIGHT RETURNS, and now DC Comics presents this classic title in a newly redesigned edition! Ten years after an aging Batman retired, Gotham City has sunk deeper into decadence and lawlessness. Now, when his city needs him most, the Dark Knight returns in a blaze of glory. Joined by Carrie Kelly, a teenaged Robin, Batman takes to the streets to end the threat of the mutant gangs that have overrun the city. And after facing off against his two greatest enemies, the Joker and Two-Face, for the final time, Batman finds himself in mortal combat with his former ally, Superman. The original 4-issue miniseries is presented here in its entirety.','BATMAN DARK KNIGHT RETURNS TP NEW EDITION (9781401263119)','dc-comics','','','DC COMICS','BATMAN DARK KNIGHT RETURNS TP NEW EDITION (9781401263119)','','','',''),(1672,1,1,'No description','BATMAN THE KILLING JOKE HC NEW ED (9781401294052)','dc-comics','','','DC COMICS','BATMAN THE KILLING JOKE HC NEW ED (9781401294052)','','','',''),(1673,1,1,'Collecting the first ten issues of the Eisner and Harvey award-winning, TIME Magazine Best Comic of the year of our lord 2013, SEX CRIMINALS, in an oversized hardcover format guaranteed to embarrass you to order.','BIG HARD SEX CRIMINALS HC (9781632152435)','image-comics','','','IMAGE COMICS','BIG HARD SEX CRIMINALS HC (9781632152435)','','','',''),(1674,1,1,'Kiedy Jon i Suzie uprawiają seks, czas dosłownie staje w miejscu. Co dzieje się potem? Obrabiają banki, to oczywiste. Teraz muszą trzymać się zdala od kłopotów, i oczywiście od siebie nawzajem, ale wszystko prędko się komplikuje.\nPo raz pierwszy wydane w jednym miejscu, w kolorze, w powiększonym formacie i we właściwej kolejności, trzeci i czwarty tom SEX CRIMINALS dostarcza emocji i humoru! Poza tym to wydanie zawiera wiele dodatków, niektóre z nich powstały z myślą o tym ekscytującym zbiorze.\nTom zbiera zeszyty SEX CRIMINALS #11-20.','BIG HARD SEX CRIMINALS HC VOL 02 (9781534307063)','image-comics','','','IMAGE COMICS','BIG HARD SEX CRIMINALS HC VOL 02 (9781534307063)','','','',''),(1675,1,1,'Gdy Suzie i Jon uprawiają seks, czas się zatrzymuje. Dosłownie.\nSuzie i John wracają do siebie po raz ostatni w tym wydanym w twardej oprawie tomie wieńczącym bestsellerową serię komediowo-romantyczną SEX CRIMINALS – razem z epilogiem, materiałami dodatkowymi stworzonymi na potrzeby tego wydania, wraz z obwolutą, która pozwala na czytanie serii bez wstydu w miejscu publicznym. Tom zbiera zeszyty SEX CRIMINALS #21-30, 69.','BIG HARD SEX CRIMINALS HC VOL 03 (9781534319097)','image-comics','','','IMAGE COMICS','BIG HARD SEX CRIMINALS HC VOL 03 (9781534319097)','','','',''),(1676,1,1,'Once they were heroes. Now, banished from existence by a multiversal crisis, the old champions of Spiral City lead simple lives in a timeless farming town. But as they attempt to free themselves from this strange purgatory, a mysterious stranger works to bring them back into action for one last adventure! Collects issues #1-6 of the series. ','BLACK HAMMER TP VOL 01 SECRET ORIGINS (9781616557867)','dark-horse','','','DARK HORSE','BLACK HAMMER TP VOL 01 SECRET ORIGINS (9781616557867)','','','',''),(1677,1,1,'PIERWSZY TOM W SPECJALNEJ NIŻSZEJ CENIE! Naukowiec anarchista, Grant McKay dokonał niemożliwego! Używając Pillaru, przebił się przez bariery między wymiarami, pozwalając na podróże między alternatywnymi rzeczywistościami. Teraz Pillar wysyła Granta i jego drużynę na coraz to nowsze przygody, oddalając ich coraz bardziej od domu… Pierwszy tom uznanej serii science fiction od scenarzysty RICKA REMENDERA (Uncanny Avengers, Captain America) i artysty MATTEO SCALERY (Secret Avengers).\nTom zbiera zeszyty BLACK SCIENCE #1-6.','BLACK SCIENCE TP VOL 01 HOW TO FALL FOREVER (9781607069676)','image-comics','','','IMAGE COMICS','BLACK SCIENCE TP VOL 01 HOW TO FALL FOREVER (9781607069676)','','','',''),(1678,1,1,'Tony Chu is a detective with a secret. A weird secret. Tony Chu is Cibopathic, which means he gets psychic impressions from whatever he eats. It also means he\'s a hell of a detective, as long as he doesn\'t mind nibbling on the corpse of a murder victim to figure out whodunit, and why. He\'s been brought on by the Special Crimes Division of the FDA, the most powerful law enforcement agency on the planet, to investigate their strangest, sickest, and most bizarre cases.','CHEW TP VOL 01 TASTER\'S CHOICE (9781607061595)','image-comics','','','IMAGE COMICS','CHEW TP VOL 01 TASTER\'S CHOICE (9781607061595)','','','',''),(1679,1,1,'Jaki jest najważniejszy dzień w życiu człowieka? Fabio Moon i Gabriel Ba odpowiadają na to pytanie w gorąco przyjętej zarówno przez czytelników jak i krytyków serii, która szturmem podbiła rynek, zdobywając uznanie takich tuzów komiksu jak Terry Moore, Craig Thompson czy Jeff Smith. Podążaj śladami początkującego pisarza Brasa de Oliva Domingosa, którego różne momenty w życiu przedstawiają kolejne zeszyty DAYTRIPPER. Moon i Ba opowiadają piękną historię całego istnienia Domingosa. Od miłości po śmierć. Zawiera wprowadzenie Craiga Thompsona (Blankets).','DAYTRIPPER TP (9781401229696)','dc-comics','','','DC COMICS','DAYTRIPPER TP (9781401229696)','','','',''),(1680,1,1,'No description','FABLES COMPENDIUM 01 TP (9781779504548)','dc-comics','','','DC COMICS','FABLES COMPENDIUM 01 TP (9781779504548)','','','',''),(1681,1,1,'Dwóch największych twórców w historii komiksu. Jedenaście nierozwiązanych morderstw. Jeden spisek oplatający całą metropolię u progu XX wieku i jeden rozpruwacz terroryzujący Londyn swoimi śmiałymi i makabrycznymi mordami. From Hell wymienia się często wraz z wieloma największymi powieściami graficznymi wszechczasów. Teraz komiks ten jest dostępny w nowym wydaniu w twardej oprawie z nową okładką.','FROM HELL HC (9781603093972)','idw-publishing','','','IDW PUBLISHING','FROM HELL HC (9781603093972)','','','',''),(1682,1,1,'Gwiazdy komiksowego scenopisarstwa i rysunku, GEOFF JOHNS i GARY FRANK, wraz z kolorystą BRADEM ANDERSONEM przedstawiają swojego pierwszego superbohatera spod szyldu Image!\nLata po tym jak wojna nuklearna zniszczyła naszą planetę, wyjęci spod prawa ocalali wakczą o przetrwanie na radioaktywnych pustkowiach. Na zatrutej równinie żyje człowiek, którego obawiają się nawet najtwardsi. Niektórzy nazywają go Joe Glow, inni znają go jako Meltdown Man, a dla reszty jest po porostu… Geigerem.\nTom zbiera zeszyty GEIGER #1-6.','GEIGER TP VOL 01 (9781534320024)','image-comics','','','IMAGE COMICS','GEIGER TP VOL 01 (9781534320024)','','','',''),(1683,1,1,'Pierwszy tom nagradzanej nagrodami Eisnera serii grozy JEFFA LEMIRE’A (Sweet Tooth, Black Hammer) i ANDREI SORRENTINO (Old Man Logan, Joker: Killer Smile) w wydaniu deluxe w twardej oprawie!\nŻycia katolickiego kapłana przybywającego do pełnego sekretów miasteczka i młodego człowieka z obsesją na punkcie tajemnic i okolicznych spisków łączy tajemnicza legenda o czarnej stodole – nieziemskim wręcz budynku, który ma rzekomo pojawiać się od czasu do czasu w mieście, przynosząc ze sobą strach, cierpienie i szaleństwo.\nMiejskie legendy i horror łączą się tu w jedną wybuchową całość z wielowymiarowymi i intrygującymi postaciami. Wszystko to dzięki zespołowi kreatywnemu, który BRIAN MICHAEL BENDIS nazwał “jednym z najlepszych w dziejach”. W wydaniu deluxe znajdziecie fantastyczne dodatki, oraz galerię okładek autorstwa jednych z najlepszych autorów w historii, takich jak CLIFF CHIANG, JOCK, TULA LOTAY, SKOTTIE YOUNG i inni.\nTom zbiera zeszyty #1-16.','GIDEON FALLS DLX ED HC VOL 01 (9781534319189)','image-comics','','','IMAGE COMICS','GIDEON FALLS DLX ED HC VOL 01 (9781534319189)','','','',''),(1684,1,1,'The Head Lopper, Norgal, and the nagging severed head of Agatha Blue Witch arrive on the Isle of Barra to find it overrun with beasts: minions of the Sorcerer of the Black Bog. When Queen Abigail hires Norgal and Agatha to slay the Sorcerer, our heroes trek across the island reliving the horrors of their heads—and playing right into the hands of a master manipulator. Collects HEAD LOPPER #1-4','HEAD LOPPER TP VOL 01 ISLAND OR A PLAGUE OF BEASTS (9781632158864)','image-comics','','','IMAGE COMICS','HEAD LOPPER TP VOL 01 ISLAND OR A PLAGUE OF BEASTS (9781632158864)','','','',''),(1685,1,1,'Wcześniej zawartość tego zbioru stanowiła cztery oddzielne omnibus; Seed of Destruction, Strange Places, The Wild Hunt, and Hellboy in Hell. Dziś to jedna kolekcja!\nTen zestaw zbiera ekskluzywne pudełko pokryte od zewnątrz i od wewnątrz rysunkami Mike’a Mignoli z kolorami Dave’a Stewarta!\nCztery tomy przygód Hellboy’a w pudełku przyozdobionym pracami Mike’a Mignoli! ','HELLBOY OMNIBUS BOXED SET TP (9781506725970)','dark-horse','','','DARK HORSE','HELLBOY OMNIBUS BOXED SET TP (9781506725970)','','','',''),(1686,1,1,'Imię potwora zna każdy. Mężczyzny w jego cieniu nigdy się nie dostrzega, bo nie chce być dostrzeżony. Jest spokojny, cichy. Gdy ktoś go postrzeli... po prostu umiera. Gdy zapada zmrok - ktoś inny powstaje z martwych. Imię mężczyzny to Banner. Imię potwora to Nieśmiertelny Hulk! Problemy ciągną się za nimi oboma. Dziennikarka Jackie McGee próbuje zrozumieć całą sprawę, gdy Banner wędruje od miasta do miasta, znajdując morderswa, tajemnicę i tragedię, gdziekolwiek by się nie zjawił. To, co znajdzie Banner, Hulk od razu niszczy! Gdzie indziej bohater zwany Sasquatch czuje się odpowiedzialny za los Bannera. By mu pomóc, musi odnaleźć potwora! Zawiera: IMMORTAL HULK #1-5 i fragmenty AVENGERS (2016) #684 autorstwa Jima Zuba i Marka Waida.','IMMORTAL HULK TP VOL 01 OR IS HE BOTH (9781302912550)','marvel-comics','','','MARVEL COMICS','IMMORTAL HULK TP VOL 01 OR IS HE BOTH (9781302912550)','','','',''),(1687,1,1,'Pierwszy tom mrocznej i pełnej przemocy opowieści, której bohaterem – a może antybohaterem – jest Frank Castle, czyli słynny Punisher. Kiedyś brutalnie zamordowano jego żonę i dzieci. Teraz w pojedynkę wymierza sprawiedliwość wszelkiej maści przestępcom. Jedna z dokonanych przez niego masakr burzy równowagę zbrodniczego półświatka i – jak się okazuje – ściąga na niego uwagę nie tylko mafii. Czego chce od samotnego mściciela CIA? I co zamierza Micro, dawny wspólnik Punishera, który najwyraźniej ma dla niego propozycję nie do odrzucenia?\nTwórcą tej przez wielu uważanej za kultową opowieści jest laureat Nagrody Eisnera, scenarzysta Garth Ennis (Kaznodzieja, Hellblazer, Hitman). Za rysunki odpowiadają Lewis LaRosa (The Immortal Iron Fist, Citizen V and the V-Battalion Everlasting) oraz Leandro Fernández (Wolverine, Spider-Man: Splątana sieć, Deadpool: Wojna Wade’a Wilsona).\n\nPunisher Max tom 1 zawiera zeszyty Punisher #1-12.','KLASYKA MARVELA - PUNISHER MAX, TOM 1 (9788328167131)','egmont','','','EGMONT','KLASYKA MARVELA - PUNISHER MAX, TOM 1 (9788328167131)','','','',''),(1688,1,1,'Uznana przez krytyków dwunastoczęściowa miniseria w końcu została zebrana w całości! Scott Free potrafi wydostać się z każdej pułapki. Jest tak świetny, że wydostał się z więzienia Granny Goodness i opuścił Apokalips, by zamieszkać na Ziemi i założyć rodzinę ze swoją żoną, Big Bardą, byłą członkiną Furii. Jako Mister Miracle zrobił karierę pokazując swoje akrobatyczne sztuczki. Został nawet dostrzeżony przez Ligę Sprawiedliwości, która dołączyła go do swoich szeregów.\nMożna rzec, że Scott Free ma wszystko... dlaczego więc to nie wystarcza? Mister Miracle jest mistrzem iluzji, wykonał każdą najtrudniejszą sztuczkę, uciekł z każdej opresji. Jednak śmierci nie da się uciec. Czy byłoby to możliwe? Nasz bohater musi się zabić, jeżeli chciałby poznać prawdę.','MISTER MIRACLE TP (9781401283544)','dc-comics','','','DC COMICS','MISTER MIRACLE TP (9781401283544)','','','',''),(1689,1,1,'Sławny album Franka Millera, za który autor został uhonorowany najważniejszymi amerykańskimi wyróżnieniami komiksowymi: Nagrodą Eisnera i Nagrodą Harveya. Na podstawie 300 w 2007 roku powstał film o tym samym tytule w reżyserii Zacka Snydera i Franka Millera.\nRok 480 przed naszą erą. Wielka armia perska wkracza na ziemie greckie. Skłócone państewka Hellenów nie są w stanie porozumieć się w sprawie utworzenia jednolitej obrony. W tej sytuacji król Sparty, wbrew decyzji sędziów swojego ludu, wyrusza wraz z nieliczną gwardią przyboczną, by stawić czoło najeźdźcom. Na miejsce bitwy wybiera wąski przesmyk Termopile, gdzie jego trzystu żołnierzy będzie miało szansę przez kilka dni zatrzymać kilkudziesięciotysięczne wojska perskie. Tak rozpoczyna się najbardziej heroiczna i najsławniejsza bitwa w starożytnej Grecji, której efektem było zjednoczenie się państw helleńskich przeciwko wrogowi ze wschodu.','MISTRZOWIE KOMIKSU 300 (9788328118652)','egmont','','','EGMONT','MISTRZOWIE KOMIKSU 300 (9788328118652)','','','',''),(1690,1,1,'(W) Emil Ferris (A/CA) Emil Ferris\nMy Favorite Thing Is Monsters is a murder mystery, a family drama, a sweeping historical epic, and a psychological thriller about monsters, real and imagined. Set against the political backdrop of late \'60s Chicago, Karen Reyes tries to solve the murder of her enigmatic upstairs neighbor. Rendered in a kaleidoscopically visual style, Emil Ferris\' draftsmanship echoes the drawing of Otto Dix, George Grosz, and Robert Crumb. This is a revelatory work of striking originality and will undoubtedly be greeted as the debut graphic novel of the year.','MY FAVORITE THING IS MONSTERS GN (9781606999592)','fantagraphics-books','','','FANTAGRAPHICS BOOKS','MY FAVORITE THING IS MONSTERS GN (9781606999592)','','','',''),(1691,1,1,'No description','NICE HOUSE ON THE LAKE TP VOL 01 (9781779514349)','dc-comics','','','DC COMICS','NICE HOUSE ON THE LAKE TP VOL 01 (9781779514349)','','','',''),(1692,1,1,'Nightwing is back in Blüdhaven and his drive to keep his adopted city safe has never been stronger! But protecting Blüdhaven is no small task, especially now that it’s being menaced by Nightwing’s most terrifying foe yet—a mysterious and murderous villain with a penchant for stealing his victim’s hearts, known only as Heartless.','NIGHTWING (2021) HC VOL 01 LEAPING INTO THE LIGHT (9781779512789)','dc-comics','','','DC COMICS','NIGHTWING (2021) HC VOL 01 LEAPING INTO THE LIGHT (9781779512789)','','','',''),(1693,1,1,'Komiks ze scenariuszem Stephena KINGA!\nFascynująca, mroczna opowieść o wampirach.\nPrzebiegły, bezwzględny i nienasycony Skinner Sweet nie jest zwykłym nocnym stworem. To pierwszy wampir zrodzony na amerykańskiej ziemi. Jest silny, nie boi się słońca i starych wampirów, pragnie krwi i... słodyczy...\nKiedyś rabował banki i pociągi. W końcu wpadł i podczas próby ucieczki został zastrzelony. Ale nie umarł Czterdzieści pięć lat później wstał z grobu i znalazł się w Los Angeles lat 20. XX wieku.\nTu wszyscy piękni i młodzi lecą jak ćmy ku światłom Hollywood. Tak jak młoda aktorka Pearl Jones, której sen o sławie przeradza się w krwawy koszmar Dzięki Skinnerowi dziewczyna poznaje smak krwi i zemsty.\nWedług Stephena Kinga wampiry nie powinny być: bladymi detektywami, którzy popijają Krwawą Mary i pracują jedynie nocą; melancholijnymi, spragnionymi miłości dżentelmenami z Południa; nastoletnimi anorektyczkami; chłoptasiami o wielkich, sarnich oczach.\nA czym być powinny?\nZabójcami... Zimnymi jak głaz zabójcami, którym nigdy dość smakowitej grupy A. Złymi chłopcami i dziewczynami. Łowcami. Innymi słowy głęboką, amerykańską nocą...','OBRAZY GROZY AMERYKAŃSKI WAMPIR, TOM 1 (9788323746744)','egmont','','','EGMONT','OBRAZY GROZY AMERYKAŃSKI WAMPIR, TOM 1 (9788323746744)','','','',''),(1694,1,1,'PREACHER #1-12—plus pinups from PREACHER #50 and #66—are collected in this new paperback that introduces Preacher Jesse Custer, Cassidy and Tulip. Disillusioned with his own beliefs, Custer begins a violent and riotous journey across the country in search of God, who has abandoned heaven.','PREACHER TP VOL 01 (9781401240455)','dc-comics','','','DC COMICS','PREACHER TP VOL 01 (9781401240455)','','','',''),(1695,1,1,'Omnibus zbierający pierwsze dziewięć tomów tej uznanej przez krytyków serii, która stała się bestsellerem New York Timesa! Ogromny tom, będący kompendium przygód Hazel i jej rodziców. 1400 stron przepięknych, kolorowych plansz z nową okładką autorstwa współtwórczyni SAGI, Fiony Staples. W środku zebrane zeszyty SAGA #1-54.','SAGA COMPENDIUM TP VOL 01 (9781534313460)','image-comics','','','IMAGE COMICS','SAGA COMPENDIUM TP VOL 01 (9781534313460)','','','',''),(1696,1,1,'Każdy zeszyt zakupiony w naszym sklepie zabezpieczamy profesjonalną folią oraz tekturką bez dodatkowych opłat!','SAGA OF THE SWAMP THING BOX SET (9781779512567)','dc-comics','','','DC COMICS','SAGA OF THE SWAMP THING BOX SET (9781779512567)','','','',''),(1697,1,1,'No description','SANDMAN BOOK 01 TP (9781779515179)','dc-comics','','','DC COMICS','SANDMAN BOOK 01 TP (9781779515179)','','','',''),(1698,1,1,'Welcome to Craw County, Alabama, home of Boss BBQ, the state champion Runnin’ Rebs football team...and more bastards than you’ve ever seen. When you’re an angry old man like Earl Tubb, the only way to survive a place like this...is to carry a really big stick. Collects SOUTHERN BASTARDS #1-4.','SOUTHERN BASTARDS TP VOL 01 HERE WAS A MAN (9781632150165)','image-comics','','','IMAGE COMICS','SOUTHERN BASTARDS TP VOL 01 HERE WAS A MAN (9781632150165)','','','',''),(1699,1,1,'Klasyczna I licząca trzy rozdziały opowieść ze świata DC powraca w nowej odsłonie. W tej historii osadzonej w samym centrum paranoi wywołanej Zimną Wojną, statek kosmiczny z pewnym niemowlęciem na pokładzie rozbija się w Związku Radzieckim z lat pięćdziesiątych ubiegłego stulecia. Tam dorasta on i staje się symbolem Sowieckiej potęgi!','SUPERMAN RED SON TP NEW EDITION (9781401247119)','dc-comics','','','DC COMICS','SUPERMAN RED SON TP NEW EDITION (9781401247119)','','','',''),(1700,1,1,'The all-new literary masterpiece from the creator of Essex County is finally here! As an underwater welder on an oilrig off the coast of Nova Scotia, Jack Joseph is used to the immense pressures of deep-sea work. Nothing, however, could prepare him for the pressures of impending fatherhood. As Jack dives deeper and deeper, he seems to pull further and further away from his young wife, and their unborn son. But then, something happens deep on the ocean floor: Jack has a strange and mind-bending encounter that will change the course of his life forever.','UNDERWATER WELDER GN (9781603090742)','top-shelf-productions','','','TOP SHELF PRODUCTIONS','UNDERWATER WELDER GN (9781603090742)','','','',''),(1701,1,1,'”Prawdopodobnie najmocniejsza praca Moore’a” – PORTLAND MERCURY','V FOR VENDETTA BLACK LABEL EDITION TP (9781779511195)','dc-comics','','','DC COMICS','V FOR VENDETTA BLACK LABEL EDITION TP (9781779511195)','','','',''),(1702,1,1,'Vision jest syntezoidem, czyli androidem korzystającym z syntetycznych ludzkich narządów i krwi. Jego twórcą jest Ultron, który przy jego użyciu zamierzał zniszczyć Avengers. Vision zwrócił się jednak przeciw swojemu twórcy i od tamtej pory walczy w szeregach superbohaterskiej drużyny. Wraz z żoną i dwojgiem dzieci Vision postanowił osiąść na amerykańskiej prowincji i wieść zupełnie zwykłe, spokojne życie. Niespodziewany atak uruchomi lawinę zdarzeń, które szybko obrócą ten plan wniwecz… Dlaczego wszystko się posypało? Co do tego doprowadziło? Czy był to przypadek? A może fatum?','VISION (9788328134904)','egmont','','','EGMONT','VISION (9788328134904)','','','',''),(1703,1,1,'Pierwszy tom kompendium Walking Dead - serii, która na zawsze zmieniła oblicze komiksu!','WALKING DEAD COMPENDIUM TP VOL 01 (9781607060765)','image-comics','','','IMAGE COMICS','WALKING DEAD COMPENDIUM TP VOL 01 (9781607060765)','','','',''),(1704,1,1,'Drugie kompendium bestsellerowego komiksu Roberta Kirkmana! Wydanie zbiorcze zawiera komiksy WALKING DEAD #49-96.','WALKING DEAD COMPENDIUM TP VOL 02 (9781607065968)','image-comics','','','IMAGE COMICS','WALKING DEAD COMPENDIUM TP VOL 02 (9781607065968)','','','',''),(1705,1,1,'Trzecie kompendium Żywych Trupów zawiera numery pierwotnie opublikowane w Walking Dead #97-144! Aż 1112 stron komiksu, który przeszedł do historii popkultury!','WALKING DEAD COMPENDIUM TP VOL 03 (9781632154569)','image-comics','','','IMAGE COMICS','WALKING DEAD COMPENDIUM TP VOL 03 (9781632154569)','','','',''),(1706,1,1,'Akurat na premierę nowego sezonu The Walking Dead na AMC, pojawia się czwarty tom\ngigantycznych omnibusów! Na ponad 1000 stronach, tom przedstawia kolejny rozdział przygody\nnapisanej przez Roberta Kirkmana i Charliego Adlarda.\nOd Whisperers to Commonwealth, Rick Grimes spotyka nowych przyjaciół i wrogów na swojej drodze\nodzyskania życia sprzed apokalipsy zombie.\nZawiera THE WALKING DEAD #145-193','WALKING DEAD COMPENDIUM TP VOL 04 (9781534313408)','image-comics','','','IMAGE COMICS','WALKING DEAD COMPENDIUM TP VOL 04 (9781534313408)','','','',''),(1707,1,1,'Nie przegapcie nowej edycji WATCHMEN INTERNATIONAL EDITION! Historia rozpoczyna się jako śledztwo w sprawie morderstwa I szybko przeistacza się w ujawnieni konspiracji, która zagraża całemu światu. Tak zwani herosi - Rorschach, Nite Owl, Silk Spectre, Dr. Manhattan oraz Ozymandias – muszą wytężyć swoje siły do maksimum i odpowiedzieć sobie na pytanie o to, gdzie znajduje się granica między dobrem i złem. Oryginalna, przełomowa historia zebrana jest tu w całości wraz z nową okładką, galerią szkiców, bonusowymi materiałami oraz wstępem autorstwa Dave’a Gibbonsa.','WATCHMEN TP INTERNATIONAL EDITION NEW ED (9781401248192)','dc-comics','','','DC COMICS','WATCHMEN TP INTERNATIONAL EDITION NEW ED (9781401248192)','','','',''),(1708,1,1,'BOGOWIE ZAWSZE SĄ PIĘKNI… I ZAWSZE ZNAJDUJEMY ICH MARTWYCH\nKapitan Malik i jego załoga przemieżają kosmos w poszukiwaniu zasobów, które mogą zostać pozyskane tylko ze zwłok gigantycznych kosmicznych bogów, które można znaleźć na obrzeżach znanego człowiekowi kosmosu. Teraz nadarza się okazja, by uciec z tej pętli: znajdując pierwszego żywego boga!\nObsesja Malika na punkcie bogów narazi jego i jego załogę na niebezpieczeństwo w najciemniejszych zakamarkach kosmosu. Chyba, że do akcji wkroczy podwójny agent…\nTom zbiera zeszyty We Only Find Them When They\'re Dead #1-5.','WE ONLY FIND THEM WHEN THEYRE DEAD TP VOL 01 (9781684156771)','boom-studios','','','BOOM! STUDIOS','WE ONLY FIND THEM WHEN THEYRE DEAD TP VOL 01 (9781684156771)','','','',''),(1709,1,1,'Co dziewięćdziesiąt lat dwunastka bogów reinkarnuje się jako ludzie. Są kochani. Są znienawidzeni. Po upływie dwóch lat są także martwi. Zespół twórców odpowiedzialnych za takie serie jak Young Avengers czy PHONOGRAM ponownie łączą siły by pokazać wam świat, w którym bogowie są największymi celebrytami, a celebryci – największymi bogami. Ale pamiętajcie: to iż ktoś jest nieśmiertelny, nie oznacza, że będzie żyć wiecznie. Zawiera THE WICKED + THE DIVINE #1-5','WICKED &amp; DIVINE TP VOL 01 THE FAUST ACT (9781632150196)','image-comics','','','IMAGE COMICS','WICKED & DIVINE TP VOL 01 THE FAUST ACT (9781632150196)','','','',''),(1710,1,1,'In 1997, almost six decades after the character\'s first appearance in 1940, legendary artist and writer Will Eisner gave permission for a new series of stories to be commissioned featuring his signature creation, resurrected detective Denny Colt, also known as the Spirit, written and drawn by the most famous names in the comics industry. The call went out, and the response was nothing short of remarkable, with contributions from such creators as Alan Moore and Dave Gibbons (in one of their rare collaborations since Watchmen), Neil Gaiman (The Sandman), Paul Chadwick (Concrete), and Eddie Campbell (From Hell), amongst others.','WILL EISNER\'S SPIRIT NEW ADVENTURES ARCHIVES HC VOL 01 (9781569717325)','dark-horse','','','DARK HORSE','WILL EISNER\'S SPIRIT NEW ADVENTURES ARCHIVES HC VOL 01 (9781569717325)','','','',''),(1711,1,1,'Kompletne wydanie nagrodzonej nagrodą Eisnera sześćdziesięcioczęściowej serii Y: THE LAST MAN! Oto saga Yoricka Browna, jedynego mężczyzny, który przetrwał atak tejemniczej plagi, która zabiła każdego ssaka z chromosomem Y na planecie. Wraz ze swoją małpką, Ampersandem, tajemniczą rządową agentką i młodą genetyczką, Yorick podróżuje przez świat szukając zaginionej miłości i odpowiedzi, dlaczego jest ostatnim mężczyzną na Ziemi. SERIA DLA DOJRZAŁEGO CZYTELNIKA.','Y THE LAST MAN OMNIBUS HC (9781401298159)','dc-comics','','','DC COMICS','Y THE LAST MAN OMNIBUS HC (9781401298159)','','','','');
